INSERT INTO `product` (`product_id`, `fk_lang_id`, `category_id`, `sub_category_id`, `child_category_id`, `unit_id`, `product_name`, `product_code`, `product_name_ar`, `product_in_marathi`, `image_name`, `pack_size`, `product_price`, `max_sell_limit`, `product_offer_price`, `product_purchase_price`, `listed_in_super_deal`, `description`, `description_ar`, `relatable_products`, `video_url`, `product_barcode`, `status`, `unit`, `mrp`, `stock_status`, `added_on`, `date_modified`, `popular`, `featured`, `best_selling`, `new_arrival`, `qty`, `supplier_id`, `currency_in_english`, `currency_in_arabic`, `product_offer`, `product_status`, `category_type`, `gift_card_stock`, `uniq_code`, `brand_id`) VALUES
(1, NULL, 15, 9, NULL, NULL, 'Powerology 10,000mAh 4 in 1 Power Bank Charging Dock - Blue', '112233', 'قاعدة شواحن باوربانك 4 في 1 بقوة 10,000 مللي امبير من Powerology – ازرق', NULL, 'uploads/products/0013.jpeg', NULL, NULL, '', '699', '649', '1', '<p>Product Details:</p>\r\n\r\n<p>(New version) of the 4 portable chargers, each with a capacity of 10,000mAh from Powerology.</p>\r\n\r\n<p>Each portable charger contains two built-in wires, Type C and Lightning, in addition to a USB port and an 18W PD port for fast charging.</p>\r\n\r\n<p>Each charger supports 15W wireless charging technology.</p>\r\n\r\n<p>The charging base contains 4 additional USB ports.</p>\r\n\r\n<p>It is characterized by ease of movement and light weight.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>&ndash; (الاصدار الجديد) من قاعدة الشواحن المتنقلة عدد 4 كل شاحن بقوة 10,000 مللي امبير من Powerology.</p>\r\n\r\n<p>&ndash; كل شاحن متنقل يحتوي على وايرين مدمجين تايب سي و لايتننغ بالإضافة الى مدخل يو اس بي ومدخل PD 18 واط للشحن السريع.</p>\r\n\r\n<p>&ndash; كل شاحن يدعم تقنية الشحن اللاسلكي بقوة 15 واط.</p>\r\n\r\n<p>&ndash; تحتوي قاعدة الشواحن على 4 منافذ يو اس بي إضافية.</p>\r\n\r\n<p>&ndash; يتميز بسهولة نقلة وخفة وزنة.</p>\r\n', NULL, '', '1234567890', '0', NULL, NULL, '1', '2022-08-27 18:23:45', '2022-08-27 15:23:45', NULL, 1, NULL, NULL, 99, 3, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '32'),
(3, NULL, 12, NULL, NULL, NULL, 'Goui LOCH Smart Bottle 420ML With 6000mAh Power Bank + Wireless Charger - Orange', '7242', 'مطارة ذكية ( شاحن لاسلكي + شاحن سلكي + شاحن متنقل ) بسعة 6000 مللي امبير من Goui – برتقالي', NULL, 'uploads/products/Z1.jpg', NULL, NULL, '', '199.25', '150.50', '1', '<p>Product Details:</p>\r\n\r\n<p>LOCH Smart bottle 420ml and wireless + wired charger + power bank with a capacity of 6000mAh from Goui.</p>\r\n\r\n<p>Made of water-resistant stainless steel, it keeps the temperature of your hot drink for 12 hours and cold for 24 hours.</p>\r\n\r\n<p>Built-in power bank charger under the bottle and can be separated from it to be used as a wireless or wired charger according to your desire.</p>\r\n\r\n<p>Suitable for daily use at home or outside the home for sports or even travel.</p>\r\n\r\n<p>Type C port for fast charging, and the battery can be charged from the same place.</p>\r\n\r\n<p>5W Wireless charger.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>&ndash; مطارة LOCH الذكية بسعة 420مل حافظة للحرارة وشاحن لاسلكي + سلكي + باوربانك بسعة 6000 مللي امبير من شركة Goui.</p>\r\n\r\n<p>&ndash; مصنوعة من الستيل المقاوم للصدأ ضد الماء وتحفظ درجة حرارة مشروبكم الحار 12 ساعة والبارد 24 ساعة.</p>\r\n\r\n<p>&ndash; شاحن باوربانك مدمج اسفل المطارة ويمكن فصله عنها لاستعماله كشاحن لاسلكي او سلكي على حسب رغبتكم.</p>\r\n\r\n<p>&ndash; مناسبة للاستعمال اليومي في المنزل او خارج المنزل للرياضة او حتى في السفر.</p>\r\n\r\n<p>&ndash; مدخل تايب سي للشحن السريع ويمكن شحن البطارية من نفس المكان.</p>\r\n\r\n<p>&ndash; شاحن لاسلكي بقوة 5 واط.</p>\r\n', NULL, '', '0123456987', '0', NULL, NULL, '1', '2022-08-27 19:01:01', '2022-08-27 16:01:01', NULL, 1, NULL, 1, 75, 3, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '18'),
(2, NULL, 9, NULL, NULL, NULL, 'Anker Powerline+ III 24k Gold Type C To Lightning Cable - 1.8M', '335522', 'واير شحن سريع من الذهب عيار 24 تايب سي الى لايتننغ من Anker', NULL, 'uploads/products/A11.jpg', NULL, NULL, '', '248.50', '210.75', '1', '<p>Product Details:</p>\r\n\r\n<p>Anker 20W PD Type C to Lightning fast charging cable.</p>\r\n\r\n<p>It is made of 24K gold and has a long life span.</p>\r\n\r\n<p>Fast charging technology it charges the iphone from 0% to 50% in 30 minutes only.</p>\r\n\r\n<p>Beautifully packaged and you can gift it to anyone.</p>\r\n\r\n<p>Length: 1.8 Meters.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>&ndash; واير شحن سريع تايب سي الى لايتننغ بتقنية PD للشحن السريع بقوة 20 واط من شركة Anker.</p>\r\n\r\n<p>&ndash; يتميز بأنه مصنوع من الذهب عيار 24 وايضاً بعمره الاستهلاكي الطويل.</p>\r\n\r\n<p>&ndash; يشحن الايفون من 0% الى 50% في 30 دقيقة فقط.</p>\r\n\r\n<p>&ndash; مغلف بشكل جميل وتقدرون تهدونه لاي شخص.</p>\r\n\r\n<p>&ndash; الطول: 1.8 متر.</p>\r\n', NULL, '<iframe width=\"753\" height=\"480\" src=\"https://www.youtube.com/embed/_vqNrcke-lo\" title=\"4 tips to know if you want to take your power bank on a plane\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '0124568215', '0', NULL, NULL, '1', '2022-08-27 18:41:57', '2022-08-27 15:41:57', 1, NULL, NULL, 1, 35, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(4, NULL, 10, NULL, NULL, NULL, 'Smart RGB Led Atmosphere Light', '5554455', 'قاعدة شواحن باوربانك 4 في 1 بقوة 10,000 مللي امبير من Powerology – ازرق', NULL, 'uploads/products/012.jpg', NULL, NULL, NULL, '799', '752', '1', '<p>fgjdfskalew`</p>\r\n', '<p>askjdlflskf</p>\r\n', NULL, '<iframe width=\"753\" height=\"480\" src=\"https://www.youtube.com/embed/_vqNrcke-lo\" title=\"4 tips to know if you want to take your power bank on a plane\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '789645120', '0', NULL, NULL, '1', '2022-08-27 19:05:56', '2022-08-27 16:05:56', 1, NULL, NULL, 1, 70, 3, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '12'),
(6, NULL, 10, NULL, NULL, NULL, 'Moft Carry Sleeve 15-16 Inch For Laptop – Brown', '226', 'شنطة وستاند لأجهزة اللابتوب 15 - 16 انش من موفت – بني', NULL, 'uploads/products/brown1.jpg', NULL, NULL, '', '240', '150', '1', '<p>Product Details:</p>\r\n\r\n<p>Laptop bag with a stylish and distinctive shape from Moft.</p>\r\n\r\n<p>It can be used as a laptop storage with the charger and also a stand for your device.</p>\r\n\r\n<p>It has a place to store cards.</p>\r\n\r\n<p>It bears a maximum weight of 10 kg.</p>\r\n\r\n<p>15 degree tilt angle when placed as a laptop stand.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شنطة ذات شكل انيق ومميز لأجهزة اللابتوب من شركة موفت.</p>\r\n\r\n<p>يمكن استخدامها كتخزين للابتوب مع الشاحن وايضاً ستاند لجهازكم.</p>\r\n\r\n<p>فيها مكان لتخزين البطاقات الشخصية.</p>\r\n\r\n<p>تتحمل وزن 10 كيلو كحد اقصى.</p>\r\n\r\n<p>زاوية ميلان 15 درجة عند وضعها كستاند للابتوب.</p>\r\n', NULL, 'https://youtu.be/G8VlOnYLJjU?t=1', '', '0', NULL, NULL, '1', '2022-08-27 22:38:55', '2022-08-27 19:38:55', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '29'),
