(12, NULL, 7, 0, NULL, NULL, 'Joyroom AUX 3.5mm Wired Metal Deep Bass Stereo Earphone For Andriod', '121', 'سماعة اذن واير من Joyroom لهواتف الاندرويد', NULL, 'uploads/products/415436_JR-E209.jpg', NULL, NULL, '', '37', '24.58', '1', '<p>Product Details:</p>\r\n\r\n<p>JOYROOM AUX 3.5mm wired in-ear headset bass stereo for Android Phones.</p>\r\n\r\n<p>Frequency response range: 20Hz~20KHz.</p>\r\n\r\n<p>Microphone sensitivity: -45&plusmn;3dB.</p>\r\n\r\n<p>Impedance: 2.2K&Omega;.</p>\r\n\r\n<p>Wire length: 1 meter.</p>\r\n\r\n<p>Material: TPE wire.</p>\r\n\r\n<p>Applicable models: AUX.</p>\r\n', '<p>تفاصيل المنتج:</p>\r\n\r\n<p>JOYROOM AUX 3.5 ملم سلكي سماعة أذن ستيريو باس لهواتف أندرويد.</p>\r\n\r\n<p>نطاق استجابة التردد: 20 هرتز ~ 20 كيلو هرتز.</p>\r\n\r\n<p>حساسية الميكروفون: -45 &plusmn; 3 ديسيبل.</p>\r\n\r\n<p>مقاومة: 2.2K&Omega;.</p>\r\n\r\n<p>طول الواير: 1 متر.</p>\r\n\r\n<p>المواد: TPE wire.</p>\r\n\r\n<p>الموديلات المناسبة: AUX.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-27 23:17:10', '2022-08-27 20:17:10', NULL, NULL, NULL, NULL, 9, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '25'),
(9, NULL, 15, 9, NULL, NULL, 'Joyroom Super Fast Charging 20000mah Two-way Fast Charging Power Bank', '187', 'شاحن متنقل سريع جداً ذو مخرجين من Joyroom بسعة 20000 مللي امبير', NULL, 'uploads/products/706963_D-QP184-Plus.jpg', NULL, NULL, '', '150', '76.90', '1', '<p>Product Details:</p>\r\n\r\n<p>Joyroom 20000mah 1 USB port &amp; 1 Type C port 22.5W fast charging.</p>\r\n\r\n<p>Portable and comfortable.</p>\r\n\r\n<p>Fireproof casing material &amp; high temperature resistance.</p>\r\n\r\n<p>Input: Type C + Lightning.</p>\r\n\r\n<p>Output: Type C + USB.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن متنقل بسعة 20000 مللي امبير مخرج يو اس بي ومخرج تايب سي بقوة 22.5 واط.</p>\r\n\r\n<p>مريح وسهل نقلها من مكان الى اخر.</p>\r\n\r\n<p>مصنوع من مواد مضادة للحرارة ومضادة للاشتعال.</p>\r\n\r\n<p>يمكن شحنة بمدخل: لايتننغ و تايب سي.</p>\r\n\r\n<p>نوع المخرج: تايب سي + يو اس بي.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-27 22:58:46', '2022-08-27 19:58:46', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '25'),
(10, NULL, 15, 9, NULL, NULL, 'Joyroom Fully Compatible 10000mah Two-way Fast Charging Power Bank', '188', 'شاحن متنقل ذو مخرجين حجم صغير من Joyroom بسعة 10000 مللي امبير', NULL, 'uploads/products/525392_D-QP184_(1).jpg', NULL, NULL, '', '79', '60.70', '1', '<p>Product Details:</p>\r\n\r\n<p>Joyroom 10000mah 1 USB port &amp; 1 PD port 22.5W fast charging.</p>\r\n\r\n<p>Portable Mini design.</p>\r\n\r\n<p>Fireproof casing material &amp; high temperature resistance.</p>\r\n\r\n<p>Input: Type C + Lightning.</p>\r\n\r\n<p>Output: Type C + USB.</p>\r\n\r\n<p>Warranty: 6 months.</p>\r\n', '<p>مواصفات المنتج :</p>\r\n\r\n<p>شاحن متنقل بسعة 10000 مللي امبير مخرج يو اس بي ومخرج تايب سي بقوة 22.5 واط.</p>\r\n\r\n<p>تصميم مميز وبحجم صغير جد.اً</p>\r\n\r\n<p>مصنوع من مواد مضادة للحرارة ومضادة للاشتعال.</p>\r\n\r\n<p>يمكن شحنة بمدخل: لايتننغ و تايب سي.</p>\r\n\r\n<p>نوع المخرج: تايب سي + يو اس بي.</p>\r\n\r\n<p>ضمان المنتج: 6 شهور.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-27 23:03:09', '2022-08-27 20:03:09', NULL, NULL, NULL, NULL, 6, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '25'),
(11, NULL, 15, 9, NULL, NULL, 'Joyroom Extreme Series 10000mah Two-way Fast Charging Power Bank', '186', 'شاحن متنقل ذو ثلاث مخارج اكستريم سيريس من Joyroom بسعة 10000 مللي امبير', NULL, 'uploads/products/962400_D-QP185.jpg', NULL, NULL, '', '79', '66.50', '1', '<p>Product Details:</p>\r\n\r\n<p>JOYROOM 10000mah 2 USB ports &amp; 1 PD port 18W fast charging.</p>\r\n\r\n<p>Ultra-thin design.</p>\r\n\r\n<p>Material: ABS + PC.</p>\r\n\r\n<p>Input: Type C.</p>\r\n\r\n<p>Output: Type C + USB.</p>\r\n', '<p>مواصفات المنتج :</p>\r\n\r\n<p>شاحن متنقل بسعة 10000 مللي امبير مخرجين يو اس بي ومخرج تايب سي بقوة 18 واط.</p>\r\n\r\n<p>تصميم مميز ونحيف.</p>\r\n\r\n<p>مصنوع من ABS + PC .</p>\r\n\r\n<p>يمكن شحنة بمدخل: تايب سي فقط.</p>\r\n\r\n<p>نوع المخرج: تايب سي + يو اس بي.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-27 23:09:48', '2022-08-27 20:09:48', NULL, NULL, NULL, NULL, 6, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '25'),
