(16, NULL, 6, 0, NULL, NULL, 'Gosund Wi-Fi Smart LED Strip Light 5M', '163', 'شريط اضاءة ذكي واي-فاي من قوسند 5 متر', NULL, 'uploads/products/406687_81i5IzdIZUL__AC_SL1500_-1.jpg', NULL, NULL, '', '150', '69.08', '1', '<p>Product Details:</p>\r\n\r\n<p>Voice &amp; App Control Smart led strip lights from Gosund (5 meters) length.</p>\r\n\r\n<p>Timer Function: Set a timer for your smart led schedule automatically switches on/off via your phone.</p>\r\n\r\n<p>8-Scene Modes: With 16 million colors, you can set different light modes to match various occasions.</p>\r\n\r\n<p>Cuttable: the strip light can be cutted to match the size you want.</p>\r\n\r\n<p>It is also characterized by ease of installation and saves on electricity consumption.</p>\r\n\r\n<p>Diy Colors: Color changing strip lights has 16 million colors with brightness and saturation adjustable.</p>\r\n\r\n<p>Support Alexa &amp; Google Assistant.</p>\r\n\r\n<p>Application: Gosund.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شريط الاضاءة الذكي من Gosund يتميز بسهولة التحكم في الاضاءة الخاصة بك عندما لا تكون في المنزل عن طريق هاتفك.</p>\r\n\r\n<p>المؤقت والجدول الزمني: يمكن القيام بجدولة تشغيل / إيقاف تشغيل, الأضواء الذكية تلقائيًا عبر هاتفك.</p>\r\n\r\n<p>8 أنواع من المودات المختلفة للأنوار.</p>\r\n\r\n<p>يمكن القيام بقص الشريط عند الحاجة لضبط الطول.</p>\r\n\r\n<p>كما يتميز بسهولة التركيب ويوفر من استهلاك الكهرباء.</p>\r\n\r\n<p>التحكم في مستوى قوة الإضاءة من 1٪ إلى 100٪.</p>\r\n\r\n<p>يدعم الأوامر الصوتية من اجهزة اليكسا وقوقل اسستنس الصوتية.</p>\r\n\r\n<p>اسم التطبيق: Gosund.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Fzw_DFHf3nI&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-28 10:22:09', '2022-08-28 07:22:09', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '17'),
