(35, NULL, 10, 0, NULL, NULL, 'Waterproof Bathroom Stick To Wall Shower Phone Case', '168', 'قاعدة ضد الماء للحائط', NULL, 'uploads/products/476236_shower-phone-holder-33-1.jpg', NULL, NULL, '', '54', '53.13', '1', '<p>Product Details:</p>\r\n\r\n<p>Waterproof wall phone case you can control your phone normally while it is inside the case.</p>\r\n\r\n<p>You can watch movies or anything while taking a shower.</p>\r\n\r\n<p>Powerful sticky stickers.</p>\r\n\r\n<p>Waterproof &amp; Anti-Fog.</p>\r\n\r\n<p>Works with: All mobile phones that under 6.8inch.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كفر مضاد للماء يمكن التحكم بالهاتف عند وضعه في الداخل.</p>\r\n\r\n<p>يمكنك مشاهدة الأفلام او اليوتيوب اثناء الاستحمام.</p>\r\n\r\n<p>لاصق للحائط قوي جداً.</p>\r\n\r\n<p>ضد الماء وضد الرطوبة.</p>\r\n\r\n<p>الموديل: لجميع أنواع الهواتف التي لا تتعدا حجم 6.8 انش.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-28 11:47:50', '2022-08-28 08:47:50', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL),
(37, NULL, 6, 0, NULL, NULL, 'Smart Aroma Diffuser 200ml', '174', 'فواحة عطرية ذكية 200 مل لاسلكية التحكم', NULL, 'uploads/products/560274_WiFi-clock-diffuser-2.jpg', NULL, NULL, '', '189', '188.34', '1', '<p>Product Details:</p>\r\n\r\n<p>Wifi Diffuser.</p>\r\n\r\n<p>Mobile APP control.</p>\r\n\r\n<p>Compatible with Alexa &amp; Google Assistance.</p>\r\n\r\n<p>Weather, temperature, week display.</p>\r\n\r\n<p>Timer Settings clock.</p>\r\n\r\n<p>Unique Super Silence Function.</p>\r\n\r\n<p>Application: Smart Live \\ Tuyasmart</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>فواحة عطرية ذكية مع شاشة رقمية.</p>\r\n\r\n<p>تتميز بسهولة التحكم بها عن طريق الهاتف.</p>\r\n\r\n<p>تدعم نظام اليكسا وقوقل بلاي.</p>\r\n\r\n<p>يوجد فيها تقويم للأيام وايضاً تستطيع معرفة حالة الطقس ودرجة الحرارة.</p>\r\n\r\n<p>منبه صوتي للساعة.</p>\r\n\r\n<p>صوت هادئ جداً.</p>\r\n\r\n<p>برنامج التحكم: (Smart Life / Tuyasmart )</p>\r\n', NULL, 'https://youtu.be/insfMa2YaLo', '', '1', NULL, NULL, '1', '2022-08-28 11:51:18', '2022-08-28 08:51:18', NULL, 1, NULL, NULL, 9, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL),
(36, NULL, 10, 0, NULL, NULL, 'Waterproof Bathroom Stick To Wall Shower iPad/Tablet Case', '167', 'قاعدة للحائط ضد الماء للايباد او التابليت', NULL, 'uploads/products/533589_白透.jpg', NULL, NULL, '', '74', '73.18', '1', '<p>Product Details:</p>\r\n\r\n<p>Waterproof wall ipad/tablet case you can control your ipad or tablet normally while it is inside the case.</p>\r\n\r\n<p>You can watch movies or anything while taking a shower.</p>\r\n\r\n<p>Powerful sticky stickers.</p>\r\n\r\n<p>Waterproof &amp; Anti-Fog.</p>\r\n\r\n<p>Works with: iPad or Tablet.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كفر مضاد للماء يمكن التحكم بالايباد او البتابليت عند وضعه في الداخل.</p>\r\n\r\n<p>يمكنك مشاهدة الأفلام او اليوتيوب اثناء الاستحمام.</p>\r\n\r\n<p>لاصق للحائط قوي جداً.</p>\r\n\r\n<p>ضد الماء وضد الرطوبة.</p>\r\n\r\n<p>الموديل: جهاز الايباد او جهاز التابليت.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-28 11:49:23', '2022-08-28 08:49:23', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL),
(38, NULL, 9, 0, NULL, NULL, 'Rocketek USB Smart Card Reader', '169', 'جهاز قارئ البطاقات الذكية من Rocketek', NULL, 'uploads/products/521106_1.jpg', NULL, NULL, '', '79', '21.76', '1', '<p>Product Details:</p>\r\n\r\n<p>Rocketek USB multifunction cards reader for E-commerce / E-Banking / E-Business / E-Government.</p>\r\n\r\n<p>Works with Hukoomi / NAS and other websites.</p>\r\n\r\n<p>Safe and fast reading.</p>\r\n\r\n<p>Mini size portable &amp; comfortable.</p>\r\n\r\n<p>Works with: Windows / MacOS</p>\r\n\r\n<p>Applicable with: Smart cards / SIM cards / SD cards / MMC cards / Micro SD-TF</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز قارئ للبطاقات الذكية من شركة Rocketek للمعاملات الالكترونية.</p>\r\n\r\n<p>يدعم نظام حكومي ونظام التوثيق الوطني وغيرة من مواقع الكترونية حكومية.</p>\r\n\r\n<p>سريع في القراءة للبطاقات وآمن.</p>\r\n\r\n<p>حجم صغير ومريح يمكن حملة والتنقل به.</p>\r\n\r\n<p>يدعم اجهزة: Windows / MacOS</p>\r\n\r\n<p>الطراز المناسب: سمارت كارد / سيم كارد / اس دي كارد / ام ام سي كارد / مايكرو اس دي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=5DDlXFsOfLE', '', '1', NULL, NULL, '1', '2022-08-28 11:53:55', '2022-08-28 08:53:55', NULL, NULL, 1, NULL, 12, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '37'),
