(41, NULL, 6, 0, NULL, NULL, 'Smart Pet Feeder Robot', '178', 'جهاز تغذية الحيوانات الذكي', NULL, 'uploads/products/296864_3_5L机器人喂食器1500_1500-600x600.jpg', NULL, NULL, '', '239', '238.88', '1', '<p>Product Details:</p>\r\n\r\n<p>Smart robot pet feeder with automatic feed system.</p>\r\n\r\n<p>Adjust meal size for each time breakfast / launch / dinner.</p>\r\n\r\n<p>Voice recording ( To call your pet for food time ).</p>\r\n\r\n<p>Timer setting.</p>\r\n\r\n<p>Digital display.</p>\r\n\r\n<p>Food Capacity: 3.5L</p>\r\n\r\n<p>2 Ways power supply: USB cable / Battery .</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز تغذية الحيوانات الأليفة الذكي مع نظام تغذية أوتوماتيكي.</p>\r\n\r\n<p>ميزة ضبط حجم الوجبة إفطار / غداء / عشاء.</p>\r\n\r\n<p>التسجيل الصوتي (لاستدعاء حيوانك الأليف لوقت الطعام).</p>\r\n\r\n<p>إعداد المؤقت.</p>\r\n\r\n<p>شاشة عرض رقمية.</p>\r\n\r\n<p>سعة الطعام: 3.5 لتر.</p>\r\n\r\n<p>طريقتان للتشغيل: يو اس بي / بطاريات.</p>\r\n', NULL, 'https://youtu.be/JewpjBsVxV0', '', '1', NULL, NULL, '1', '2022-08-28 11:59:19', '2022-08-28 08:59:19', NULL, NULL, 1, NULL, 10, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL),
(42, NULL, 15, 11, NULL, NULL, '3in1 Backseat Passengers Charging Station For Car', '180', 'شاحن خدمي 3 في 1 للسيارات', NULL, 'uploads/products/159255_1-1.jpg', NULL, NULL, '', '59', '57.16', '1', '<p>Product Details:</p>\r\n\r\n<p>3in1 Charger station for cars that has all what you need of charging cables.</p>\r\n\r\n<p>Easy to install and use.</p>\r\n\r\n<p>Saving money from buying more cables.</p>\r\n\r\n<p>Each charging cable are 55cm length.</p>\r\n\r\n<p>Input: USB.</p>\r\n\r\n<p>Output: Type C / Lightning / Micro.</p>\r\n\r\n<p>Output Power: 10W-5W.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن للراكبين في الخلف للسيارات فيه أنواع اسلاك الشحن جميعها.</p>\r\n\r\n<p>سهل الاستخدام والتركيب.</p>\r\n\r\n<p>يوفر المال بحيث لا تحتاج الى شراء اسلاك أخرى.</p>\r\n\r\n<p>كل سلك يبلغ طوله 55 سنتيمتر.</p>\r\n\r\n<p>مدخل: يو اس بي.</p>\r\n\r\n<p>مخارج للشحن: تايب سي + لايتننغ + مايكرو.</p>\r\n\r\n<p>قوة المخارج: 10 واط &ndash; 5 واط.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-28 12:02:15', '2022-08-28 09:02:15', NULL, NULL, NULL, NULL, 8, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL),
(43, NULL, 8, 0, NULL, NULL, 'RGB Gaming Laptop Cooler', '176', 'مراوح تبريد ار جي بي لأجهزة اللابتوب', NULL, 'uploads/products/852138_RGB-COOLER-6.jpg', NULL, NULL, '', '159', '157.09', '1', '<p>Product Details:</p>\r\n\r\n<p>RGB gaming cooler fans 3000 RPM airflow.</p>\r\n\r\n<p>Comfortable &amp; easy to use.</p>\r\n\r\n<p>Adjustable height.</p>\r\n\r\n<p>Applicable Models: 12inch to 17inch Laptops.</p>\r\n\r\n<p>Material: Plastic.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مرواح تبريد للابتوب بقوة 3000 ار بي ام.</p>\r\n\r\n<p>تتميز بسهولة تحريكها واستخدامها.</p>\r\n\r\n<p>قواعد للتحكم بالارتفاع.</p>\r\n\r\n<p>الطراز المناسبة لها: كل انوع اللابتوبات من 12انش الى 17انش.</p>\r\n\r\n<p>مصنوعة من البلاستيك المقوى.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-28 12:03:56', '2022-08-28 09:03:56', NULL, NULL, NULL, NULL, 7, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL);
