(44, NULL, 5, 0, NULL, NULL, 'Auto Rotation Essential Oil Diffuser For Home or Office \\ 230ML - White', '170', 'فواحة عطرية مع تحريك تلقائي للمنزل او المكتب/ 230 مل - ابيض', NULL, 'uploads/products/344674_white.jpg', NULL, NULL, '', '109', '61.61', '1', '<p>Product Details:</p>\r\n\r\n<p>Auto rotation oil diffuser that helps to spread the aroma smell in the room or office.</p>\r\n\r\n<p>Aroma oil can be added on the top of the diffuser.</p>\r\n\r\n<p>Colorful led light and it can be turned off.</p>\r\n\r\n<p>120 degree left and right Rotation, 180 degree up and down rotation.</p>\r\n\r\n<p>2 Spray modes: Continuous spray &amp; intermittent spray.</p>\r\n\r\n<p>Battery: 800mah rechargeable.</p>\r\n\r\n<p>Water capacity: 230ml.</p>\r\n\r\n<p>Working time: 4h.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p><strong>The essential oil should not be mixed with water, it must be place in the designated place, which is at the top of the diffuser. Please read the instruction book.</strong></p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>فواحة عطرية ذات تحريك اوتوماتيكي تساعد في نشر الرائحة في انحاء المكان.</p>\r\n\r\n<p>يمكن وضع الزيت العطري في اعلى الفواحة.</p>\r\n\r\n<p>يوجد بها اضاءة ملونة ويمكن اطفائها.</p>\r\n\r\n<p>التحريك من اليمين الى اليسار 120 درجة، ومن الأسفل الى الأعلى 180 درجة.</p>\r\n\r\n<p>يوجد بها وضعان لنشر الرائحة وضع دائم ووضع متقطع.</p>\r\n\r\n<p>سعة البطارية: 800 مللي امبير ويمكن شحنها.</p>\r\n\r\n<p>سعة خزان الماء: 230 مل.</p>\r\n\r\n<p>مدة اشتغال: 4 ساعات.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p><strong>يجب عدم وضع الزيت العطري مع الماء وانما في المكان المخصص وهو في الأعلى من الفواحة يرجى قراءة دفتر التعليمات.</strong></p>\r\n', NULL, 'https://www.youtube.com/watch?v=5oH9Nr3bKfw', '', '1', NULL, NULL, '1', '2022-08-28 12:10:52', '2022-08-28 09:10:52', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
