(100, NULL, 15, 12, NULL, NULL, '3in1 Wireless Charging Station For iPhone 12 – Black', '192', 'شاحن وايرليس 3 في 1 للايفون 12 و 13 - اسود', NULL, 'uploads/products/985768_He1ff1d85d527421f88fc967f7fc2e7f09.jpg', NULL, NULL, '', '130', '88.62', '1', '<p>Product Details:</p>\r\n\r\n<p>3in1 Wireless charger station dock with dim light for iPhone 12 ONLY.</p>\r\n\r\n<p>Charges more than one device at the same time iPhone, Apple Watch and AirPods.</p>\r\n\r\n<p>Suitable for office or bedrooms.</p>\r\n\r\n<p>Supports PD &amp; QC3.0 fast charging technology.</p>\r\n\r\n<p>Easy to install and use.</p>\r\n\r\n<p>15W Charging power.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن وايرليس 3 في 1 مع اضاءة خافتة للأيفون 12 و 13&nbsp;فقط.</p>\r\n\r\n<p>يشحن اكثر من جهاز في نفس الوقت الايفون وساعة ابل وسماعات الايربودز.</p>\r\n\r\n<p>مناسب للمكتب او غرف النوم.</p>\r\n\r\n<p>يدعم تقنية PD &amp; QC3.0 للشحن السريع.</p>\r\n\r\n<p>سهل التركيب والاستعمال.</p>\r\n\r\n<p>قوة شحن 15 واط.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-28 18:29:21', '2022-08-28 15:29:21', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, NULL),
(101, NULL, 8, 0, NULL, NULL, 'Jiqiao Gaming Chair - Pink', '190', 'كرسي جيمنغ جيغوا - وردي', NULL, 'uploads/products/387929_pink9876.jpg', NULL, NULL, '', '599', '538.10', '1', '<p>Product Details:</p>\r\n\r\n<p>Jiqiao multi-functional gaming chair.</p>\r\n\r\n<p>Pillow for the neck and pillow with a massage feature for the lower back.</p>\r\n\r\n<p>The height and angle of the chair can be adjusted according to your desire.</p>\r\n\r\n<p>Seat for the leg under the chair gives you more comfort.</p>\r\n\r\n<p>RGB lighting on the corners of the chair gives you a beautiful view for the gaming.</p>\r\n\r\n<p>Two speakers behind the chair that can be controlled via Bluetooth with a phone or other bluethooth devices.</p>\r\n\r\n<p>It is characterized by the presence of a massage feature in the entire chair.</p>\r\n\r\n<p>5 Massage mods with the ability to control the strength of the massage and also focus on a specific area via the remote control.</p>\r\n\r\n<p><em><strong>Note:</strong></em></p>\r\n\r\n<ul>\r\n	<li>The chair comes built and ready to use as it is in the picture only needs to connect the wires.</li>\r\n</ul>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>- كرسي جيمنغ متعدد المزايا من شركة Jiqiao.</p>\r\n\r\n<p>- وسادة للرقبة وايضاً وسادة مع خاصية المساج لأسفل الظهر.</p>\r\n\r\n<p>- يمكن تغيير الارتفاع وزاوية الكرسي على حسب رغبتكم.</p>\r\n\r\n<p>- مقعد للرجل اسفل الكرسي يعطيكم راحة اكثر.</p>\r\n\r\n<p>-&nbsp; اضاءة ار جي بي على زوايا الكرسي تعطيكم منظر جميل للجيمنغ.</p>\r\n\r\n<p>- مكبرين صوت خلف الكرسي يمكن التحكم بهم عن طريق البلوتوث بالهاتف او غيره.</p>\r\n\r\n<p>- يتميز بوجود خاصية المساج في الكرسي بالكامل.</p>\r\n\r\n<p>- 5 مودات للمساج مع القدرة على التحكم بقوة المساج وايضاً التركيز على منطقة معينة عن طريق جهاز التحكم.</p>\r\n\r\n<p><em><strong>ملاحظة:</strong></em></p>\r\n\r\n<ul>\r\n	<li>الكرسي يأتي جاهز كما هو فالصورة فقط يحتاج الى توصيل الوايرات.</li>\r\n</ul>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-28 18:37:15', '2022-08-28 15:37:15', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL),
(102, NULL, 15, 9, NULL, NULL, 'Camping Solar Power Bank 20000mAh', '194', 'شاحن الرحلات باوربانك مع الواح شمسية بقوة 20000 مللي امبير', NULL, 'uploads/products/588846_H8d49e4580d3b45da9db23b8779ac0075n.jpg', NULL, NULL, '', '119', '115.37', '1', '<p>Product Details:</p>\r\n\r\n<p>2 USB Ports Solar power bank charger 20000mAh with emergency night light.</p>\r\n\r\n<p>4 Solar panels to charge the power bank, which saves you on electricity consumption.</p>\r\n\r\n<p>Overheat protection + Overcharge protection.</p>\r\n\r\n<p>Overheat protection + Overcharge protection.</p>\r\n\r\n<p>Water resistance.</p>\r\n\r\n<p>Suitable for camping.</p>\r\n\r\n<p>Input: Micro.</p>\r\n\r\n<p>Output: USB</p>\r\n\r\n<p>This product doesn&rsquo;t have warranty.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن باوربانك بقوة 20000 مللي امبير ذو مدخلين يو اس بي للشحن مع اضاءة ليلة للطوارئ.</p>\r\n\r\n<p>يتميز بوجود 4 الواح شمسية لشحنة مما يوفر عليك استهلاك الكهرباء.</p>\r\n\r\n<p>يوجد به نظام للشحن حتى لا يعطي قوة زائدة للشحن.</p>\r\n\r\n<p>مضادة للحرارة.</p>\r\n\r\n<p>مضاد للمياه.</p>\r\n\r\n<p>مناسب للرحلات البرية.</p>\r\n\r\n<p>مدخل الشحن: مايكرو.</p>\r\n\r\n<p>مخرج للشحن: يو اس بي</p>\r\n\r\n<p>هذا المنتج لا يحتوي على ضمان.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-28 18:42:04', '2022-08-28 15:42:04', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL),
