(109, NULL, 15, 11, NULL, NULL, 'REMAX Salo Series 58.5W USB + Type C Fast Car Charger – Black', '206', 'شاحن سريع ذو مدخلين يو اس بي + تايب سي من Remax بقوة 58.5 واط – اسود', NULL, 'uploads/products/196601_7.jpg', NULL, NULL, '', '59', '47.44', '1', '<p>Product Details:</p>\r\n\r\n<p>Remax car charger 58.5W high power, QC3.0 USB Port &amp; supports PD3.0</p>\r\n\r\n<p>Safe usage with all-round protection, equipped with built-in protections against overheating, overcharging, and short-circuit to safeguard the charging process.</p>\r\n\r\n<p>Universal compatibility charge all USB powered devices.</p>\r\n\r\n<p>Input: USB + Type C.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن سريع من شركة REMAX بقوة 58.5 واط ذو مدخلين تايب سي + يو اس بي.</p>\r\n\r\n<p>استخدام آمن مع حماية شاملة مزود بوسائل حماية مدمجة ضد ارتفاع درجة الحرارة والشحن الزائد.</p>\r\n\r\n<p>يشحن جميع أنواع الهواتف.</p>\r\n\r\n<p>نوع المدخل: تايب سي + يو اس بي.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-28 19:08:46', '2022-08-28 16:08:46', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '35'),
