(112, NULL, 15, 10, NULL, NULL, 'REMAX Wanfu Charger 4 USB Ports - White', '208', 'شاحن ذو 4 مداخل يو اس بي من Remax - ابيض', NULL, 'uploads/products/773278_英规白色.jpg', NULL, NULL, '', '59', '49.03', '1', '<p>Product Details:</p>\r\n\r\n<p>Remax Wanfu charger with 4 USB ports.</p>\r\n\r\n<p>4 USB ports can be output at the same time to achieve simultaneous charging of multiple devices.</p>\r\n\r\n<p>Smartly identify the type of mobile phone and automatically adjust the charging current.</p>\r\n\r\n<p>Overpower and over-charge protection.</p>\r\n\r\n<p>The shell is made of PC material, which has the characteristics of fire resistance, drop resistance and durability.</p>\r\n\r\n<p>Current: 3.4A.</p>\r\n\r\n<p>Input: USB.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن ذو اربع مداخل للشحن من REMAX.</p>\r\n\r\n<p>4 مداخل يو اس بي يمكّنك من شحن اربع أجهزة في نفس الوقت.</p>\r\n\r\n<p>يتميز بوجود نظام ذكي للتعرف على نوع الجهاز حتى لا يعطي طاقة شحن اكبر من تحمل الجهاز.</p>\r\n\r\n<p>حماية من القوة الزائدة او الشحن الزائد.</p>\r\n\r\n<p>مصنوع من مواد قوية غير قابلة للأشتعال ومقاومة للسقوط.</p>\r\n\r\n<p>قوة التيار: 3.4A</p>\r\n\r\n<p>نوع المدخل: يو اس بي.</p>\r\n', NULL, 'https://www.youtube.com/embed/pXNeoXnU7iM', '', '1', NULL, NULL, '1', '2022-08-28 19:13:47', '2022-08-28 16:13:47', NULL, NULL, NULL, NULL, 7, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '35'),
(113, NULL, 7, 0, NULL, NULL, 'REMAX Wireless Headphone – Black', '197', 'سماعة لاسلكية من Remax - اسود', NULL, 'uploads/products/281603_¦½.jpg', NULL, NULL, '', '69', '60.48', '1', '<p>Product Details:</p>\r\n\r\n<p>High quality sound wireless headphone from Remax.</p>\r\n\r\n<p>Over-ear design, foldable &amp; light weight.</p>\r\n\r\n<p>Ergonomic design, soft earmuffs with Imitating protein leather.</p>\r\n\r\n<p>Long-Term Wearing without pain.</p>\r\n\r\n<p>Bluetooth connectivity.</p>\r\n\r\n<p>Built-in microphone with volume controller.</p>\r\n\r\n<p>Connectivity: Bluetooth and Wired (Dual-Use Mode)</p>\r\n\r\n<p>Compatible with iOS / Android / PC / Laptop</p>\r\n\r\n<p>Bluetooth Distance: 10-15m.</p>\r\n\r\n<p>Input: Micro + AUX.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>سماعة لاسلكية بصوت عالي الجودة من REMAX.</p>\r\n\r\n<p>تصميم رائع قابل للتعديل وتتميز بخفة الوزن.</p>\r\n\r\n<p>غطاء للأذنين ناعم ومريح جداً.</p>\r\n\r\n<p>يمكن ارتدائها لمدة طويلة من الوقت بدون ألم.</p>\r\n\r\n<p>تدعم خاصية البلوتوث.</p>\r\n\r\n<p>تتميز بوجود ميكروفون مدمج مع وحدة تحكم في الصوت.</p>\r\n\r\n<p>وضع الاستخدام المزدوج السلكي واللاسلكي.</p>\r\n\r\n<p>متوافقة مع انظمة: IOS / Android / PC / Laptop</p>\r\n\r\n<p>مسافة اتصال البلوتوث: 10-15 متر.</p>\r\n\r\n<p>مدخل: مايكرو + أي يو اكس.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-28 19:17:40', '2022-08-28 16:17:40', NULL, NULL, NULL, NULL, 6, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '35'),
