(119, NULL, 7, 0, NULL, NULL, 'REMAX Wargod Series Gaming Headset', '198', 'سماعة سلكية Wargod سيريس للجيمنغ من Remax', NULL, 'uploads/products/785548_Hcf09aee0df6042c084476230e954d811n.jpg', NULL, NULL, '', '99', '98.72', '1', '<p>Product Details:</p>\r\n\r\n<p>WarGod Series Gaming Headphones with Virtual 7.1 Stereo and 360&deg; Adjustable Microphone from Remax.</p>\r\n\r\n<p>Equipped with a 53mm diaphragm dynamic speaker driver unit.</p>\r\n\r\n<p>Cool RGB lighting effects, four modes can be switched.</p>\r\n\r\n<p>Ergonomic design, soft earmuffs with Imitating protein leather.</p>\r\n\r\n<p>Long-Term Wearing without pain.</p>\r\n\r\n<p>Wire Length: 2.5M.</p>\r\n\r\n<p>Output: USB.</p>\r\n\r\n<p>Compatible with: PC / Laptop.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>- سماعات الألعاب من سلسلة WarGod بتنقية Virtual 7.1 Stereo وميكروفون قابل للتعديل 360 درجة من شركة REMAX.</p>\r\n\r\n<p>- مجهزة بوحدة تشغيل مكبر صوت ديناميكي بغشاء 53 مم.</p>\r\n\r\n<p>- أربع أوضاع تأثيرات إضاءة RGB رائعة ويمكن تبديله على حسب الرغبة.</p>\r\n\r\n<p>- غطاء للأذنين ناعم ومريح جداً.</p>\r\n\r\n<p>- يمكن ارتدائها لمدة طويلة من الوقت بدون ألم.</p>\r\n\r\n<p>- طول السلك: 2.5 متر.</p>\r\n\r\n<p>- مخرج: يو اس بي.</p>\r\n\r\n<p>- متوافق مع أنظمة: PC / Laptop.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=izez77H88og', '', '1', NULL, NULL, '1', '2022-08-29 11:39:15', '2022-08-29 08:39:15', NULL, NULL, 1, NULL, 19, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '35'),
(120, NULL, 6, 0, NULL, NULL, 'Gosund Wi-Fi Smart Power Strip', '214', 'موصل كهرباء واي-فاي ذكي من Gosund', NULL, 'uploads/products/422846_H11b34d03e5dc448c83f719b8b6b3086al.png', NULL, NULL, '', '99', '76.94', '1', '<p>Product Details:</p>\r\n\r\n<p>Gosund Smart Wi-Fi extension.</p>\r\n\r\n<p>4 Sockets &amp; 3 USB ports.</p>\r\n\r\n<p>Voice &amp; App Control: allows you to control your power strip when you are not at home or travel around.</p>\r\n\r\n<p>It is also characterized by ease of installation and saves on electricity consumption.</p>\r\n\r\n<p>Support Alexa &amp; Google Assistant.</p>\r\n\r\n<p>Multiple Safeguards: Gosund smart power strip with fire prevention and overload protection 10A maximum load. Circuit breaker automatically breaks off when the current exceeds threshold, preventing plugged-in devices from damage.</p>\r\n\r\n<p>Device Sharing: You can share the device with your family.</p>\r\n\r\n<p>Max Power: 3250w</p>\r\n\r\n<p>Wire Length: 1.8m</p>\r\n\r\n<p>Application: Gosund.</p>\r\n\r\n<p>Warranty: 1 Year</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>يسمح لك موصل الكهرباء الذكي من GOSUND بالتحكم به عندما لا تكون في المنزل عن طريق هاتفك عبر الانترنت.</p>\r\n\r\n<p>يوجد فيه 4 بلكات للكهرباء بالإضافة الى 3 منافذ يو اس بي للشحن.</p>\r\n\r\n<p>المؤقت والجدول الزمني: يمكن القيام بجدولة تشغيل / إيقاف تشغيل الموصل الذكي تلقائيًا عبر هاتفك.</p>\r\n\r\n<p>كما يتميز بسهولة التركيب ويوفر من استهلاك الكهرباء.</p>\r\n\r\n<p>يدعم الأوامر الصوتية من اجهزة اليكسا وقوقل اسستنس.</p>\r\n\r\n<p>مصنوع من مواد عالية الجودة وغير قابلة للحريق وحماية من الكهرباء الزائدة.</p>\r\n\r\n<p>يمكنك مشاركة موصل الكهرباء مع افراد عائلتك عن طريق التطبيق.</p>\r\n\r\n<p>قوة تحمل الموصل: 3250 واط</p>\r\n\r\n<p>طول السلك: 1.8 متر</p>\r\n\r\n<p>اسم التطبيق: Gosund</p>\r\n\r\n<p>ضمان لمدة سنة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=UwfEz1OUwN4', '', '1', NULL, NULL, '1', '2022-08-29 11:45:39', '2022-08-29 08:45:39', NULL, 1, NULL, NULL, 8, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '17'),
(121, NULL, 6, 0, NULL, NULL, 'Gosund Wi-Fi Smart Switch', '215', 'بلك ثنائي واي-فاي ذكي للتحكم في الإضاءة من Gosund', NULL, 'uploads/products/398437_27.jpg', NULL, NULL, '', '119', '52.36', '1', '<p>Product Details:</p>\r\n\r\n<p>Gosund Wi-Fi smart double switch light control.</p>\r\n\r\n<p>Voice &amp; App Control: Smart switch from Gosund that works with Alexa &amp; Google Assistance, allows you to control your lights when you are not at home or travel around.</p>\r\n\r\n<p>It is also characterized by ease of installation and saves on electricity consumption.</p>\r\n\r\n<p>2 Ways Control: Touch, App Control.</p>\r\n\r\n<p>Device Sharing: You can share the device with your family.</p>\r\n\r\n<p>Support Alexa &amp; Google Assistant.</p>\r\n\r\n<p>Application: Gosund.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>بلك ثنائي واي-فاي ذكي من GOSUND يسمح لك بالتحكم في الاضاءة الخاصة بك عندما لا تكون في المنزل عن طريق هاتفك.</p>\r\n\r\n<p>المؤقت والجدول الزمني: يمكن القيام بجدولة تشغيل / إيقاف تشغيل البلك الذكي تلقائيًا عبر هاتفك الذكي.</p>\r\n\r\n<p>كما يتميز بسهولة التركيب ويوفر من استهلاك الكهرباء.</p>\r\n\r\n<p>يمكن التحكم به عن طريق اللمس او عن طريق الهاتف.</p>\r\n\r\n<p>يمكنك مشاركة البلك مع افراد عائلتك عن طريق التطبيق.</p>\r\n\r\n<p>يدعم الأوامر الصوتية من اجهزة اليكسا وقوقل اسستنس.</p>\r\n\r\n<p>اسم التطبيق: Gosund</p>\r\n', NULL, 'https://www.youtube.com/watch?v=x5Gu1LoWJ0E', '', '1', NULL, NULL, '1', '2022-08-29 11:50:21', '2022-08-29 08:50:21', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '17'),
(122, NULL, 9, 0, NULL, NULL, 'REMAX Retor Series 9 in 1 Type C Hub', '207', 'وصله تايب سي 9 في 1 من Remax', NULL, 'uploads/products/424638_eng_pl_REMAX-Retor-Series9-in-1-Docking-Station-RU-U91-USB-Hub-Grey-89670_1.jpg', NULL, NULL, '', '149', '117.94', '1', '<p>Product Details:</p>\r\n\r\n<p>Remax Retor series 9 in 1 docking station Type C Hub.</p>\r\n\r\n<p>100W PD fast charging, you can charge your device through the hub as well.</p>\r\n\r\n<p>Metal Luxury No Overheating.</p>\r\n\r\n<p>Interface: HDMI + Ethernet Lan + TF Card + SD Card + 3 USB Port + AUX Port + Type C Charging Port.</p>\r\n\r\n<p>Applicable Model: All devices that support Type C.</p>\r\n\r\n<p>Warranty: 6 months.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>وصله 9 في 1 من شركة REMAX تايب سي لأجهزة ابل وغيرها.</p>\r\n\r\n<p>قوة شحن 100 واط بتقنية PD للشحن السريع تقدر تشحن جهازك واستعمال الوصله في نفس الوقت.</p>\r\n\r\n<p>تصميم رائع من الحديد العازل للحرارة.</p>\r\n\r\n<p>مداخل الوصله: HDMI + Ethernet Lan + TF Card + SD Card + 3 USB Ports + AUX Port + Type C Charging Port</p>\r\n\r\n<p>الموديل المناسب: كل الأجهزة التي تدعم مدخل تايب سي.</p>\r\n\r\n<p>ضمان المنتج: 6 شهور.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Y9OJ4MvIqjI', '', '1', NULL, NULL, '1', '2022-08-29 11:57:39', '2022-08-29 08:57:39', NULL, 1, NULL, NULL, 12, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '35'),
(123, NULL, 15, 11, NULL, NULL, 'REMAX Tury Series Wireless Car Charger', '209', 'شاحن لاسلكي للسيارات مع قاعدة قابله للدوران من Remax', NULL, 'uploads/products/316060_av-gia-do-dien-thoai-oto-rm-c48-16042021.jpg', NULL, NULL, '', '120', '57.58', '1', '<p>Product Details:</p>\r\n\r\n<p>Remax Tury series magnetic wireless 15W fast car charger.</p>\r\n\r\n<p>Fully adjustable with the 360-degree swivel ball head for custom viewing angles.</p>\r\n\r\n<p>Easy to use designed with clip to fit on any AC vent.</p>\r\n\r\n<p>Wonderful carbon fiber design.</p>\r\n\r\n<p>Support iPhone 12.</p>\r\n\r\n<p>Input: Type C</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن لاسلكي بقوة 15 واط مع قاعدة تركب في فتحات مكيف السيارة من شركة REMAX.</p>\r\n\r\n<p>القاعدة قابلة للدوران 360 درجة.</p>\r\n\r\n<p>سهل في التركيب كل ماعليك وضعة في فتحة المكيف وشحن هاتفك.</p>\r\n\r\n<p>تصميم مميز وحصري من الكاربون فايبر.</p>\r\n\r\n<p>يدعم الايفون 12.</p>\r\n\r\n<p>مدخل: تايب سي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=-slGldf-wns', '', '1', NULL, NULL, '1', '2022-08-29 12:01:15', '2022-08-29 09:01:15', NULL, 1, NULL, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35');
