(124, NULL, 7, 0, NULL, NULL, 'REMAX Jungo Portable Wireless Speaker', '195', 'مكبر الصوت اللاسلكي Jungo سيريس من Remax', NULL, 'uploads/products/251120_黑色-1.jpg', NULL, NULL, '', '189', '123.63', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable wireless speaker from Remax.</p>\r\n\r\n<p>There are RGB lights to add beauty.</p>\r\n\r\n<p>Able to connect two speakers at the same time.</p>\r\n\r\n<p>True wireless stereo with a built-in mic, can receive voice calls through the speaker.</p>\r\n\r\n<p>There is a light to show the working situation, and to show the battery percentage.</p>\r\n\r\n<p>Output power: 14W.</p>\r\n\r\n<p>Waterproof in ipx6 level.</p>\r\n\r\n<p>Support wireless connection via Bluetooth, wired via AUX port, support flash drive.</p>\r\n\r\n<p>Comes with a control button to play music and adjust the volume from the speaker.</p>\r\n\r\n<p>Input: Type C.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مكبر صوت بلوتوث بتصميم جميل مع حبل لسهولة النقل من شركة REMAX.</p>\r\n\r\n<p>أضواء ار جي بي لمنظر رائع.</p>\r\n\r\n<p>يتميز بالقدرة على توصيل اثنين من مكبرات الصوت في نفس الوقت.</p>\r\n\r\n<p>ستيريو لاسلكي مع خاصية ميكروفون مدمج، يمكن استقبال المكالمات الصوتية من خلال مكبر الصوت.</p>\r\n\r\n<p>هناك ضوء لإظهار حالة العمل وتظهر نسبة البطارية.</p>\r\n\r\n<p>قوة مكبرات الصوت: 14 واط.</p>\r\n\r\n<p>مقاوم للماء.</p>\r\n\r\n<p>يدعم الاتصال اللاسلكي عبر البلوتوث، وسلكي عبر منفذ اي يو اكس، ويدعم محرك أقراص فلاش.</p>\r\n\r\n<p>يوجد نظام تحكم لتشغيل الموسيقى وضبط مستوى الصوت من السماعة.</p>\r\n\r\n<p>منفذ الشحن: تايب سي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=QsMw6EcleGA', '', '1', NULL, NULL, '1', '2022-08-29 12:03:51', '2022-08-29 09:03:51', NULL, NULL, NULL, NULL, 9, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '35'),
(125, NULL, 7, 0, NULL, NULL, 'REMAX Little Boy Outdoor Wireless Speaker', '104', 'مكبر صوت خارجي مع ميكروفون لاسلكي من Remax', NULL, 'uploads/products/190394_黑色.jpg', NULL, NULL, '', '310', '265.59', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable wireless speaker with wireless microphone from Remax.</p>\r\n\r\n<p>You can pair 2 speakers together.</p>\r\n\r\n<p>3D Stereo sound system.</p>\r\n\r\n<p>Button-control, easy to use.</p>\r\n\r\n<p>Dual-speaker drivers, high-fidelity sound.</p>\r\n\r\n<p>Charging time: 4H.</p>\r\n\r\n<p>Speaker Power: 30W.</p>\r\n\r\n<p>Battery: 4500mAh.</p>\r\n\r\n<p>Supports USB Flash drive /Bluetooth /Record use.</p>\r\n\r\n<p>Warranty: 6 months.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>سماعة لاسلكية محمولة مع ميكرفون لاسلكي للحفلات من شركة REMAX.</p>\r\n\r\n<p>يمكن اقتران سماعتين في وقت واحد.</p>\r\n\r\n<p>نظام صوت ستيريو ثلاثي الابعاد.</p>\r\n\r\n<p>سهل التحكم بها عن طريق لوحة التحكم الموجودة في مكبر الصوت.</p>\r\n\r\n<p>تتميز بوجود مكبرات صوت مزدوجة مما تعطي دقه عالية فالصوت.</p>\r\n\r\n<p>وقت الشحن للسماعة: 4 ساعات.</p>\r\n\r\n<p>قوة مكبر الصوت: 30 واط</p>\r\n\r\n<p>قوة البطارية: 4500 مللي امبير</p>\r\n\r\n<p>تدعم البلوتوث + يو اس بي فلاش.</p>\r\n\r\n<p>ضمان المنتج: 6 شهور.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=AV94m0sDrm8&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-08-29 12:07:39', '2022-08-29 09:07:39', NULL, NULL, NULL, NULL, 6, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '35'),
