(140, NULL, 6, 0, NULL, NULL, 'NiteBird By Gosund Wi-Fi Smart Bulb', '159', 'لمبة NightBird الذكية واي-فاي من Gosund', NULL, 'uploads/products/162678_19-scaled1.jpg', NULL, NULL, '', '89', '48.23', '1', '<p>Product Details:</p>\r\n\r\n<p>Voice &amp; App Control: Smart bulbs from NiteBird that work with Alexa, Google Home, allows you to control your lights when you are not at home .</p>\r\n\r\n<p>Timer &amp; Schedule: Schedule the smart lights on/off automatically via your smartphone, then wake up in the morning with your favorite light. No hub required, easy to install.</p>\r\n\r\n<p>Can be controlled by group of 6 bulbs at the same time.</p>\r\n\r\n<p>8-Scene Modes: With 16 million colors, you can set different light modes to match various occasions.</p>\r\n\r\n<p>Brightness Dimmable: The light bulb has a dimming range from 1% to 100%, and you can set the brightness for different usage.</p>\r\n\r\n<p>Diy Colors: Color changing strip lights has 16 million colors with brightness and saturation adjustable.</p>\r\n\r\n<p>Support Alexa &amp; Google Assistant.</p>\r\n\r\n<p>Application: Gosund.</p>\r\n\r\n<p>Applicable Model: E27.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>المصباح الذكي من NiteBird يسمح لك بالتحكم في المصباح الخاص بك عندما لا تكون في المنزل عن طريق هاتفك.</p>\r\n\r\n<p>المؤقت والجدول الزمني: يمكن القيام بجدولة تشغيل / إيقاف تشغيل الأضواء الذكية تلقائيًا عبر هاتفك الذكي.</p>\r\n\r\n<p>يمكن ربط 6 مصابيح والتحكم فيهم في نفس الوقت عن طريق الهاتف.</p>\r\n\r\n<p>8 أنواع من المودات المختلفة للأنوار.</p>\r\n\r\n<p>كما يتميز بسهولة التركيب ويوفير من استهلاك الكهرباء.</p>\r\n\r\n<p>التحكم في مستوى قوة الإضاءة من 1٪ إلى 100٪.</p>\r\n\r\n<p>يدعم الأوامر الصوتية من اجهزة اليكسا وقوقل اسستنس الصوتية.</p>\r\n\r\n<p>اسم التطبيق: Gosund.</p>\r\n\r\n<p>الطراز: E27.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Ql5a6Nul6MA', '', '1', NULL, NULL, '1', '2022-08-29 13:24:46', '2022-08-29 10:24:46', NULL, NULL, NULL, NULL, 6, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '17'),
(141, NULL, 10, 0, NULL, NULL, 'MOFT X Phone Stand – Light Blue', '223', 'ستاند ومحفظة للجوال من موفت – ازرق فاتح', NULL, 'uploads/products/blue23.jpg', NULL, NULL, '', '80', '54', '1', '<p>Product Details:</p>\r\n\r\n<p>Grip, stand and ultra-thin wallet from MOFT.</p>\r\n\r\n<p>Suitable for all types of phones and can be installed on the cases.</p>\r\n\r\n<p>It features a hidden magnet to attach it to magnetic bases in the cars.</p>\r\n\r\n<p>It has a wallet for cards, and a maximum of 3 cards can be placed.</p>\r\n\r\n<p>It can be used as a base in length or width at an angle of 60 degrees, as desired and enjoy watching Movies or Youtube.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مسكة وستاند ومحفظة نحيفة جداً من شركة موفت.</p>\r\n\r\n<p>مناسبة لجميع أنواع الهواتف ويمكن تركيبها على الكفرات.</p>\r\n\r\n<p>تتميز بوجود مغناطيس مخفي لتثبيتها بقواعد مغناطيسية في السيارة وغيرها.</p>\r\n\r\n<p>يوجد فيها محفظة للبطاقات ويمكن وضع 3 بطاقات كحد اقصى.</p>\r\n\r\n<p>يمكن استخدامها كقاعدة بالطول او العرض بزاوية 60 درجة على حسب الرغبة لمشاهدة الأفلام او اليوتيوب.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=TMzUg2Z1Kk8&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-29 15:53:47', '2022-08-29 12:53:47', NULL, NULL, NULL, NULL, 6, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '29'),
