(157, NULL, 10, 0, NULL, NULL, 'Moft Snap iPad/Tablet Stand – Gray', '228', 'ستاند لأجهزة الايباد او التابليت من موفت – رمادي', NULL, 'uploads/products/471118_gray.jpg', NULL, NULL, '', '145', '100', '1', '<p>Product Details:</p>\r\n\r\n<p>Stand for iPads or Tablets from 9.7 inches and above from Moft.</p>\r\n\r\n<p>It is characterized by its slim and elegant shape, suitable and does not increase the thickness of the device.</p>\r\n\r\n<p>It can be used as a base in length or width at different angles according to the desire to watch movies or YouTube.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ستاند لأجهزة الايباد او التابليت من 9.7 انش وما فوق من شركة موفت.</p>\r\n\r\n<p>تتميز بشكلها النحيف والانيق، مناسبة ولا تزيد من سماكة الجهاز.</p>\r\n\r\n<p>يمكن استخدامها كقاعدة بالطول او العرض بزاويا مختلفة على حسب الرغبة لمشاهدة الأفلام او اليوتيوب.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-29 17:19:05', '2022-08-29 14:19:05', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '29'),
(158, NULL, 10, 0, NULL, NULL, 'MOFT Snap-On MagSafe Phone Stand – Gray', '222', 'ستاند ومحفظة للجوال MagSafe من موفت - رمادي', NULL, 'uploads/products/849928_gray-1.jpg', NULL, NULL, '', '110', '70', '1', '<p>Product Details:</p>\r\n\r\n<p>Grip, Stand and Wallet from Moft, supports MagSafe technology.</p>\r\n\r\n<p>Suitable for all Apple 12 phones via magnet ( MagSafe ) without need for any adhesive.</p>\r\n\r\n<p>It can be used as a base in length or width at an angle of 60 degrees, as desired and enjoy watching Movies or Youtube.</p>\r\n\r\n<p>It features magnets to attach it to any magnetic bases in the car.</p>\r\n\r\n<p>It has a wallet for cards, and a maximum of 3 cards can be placed.</p>\r\n\r\n<p>Small in size, suitable and does not increase the thickness of the phone.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مسكة وستاند ومحفظة من شركة موفت والتي تدعم تقنية MagSafe.</p>\r\n\r\n<p>مناسبة لجميع هواتف ابل 12 عن طريق المغناطيس ( MagSafe ) دون الحاجة الى أي لاصق.</p>\r\n\r\n<p>يمكن استخدامها كقاعدة بالطول او العرض بزاوية 60 درجة على حسب الرغبة لمشاهدة الأفلام او اليوتيوب.</p>\r\n\r\n<p>تتميز بوجود مغناطيس لتثبيتها بقواعد مغناطيسية في السيارة وغيرها.</p>\r\n\r\n<p>يوجد فيها محفظة للبطاقات ويمكن وضع 3 بطاقات كحد اقصى.</p>\r\n\r\n<p>صغيرة الحجم ومناسبة ولا تزيد من سماكة الهاتف.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=JgNyIMvivZ4&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-29 17:20:21', '2022-08-29 14:20:21', NULL, NULL, NULL, NULL, 8, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '29'),
