(162, NULL, 11, 0, NULL, NULL, 'MOFT Magnetic Snap-On Sticky Pad', '229', 'قاعدة مغناطيسية صغيرة الحجم من موفت', NULL, 'uploads/products/327716_b7001d0a-6bafd0ad9.jpg', NULL, NULL, '', '15', '0.00', '1', '<p>Product Details:</p>\r\n\r\n<p>Magnetic base with strong adhesive.</p>\r\n\r\n<p>Very small in size and suitable for home or car.</p>\r\n\r\n<p>It is suitable for all devices and can also be used with Moft stands.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>قاعدة مغناطيسية مع لاصق قوي جداً من شركة موفت.</p>\r\n\r\n<p>تتميز بصغر حجمها ومناسبه للمنزل او السيارة.</p>\r\n\r\n<p>تناسب كل الاجهزة وايضاً ممكن استعمالها مع ستاندات شركة موفت.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=pIsIsRezoWc&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-29 17:29:35', '2022-08-29 14:29:35', NULL, NULL, 1, NULL, 79, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '29'),
(163, NULL, 11, 0, NULL, NULL, 'Computer Monitor Stand With 4 USB Ports', '177', 'ستاند مع 4 مداخل يو اس بي للشاشات', NULL, 'uploads/products/653804_黑.png', NULL, NULL, '', '242', '241.80', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable monitor stand with 4 USB ports.</p>\r\n\r\n<p>Mini drawer + Phone stand.</p>\r\n\r\n<p>Changeable size.</p>\r\n\r\n<p>RGB color.</p>\r\n\r\n<p>Weight bearing: 30KG.</p>\r\n\r\n<p>Applicable models: 19inches and below.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>استاند متنقل للشاشات مع 4 مداخل يو اس بي.</p>\r\n\r\n<p>درج صغير للتخزين + استاند للهاتف.</p>\r\n\r\n<p>يمكن تغيير حجمه على حسب الرغبة.</p>\r\n\r\n<p>اضاءة ار جي بي.</p>\r\n\r\n<p>يستحمل وزن حتى 30 كيلو جرام.</p>\r\n\r\n<p>الطراز المناسب: كل أنواع الشاشات ذات حجم 19انش واقل.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=lpNsvUUQcjY&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-29 17:31:55', '2022-08-29 14:31:55', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL),
(164, NULL, 5, 0, NULL, NULL, 'Soap Dispenser – 350ML', '107', 'جهاز صانع الرغوة - 350 مل', NULL, 'uploads/products/884566_unnamed-3.jpg', NULL, NULL, '', '84', '83.10', '1', '<p>Product Details:</p>\r\n\r\n<p>Auto foaming soap dispenser with hand sensor.</p>\r\n\r\n<p>Make you easy to wash your hand.</p>\r\n\r\n<p>Rechargeable and doesn&#39;t need batteries.</p>\r\n\r\n<p>Input: Micro.</p>\r\n\r\n<p>Capacity: 350ml.</p>\r\n\r\n<p>Warranty: 3 Months.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز يصنع الرغوة من الصابون مع مستشعر ذكي عند وضع اليد.</p>\r\n\r\n<p>يسهل عملية غسل اليدين.</p>\r\n\r\n<p>قابل للشحن لا يحتاج الى بطاريات.</p>\r\n\r\n<p>مدخل: مايكرو.</p>\r\n\r\n<p>سعة 350 مل.</p>\r\n\r\n<p>ضمان لمدة 3 شهور.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=zcdMkpPDes0&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-29 17:33:47', '2022-08-29 14:33:47', NULL, NULL, NULL, NULL, 35, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL),
(165, NULL, 5, 0, NULL, NULL, 'Digital Weather Station With Outdoor Sensor', '173', 'جهاز لحالة الطقس ذو شاشة رقمية وحساس خارجي منفصل', NULL, 'uploads/products/617860_YT60180-前视图_1-1.jpg', NULL, NULL, '', '129', '122.08', '1', '<p>Product Details:</p>\r\n\r\n<p>Weather station with digital screen and touch keys.</p>\r\n\r\n<p>Indoor outdoor temperature + humidity + weather forecast + barometer.</p>\r\n\r\n<p>Alarm clock + High temperature alert + Calendar.</p>\r\n\r\n<p>An alarm clock and also an alarm when the temperature is high.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز الطقس مع شاشة رقمية لمس وحساس خارجي منفصل.</p>\r\n\r\n<p>الشاشة تحتوي على درجة الحرارة + الرطوبة + حالة الطقس الخارجي والداخلي.</p>\r\n\r\n<p>يوجد بها ساعة وتقويم للأيام.</p>\r\n\r\n<p>منبه للساعة وايضاً منبه عند ارتفاع درجة الحرارة.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-29 17:35:35', '2022-08-29 14:35:35', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL),
(166, NULL, 8, 0, NULL, NULL, 'DOBE PS5 Dual Charging Dock', '152', 'استاند وشاحن لأجهزة سوني 5 من DOBE', NULL, 'uploads/products/621141_23659787332_761289705.jpg', NULL, NULL, '', '70', '69.60', '1', '<p>Product Details:</p>\r\n\r\n<p>Direct &amp; Fast Charging dock from DOBE.</p>\r\n\r\n<p>This Charging Dock is designed to charge two Dualsense PS5 controllers at the same time.</p>\r\n\r\n<p>Charging time: Less than 3 hours.</p>\r\n\r\n<p>Intelligent Protection the built-in intelligent chip provides intelligent overload protection, protects your controllers from over-charging, over-voltage, overheat.</p>\r\n\r\n<p>LED lights on the top and the bottom will flash when the controller is charging, the orange light shows that charging is in progress and the light will be turned off automatically when the controller is fully charged.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>استاند وشاحن سريع جداً لأجهزة سوني 5 من شركة DOBE.</p>\r\n\r\n<p>مصمم لشحن جهازين في نفس الوقت.</p>\r\n\r\n<p>وقت الشحن: اقل من 3 ساعات.</p>\r\n\r\n<p>يتميز بنظام حماية ذكي لكي لا يعطي شحن زائد او حرارة زائدة للأجهزة مما قد يسبب اعطال لها.</p>\r\n\r\n<p>نظام اضاءة في الأعلى وفي الأسفل من الشاحن لمعرفة ان كان الجهاز قيد الشحن وتخفتي الإضاءة في حالة تم الشحن بالكامل للأجهزة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=7ZO_q5TBUAY&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-29 17:37:50', '2022-08-29 14:37:50', NULL, NULL, NULL, NULL, 9, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '14'),
(167, NULL, 10, 0, NULL, NULL, 'Baseus Invisible Phone Ring Holder – Rosegold', '233', 'حامل هاتف نحيف الحجم من Baseus - روز قولد', NULL, 'uploads/products/645639_01-1-600x600.jpg', NULL, NULL, '', '49', '48.28', '1', '<p>Product Details:</p>\r\n\r\n<p>Baseus ring holder and stand for mobile phones with strong 3M adhesive.</p>\r\n\r\n<p>Ring is aptly designed to be compatible with all finger sizes.</p>\r\n\r\n<p>360-degree rotatable design offers convenient viewing angles and can be used as a stand to watch Youtube or Movies.</p>\r\n\r\n<p>Made from top-quality material that allows for long term use.</p>\r\n\r\n<p>Slim and comfortable doesn&rsquo;t increase the size of your phone.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>Please clean the phone very good and wait at least 1 hour after installation to use this phone grip.</p>\r\n\r\n<p>This ring phone holder does not support silicone phone case.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>حامل هاتف واستاند في نفس الوقت من شركة &nbsp;Baseusمع لاصق قوي جداً 3M.</p>\r\n\r\n<p>تم تصميم الحلقة بشكل مناسب لتكون متوافقة مع جميع أحجام الأصابع.</p>\r\n\r\n<p>قابل للدوران بزاوية 360 درجة لزوايا عرض مريحة وتقدرون تستعملونه كستاند لمشاهدة الأفلام او اليوتيوب.</p>\r\n\r\n<p>مصنوع من مواد عالية الجودة تسمح باستخدام طويل الأمد.</p>\r\n\r\n<p>حجم نحيف جداً ومريح ولا يزيد من حجم الهاتف.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>يجب تنظيف الهاتف جيداً قبل تركيب الحامل والانتظار لمدة ساعة حتى تلتصق بشكل جيد.</p>\r\n\r\n<p>هذا الحامل لا يناسب الكفرات المصنوعة من السيليكون.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=D6kgphDXQBc&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-29 17:41:31', '2022-08-29 14:41:31', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '13'),
(168, NULL, 11, 0, NULL, NULL, 'Baseus iPad / Tablet Adjustable Stand – Black', '232', 'استاند لأجهزة الايباد او التابليت من Baseus - أسود', NULL, 'uploads/products/338843_SUZJ-01-2.jpg', NULL, NULL, '', '135', '83.18', '1', '<p>Product Details:</p>\r\n\r\n<p>Baseus Adjustable desk stand compatible with all devices size 5.5 to 21.5 (screen size) supports both vertical and horizontal placement.</p>\r\n\r\n<p>Height adjustable from 10 inch to 13.77 inch,</p>\r\n\r\n<p>The angle of this stand supports 45 degrees up and down adjustment.</p>\r\n\r\n<p>The stand has natural fabrics soft and comfortable, will not scratch your device.</p>\r\n\r\n<p>Non-Slip silicone pads are used for the inner and bottom corners of the bracket to avoid scratching the tablet and preventing slippage.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ستاند قابل للتعديل من شركةBaseus متوافق مع جميع الأجهزة بحجم 5.5 إلى 21.5 (حجم الشاشة) يدعم الوضع الرأسي والأفقي.</p>\r\n\r\n<p>ارتفاع قابل للتعديل من 10 إنش إلى 13.77 إنش.</p>\r\n\r\n<p>زاوية تدعم تعديل 45 درجة لأعلى ولأسفل.</p>\r\n\r\n<p>يتميز بوجود قماش طبيعي في الخلف حتى لا يسبب خدوش في اجهزتكم.</p>\r\n\r\n<p>مسكة الاستاند للزوايا الداخلية والسفلية مصنوعه من السيليكون حتى يمنع الأجهزة من الانزلاق.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=0aHwUL4-sko&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-29 17:43:48', '2022-08-29 14:43:48', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '13'),
(169, NULL, 5, 0, NULL, NULL, 'Baseus Mini Vacuum Cleaner – Black', '236', ' اسود - Baseus مكنسة كهربائية محمولة صغيرة الحجم من', NULL, 'uploads/products/280485_CRXCQ01-01-1.jpg', NULL, NULL, '', '169', '120.14', '1', '<p>Product Details:</p>\r\n\r\n<p>This compact and lightweight Vacuum Cleaner from BASEUS is the ideal tool for quick cleaning because it easily reaches into small corners and edges in the car or even the home.</p>\r\n\r\n<p>Equipped with a powerful suction feature to clean all kinds of dirt such as food crumbs, dust, traces of stuck dirt, etc.</p>\r\n\r\n<p>The device has an innovative 3-in-1 nozzle that can be used separately or with the brush.</p>\r\n\r\n<p>The internal filter of the vacuum cleaner can be washed and reused.</p>\r\n\r\n<p>The possible time for operating of the device in a single use is 21 minutes, and it takes 3 hours to fully charge it.</p>\r\n\r\n<p>It is characterized by ease of use and high suction power of up to 3.75 kPa.</p>\r\n\r\n<p>It works by charging and does not need batteries.</p>\r\n\r\n<p>Input: Type C.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>تعتبر هذه المكنسة المدمجة وخفيفة الوزن من Baseus أداة مثالية للتنظيف السريع بسبب سهولة وصولها إلى الزوايا والحواف الصغيرة في السيارة أو حتى المنزل.</p>\r\n\r\n<p>مزودة بميزة الشفط القوي لتنظيف جميع أنواع الأوساخ كفتات الطعام والغبار وآثار التراب العالق وغيرها.</p>\r\n\r\n<p>الجهاز يحتوي على فوهة مبتكرة 3 في 1 والتي يمكن استخدامها بشكل منفصل او مع الفرشاة.</p>\r\n\r\n<p>يمكن غسيل الفلتر الداخلي للمكنسة واعادة استخدامه مرة اخرى.</p>\r\n\r\n<p>المدة الممكنة لتشغيل الجهاز في الاستخدام الواحد 21 دقيقة وتحتاج الى 3 ساعات لشحنها بالكامل.</p>\r\n\r\n<p>تتميز بسهولة الاستخدام وقوة شفط عالية تصل الى 3.75 كيلو باسكال.</p>\r\n\r\n<p>تعمل عن طريق الشحن ولا تحتاج الى بطاريات.</p>\r\n\r\n<p>مدخل: تايب سي</p>\r\n', NULL, 'https://www.youtube.com/watch?v=3f04IiKZixk&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-29 17:48:26', '2022-08-29 14:48:26', NULL, NULL, NULL, NULL, 7, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '13'),
(170, NULL, 6, 0, NULL, NULL, 'Xiaomi Mi Body Composition Scale 2', '219', 'ميزان ومقياس لكتلة الجسم الذكي من Xiaomi', NULL, 'uploads/products/436876_Mi-Body-Composition-Scale-2.jpg', NULL, NULL, '', '109', '82', '1', '<p>Product Details:</p>\r\n\r\n<p>Smart scale with hidden digital display from Xiaomi.</p>\r\n\r\n<p>It is characterized by its high accuracy of daily body sensing when used.</p>\r\n\r\n<p>Intelligent analysis system that allows you to share it with your family members and can save the data of up to 16 people.</p>\r\n\r\n<p>It can be controlled by your phone so you can follow up your data.</p>\r\n\r\n<p>Warranty: 3 months.</p>\r\n\r\n<p>Control Application: Mi Fit.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ميزان ذكي مع شاشة رقمية مخفيه للجسم من شركة XIAOMI.</p>\r\n\r\n<p>يتميز بدقته العالية لاستشعار الجسد يومياً عند استعمالة.</p>\r\n\r\n<p>نظام تحليل ذكي مما يتيح لك مشاركته مع افراد عائلتك ويمكنه حفظ بيانات ما يصل الى ١٦ شخص.</p>\r\n\r\n<p>يمكن التحكم به عن طريق هاتفك ومعرفة البيانات الخاصه بك.</p>\r\n\r\n<p>ضمان المنتج: ٣ اشهر.</p>\r\n\r\n<p>تطبيق التحكم: Mi Fit</p>\r\n', NULL, 'https://www.youtube.com/watch?v=IR5mbtV_dYo&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-29 17:50:02', '2022-08-29 14:50:02', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(171, NULL, 15, 10, NULL, NULL, 'Charger station 5 Ports 110W', '157', 'شاحن وايرليس ذو 5 مداخل مع شاشة رقمية', NULL, 'uploads/products/446677_i8-6.jpg', NULL, NULL, '', '199', '152.48', '1', '<p>Product Details:</p>\r\n\r\n<p>Multiple charger station 4 USB-Port / 1 Type C-Port &amp; Wireless charger with voltage digital screen.</p>\r\n\r\n<p>Overpower and over-charge protection.</p>\r\n\r\n<p>Wireless Charger: 10W.</p>\r\n\r\n<p>PD Output: 5V3A,9V2A,12V3A,15V3A,20V3.25A (65W).</p>\r\n\r\n<p>One QC Output.</p>\r\n\r\n<p>Total Output: 110W.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن وايرليس ذو 4 مداخل يو اس بي ومدخل تايب سي مع شاشة رقمية بقوة الفولت.</p>\r\n\r\n<p>حماية من القوة الزائدة او الشحن الزائد.</p>\r\n\r\n<p>قوة شاحن الوايرليس: 10 واط.</p>\r\n\r\n<p>مخرج بتقنية PD بقوة 65 واط.</p>\r\n\r\n<p>مخرج بتنقية QC.</p>\r\n\r\n<p>اجمالي قوة المداخل: 110 واط.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=yfY7Hp9Da80&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-29 17:51:50', '2022-08-29 14:51:50', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(172, NULL, 15, 10, NULL, NULL, 'iLepo 60W Multiple Charger Station 8-Port USB', '155', 'شاحن ذو 8 مداخل يو اس بي من مع شاشة رقمية من iLepo', NULL, 'uploads/products/473812_9edfe5626U.jpg', NULL, NULL, '', '169', '111.63', '1', '<p>Product Details:</p>\r\n\r\n<p>iLepo multiple charger station 8-Port 3.0 USB charger with voltage digital screen.</p>\r\n\r\n<p>Overpower and over-charge protection.</p>\r\n\r\n<p>QC Port Output: 5V3A,9V2A 18W.</p>\r\n\r\n<p>Total Output: 60W 12A.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن ذو 8 مداخل يو اس بي من شركة iLepo مع شاشة رقمية بقوة الفولت.</p>\r\n\r\n<p>حماية من القوة الزائدة او الشحن الزائد.</p>\r\n\r\n<p>مخرج بتنقية كوال كوم للشحن السريع بقوة 18 واط.</p>\r\n\r\n<p>اجمالي قوة المداخل: 60 واط.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Ep8YyOz8BZ0&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-29 17:53:48', '2022-08-29 14:53:48', NULL, NULL, NULL, NULL, 7, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '24'),
