(174, NULL, 15, 10, NULL, NULL, 'Anker PowerPort Atom 4 Ports 100w', '248', 'شاحن باور بورت ذو 4 مداخل من Anker بقوة 100 واط', NULL, 'uploads/products/613486_anker-powerport-atom-pd-4-black-100w-new_photos_v2_x4_1.jpg', NULL, NULL, '', '449', '290', '1', '<p>Product Details:</p>\r\n\r\n<p>Anker Atom 100w power port 2 Type C port / 2 USB port.</p>\r\n\r\n<p>Super power provides an enormous 100W of charging power enough to charge 2 Type C laptops and 2 smartphones at the same time.</p>\r\n\r\n<p>High speed charging save up to 1 hour of charging time.</p>\r\n\r\n<p>PD Output: 5V = 3A/9V = 3A/20V = 5A. (100W)</p>\r\n\r\n<p>USB QC Output: 5V = 2.4A max per port.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن ذو 4 مداخل يو اس بي وتايب سي بتقنية PD وتقنية QC للشحن السريع من شركة Anker بقوة 100 واط.</p>\r\n\r\n<p>يشحن 4 اجهزة بنفس الوقت يعني تقدرون تشحنون جهازين لابتوب تايب سي وجوالين عن طريق اليو اس بي.</p>\r\n\r\n<p>مخرجين بتقنية PD بقوة 100 واط.</p>\r\n\r\n<p>مخرجين بتنقية QC للشحن السريع.</p>\r\n\r\n<p>اجمالي قوة المداخل: 100 واط.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-29 21:11:10', '2022-08-29 18:11:10', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '11'),
(175, NULL, 8, 0, NULL, NULL, 'PowerCore Play 6700 mAh Mobile Game Controller', '244', 'جهاز انكر باور كور بلي للجيمنغ + شاحن متنقل بسعة 6700 مللي امبير', NULL, 'uploads/products/763717_1254_auto_x2-1.jpg', NULL, NULL, '', '199', '120', '1', '<p>Product Details:</p>\r\n\r\n<p>Anker PowerCore Play 3 in 1 device with 6700 mAh built in power bank.</p>\r\n\r\n<p>This device features an additional battery with a capacity of 6700 mAh to charge the device while playing, as well as a fan for cooling your mobile and a comfortable grip for playing.</p>\r\n\r\n<p>Supports Android and Apple phones from 5.7 inches to 6.45 inches as a maximum.</p>\r\n\r\n<p>Two ways to charge the device USB or Type C cable according to your choice and it doesn&rsquo;t supports wireless charging.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>- جهاز باور كور بلي 3 في 1 متعدد الاستخدام من شركة Anker.</p>\r\n\r\n<p>- يتميز هذا الجهاز بوجود بطارية إضافية بسعة 6700 مللي امبير لشحن الجهاز اثناء اللعب وايضاً مروحة للتبريد ومسكة مريحة للعب.</p>\r\n\r\n<p>- يدعم هواتف الاندرويد والابل من حجم 5.7 انش الى 6.45 انش كحد اقصى.</p>\r\n\r\n<p>- طريقتين لشحن الجهاز واير يو اس بي او تايب سي حسب اختياركم ومايدعم الشحن اللاسلكي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=ZxqzbMKQWV0&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-08-29 21:13:31', '2022-08-29 18:13:31', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(176, NULL, 15, 10, NULL, NULL, 'Anker PowerPort Atom Slim 4 Ports 65W – Black', '246', 'شاحن انكر باور بورت اتوم ذو 4 مداخل بقوة 65 واط - اسود', NULL, 'uploads/products/461141_anker_slim_charger.jpg', NULL, NULL, '', '199', '125', '1', '<p>Product Details:</p>\r\n\r\n<p>Super thin Slim Series 65W charger from Anker.</p>\r\n\r\n<p>It can charge four devices at the same time and also charge laptops.</p>\r\n\r\n<p>Type C port with PD technology for fast charging.</p>\r\n\r\n<p>3 USB ports with IQ technology for fast charging.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن نحيف جداً سليم سيريس بقوة 65 واط والمشهور من شركة Anker.</p>\r\n\r\n<p>يمكن شحن اربع اجهزة بنفس الوقت وايضاً يشحن اجهزة اللابتوب.</p>\r\n\r\n<p>مدخل تايب سي بتقنية PD للشحن السريع.</p>\r\n\r\n<p>3 مداخل يو اس بي بتقنية QC3.0 للشحن السريع.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=co4XW2qXJgA&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-08-29 21:15:42', '2022-08-29 18:15:42', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(177, NULL, 15, 9, NULL, NULL, 'Anker Sense 10,000 mAh Power Bank 2 Ports – Pink', '322', 'شاحن متنقل بسعة 10,000 مللي امبير ذو مخرجين من Anker - وردي', NULL, 'uploads/products/524412_pink_metro.jpg', NULL, NULL, '', '189', '132.30', '1', '<p>Product Details:</p>\r\n\r\n<p>10000 mAh Slim Sense series power bank with two outputs PD and IQ technology for fast charging from Anker.</p>\r\n\r\n<p>A slim, distinctive and small shape, as well as a layer of velvet that gives a very beautiful appearance to the power bank.</p>\r\n\r\n<p>Charges two devices at the same time at high speed.</p>\r\n\r\n<p>Type-C input &amp; Output with PD technology 18W.</p>\r\n\r\n<p>USB Output with IQ technology 12W.</p>\r\n\r\n<p>Input: Type C.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>باوربانك ذو مخرجين بتقنية PD وتقنية IQ للشحن السريع بسعة 10000 مللي امبير من شركة Anker.</p>\r\n\r\n<p>شكل نحيف ومميز وصغير الحجم وايضاً طبقة من المخمل تعطي مظهر جميل جداً للباوربانك.</p>\r\n\r\n<p>يشحن جهازين بنفس الوقت بسرعة عالية.</p>\r\n\r\n<p>مدخل تايب سي بتقنية PD بقوة 18 واط.</p>\r\n\r\n<p>مدخل يو اس بي بتقنية IQ بقوة 12 واط.</p>\r\n\r\n<p>مدخل شحن الباوربانك تايب سي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Uec7P8pF9_A', '', '1', NULL, NULL, '1', '2022-08-29 21:17:55', '2022-08-29 18:17:55', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
