(179, NULL, 15, 9, NULL, NULL, 'Zendure A1 Power Bank 3350mAh USB Port', '264', 'شاحن متنقل صغير الحجم A1 بسعة 3,350 مللي امبير ذو مدخل واحد من Zendure', NULL, 'uploads/products/zendure-zendure-a1-mini-portable-charger-3350mah-s.jpg', NULL, NULL, '', '99', '69.30', '1', '<p>Product Details:</p>\r\n\r\n<p>Ultra-small 3,350 mAh power bank with USB port from Zendure.</p>\r\n\r\n<p>It is characterized by its size and strength against shocks and falls, and also for emergency uses, fully chargers the iPhone (one time use).</p>\r\n\r\n<p>Suitable for outdoor uses. You can put it in the bag or in your clothes due to its small size.</p>\r\n\r\n<p>USB port for charging.</p>\r\n\r\n<p>Micro power bank charging port.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>باوربانك صغير الحجم جداً بسعة 3,350 مللي امبير ذو مدخل يو اس بي من شركة Zendure.</p>\r\n\r\n<p>يتميز بحجمة وقوته ضد الصدمات والسقوط وايضاً للاستعمالات الطارئة يشحن الايفون شحنه وحدة كاملة.</p>\r\n\r\n<p>مناسب للأستعمالات الخارجية تقدرون تحطونة فالشنطة او في ملابسك بحكم حجمة الصغير.</p>\r\n\r\n<p>مدخل يو اس بي للشحن.</p>\r\n\r\n<p>مدخل شحن الباوربانك مايكرو.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=PUW7js8ODLE&feature=emb_imp_woyt', '', '0', NULL, NULL, '1', '2022-08-29 21:22:39', '2022-08-29 18:22:39', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '49'),
