(181, NULL, 12, 0, NULL, NULL, 'Goui Max Multifunction Device 5200 mAh', '374', 'شاحن متنقل + مكبر صوت + فلاش بسعة 5200 مللي امبير من Goui', NULL, 'uploads/products/490105_max_1000x1000.jpg', NULL, NULL, '', '200', '', '1', '<p>Product Details:</p>\r\n\r\n<p>A multi-use device that is a power bank, flash and speaker at the same time with a capacity of 5200 mA from Goui.</p>\r\n\r\n<p>It is characterized by its small size and a modern cylindrical shape.</p>\r\n\r\n<p>Flash lighting at the bottom of the device in more than one mode of use, as well as side LED lighting.</p>\r\n\r\n<p>Easy to use and has a clear control button.</p>\r\n\r\n<p>USB port for fast charging.</p>\r\n\r\n<p>Suitable for road trips.</p>\r\n\r\n<p>Can be installed on bike arm for bike lovers.</p>\r\n\r\n<p>Micro SD input.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز متعدد الاستخدام ويعتبر باوربانك وفلاش ومكبر صوت بنفس الوقت بسعة 5200 مللي امبير من شركة Goui.</p>\r\n\r\n<p>يتميز بحجمه الصغير وبشكل اسطواني عصري.</p>\r\n\r\n<p>اضاءة فلاش اسفل الجهاز بأكثر من وضع للأستخدام وايضاً اضاءة LED جانبية.</p>\r\n\r\n<p>سهل الاستخدام ويوجد فيه ازرة التحكم واضحة.</p>\r\n\r\n<p>مدخل يو اس بي للشحن السريع.</p>\r\n\r\n<p>مناسب للرحلات البرية.</p>\r\n\r\n<p>يمكن تركيبة على ذراع الدراجة لمحبين الدراجات.</p>\r\n\r\n<p>مدخل Micro SD.</p>\r\n', NULL, 'https://youtu.be/2C4M7KR-fPQ', '', '1', NULL, NULL, '1', '2022-08-29 21:27:42', '2022-08-29 18:27:42', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '18'),
