(183, NULL, 15, 12, NULL, NULL, 'Goui Wireless Charging Mouse Pad', '256', 'ماوس باد وشاحن لاسلكي من Goui', NULL, 'uploads/products/969073_goui-pad-01.png', NULL, NULL, '', '159', '103.50', '1', '<p>Product Details:</p>\r\n\r\n<p>Goui 15W wireless charger and mouse pad with built-in magnets.</p>\r\n\r\n<p>It features a wireless charger with a mouse pad, you can charge your mobile phone while using your computer.</p>\r\n\r\n<p>Comfortable to use, and the charger can be separated from the mouse pad or combined through the magnets in the mouse pad.</p>\r\n\r\n<p>Type C port to operate the wireless charger.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>- ماوس باد وشاحن لاسلكي بقوة 15 واط مع مغناطيس مدمج من شركة Goui.</p>\r\n\r\n<p>- يتميز بوجود شاحن لاسكلي مع الماوس باد تقدرون تشحنون الجوال وانتوا تستخدمون الكمبيوتر.</p>\r\n\r\n<p>- مريح فالاستخدام ويمكن فصل الشاحن عن الماوس باد او دمجهم عن طريق المعناطيس الموجود في الماوس باد.</p>\r\n\r\n<p>- مدخل تايب سي لتشغيل الشاحن اللاسلكي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=4SkmvLOr0FU', '', '1', NULL, NULL, '1', '2022-08-30 12:11:47', '2022-08-30 09:11:47', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '18'),
(184, NULL, 15, 9, NULL, NULL, 'Goui Buyuni Multifunction Speaker + Wall Charger + Power Bank ', '257', 'جهاز Buyuni متعدد الاستخدام 3 في 1 من Goui', NULL, 'uploads/products/336948_1_11.jpg', NULL, NULL, '', '199', '129', '1', '<p>Product Details:</p>\r\n\r\n<p>Buyuni 3 in 1 charger with two USB ports for fast charging with a capacity of 5200 mAh from Goui.</p>\r\n\r\n<p>It features a travel wall charger and at the same time a power bank, as well as a speaker with 5W power.</p>\r\n\r\n<p>Two additional pieces to fit the sockets of all countries such as USA, EU and UK.</p>\r\n\r\n<p>Easy to use and small in size, suitable for use outside home or for travel.</p>\r\n\r\n<p>Two devices can be charged at the same time.</p>\r\n\r\n<p>Two USB ports for fast charging.</p>\r\n\r\n<p>Speaker 5W.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن 3 في 1 ذو مدخلين يو اس بي للشحن السريع بسعة 5200 مللي امبير من شركة Goui.</p>\r\n\r\n<p>يتميز انه شاحن جداري للسفر وفي نفس الوقت باوربانك وايضاً مكبر صوت بقوة 5 واط.</p>\r\n\r\n<p>قطعتين اضافية ليتناسب مع بلكات كل الدول مثل امريكا واوروبا وبريطانيا.</p>\r\n\r\n<p>سهل الاستخدام وصغير فالحجم ومناسب للاستعمال خارج المنزل او للسفر.</p>\r\n\r\n<p>يمكن شحن جهازين بنفس الوقت.</p>\r\n\r\n<p>مدخلين يو اس بي للشحن السريع.</p>\r\n\r\n<p>مكبر صوت بقوة 5 واط.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=EtkEHnT6AF4', '', '1', NULL, NULL, '1', '2022-08-30 12:22:16', '2022-08-30 09:22:16', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '18'),
(185, NULL, 15, 12, NULL, NULL, 'Goui Dock 3 in 1 Wireless Charging', '258', 'شاحن لاسلكي وقاعدة 3 في 1 من Goui', NULL, 'uploads/products/897440_dock1_500x500-768x768.jpg', NULL, NULL, '', '299', '194', '1', '<p>Product Details:</p>\r\n\r\n<p>Dock 3 in 1 wireless charger with fast charging technology for phones from Goui.</p>\r\n\r\n<p>Charges 3 devices at the same time iPhone, Apple Watch and Apple Airpods.</p>\r\n\r\n<p>Suitable for office or bedrooms.</p>\r\n\r\n<p>7.5W phone wireless charging.</p>\r\n\r\n<p>Easy to install and use.</p>\r\n\r\n<p><em><strong>Note:</strong></em></p>\r\n\r\n<p>The base does not contain charging wires, but only the operating wire for the device.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن وايرليس 3 في 1 مع تقنية الشحن السريع للهواتف من شركة Goui.</p>\r\n\r\n<p>يشحن اكثر من جهاز في نفس الوقت الايفون وساعة ابل وسماعة ابل.</p>\r\n\r\n<p>مناسب للمكتب او غرف النوم.</p>\r\n\r\n<p>شحن لاسلكي للهواتف بقوة 7.5 واط.</p>\r\n\r\n<p>سهل التركيب والاستعمال.</p>\r\n\r\n<p><em><strong>ملاحظة</strong></em></p>\r\n\r\n<p>&nbsp;القاعدة لا تحتوي على اسلاك الشحن وانما فقط سلك التشغيل للجهاز.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-30 12:26:16', '2022-08-30 09:26:16', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '18'),
(186, NULL, 5, 0, NULL, NULL, 'Goui LOCH Smart Bottle 420ML With 6000mAh Power Bank + Wireless Charger', '260', 'مطارة ذكية شاحن لاسلكي + شاحن سلكي + شاحن متنقل  بسعة 6000 مللي امبير من Goui', NULL, 'uploads/products/182454_loch_1_1200x1200.jpg', NULL, NULL, '', '199', '129', '1', '<p>Product Details:</p>\r\n\r\n<p>LOCH Smart bottle 420ml and wireless + wired charger + power bank with a capacity of 6000mAh from Goui.</p>\r\n\r\n<p>Made of water-resistant stainless steel, it keeps the temperature of your hot drink for 12 hours and cold for 24 hours.</p>\r\n\r\n<p>Built-in power bank charger under the bottle and can be separated from it to be used as a wireless or wired charger according to your desire.</p>\r\n\r\n<p>Suitable for daily use at home or outside the home for sports or even travel.</p>\r\n\r\n<p>Type C port for fast charging, and the battery can be charged from the same place.</p>\r\n\r\n<p>5W Wireless charger.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مطارة LOCH الذكية بسعة 420 مل حافظة للحرارة وشاحن لاسلكي + سلكي + باوربانك بسعة 6000 مللي امبير من شركة Goui.</p>\r\n\r\n<p>مصنوعة من الستيل المقاوم للصدأ ضد الماء وتحفظ درجة حرارة مشروبكم الحار 12 ساعة والبارد 24 ساعة.</p>\r\n\r\n<p>شاحن باوربانك مدمج اسفل المطارة ويمكن فصله عنها لاستعماله كشاحن لاسلكي او سلكي على حسب رغبتكم.</p>\r\n\r\n<p>مناسبة للاستعمال اليومي في المنزل او خارج المنزل للرياضة او حتى في السفر.</p>\r\n\r\n<p>مدخل تايب سي للشحن السريع ويمكن شحن البطارية من نفس المكان.</p>\r\n\r\n<p>شاحن لاسلكي بقوة 5 واط.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=ZKYy2pDkJPE&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-08-30 12:29:45', '2022-08-30 09:29:45', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '18'),
(187, NULL, 15, 9, NULL, NULL, 'Jump Starter Pro Power Bank Roav By Anker 8,000mAh', '249', 'شاحن متنقل Roav لتشغيل السيارات بسعة 8000 مللي امبير من Anker', NULL, 'uploads/products/item_XL_43120332_4a8d2e79159aa_458x600.jpg', NULL, NULL, '', '349', '220', '1', '<p>Product Details:</p>\r\n\r\n<p>8,000mAh Roav Power bank with two USB ports and one port for charging the car from Anker.</p>\r\n\r\n<p>It charges devices like any other power bank, and its advantage is that it charges the car battery in the event that the car battery is weak.</p>\r\n\r\n<p>Emergency flash lighting.</p>\r\n\r\n<p>Compass for directions.</p>\r\n\r\n<p>illuminations to know the status of the battery charge.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>باوربانك الرحلات بقوة 8,000 مللي امبير ذو مدخلين يو اس بي ومدخل لشحن السيارة من شركة Anker.</p>\r\n\r\n<p>يشحن الأجهزة كأي باوربانك اخر وميزته ان يشحن بطارية السيارة في حال وقت عليكم السيارة او ضعفت البطارية.</p>\r\n\r\n<p>إضاءة فلاش لحالات الطوارئ.</p>\r\n\r\n<p>بوصلة لمعرفة الاتجاهات.</p>\r\n\r\n<p>اضاءات لمعرفة حالة شحن البطارية.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=anwR1yrOhXI', '', '1', NULL, NULL, '1', '2022-08-30 12:43:50', '2022-08-30 09:43:50', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '11'),
(188, NULL, 15, 10, NULL, NULL, 'Anker PowerPort Built For Travel 2 Ports 60W', '245', 'شاحن سريع للسفر ذو مدخلين تايب سي بقوة 60 واط', NULL, 'uploads/products/Anker-PowerPort-III-2-Port-60W-Black_800x800.png', NULL, NULL, '', '259', '160', '1', '<p>Product Details:</p>\r\n\r\n<p>Anker 60W charger with 2 Type C PD fast charging ports.</p>\r\n\r\n<p>It is characterized by the presence of additional pieces of interchangeable plugs for use in the US, UK, and Europe.</p>\r\n\r\n<p>Two inputs with PD technology for fast charging with a power of 60W, and it can charge two devices at the same time.</p>\r\n\r\n<p>Supports all types of devices in addition to computers.</p>\r\n\r\n<p>Protection against overpowering or overcharging.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن ذو مدخلين تايب سي بتقنية PD للشحن السريع من شركة Anker.</p>\r\n\r\n<p>يتميز بوجود قطع إضافية للبلكات مختلفة ليتناسب مع كل الدول.</p>\r\n\r\n<p>مدخلين بتقنية PD للشحن السريع بقوة 60 واط ويمكن شحن جهازين في نفس الوقت.</p>\r\n\r\n<p>يدعم جميع انواع الأجهزة بالإضافة الى اجهزة الكمبيوتر.</p>\r\n\r\n<p>حماية من القوة الزائدة او الشحن الزائد.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=a26PIDEolgw&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-08-30 12:49:51', '2022-08-30 09:49:51', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(189, NULL, 15, 10, NULL, NULL, 'Anker PowerPort Atom Slim 4 Ports 65W – Blue', '247', 'شاحن انكر باور بورت اتوم ذو 4 مداخل بقوة 65 واط - ازرق', NULL, 'uploads/products/758535_file_16_3.jpg', NULL, NULL, '', '199', '125', '1', '<p>Product Details:</p>\r\n\r\n<p>Super thin Slim Series 65W charger from Anker.</p>\r\n\r\n<p>It can charge four devices at the same time and also charge laptops.</p>\r\n\r\n<p>Type C port with PD technology for fast charging.</p>\r\n\r\n<p>3 USB ports with IQ technology for fast charging.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن نحيف جداً سليم سيريس بقوة 65 واط والمشهور من شركة Anker.</p>\r\n\r\n<p>يمكن شحن اربع اجهزة بنفس الوقت وايضاً يشحن اجهزة اللابتوب.</p>\r\n\r\n<p>مدخل تايب سي بتقنية PD للشحن السريع.</p>\r\n\r\n<p>3 مداخل يو اس بي بتقنية QC3.0 للشحن السريع.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=co4XW2qXJgA', '', '1', NULL, NULL, '1', '2022-08-30 13:03:18', '2022-08-30 10:03:18', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(190, NULL, 5, 0, NULL, NULL, 'Baseus Mini Vacuum Cleaner – Silver', '236', 'مكنسة كهربائية محمولة صغيرة الحجم من Baseus - رصاصي', NULL, 'uploads/products/704618_CRXCQ01-0S-1.jpg', NULL, NULL, '', '169', '120.14', '1', '<p>Product Details:</p>\r\n\r\n<p>This compact and lightweight Vacuum Cleaner from BASEUS is the ideal tool for quick cleaning because it easily reaches into small corners and edges in the car or even the home.</p>\r\n\r\n<p>Equipped with a powerful suction feature to clean all kinds of dirt such as food crumbs, dust, traces of stuck dirt, etc.</p>\r\n\r\n<p>The device has an innovative 3-in-1 nozzle that can be used separately or with the brush.</p>\r\n\r\n<p>The internal filter of the vacuum cleaner can be washed and reused.</p>\r\n\r\n<p>The possible time for operating of the device in a single use is 21 minutes, and it takes 3 hours to fully charge it.</p>\r\n\r\n<p>It is characterized by ease of use and high suction power of up to 3.75 kPa.</p>\r\n\r\n<p>It works by charging and does not need batteries.</p>\r\n\r\n<p>Input: Type C.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>تعتبر هذه المكنسة المدمجة وخفيفة الوزن من Baseus أداة مثالية للتنظيف السريع بسبب سهولة وصولها إلى الزوايا والحواف الصغيرة في السيارة أو حتى المنزل.</p>\r\n\r\n<p>مزودة بميزة الشفط القوي لتنظيف جميع أنواع الأوساخ كفتات الطعام والغبار وآثار التراب العالق وغيرها.</p>\r\n\r\n<p>الجهاز يحتوي على فوهة مبتكرة 3 في 1 والتي يمكن استخدامها بشكل منفصل او مع الفرشاة.</p>\r\n\r\n<p>يمكن غسيل الفلتر الداخلي للمكنسة واعادة استخدامه مرة اخرى.</p>\r\n\r\n<p>المدة الممكنة لتشغيل الجهاز في الاستخدام الواحد ٢١ دقيقة وتحتاج الى 3 ساعات لشحنها بالكامل.</p>\r\n\r\n<p>تتميز بسهولة الاستخدام وقوة شفط عالية تصل الى 3.75 كيلو باسكال.</p>\r\n\r\n<p>تعمل عن طريق الشحن ولا تحتاج الى بطاريات.</p>\r\n\r\n<p>مدخل: تايب سي</p>\r\n', NULL, 'https://www.youtube.com/watch?v=3f04IiKZixk', '', '1', NULL, NULL, '1', '2022-08-30 13:07:45', '2022-08-30 10:07:45', NULL, NULL, NULL, NULL, 7, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '13'),
(191, NULL, 5, 0, NULL, NULL, 'Smart Diamond Crystal Lamp', '309', 'الأباجورة الذكية من الكريستال', NULL, 'uploads/products/956859_lamp-10.jpg', NULL, NULL, '', '150', '115.79', '1', '<p>Product Details:</p>\r\n\r\n<p>Smart rechargeable crystal touch lamp.</p>\r\n\r\n<p>It can be charged and used without wire and does not require batteries.</p>\r\n\r\n<p>Lightweight and gives a sweet look for occasions or bedrooms and others.</p>\r\n\r\n<p>3 Colors of lights ( White / Warm / Yellow )</p>\r\n\r\n<p>It comes with a charging cable inside the box.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ابجورة ذكية تعمل عن طريق اللمس من الكريستال.</p>\r\n\r\n<p>يمكن شحنها ويتم استعمالها بدون واير ولا تحتاج الى بطاريات.</p>\r\n\r\n<p>خفيفة فالوزن وتعطي منظر حلو للمناسبات او غرف النوم وغيرها.</p>\r\n\r\n<p>3 الوان من الاضاءة ( ابيض / برتقالي وورم / اصفر )</p>\r\n\r\n<p>يأتي معها واير الشحن بداخل الصندوق.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-30 13:09:47', '2022-08-30 10:09:47', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, NULL),
(192, NULL, 8, 0, NULL, NULL, 'Baseus GAMO Cooling Radiator For Mobile Phones', '231', 'مروحة تبريد للهواتف من Baseus', NULL, 'uploads/products/497075_GMGA06-01-2.jpg', NULL, NULL, '', '99', '97.56', '1', '<p>Product Details:</p>\r\n\r\n<p>Baseus Gamo cooling fan for mobile phones.</p>\r\n\r\n<p>Provides silent and fast cooling for your phone, limiting thermal throttling.</p>\r\n\r\n<p>Triple cooling technology.</p>\r\n\r\n<p>Continuous use for 200 hours Best choice for professional gamers.</p>\r\n\r\n<p>Works with all mobile phones size 67 mm to 88 mm wide.</p>\r\n\r\n<p>Input: Type C</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مروحة تبريد Gamo للهواتف المحمولة لأصحاب الجيمنغ من شركة Baseus.</p>\r\n\r\n<p>تتميز بسرعة تبريد هاتفك وبدون صوت.</p>\r\n\r\n<p>تقنية التبريد الثلاثي.</p>\r\n\r\n<p>تقدرون تستخدمونها بشكل متواصل لمدة 200 ساعة وتعتبر أفضل خيار للي يحبون اللعب على الجوال.</p>\r\n\r\n<p>تعمل مع جميع الهواتف المحمولة والتي عرضها يبتدأ من 67 مم إلى 88 مم.</p>\r\n\r\n<p>مدخل: تايب سي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=ZU4VGoW7LOY', '', '1', NULL, NULL, '1', '2022-08-30 13:12:28', '2022-08-30 10:12:28', NULL, NULL, NULL, NULL, 7, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '13'),
(193, NULL, 15, 11, NULL, NULL, 'Baseus High Efficiency 80W Dual Cigarette Lighter', '238', 'ولاعة سجائر مزدوجة عالية الكفاءة 80 واط مع شاحن من Baseus', NULL, 'uploads/products/123409_CRDYQ-01-1-600x600.jpg', NULL, NULL, '', '59', '58.54', '1', '<p>Product Details:</p>\r\n\r\n<p>BASEUS dual USB smart extended car charger with 80W dual ports cigarette lighter socket.</p>\r\n\r\n<p>Dual USB car charger with 3.4A output.</p>\r\n\r\n<p>Extend your car cigarette lighter to 2 lighter socket and two USB ports.</p>\r\n\r\n<p>12-24V output, widely compatible with smartphones, tablet, etc.</p>\r\n\r\n<p>Designed with high quality materials, fashionable and suitable for cars.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز ولاعة سجائر مزدوج من شركة Baseus.</p>\r\n\r\n<p>ولاعة السجائر في السيارة بمقبس ولاعة ومنفذين يو اس بي إضافيين.</p>\r\n\r\n<p>شاحن يو اس بي مزدوج مع مخرج بقوة 3.4A.</p>\r\n\r\n<p>مخرج 12-24 فولت، متوافق مع نطاق واسع مع الهواتف الذكية والاجهزة اللوحية وغيرها.</p>\r\n\r\n<p>مصمم بمواد عالية الجودة وبشكل عصري ومناسب للسيارات.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=JEXessKWQUY&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 14:24:35', '2022-08-30 11:24:35', NULL, NULL, NULL, NULL, 8, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '13'),
(194, NULL, 5, 0, NULL, NULL, 'Baseus Mini Air Conditioner 320ML', '235', 'مبرد هواء 320مل صغير الحجم من Baseus', NULL, 'uploads/products/CXTM-21-2.jpg', NULL, NULL, '', '170', '114.66', '1', '<p>Product Details:</p>\r\n\r\n<p>Baseus Portable light weight personal air cooler can cool the hot air around you.</p>\r\n\r\n<p>3 Fan speeds you can choose the ideal wind power as needed.</p>\r\n\r\n<p>320ML Water tank capacity and you can put ice mixed with water.</p>\r\n\r\n<p>Ultra-quite fan comfortable and can be used in bedrooms or at work.</p>\r\n\r\n<p>This portable air cooler has three functions including air cooling, humidification and purification.</p>\r\n\r\n<p>Input: Type C.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مبرد هواء شخصي خفيف الوزن محمول من شركة &nbsp;Baseus يمكنه تبريد الهواء الساخن من حولك.</p>\r\n\r\n<p>3 سرعات للمروحة يمكنك اختيار طاقة الرياح المثالية حسب الحاجة.</p>\r\n\r\n<p>سعة خزان المياه 320 مللي ويمكنك وضع الثلج الممزوج بالماء.</p>\r\n\r\n<p>صوت المبرد خفيف للغاية ويمكن استخدامه في غرف النوم أو في العمل.</p>\r\n\r\n<p>يحتوي مبرد الهواء المحمول هذا على ثلاث وظائف بما في ذلك تبريد الهواء والترطيب والتنقية.</p>\r\n\r\n<p>مدخل: تايب سي</p>\r\n', NULL, 'https://www.youtube.com/watch?v=SRqqGFlSzqE&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 14:26:24', '2022-08-30 11:26:24', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '13'),
(195, NULL, 10, 0, NULL, NULL, 'Baseus Invisible Phone Ring Holder – Tarnish', '233', 'حامل هاتف نحيف الحجم من Baseus - نحاسي', NULL, 'uploads/products/729192_04.jpg', NULL, NULL, '', '49', '48.28', '1', '<p>Product Details:</p>\r\n\r\n<p>Baseus ring holder and stand for mobile phones with strong 3M adhesive.</p>\r\n\r\n<p>Ring is aptly designed to be compatible with all finger sizes.</p>\r\n\r\n<p>360-degree rotatable design offers convenient viewing angles and can be used as a stand to watch Youtube or Movies.</p>\r\n\r\n<p>Made from top-quality material that allows for long term use.</p>\r\n\r\n<p>Slim and comfortable doesn&rsquo;t increase the size of your phone.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>Please clean the phone very good and wait at least 1 hour after installation to use this phone grip.</p>\r\n\r\n<p>This ring phone holder does not support silicone phone case.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>حامل هاتف واستاند في نفس الوقت من شركة &nbsp;Baseusمع لاصق قوي جداً 3M</p>\r\n\r\n<p>تم تصميم الحلقة بشكل مناسب لتكون متوافقة مع جميع أحجام الأصابع.</p>\r\n\r\n<p>قابل للدوران بزاوية 360 درجة لزوايا عرض مريحة وتقدرون تستعملونه كستاند لمشاهدة الأفلام او اليوتيوب.</p>\r\n\r\n<p>مصنوع من مواد عالية الجودة تسمح باستخدام طويل الأمد.</p>\r\n\r\n<p>حجم نحيف جداً ومريح ولا يزيد من حجم الهاتف.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>يجب تنظيف الهاتف جيداً قبل تركيب الحامل والانتظار لمدة ساعة حتى تلتصق بشكل جيد.</p>\r\n\r\n<p>هذا الحامل لا يناسب الكفرات المصنوعة من السيليكون.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=D6kgphDXQBc&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 14:28:14', '2022-08-30 11:28:14', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '13'),
(196, NULL, 11, 0, NULL, NULL, 'Baseus iPad / Tablet Adjustable Stand – White', '232', 'ستاند لأجهزة الايباد او التابليت من Baseus - ابيض', NULL, 'uploads/products/289136_SUZJ-02-2.jpg', NULL, NULL, '', '135', '83.18', '1', '<p>Product Details:</p>\r\n\r\n<p>Baseus Adjustable desk stand compatible with all devices size 5.5 to 21.5 (screen size) supports both vertical and horizontal placement.</p>\r\n\r\n<p>Height adjustable from 10 inch to 13.77 inch,</p>\r\n\r\n<p>The angle of this stand supports 45 degrees up and down adjustment.</p>\r\n\r\n<p>The stand has natural fabrics soft and comfortable, will not scratch your device.</p>\r\n\r\n<p>Non-Slip silicone pads are used for the inner and bottom corners of the bracket to avoid scratching the tablet and preventing slippage.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ستاند قابل للتعديل من شركةBaseus &nbsp;متوافق مع جميع الأجهزة بحجم 5.5 إلى 21.5 (حجم الشاشة) يدعم الوضع الرأسي والأفقي.</p>\r\n\r\n<p>ارتفاع قابل للتعديل من 10 إنش إلى 13.77 إنش.</p>\r\n\r\n<p>زاوية تدعم تعديل 45 درجة لأعلى ولأسفل.</p>\r\n\r\n<p>يتميز بوجود قماش طبيعي في الخلف حتى لا يسبب خدوش في اجهزتكم.</p>\r\n\r\n<p>مسكة الاستاند للزوايا الداخلية والسفلية مصنوعه من السيليكون حتى يمنع الأجهزة من الانزلاق.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=0aHwUL4-sko&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-08-30 14:30:38', '2022-08-30 11:30:38', NULL, 1, NULL, NULL, 8, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '13'),
(197, NULL, 9, 0, NULL, NULL, 'Vention 8K High Definition HDMI Cable - 2 Meters Length', '269', 'كابل HDMI بدقة 8K عالي الوضوح من Vention - الطول 2 متر', NULL, 'uploads/products/761203_Ha7f6e7d473584038a8dd4bf873a23fe4w.jpg', NULL, NULL, '', '119', '67.40', '1', '<p>Product Details:</p>\r\n\r\n<p>HDMI 8K cable for high-definition monitors from Vention.</p>\r\n\r\n<p>It gives you more accuracy and clarity than any cable, provided that there is a screen that supports 8K resolution.</p>\r\n\r\n<p>Suitable for watching movies or playing games that require and support high definition.</p>\r\n\r\n<p>Lengths: 2 Meters.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كابل HDMI 8K عالي الوضوح للشاشات من شركة Vention.</p>\r\n\r\n<p>يعطيكم دقه ووضوح اكثر من اي كابل بشرط وجود شاشة تدعم وضوح 8K.</p>\r\n\r\n<p>مناسب حق اصحاب الافلام او الالعاب التي تتطلب وتدعم وضوح عالي.</p>\r\n\r\n<p>الطول: 2 متر.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=ukoeGJDlzME&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 14:47:54', '2022-08-30 11:47:54', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '47');
INSERT INTO `product` (`product_id`, `fk_lang_id`, `category_id`, `sub_category_id`, `child_category_id`, `unit_id`, `product_name`, `product_code`, `product_name_ar`, `product_in_marathi`, `image_name`, `pack_size`, `product_price`, `max_sell_limit`, `product_offer_price`, `product_purchase_price`, `listed_in_super_deal`, `description`, `description_ar`, `relatable_products`, `video_url`, `product_barcode`, `status`, `unit`, `mrp`, `stock_status`, `added_on`, `date_modified`, `popular`, `featured`, `best_selling`, `new_arrival`, `qty`, `supplier_id`, `currency_in_english`, `currency_in_arabic`, `product_offer`, `product_status`, `category_type`, `gift_card_stock`, `uniq_code`, `brand_id`) VALUES
(198, NULL, 5, 0, NULL, NULL, 'Rawash Portable Bidet', '435', 'شطاف متنقل من Rawash', NULL, 'uploads/products/715811_2122.jpg', NULL, NULL, '', '300', '117.73', '1', '<p>Product Details:</p>\r\n\r\n<p>Rechargeable portable bidet from Rawash.</p>\r\n\r\n<p>It is characterized by the power of pumping water 5 times than any other bidet.</p>\r\n\r\n<p>It can be used with different water sources such as ( water basin, water bottle, and others).</p>\r\n\r\n<p>It works for two weeks if it is fully charged and is considered suitable for travel or land trips.</p>\r\n\r\n<p>Small in size, easy to use and carry anywhere.</p>\r\n\r\n<p>Warranty: 1 Year</p>\r\n\r\n<p><strong>Package includes:</strong></p>\r\n\r\n<p>Bidet stand.</p>\r\n\r\n<p>USB Cable for charging.</p>\r\n\r\n<p>Small bag to carry the bidet.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شطاف متنقل قابل للشحن من شركة Rawash.</p>\r\n\r\n<p>يتميز بقوة&nbsp;ضخ ماء 5 مرات من اي شطاف اخر.</p>\r\n\r\n<p>يمكن استخدامة مع مصادر مياه مختلفة مثل ( حوض ماء، قارورة ماء ، وغيرها ).</p>\r\n\r\n<p>يعمل لمدة اسبوعين اذا تم شحنة بالكامل ويعتبر مناسب للسفر او الرحلات البرية.</p>\r\n\r\n<p>صغير الحجم ويسهل استخدامة وحمله الي اي مكان.</p>\r\n\r\n<p>ضمان لمدة سنة.</p>\r\n\r\n<p><strong>الصندوق يحتوي على:</strong></p>\r\n\r\n<p>قاعدة للشطاف.</p>\r\n\r\n<p>واير الشحن منفذ USB.</p>\r\n\r\n<p>حقيبة صغيرة لحمل الشطاف.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Z6-3GJPbJh8&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 15:13:51', '2022-08-30 12:13:51', NULL, NULL, NULL, NULL, 15, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '12'),
(199, NULL, 5, 0, NULL, NULL, 'Portable Bag Packaging Device', '468', 'جهاز حراري محمول لتغليف للأكياس', NULL, 'uploads/products/227489_101.jpg', NULL, NULL, '', '150', '44.09', '1', '<p>Product Details:</p>\r\n\r\n<p>2 in 1 Portable rechargeable device for packaging open bags from Fiebi.</p>\r\n\r\n<p>It wraps the bags with the push of a button and also opens the heat-coated bags.</p>\r\n\r\n<p>Designed with a very thin opening so as not to be used incorrectly by children.</p>\r\n\r\n<p>Small in size and easy to use, suitable for every home to wrap food for children and others.</p>\r\n\r\n<p>When fully charged it works for a long time.</p>\r\n\r\n<p>Input: Micro.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز حراري 2 في 1 محمول قابل للشحن لتغليف الاكياس المفتوحة من شركة Fiebi.</p>\r\n\r\n<p>يغلف الاكياس بضغطة زر واحدة وايضاً يفتح الاكياس المغلفة بالحرارة.</p>\r\n\r\n<p>مصمم بفتحه رفيعة جداً حتى لا يتم استخدامة بشكل خاطئ من قبل الاطفال.</p>\r\n\r\n<p>صغير الحجم وسهل الاستخدام ومناسب لكل منزل لتغليف الطعام للاطفال وغيرها.</p>\r\n\r\n<p>عندما يتم شحنه بالكامل يعمل لفترة طويلة.</p>\r\n\r\n<p>مدخل الشحن: مايكرو.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=1f9L9kfbJ_g&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 15:15:55', '2022-08-30 12:15:55', NULL, NULL, 1, NULL, 10, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(200, NULL, 9, 0, NULL, NULL, 'uGreen Cat8 Fast Ethernet Cable - 3 Meter', '268', 'كابل انترنت سريع كات 8 - 3 متر من uGreen', NULL, 'uploads/products/544070_sa5a4sA5454.jpg', NULL, NULL, '', '110', '55.80', '1', '<p>Product Details:</p>\r\n\r\n<p>The latest and fastest internet cable, Cat8 category, from uGreen.</p>\r\n\r\n<p>The Data transfer speed of the cable is 40 gigabytes per second.</p>\r\n\r\n<p>Length: 3 Meters.</p>\r\n\r\n<p>Supports the frequency of 2000MHz.</p>\r\n\r\n<p>Suitable for gaming, downloading and uploading videos online.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كابل الانترنت الاحدث والأسرع حاليًا فئة كات 8 من شركة uGreen.</p>\r\n\r\n<p>تصل سرعة نقل البيانات في الكيبل 40 جيجابايت في الثانية.</p>\r\n\r\n<p>الطول: 3 متر.</p>\r\n\r\n<p>يدعم تردد 2000 ميجاهرتز.</p>\r\n\r\n<p>مناسب حق اصحاب الجيمنغ واصحاب تحميل ورفع الفيديوهات اونلاين.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Pwo1ow0ZBEA&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 15:18:09', '2022-08-30 12:18:09', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '46'),
(201, NULL, 10, 0, NULL, NULL, 'Flash memory for Apple phones 64GB from Sandisk', '270', 'فلاش ميموري لهواتف ابل بحجم 64 جيجابايت من Sandisk', NULL, 'uploads/products/907852_Sandisk-1-600x600.jpg', NULL, NULL, '', '200', '146', '1', '<p>Product Details:</p>\r\n\r\n<p>Flash memory with a storage capacity of 64 GB for Apple phones from Sandisk.</p>\r\n\r\n<p>Small in size and you can take it with you anywhere.</p>\r\n\r\n<p>It is the most suitable solution for your phones in case you do not have a storage space.</p>\r\n\r\n<p>Suitable for owners of mobile photography or those who need more storage spaces, as well as for travel.</p>\r\n\r\n<p>Easy to use, just upload the files from the phone, and you can download them to any other device from the laptop and others.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>فلاش ميموري بسعة تخزين 64 جيجابايت لهواتف ابل من شركة Sandisk.</p>\r\n\r\n<p>حجمه صغير وتقدرون تشيلونه معاكم خارج البيت.</p>\r\n\r\n<p>يعتبر الحل الانسب لهواتفكم في حال صار ماعندكم مساحة تخزين.</p>\r\n\r\n<p>مناسب لأصحاب التصوير بالهاتف او الي يحتاجون مساحات تخزين اكبر وايضاً للسفر.</p>\r\n\r\n<p>سهل الاستخدام فقط يتم تحميل الملفات من الهاتف وتقدرون تفرغونها في اي جهاز اخر من اللابتوب وغيرها.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=axJCrTOB0ks&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 15:25:29', '2022-08-30 12:25:29', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '39'),
(202, NULL, 12, 0, NULL, NULL, 'HailiCare Electric Knee Warmer', '271', 'لفافة الكترونية لستخين الركبة من HailiCare', NULL, 'uploads/products/640809_H7724fe5ab9a543808f1b493fcbef85f4k.jpg', NULL, NULL, '', '130', '75.60', '1', '<p>Product Details:</p>\r\n\r\n<p>An Electric coil warmer for the knees with an adjustable size from HailiCare.</p>\r\n\r\n<p>It has 3 different temperature settings, so you can choose the temperature that suits you.</p>\r\n\r\n<p>Suitable for the elderly or those who suffer from problems or cold in the knees.</p>\r\n\r\n<p>Designed to fit both sides of the leg, right or left.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>لفافه الكترونية لتسخين الركب مع حجم قابل للتعديل ليتناسب مع الكل من شركة HailiCare.</p>\r\n\r\n<p>يوجد فيها 3 اوضاع مختلفة للحرارة تقدرون تختارون الدرجة الي تناسبكم.</p>\r\n\r\n<p>مناسب لكبار السن او الذين يعانون من مشاكل او برد في الركب.</p>\r\n\r\n<p>مصمم ليتناسب مع الجهتين من الرجل اليمين او اليسار.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=wAGu1lA-D90&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 15:26:57', '2022-08-30 12:26:57', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '21'),
(203, NULL, 5, 0, NULL, NULL, 'Bellson Portable Lint Remover', '272', 'جهاز محمول لإزالة الوبر من الملابس من Bellson', NULL, 'uploads/products/Bellson-V8103-3.jpg', NULL, NULL, '', '199', '81.80', '1', '<p>Product Details:</p>\r\n\r\n<p>A portable device for removing lint from clothes</p>\r\n\r\n<p>It is characterized by its small size, lightness and strong performance.</p>\r\n\r\n<p>Easy to use, just turn it on and wipe it over the clothes.</p>\r\n\r\n<p>Very quiet and faint sound that can be carried and used for travel.</p>\r\n\r\n<p>Rechargeable and doesn&#39;t need batteries.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز محمول لإزالة الوبر من الملابس من شركة Bellson.</p>\r\n\r\n<p>يتميز بحجمه الصغير وخفته وادائه القوي.</p>\r\n\r\n<p>سهل الاستخدام فقط يتم تشغيله ومسحهه على الملابس.</p>\r\n\r\n<p>صوت هادئ وخافت جداً ويمكن حمله واستخدامة للسفر.</p>\r\n\r\n<p>قابل للشحن ولا يحتاج الى بطاريات.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-30 15:28:37', '2022-08-30 12:28:37', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, NULL),
(204, NULL, 5, 0, NULL, NULL, 'JMEY By Xiaomi Small Size Water Heater', '308', 'جهاز سريع لتسخين الماء صغير الحجم من Xiaomi', NULL, 'uploads/products/195602_212ke.jpg', NULL, NULL, '', '309', '184.23', '1', '<p>Product Details:</p>\r\n\r\n<p>Small and fast water heater with water intake connection from JMEY.</p>\r\n\r\n<p>The water temperature can be set according to your choice from 25 to 99 degrees celsius.</p>\r\n\r\n<p>The device has a smart lock so that it is not used by children.</p>\r\n\r\n<p>It is characterized by the presence of two ways to withdraw water, either by connecting the intake to the water barrel or by placing a water bottle on top, and the withdrawal is carried out through it.</p>\r\n\r\n<p>Digital temperature display.</p>\r\n\r\n<p>It can be used for road trips, travel, or even at home to save space.</p>\r\n\r\n<p>It works by electricity and does not need charging or batteries.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز تسخين الماء صغير الحجم وسريع مع وصلة سحب الماء من شركة JMEY.</p>\r\n\r\n<p>يمكن تحديد درجة الماء على حسب اختياركم من 25 الى 99 درجة مئوية.</p>\r\n\r\n<p>يحتوي الجهاز على قفل ذكي حتى لا يتم استخدامة من قبل الاطفال.</p>\r\n\r\n<p>يتميز بوجود طريقتان لسحب الماء اما عن طريق توصيل الوصلة في برميل الماء او وضع قارورة ماء في الاعلى ويتم السحب من خلالها.</p>\r\n\r\n<p>شاشة رقمية لدرجة الحرارة.</p>\r\n\r\n<p>يمكن استخدامة للرحلات البرية او السفر او حتى في المنزل لتوفير المساحة.</p>\r\n\r\n<p>يعمل عن طريق الكهرباء ولايحتاج الى شحن او بطاريات.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=2IqVSbNo5tU&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 15:38:18', '2022-08-30 12:38:18', NULL, 1, NULL, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(205, NULL, 10, 0, NULL, NULL, '10Moons Smart Pen For Phones and Tablets - White', '274', 'قلم ذكي للهواتف والاجهزة اللوحية من 10Moons - ابيض', NULL, 'uploads/products/988196_2454.jpg', NULL, NULL, '', '150', '97.60', '1', '<p>Product Details:</p>\r\n\r\n<p>A Smart pen that works with all IOS and Andriod systems from 10Moons.</p>\r\n\r\n<p>Suitable for facilitating the work of students or workers on the iPads or Tablets.</p>\r\n\r\n<p>Small in size and has no weight. It is easy to use with a single push of a button, and it does not need any pairing process.</p>\r\n\r\n<p>Illumination to know the status of the battery charge.</p>\r\n\r\n<p>Can be used for Phones, iPads or Tablets.</p>\r\n\r\n<p>Comes with USB wire for charging.</p>\r\n\r\n<p>Input: Micro.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>قلم ذكي يعمل مع جميع الانظمة IOS و Andriod من شركة 10Moons.</p>\r\n\r\n<p>مناسب لتسهيل العمل للطلاب او العاملين على الايباد او التابليت.</p>\r\n\r\n<p>حجمه صغير ومافيه وزن سهل الاستخدام بضغطة زر وحدة ومايحتاج الى اي عملية اقتران.</p>\r\n\r\n<p>اضاءة لمعرفة حالة الشحن.</p>\r\n\r\n<p>يمكن استخدامة للهواتف او الايباد او التابليت.</p>\r\n\r\n<p>يأتي مع واير الشحن بمنفذ يو اس بي.</p>\r\n\r\n<p>مدخل الشحن: مايكرو.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=g7MSne9LV9k&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 15:40:38', '2022-08-30 12:40:38', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '30'),
(206, NULL, 6, 0, NULL, NULL, 'Hipee Smart Back Curvature Alarm Device', '276', 'جهاز ذكي للتنبيه بتعديل انحناء الظهر من Hipee', NULL, 'uploads/products/603850_365454545.jpg', NULL, NULL, '', '149', '113.80', '1', '<p>Product Details:</p>\r\n\r\n<p>A Smart device to keep your back straight and alert you in the event of a curve in the back from Hipee.</p>\r\n\r\n<p>Easy to control via mobile app.</p>\r\n\r\n<p>Helps keep the back in a straight motion so that you do not suffer from back pain.</p>\r\n\r\n<p>Small in size, drapes over the neck and can be concealed with clothing.</p>\r\n\r\n<p>Control Application: Posture up.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز ذكي لابقاء ظهرك مستقيم وينبهك في حالة وجود انحناء في الظهر من شركة Hipee.</p>\r\n\r\n<p>سهل التحكم عن طريق الجوال.</p>\r\n\r\n<p>يساعد في ابقاء الظهر بحركة مستقيمة حتى لا تعاني من الم الظهر.</p>\r\n\r\n<p>صغير الحجم وينحط على الرقبة ويمكن اخفائه بالملابس.</p>\r\n\r\n<p>تطبيق التحكم: Posture up.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=zxStnphcjtw&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 15:44:26', '2022-08-30 12:44:26', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '56'),
(207, NULL, 5, 0, NULL, NULL, 'Portable Bukhoor Burner Small Size', '277', 'مبخرة إلكترونية متنقلة الحجم الصغير', NULL, 'uploads/products/sd23sd5w.jpg', NULL, NULL, '', '199', '128', '1', '<p>Product Details:</p>\r\n\r\n<p>Newest design of portable bukhoor burner.</p>\r\n\r\n<p>Suitable for cars, travel or offices at work and even at home.</p>\r\n\r\n<p>It works by charging and does not need batteries.</p>\r\n\r\n<p>New slim and distinctive shape.</p>\r\n\r\n<p>Input: Type-C charging port.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>احدث اصدارات المبخرة الإلكترونية المتنقلة.</p>\r\n\r\n<p>مناسبة للسيارات او السفر او المكاتب في العمل وحتى المنزل.</p>\r\n\r\n<p>قابلة للشحن ولا تحتاج الى بطاريات.</p>\r\n\r\n<p>شكل جديد نحيفه ومميزة.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-30 15:47:39', '2022-08-30 12:47:39', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, NULL),
(208, NULL, 15, 11, NULL, NULL, 'Joyroom Electric Rotary Wireless Car Charger', '284', 'شاحن لاسلكي مع قاعدة إلكترونية للسيارات من Joyroom', NULL, 'uploads/products/zs424.jpg', NULL, NULL, '', '149', '78.38', '1', '<p>Product Details:</p>\r\n\r\n<p>Joyroom electric base wireless 15W fast car charger.</p>\r\n\r\n<p>The charger base is electronic. You can control it to be in length or width by pressing one button or manually according to your desire.</p>\r\n\r\n<p>The bottom base of the stand is retractable to fit all types of phones.</p>\r\n\r\n<p>For 4.5 - 6.8 inches mobile phones.</p>\r\n\r\n<p>90&deg; rotation angle (Free to adjust the viewing angle, it is more convenient for navigation).</p>\r\n\r\n<p>Fireproof casing material &amp; high temperature resistance.</p>\r\n\r\n<p>Input interface: Type C.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن لاسلكي ثابت وسريع بقوة 15 واط من شركة Joyroom.</p>\r\n\r\n<p>قاعدة الشاحن الكترونية تقدرون تتحكمون فيها لتكون بالطول او بالعرض بضغطت زر وحدة او يدوياً على حسب رغبتكم.</p>\r\n\r\n<p>القاعدة السفليه للشاحن قابله للتنزيل لتناسب جميع انواع الهواتف.</p>\r\n\r\n<p>للهواتف المحمولة من قياس 4.5 انش الى 6.8 انش.</p>\r\n\r\n<p>زاوية دوران 90 درجة.</p>\r\n\r\n<p>مصنوع من مواد مضادة للاشتعال.</p>\r\n\r\n<p>نوع المدخل: تايب سي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=4g0Tfs0ZFtI&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 15:49:29', '2022-08-30 12:49:29', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '25'),
(209, NULL, 11, 0, NULL, NULL, 'Joyroom Mechanical Phone Car Cup Holder', '283', 'قاعدة هواتف للسيارات تركب مكان الاكواب من Joyroom', NULL, 'uploads/products/207784_Hdc24157529a4423bb0a453c7d686d106C.jpg', NULL, NULL, '', '85', '37.13', '1', '<p>Product Details:</p>\r\n\r\n<p>Mechanical mobile stand that suits in car cup holder from Joyroom.</p>\r\n\r\n<p>It contains 3 small bases for fixing in the place of cups and also designed to fit most cup bases for cars.</p>\r\n\r\n<p>The inner layer of the base is made of silicone so that the phone is well established and not damaged from the back.</p>\r\n\r\n<p>One-handed control over the position of the phone and with the press of one button, it can be lifted from the base.</p>\r\n\r\n<p>Universal for All Phones with screen size from 4.7 to 6.7inch.</p>\r\n\r\n<p>Flexible and can be moved according to your desire.</p>\r\n\r\n<p>360 &deg; rotation angle (Free to adjust the viewing angle, it is more convenient for navigation).</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>قاعدة للهواتف محمولة تركب مكان الاكواب في السيارات من شركة Joyroom.</p>\r\n\r\n<p>تحتوي على 3 قواعد صغيرة للتثبيت مكان الاكواب وايضاً مصممه لتناسب اغلب قواعد الاكواب للسيارات.</p>\r\n\r\n<p>الطبقة الداخلية للقاعدة مصنوعة من السيليكون حتى يثبت الهاتف جيداً ولا يتضرر من الخلف.</p>\r\n\r\n<p>التحكم بيد واحدة عن وضع الهاتف وبضغطة زر يمكن رفعه من القاعدة.</p>\r\n\r\n<p>مناسبة لجميع الهواتف من 4.7 انش الى 6.7 انش.</p>\r\n\r\n<p>مرنه وقابلة للتحريك على حسب رغبتكم.</p>\r\n\r\n<p>زاوية دوران 360 درجة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=5Cb9i7kkmjI&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 15:51:04', '2022-08-30 12:51:04', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '25'),
(210, NULL, 15, 9, NULL, NULL, 'REMAX Hunergy Series 5 Charging Port 60000mAh Power Bank – Black', '280', 'شاحن متنقل ذو 5 مخارج Hunergy سيريس من Remax بسعة 60000 مللي امبير - اسود', NULL, 'uploads/products/巨能系列22_5W多兼容快充移动电源官方图4.png', NULL, NULL, '', '300', '187.43', '1', '<p>Product Details:</p>\r\n\r\n<p>REMAX Hunergy series 60000mah power bank 4 USB port with QC3.0 &amp; 1 PD 22.5W port.</p>\r\n\r\n<p>Portable and comfortable.</p>\r\n\r\n<p>Digital screen battery indicator.</p>\r\n\r\n<p>LED soft night light helps you to find small lost items in the dark for rooms.</p>\r\n\r\n<p>Support simultaneous charging of 5 devices.</p>\r\n\r\n<p>4 USB Outputs (1 USB Port Support QC3.0).</p>\r\n\r\n<p>Type C port with PD technology for fasting charging.</p>\r\n\r\n<p>3 Power bank charging Inputs.</p>\r\n\r\n<p>Input: Type C + Lightning + Micro.</p>\r\n\r\n<p>Warranty: 1 Year</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن متنقل Hunergy سيريس ذو 4 مخارج يو اس بي يدعم تنقية كوال كوم 3.0 ومخرج بي دي 22.5 واط من REMAX بقوة 60000 مللي امبير.</p>\r\n\r\n<p>مريح وسهل نقلة من مكان الى اخر.</p>\r\n\r\n<p>شاشة رقمية لحالة شحن البطارية.</p>\r\n\r\n<p>اضاءة خافته ال أي دي يساعدك في إيجاد الأشياء في الأماكن المظلمة مثل الغرف.</p>\r\n\r\n<p>يشحن 5 أجهزة بسرعة عالية.</p>\r\n\r\n<p>4 منافذ للشحن يو اس بي منها منفذ واحد بتقنية QC3.0 للشحن السريع.</p>\r\n\r\n<p>منفذ تايب سي بتقنية PD للشحن السريع.</p>\r\n\r\n<p>3 مداخل لشحن الباوربانك.</p>\r\n\r\n<p>يمكن شحنة بمدخل: لايتننغ + مايكرو + تايب سي.</p>\r\n\r\n<p>ضمان لمدة سنة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=l9e1-htLzxk&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 15:54:34', '2022-08-30 12:54:34', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '35'),
(211, NULL, 15, 9, NULL, NULL, 'Remax 10,000mAh Portable Car Jump Starter', '281', 'شاحن متنقل لتشغيل السيارات 10,000 مللي امبير من Remax', NULL, 'uploads/products/712925_黑色1.jpg', NULL, NULL, '', '399', '219.73', '1', '<p>Product Details:</p>\r\n\r\n<p>Remax 10,000mAh car jump starter power bank for trips with USB &amp; Type-C 18W ports.</p>\r\n\r\n<p>It charges devices like any other power bank, and its advantage is that it charges the car battery in the event that the car battery is weak.</p>\r\n\r\n<p>It can start all cars with engines size of (Petrol Up to 9L / Diesel Up to 7L Diesel ) in just one second with 1000A peak power.</p>\r\n\r\n<p>The device has alarm system if the battery wires are reversed.</p>\r\n\r\n<p>Type-C input with a power of 18W, and the power bank can be charged from the same input.</p>\r\n\r\n<p>It can withstand a temperature up to 80 degrees Celsius, suitable for the temperature of Qatar in summer so you can keep it in the car for emergency.</p>\r\n\r\n<p>Digital screen battery indicator.</p>\r\n\r\n<p>Emergency flash lighting.</p>\r\n\r\n<p>IP65 Water Resistant.</p>\r\n\r\n<p>Warranty: 1 Year.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>باوربانك الرحلات بقوة 10,000 مللي امبير ذو مدخلين يو اس بي وتايب سي بقوة 18 واط لشحن الهواتف ومدخل لشحن السيارة من شركة Remax.</p>\r\n\r\n<p>يشحن جهازين في نفس الوقت كأي باوربانك اخر وميزته ان يشحن بطارية السيارة 15 مره ( اذا تم شحنه بالكامل ) في حال وقفت عليكم السيارة او ضعفت البطارية.</p>\r\n\r\n<p>يشغل سيارات بحجم مكينة ( فئة البترول لحد 9L / فئة الديزل لحد 7L ) في ثانية وحدة فقط وقوة تشغيل تصل الى 1000 امبير.</p>\r\n\r\n<p>يعطيكم تنبية في حال تم عكس تركيب اسلاك البطارية للسيارة.</p>\r\n\r\n<p>مدخل تايب سي بقوة 18 واط لشحن الباوريانك ويمكن شحن الهواتف من نفس المدخل.</p>\r\n\r\n<p>يستحمل درجة الحرارة تصل الى 80 درجة مئوية مناسب لحرارة الجو عندنا فالصيف تخليه فالسيارة.</p>\r\n\r\n<p>شاشة رقمية لمعرفة حالة شحن البطارية.</p>\r\n\r\n<p>إضاءة فلاش لحالات الطوارئ.</p>\r\n\r\n<p>مقاوم للماء بمعيار IP65.</p>\r\n\r\n<p>ضمان: سنة.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-30 15:56:52', '2022-08-30 12:56:52', NULL, NULL, NULL, NULL, 7, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(212, NULL, 15, 9, NULL, NULL, 'REMAX 80000mAh Power Bank 5 Charging Port', '417', 'شاحن متنقل بسعة 80,000 مللي امبير ذو 5 مخارج من Remax', NULL, 'uploads/products/896306_产品.jpg', NULL, NULL, '', '420', '133.52', '1', '<p>Product Details:</p>\r\n\r\n<p>REMAX ( New Version ) Hunergy series 80000mah power bank 4 USB port &amp; 1 PD 22.5W port.</p>\r\n\r\n<p>It takes 23 hours to fully charge with fast charging and 35 hours with normal charging, and it works for 15 days.</p>\r\n\r\n<p>LED soft night light helps you to find small lost items in the dark for rooms.</p>\r\n\r\n<p>4 USB Outputs (1 USB Port Support QC3.0).</p>\r\n\r\n<p>Type C port with PD technology for fasting charging.</p>\r\n\r\n<p>Digital screen battery indicator.</p>\r\n\r\n<p>Support simultaneous charging of 5 devices.</p>\r\n\r\n<p>3 Power bank charging Inputs.</p>\r\n\r\n<p>Input: Type C + Lightning + Micro.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن متنقل&nbsp; ( الاصدار الجديد&nbsp;) من Hunergy سيريس بسعة 80،000 مللي امبير ذو اربع مخارج يو اس بي ومخرج بي دي 22.5 واط من شركة Remax.</p>\r\n\r\n<p>يستغرق شحنة بالكامل 23 ساعة بالشحن السريع و 35 ساعة بالشحن العادي ويعمل لمدة 15 يوم.</p>\r\n\r\n<p>اضاءة خافته ال أي دي يساعدك في إيجاد الأشياء في الأماكن المظلمة مثل الغرف.</p>\r\n\r\n<p>4 منافذ للشحن يو اس بي منها منفذ واحد بتقنية QC3.0 للشحن السريع.</p>\r\n\r\n<p>منفذ تايب سي بتقنية PD للشحن السريع.</p>\r\n\r\n<p>شاشة رقمية لحالة شحن البطارية.</p>\r\n\r\n<p>يشحن 5 أجهزة بسرعة عالية.</p>\r\n\r\n<p>3 مداخل لشحن الباوربانك.</p>\r\n\r\n<p>يمكن شحنة بمدخل: لايتننغ + مايكرو + تايب سي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=i7z1a1tgEG4', '', '1', NULL, NULL, '1', '2022-08-30 16:00:21', '2022-08-30 13:00:21', NULL, NULL, 1, NULL, 18, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(213, NULL, 6, 0, NULL, NULL, 'Govee Wi-Fi Smart LED Strip Light 5M', '286', 'شريط اضاءة ذكي واي-فاي طول 5 متر من Govee', NULL, 'uploads/products/750299_71FN5PwrLLL__AC_SL1500_.jpg', NULL, NULL, '', '210', '148.83', '1', '<p>Product Details:</p>\r\n\r\n<p>Voice &amp; App control smart led strip lights from Govee.</p>\r\n\r\n<p>Timer &amp; Schedule: Schedule the smart lights on/off automatically via your smartphone, then wake up in the morning with your favorite light. No hub required, easy to install.</p>\r\n\r\n<p>Sync to music with built-in sensitive mic.</p>\r\n\r\n<p>The strip light equipped with 150 LED beads.</p>\r\n\r\n<p>7 Scene Modes: With 16 million colors, you can set different light modes to match various occasions.</p>\r\n\r\n<p>The strip light can be cutted to match the size you want.</p>\r\n\r\n<p>It is also characterized by ease of installation and saves on electricity consumption.</p>\r\n\r\n<p>Brightness control from 1% to 100%.</p>\r\n\r\n<p>Support Alexa &amp; Google Assistant.</p>\r\n\r\n<p>Control App: Govee.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شريط الاضاءة الذكي من Govee يتميز بسهولة التحكم في الشريط عندما لا تكون في المنزل عن طريق هاتفك.</p>\r\n\r\n<p>يمكن القيام بجدولة تشغيل / إيقاف تشغيل الأضواء الذكية تلقائيًا عبر هاتفك.</p>\r\n\r\n<p>يدعم خاصية التفاعل مع الموسيقى او الاصوات المحيطة.</p>\r\n\r\n<p>يحتوي الشريط على 150 لمبة الي اي دي صغيرة.</p>\r\n\r\n<p>7 أنواع من المودات المختلفة لطريقة عمل للأنوار.</p>\r\n\r\n<p>يمكن القيام بقص الشريط عند الحاجة لضبط الطول.</p>\r\n\r\n<p>كما يتميز بسهولة التركيب ويوفر من استهلاك الكهرباء.</p>\r\n\r\n<p>التحكم في مستوى قوة الإضاءة من 1٪ إلى 100٪.</p>\r\n\r\n<p>يدعم الأوامر الصوتية من اجهزة اليكسا وقوقل اسستنس الصوتية.</p>\r\n\r\n<p>اسم التطبيق: Govee.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=m98Ct9OG7xM&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 16:03:23', '2022-08-30 13:03:23', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '19'),
