(215, NULL, 6, 0, NULL, NULL, 'Govee Dreamcolor Bluetooth Smart LED Strip Light 10M', '289', 'شريط اضاءة ذكي من نوع Dreamcolor بلوتوث طول 10 متر من Govee', NULL, 'uploads/products/618234_71Deh-GenrS__AC_SL1500_.jpg', NULL, NULL, '', '279', '198.20', '1', '<p>Product Details:</p>\r\n\r\n<p>Govee bluetooth dreamcolor strip lights that can be controlled by mobile App.</p>\r\n\r\n<p>This category of strip light are characterized by the presence of smart chips that enable you to choose different colors for each part of the tape at the same time.</p>\r\n\r\n<p>Timer &amp; Schedule: Schedule the smart lights on/off automatically via your smartphone, then wake up in the morning with your favorite light. No hub required, easy to install.</p>\r\n\r\n<p>Sync to music with built-in sensitive mic.</p>\r\n\r\n<p>Protected by a waterproof layer over the entire light strip.</p>\r\n\r\n<p>The strip light equipped with 300 LED beads.</p>\r\n\r\n<p>12 Scene Modes: With 16 million colors, you can set different light modes to match various occasions.</p>\r\n\r\n<p>It is also characterized by ease of installation and saves on electricity consumption.</p>\r\n\r\n<p>Brightness control from 1% to 100%.</p>\r\n\r\n<p>Control App: Govee.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>This type of strip light are NOT cuttable because of the smart chip equipped all over the roll.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شريط الاضاءة الذكي من فئة Dreamcolor من شركة Govee يتميز بسهولة التحكم في الشريط عن طريق هاتفك.</p>\r\n\r\n<p>تتميز هذه الفئة من الاضاءة بوجود شرائح ذكية والتي تمكنكم من اختيار الوان مختلفة لكل جزء من الشريط في نفس الوقت.</p>\r\n\r\n<p>يمكن القيام بجدولة تشغيل / إيقاف تشغيل الأضواء الذكية تلقائيًا عبر هاتفك.</p>\r\n\r\n<p>يدعم خاصية التفاعل مع الموسيقى او الاصوات المحيطة.</p>\r\n\r\n<p>محميه بطبقة مضادة للماء على شريط الاضاءة بالكامل.</p>\r\n\r\n<p>يحتوي الشريط على 300 لمبة الي اي دي صغيرة.</p>\r\n\r\n<p>12 أنواع من المودات المختلفة لطريقة عمل للأنوار.</p>\r\n\r\n<p>كما يتميز بسهولة التركيب ويوفر من استهلاك الكهرباء.</p>\r\n\r\n<p>التحكم في مستوى قوة الإضاءة من 1٪ إلى 100٪.</p>\r\n\r\n<p>اسم التطبيق: Govee.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>&nbsp;هذه الفئة من شريط الاضاءة غير قابلة للقص بسبب وجود شرائح ذكية على طول الشريط .</p>\r\n', NULL, 'https://www.youtube.com/watch?v=TMi8QvwZwgE&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 16:06:49', '2022-08-30 13:06:49', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '19'),
