(216, NULL, 6, 0, NULL, NULL, 'Govee Bluetooth Smart LED Strip Light 20M', '290', 'شريط اضاءة ذكي بلوتوث طول 20 متر من Govee', NULL, 'uploads/products/735527_71quPOazLIS__AC_SL1500_.jpg', NULL, NULL, '', '465', '233.50', '1', '<p>Product Details:</p>\r\n\r\n<p>Govee bluetooth strip lights that can be controlled by mobile App.</p>\r\n\r\n<p>The light comes with 2 rolls of 10 meters length.</p>\r\n\r\n<p>Sync to music with built-in sensitive mic.</p>\r\n\r\n<p>Timer &amp; Schedule: Schedule the smart lights on/off automatically via your smartphone, then wake up in the morning with your favorite light. No hub required, easy to install.</p>\r\n\r\n<p>Each roll of strip light equipped with 300 LED beads.</p>\r\n\r\n<p>The strip light can be cutted to match the size you want.</p>\r\n\r\n<p>It is also characterized by ease of installation and saves on electricity consumption.</p>\r\n\r\n<p>Brightness control from 1% to 100%.</p>\r\n\r\n<p>Control App: Govee.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شريط الاضاءة الذكي من Govee يتميز بسهولة التحكم في الشريط عن طريق هاتفك.</p>\r\n\r\n<p>الاضاءة عبارة عن شريطتين بطول 10 متر يتم دمجهم والتحكم بهم في بنفس الوقت.</p>\r\n\r\n<p>يتميز بوجود خاصية التفاعل مع الموسيقى او الاصوات المحيطة.</p>\r\n\r\n<p>يمكن القيام بجدولة تشغيل / إيقاف تشغيل الأضواء الذكية تلقائيًا عبر هاتفك.</p>\r\n\r\n<p>يحتوي الشريط (الواحد) على 300 لمبة الي اي دي صغيرة.</p>\r\n\r\n<p>يمكن القيام بقص الشريط عند الحاجة لضبط الطول.</p>\r\n\r\n<p>كما يتميز بسهولة التركيب ويوفر من استهلاك الكهرباء.</p>\r\n\r\n<p>التحكم في مستوى قوة الإضاءة من 1٪ إلى 100٪.</p>\r\n\r\n<p>اسم التطبيق: Govee.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-30 16:09:19', '2022-08-30 13:09:19', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '19'),
(217, NULL, 12, 0, NULL, NULL, '3D Moon Light With Stand', '291', 'ستاند مع إضاءة بشكل القمر', NULL, 'uploads/products/426667_61zNShV3JKL__AC_SL1500_.jpg', NULL, NULL, '', '200', '125', '1', '<p>Product Details:</p>\r\n\r\n<p>Moon shaped illumination with a stand, 3D high quality refining to the real moon shape.</p>\r\n\r\n<p>It works by touch and the color can be changed or turned off in the same way.</p>\r\n\r\n<p>Brightness can be adjusted by touching and holding the power button.</p>\r\n\r\n<p>Rechargeable and does not require batteries. Charging time takes 2-3 hours and works for 6-12 hours, depending on use.</p>\r\n\r\n<p>Two different lighting colors ( cold white, warm white ).</p>\r\n\r\n<p>Creates a suitable atmosphere for sleep and can be used in rooms or at home.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ستاند مع إضاءة بشكل القمر مطبوعة بتنقية 3D ثلاثية الابعاد عالية الجودة لشكل القمر الحقيقي.</p>\r\n\r\n<p>تعمل عن طريق اللمس ويمكن تغيير اللون او اطفائها بنفس الطريقة.</p>\r\n\r\n<p>يمكن ضبط السطوع من خلال اللمس والضغط بشكل مطول على الزر الخاص بالتشغيل.</p>\r\n\r\n<p>قابلة للشحن ولا تحتاج الى بطاريات يستغرق وقت الشحن من 2 - 3 ساعات وتعمل لمدة 6 - 12 ساعة على حسب الاستخدام.</p>\r\n\r\n<p>لونين مختلفين للإضاءة ( ابيض ، ابيض دافئ ).</p>\r\n\r\n<p>تخلق جو مناسب للنوم يمكن استخدامها في الغرف او المنزل.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=pA-KWPqwOEs&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 16:11:06', '2022-08-30 13:11:06', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(218, NULL, 5, 0, NULL, NULL, 'Proda 5 in 1 Wireless Charger With LED Lamp - White', '293', 'شاحن لاسلكي 5 في 1 مع إضاءة من PRODA - ابيض', NULL, 'uploads/products/872082_3-2.jpg', NULL, NULL, '', '199', '118.89', '1', '', '', NULL, 'https://www.youtube.com/watch?v=hhQczWetpbk&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 16:13:10', '2022-08-30 13:13:10', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '33'),
(513, NULL, 10, 14, NULL, NULL, 'Uniq Monos 2-in-1 Strap With Hybrid Case for Apple Watch 44/45mm - Midnight Black', '20033', 'سير وكڤر Monos لساعة ابل حجم 44 و 45 - اسود من UNIQ', NULL, 'uploads/products/594222_Monos-black-1.jpg', NULL, NULL, '', '90', '55', '1', '<p>Product Details:</p>\r\n\r\n<p>Two in one silicone strap and hybrid case for Apple Watch, comfortable to use from UNIQ.</p>\r\n\r\n<p>It is characterized by protecting the watch from all sides and a strap at the same time with a modern design that gives a beautiful appearance.</p>\r\n\r\n<p>Resistant to water and sweating, suitable for sports and other uses.</p>\r\n\r\n<p>Suitable for size 44mm and 45mm.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>سير وكڤر لساعة ابل من السيليكون مريح عند الاستخدام.</p>\r\n\r\n<p>يتميز بأنه يحمي الساعة من جميع الاطراف وسير في نفس الوقت مع تصميم عصري يعطي مظهر جميل.</p>\r\n\r\n<p>ضد الماء والتعرق مناسب للرياضه وللاستعمالات الاخرى.</p>\r\n\r\n<p>مناسب لحجم 44 و 45.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=IYY1nmFaiu8', '', '1', NULL, NULL, '1', '2022-10-24 22:31:22', '2022-10-24 19:31:22', NULL, NULL, NULL, NULL, 4, 3, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '45'),
(219, NULL, 5, 0, NULL, NULL, 'Proda 5 in 1 Wireless Charger With LED Lamp - Black', '293', 'شاحن لاسلكي 5 في 1 مع إضاءة من PRODA - اسود', NULL, 'uploads/products/352489_3-1.jpg', NULL, NULL, '', '199', '118.89', '1', '<p>Product Details:</p>\r\n\r\n<p>Proda 5 in 1 Wireless charger with a power deliver of 15W for all devices that support wireless charging technology.</p>\r\n\r\n<p>It is characterized by the presence of a smart chip to identify the devices and connect the appropriate watts of power for charging.</p>\r\n\r\n<p>The wireless charger can charge 3 device such as mobile phone, airpods and Apple watch all in same time.</p>\r\n\r\n<p>360-degree moving light, also the brightness can be adjusted via the lighting control button according to your desire.</p>\r\n\r\n<p>The Wireless watch charger can be hidden if you do not want to use it.</p>\r\n\r\n<p>Modern and distinctive shape suitable for bedrooms at home.</p>\r\n\r\n<p>Input: Type C</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>The device contains the power cord only and does not contain a wall charger.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن لاسلكي 5 في 1 بقوة 15 واط لجميع الاجهزة التي تدعم الشحن اللاسلكي من شركة Proda.</p>\r\n\r\n<p>يتميز بوجود شريحه ذكية للتعرف بالأجهزة وتوصيل ما يناسبها من قوة الواط للشحن.</p>\r\n\r\n<p>يمكن شحن الهاتف والسماعة وايضاً ساعة ابل في نفس الوقت وبسرعة عالية جداً.</p>\r\n\r\n<p>إضاءة قابلة للتحريك 360 درجة وايضاً يمكن التحكم بالسطوع عن طريق زر التحكم الخاص بالإضاءة.</p>\r\n\r\n<p>شاحن الساعة اللاسلكي يمكن اخفائة في حال عدم الرغبة من استخدامه.</p>\r\n\r\n<p>شكل عصري ومميز مناسبة لغرف النوم في المنزل.</p>\r\n\r\n<p>مدخل: تايب سي.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>الجهاز يحتوي على سلك التشغيل فقط ولا يحتوي على شاحن جداري.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=hhQczWetpbk&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 16:14:43', '2022-08-30 13:14:43', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '33'),
(220, NULL, 15, 12, NULL, NULL, 'Proda 4 in 1 Magnetic Wireless Charger for Apple Devices - White', '292', 'قاعدة شحن لاسلكي لإجهزة ابل 4 في 1 من Proda - ابيض', NULL, 'uploads/products/413451_04_1.jpg', NULL, NULL, '', '159', '109.97', '1', '<p>Product Details:</p>\r\n\r\n<p>Proda Wireless charger with luxurious and modern style for office.</p>\r\n\r\n<p>Simultaneously charge 4 device at the same time, 3 via wireless charger and extrs USB output to charge extra 4th device.</p>\r\n\r\n<p>15W Charging power with built-in smart chip to identify the devices and distribute the watts according to the device needs.</p>\r\n\r\n<p>Equipped with a very strong magnet, which enables you to use the base to watch movies or series, and place the device in length or width as desired.</p>\r\n\r\n<p>Overcharging and Overheating protection.</p>\r\n\r\n<p>Suitable for offices in work or home.</p>\r\n\r\n<p>Input: Type C.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>The Product contains power cord and does not contain the power charger.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن لاسلكي بتقنية ( MagSafe ) مع قاعدة للمكاتب بشكل عصري وفخم من شركة Proda.</p>\r\n\r\n<p>يمكن شحن 4 اجهزة في نفس الوقت، 3 عن طريق الشحن لاسلكي ومخرج إضافي يو اس بي لشحن الجهاز الرابع.</p>\r\n\r\n<p>قوة الشاحن اللاسلكي 15 واط مع وجود شريحه ذكية للتعرف على الاجهزة وتوزيع قوة الواط على حسب نوع الجهاز.</p>\r\n\r\n<p>مزودة بمغناطيس قوي جداً مما يمكّنكم من استخدام القاعدة لمشاهدة الافلام او المسلسلات ووضع الجهاز بالطول او بالعرض على حسب الرغبة.</p>\r\n\r\n<p>يتميز بوجود حماية من توصيل شحن زائد وايضاً حماية من ارتفاع درجة الحرارة.</p>\r\n\r\n<p>مناسبة للمكاتب للعمل او المنزل.</p>\r\n\r\n<p>مدخل: تايب سي</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>القاعدة تحتوي على سلك التشغيل ولا تحتوي على شاحن التشغيل.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=9dcK4qz9xZs&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 16:16:38', '2022-08-30 13:16:38', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '33'),
