(222, NULL, 8, 0, NULL, NULL, 'Maono Portable Sound Card Mixer', '294', 'مكسر احترافي لتعديل وهندسة الصوت لاسلكي من Maono', NULL, 'uploads/products/147806_AM200Maono.jpg', NULL, NULL, '', '310', '202.78', '1', '<p>Product Details:</p>\r\n\r\n<p>Maono portable mixer easy to setup and use.</p>\r\n\r\n<p>Give you more possibilities like changing your.</p>\r\n\r\n<p>Add a background music while talking.</p>\r\n\r\n<p>Noise cancellation.</p>\r\n\r\n<p>Special Effects: Eight Built-in special audio effects and various adjustments available for your creation.</p>\r\n\r\n<p>Battery: 1200mAh Up to 8 hours off-grid operation.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مكسر احترافي للصوت من شركة مانو يتميز بسهولة الاستخدام.</p>\r\n\r\n<p>يمنحك المزيد من الامكانيات مثل تغيير الصوت الخاص بك لصوت فتاة او رجل او روبوت.</p>\r\n\r\n<p>إضافة موسيقي كخلفية اثناء التحدث.</p>\r\n\r\n<p>تقنية إخفاء الأصوات الجانبية او البعيدة.</p>\r\n\r\n<p>المؤثرات الخاصة: ثمانية مؤثرات صوتية وتعديلات مختلفة متاحة.</p>\r\n\r\n<p>سعة البطارية: 1200 مللي أمبير</p>\r\n', NULL, 'https://www.youtube.com/watch?v=LxHbGGkDQzY&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 16:20:32', '2022-08-30 13:20:32', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '28'),
(223, NULL, 7, 0, NULL, NULL, 'Tronsmart Onyx Prime Wireless Earphone', '296', 'سماعة Onyx Prime من Tronsmart', NULL, 'uploads/products/426051_tronsmart-onyx-prime-dual-driver-wireless-earbuds.jpg', NULL, NULL, '', '275', '173.66', '1', '<p>Product Details:</p>\r\n\r\n<p>Tronsmart Wireless Earphone, the latest version of the Onyx category, suitable for Apple and Android devices.</p>\r\n\r\n<p>This earphone features the latest Bluetooth 5.2 technology, as well as many touch-enabled features.</p>\r\n\r\n<p>Charging time takes about two hours and works for 7 hours continuously.</p>\r\n\r\n<p>Settings can be controlled by phone using its own application.</p>\r\n\r\n<p>The communication distance between the earphone and the phone is up to 10 meters.</p>\r\n\r\n<p>Supports the side noise cancellation feature.</p>\r\n\r\n<p>Supports voice commands from Siri and Google Assistant.</p>\r\n\r\n<p>Control Application: Tronsmart.</p>\r\n\r\n<p>Warranty: 1 Year</p>\r\n\r\n<p>Inside Box: Charging Case + Wireless Earphone + Eartips + Cable + Bag.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>سماعة بلوتوث الاصدار الحديث من فئة Onyx مناسبة لاجهزة ابل واندرويد من شركة Tronsmart.</p>\r\n\r\n<p>تتميز هذه السماعة بوجود احدث تقنية من البلوتوث 5.2 وايضاً مميزات عديدة تعمل بتقنية اللمس.</p>\r\n\r\n<p>يستغرق وقت الشحن ساعتين تقريباً وتعمل لمدة 7 ساعات متواصله.</p>\r\n\r\n<p>يمكن التحكم بالاعدادت عن طريق الهاتف بواسطة التطبيق الخاص بها.</p>\r\n\r\n<p>مسافة الاتصال بين السماعة والهاتف تصل الى 10 متر.</p>\r\n\r\n<p>تدعم ميزة عزل الاصوات الجانبية.</p>\r\n\r\n<p>تدعم الاوامر الصوتية من سيري ومساعد قوقل.</p>\r\n\r\n<p>تطبيق التحكم: Tronsmart.</p>\r\n\r\n<p>ضمان لمدة سنة.</p>\r\n\r\n<p>الصندوق الداخلي: علبة شحن + سماعة اذن لاسلكية + قطع للأذن + واير الشحن.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Nosa3piYvV0&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 16:22:36', '2022-08-30 13:22:36', NULL, NULL, NULL, NULL, 8, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '43'),
(224, NULL, 7, 0, NULL, NULL, 'Tronsmart Apollo Air+ Bluetooth Earphone - White', '297', 'سماعة +Apollo Air من Tronsmart - ابيض', NULL, 'uploads/products/881700_eng_pl_Tronsmart-Apollo-Air-TWS-ANC-Bluetooth-5-2-wireless-earphones-earbuds-waterproof-white-372453-72961_2-600x600.jpg', NULL, NULL, '', '329', '228.16', '1', '<p>Product Details:</p>\r\n\r\n<p>Tronsmart Wireless Earphone, the latest version of the Apollo category, suitable for Apple and Android devices.</p>\r\n\r\n<p>The recognition feature to turn on and off when placed in the ear or removed, in addition to the presence of many features with touch technology.</p>\r\n\r\n<p>It takes 2.5 hours to fully charge and it works for 5 hours.</p>\r\n\r\n<p>Supports the latest 35db side noise cancellation technologies.</p>\r\n\r\n<p>Supports fast wireless charging technology.</p>\r\n\r\n<p>It contains the latest Bluetooth 5.2 technology.</p>\r\n\r\n<p>Settings can be controlled by phone using its own application.</p>\r\n\r\n<p>Input: Type-C charging port.</p>\r\n\r\n<p>Control Application: Tronsmart.</p>\r\n\r\n<p>Warranty: 1 Year</p>\r\n\r\n<p>Inside Box: Charging Case + Wireless Earphone + Eartips + Cable + Bag.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>سماعة لاسلكية الاصدار الاحدث من فئة Apollo مناسبة لأجهزة ابل والاندرويد من شركة Tronsmart.</p>\r\n\r\n<p>ميزة التعرف للتشغيل وايقاف التشغيل عند وضعها بالاذن او ازالتها بالإضافه الى وجود مميزات عديدة بتقنية اللمس.</p>\r\n\r\n<p>يستغرق شحنها 2.5 ساعه وتعمل لمدة 5 ساعات متوصله.</p>\r\n\r\n<p>تدعم احدث تقنيات عزل الضوضاء الجانبية 35 ديسيبل.</p>\r\n\r\n<p>تدعم تقنية الشحن اللاسلكي السريع.</p>\r\n\r\n<p>تحتوي على تقنية البلوتوث الحديثة 5.2.</p>\r\n\r\n<p>يمكن التحكم بالاعدادات عن طريق الهاتف باستخدام التطبيق الخاص بها.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n\r\n<p>تطبيق التحكم: Tronsmart.</p>\r\n\r\n<p>ضمان لمدة سنة.</p>\r\n\r\n<p>الصندوق الداخلي: علبة شحن + سماعة اذن لاسلكية + قطع للأذن + واير الشحن + حقيبة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=fJVkB6fa6Iw&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 16:26:31', '2022-08-30 13:26:31', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '43');
