rcuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-30 16:27:21', '2022-08-30 13:27:21', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '43'),
(537, NULL, 10, 14, NULL, NULL, 'Apple Watch Silicon Strap 42mm & 44mm & 45mm - Light Green', '10025', 'سير سيليكون لساعة ابل حجم 42 و 44 و 45 - اخضر فاتح', NULL, 'uploads/products/pixelcut_2.png', NULL, NULL, '', '99', '60', '1', '<p>Product Details:</p>\r\n\r\n<p>Silicone magnetic strap for Apple Watch, comfortable to use.</p>\r\n\r\n<p>Suitable for size 42mm, 44mm and 45mm.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>سير مغناطيس لساعة ابل من السيليكون مريح عند الاستخدام.</p>\r\n\r\n<p>مناسب لحجم 42 و 44 و 45.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=OwzlhYVGA5M&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-10-26 21:23:03', '2022-10-26 18:23:03', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
