(226, NULL, 12, 0, NULL, NULL, 'Head Massager', '469', 'جهاز مساج للرأس', NULL, 'uploads/products/445243_Ha3e63f485a8146fd9b56fac5950a0f9bG.jpg', NULL, NULL, '', '220', '110.44', '1', '<p>Product Details:</p>\r\n\r\n<p>A Head massager that contains 10 small massage heads.</p>\r\n\r\n<p>Designed in a small octopus shape to cover the head completely.</p>\r\n\r\n<p>The corners of the device are movable to fit all heads.</p>\r\n\r\n<p>It contains different massage modes that can be changed according to the desire.</p>\r\n\r\n<p>Rechargeable and doesn&#39;t need batteries.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز مساج للرأس يحتوي على 10 رؤوس للمساج.</p>\r\n\r\n<p>مصمم بشكل اخطبوطي صغير حتى يغطي الرأس بشكل كامل.</p>\r\n\r\n<p>زوايا الجهاز متحركة حتى يتناسب مع كل احجام الرؤوس.</p>\r\n\r\n<p>يحتوي على اوضاع مختلفة للمساج يمكن تغييرها على حسب الرغبة من الجهاز نفسه.</p>\r\n\r\n<p>قابل للشحن ولا يحتاج الى بطاريات.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=xEZceLHJ1Nk&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-08-31 13:15:49', '2022-08-31 10:15:49', NULL, NULL, 1, NULL, 10, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(227, NULL, 10, 0, NULL, NULL, '10Moons Smart Pen For Phones and Tablets - Black', '303', 'قلم ذكي للهواتف والاجهزة اللوحية من 10Moons - اسود', NULL, 'uploads/products/658166_black1.jpg', NULL, NULL, '', '169', '117.25', '1', '<p>Product Details:</p>\r\n\r\n<p>A Smart pen that works with all IOS and Andriod systems from 10Moons.</p>\r\n\r\n<p>Suitable for facilitating the work of students or workers on the iPads or Tablets.</p>\r\n\r\n<p>Small in size and has no weight. It is easy to use with a single push of a button, and it does not need any pairing process.</p>\r\n\r\n<p>Illumination to know the status of the battery charge.</p>\r\n\r\n<p>Can be used for Phones, iPads or Tablets.</p>\r\n\r\n<p>Comes with USB wire for charging.</p>\r\n\r\n<p>Input: Micro.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>قلم ذكي يعمل مع جميع الانظمة IOS و Andriod من شركة 10Moons.</p>\r\n\r\n<p>مناسب لتسهيل العمل للطلاب او العاملين على الايباد او التابليت.</p>\r\n\r\n<p>حجمه صغير ومافيه وزن سهل الاستخدام بضغطة زر وحدة ومايحتاج الى اي عملية اقتران.</p>\r\n\r\n<p>اضاءة لمعرفة حالة الشحن.</p>\r\n\r\n<p>يمكن استخدامة للهواتف او الايباد او التابليت.</p>\r\n\r\n<p>يأتي مع واير الشحن بمنفذ يو اس بي.</p>\r\n\r\n<p>مدخل الشحن: مايكرو.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=g7MSne9LV9k&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 13:17:41', '2022-08-31 10:17:41', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '30'),
(228, NULL, 10, 0, NULL, NULL, 'Flash Memory 4 in 1 For All Mobile Phones 1TB', '10001', 'فلاش ميموري لجميع الهواتف بحجم 1 تيرابايت', NULL, 'uploads/products/487154_cle-usb-pour-iphone-64-go-cle-usb-3-0-stockage-su.jpg', NULL, NULL, '', '260', '175', '1', '<p>Product Details:</p>\r\n\r\n<p>Flash memory with a storage capacity of 1 TB for all mobile phones.</p>\r\n\r\n<p>It is characterized by the presence of all ports that are suitable for all IOS and Android phones.</p>\r\n\r\n<p>Small in size and you can take it with you anywhere.</p>\r\n\r\n<p>It is the most suitable solution for your phones in case you do not have a storage space.</p>\r\n\r\n<p>Suitable for owners of mobile photography or those who need more storage spaces, as well as for travel.</p>\r\n\r\n<p>Easy to use, just upload the files from the phone, and you can download them to any other device from the laptop and others.</p>\r\n\r\n<p>Control App: Y-Disk.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>فلاش ميموري بسعة تخزين 1 تيرابايت لجميع الهواتف.</p>\r\n\r\n<p>يتميز بوجود جميع المنافذ التي تناسب جميع الهواتف نظام IOS و Android.</p>\r\n\r\n<p>حجمه صغير وتقدرون تشيلونه معاكم خارج البيت.</p>\r\n\r\n<p>يعتبر الحل الانسب لهواتفكم في حال صار ماعندكم مساحة تخزين.</p>\r\n\r\n<p>مناسب لأصحاب التصوير بالهاتف او الي يحتاجون مساحات تخزين اكبر وايضاً للسفر.</p>\r\n\r\n<p>سهل الاستخدام فقط يتم تحميل الملفات من الهاتف وتقدرون تفرغونها في اي جهاز اخر من اللابتوب وغيرها.</p>\r\n\r\n<p>تطبيق التحكم: Y-Disk.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=308tyrc9Vaw&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 13:19:42', '2022-08-31 10:19:42', NULL, NULL, 1, NULL, 46, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(229, NULL, 15, 9, NULL, NULL, 'Anker MagGo Magnetic Battery - Black', '339', 'باوربانك لاسلكي وستاند مغناطيسي بقوة 5000 مللي امبير من Anker - اسود', NULL, 'uploads/products/614240_A1611011_TD01_V1_2048x.jpg', NULL, NULL, '', '229', '215.11', '1', '<p>Product Details:</p>\r\n\r\n<p>Wireless charger with a capacity of 5000 mAh with Magsafe technology for iPhone from Anker.</p>\r\n\r\n<p>Supports fast wireless charging for iPhone 12 and above.</p>\r\n\r\n<p>It can be used as a phone stand to watch movies, series, etc.</p>\r\n\r\n<p>It is characterized by its small size and is considered half the size compared to other wireless chargers.</p>\r\n\r\n<p>Type C port to charge the power bank, and other devices can be charged from the same port.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن لاسلكي بسعة 5000 مللي امبير وستاند بتقنية Magsafe للايفون من شركة Anker.</p>\r\n\r\n<p>يدعم الشحن اللاسلكي السريع لاجهزة الايفون 12 وما فوق.</p>\r\n\r\n<p>يمكن استخدامة كستاند للهاتف لمشاهدة الافلام او المسلسلات وغيرها.</p>\r\n\r\n<p>يتميز بصغر حجمه ويعتبر بنصف الحجم مقارنةً بغيره من الشواحن اللاسلكية.</p>\r\n\r\n<p>مدخل تايب سي لشحن الباوربانك ويمكن شحن اجهزة اخرى من نفس المدخل.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=vo0iWbKYI88&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 13:21:17', '2022-08-31 10:21:17', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '11'),
(230, NULL, 5, 0, NULL, NULL, 'Anker Nebula Astro Portable Projector', '325', 'بروجكتر متنقل Nebula صغير الحجم من Anker', NULL, 'uploads/products/434881_Nebula-Astro-Pocket-Projector-White.jpg', NULL, NULL, '', '1350', '1214.10', '1', '<p>Product Details:</p>\r\n\r\n<p>Nebula projector is very small in size and high quality from Anker.</p>\r\n\r\n<p>The battery capacity is 3200 mAh, rechargeable, and it takes two hours to fully charge it, and it works for 2.5 continuous hours using the battery mode.</p>\r\n\r\n<p>It is characterized by its small size and can be moved from one place to another easily.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز بروجكتور Nebula صغير الحجم جداً ودقه عالية الجودة من شركة Anker.</p>\r\n\r\n<p>سعة البطارية 3200 مللي امبير قابل للشحن ويستغرق شحنه بالكامل ساعتين، يعمل لمدة 2.5 متواصله باستخدام وضع البطارية.</p>\r\n\r\n<p>يتميز بصغر حجمه ويمكن نقله من مكان الى اخر بسهولة.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-31 13:23:33', '2022-08-31 10:23:33', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
