(237, NULL, 15, 11, NULL, NULL, 'Green Stark Plus Power Inverter 300W', '318', 'موصل لتحويل كهرباء السيارة الى كهرباء منزلية بقوة 300 واط من Green', NULL, 'uploads/products/487712_Spark-3-power-inverter.png', NULL, NULL, '', '199', '125', '1', '<p>Product Details:</p>\r\n\r\n<p>A Device for converting car electricity into home electricity (the new version) with a power of 300W from Green.</p>\r\n\r\n<p>Easy to use, all you have to do is install the car entrance and operate any device you have less than 300 watts.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز تحويل كهرباء السيارة الى كهرباء منزل ( الاصدار الجديد ) بقوة 300 واط من شركة Green.</p>\r\n\r\n<p>سهل الاستخدام كل ماعليكم تركبون مدخل السيارة وتشغلون اي جهاز عندكم اقل من 300 واط.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Vx84HJq3RGs&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 13:40:51', '2022-08-31 10:40:51', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '20'),
(238, NULL, 15, 9, NULL, NULL, 'Zendure X6 Portable Charger & Hub with USB-C PD 45W 20100mAh', '398', 'شاحن متنقل X6 بسعة 20,100 مللي امبير وبقوة 45 واط من Zendure', NULL, 'uploads/products/252744_white_X6-2_1024x1024.jpg', NULL, NULL, '', '399', '225', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable 4 USB &amp; 1 PD ports power bank with a capacity of 20,100mAh from Zendure.</p>\r\n\r\n<p>It is characterized by the presence of two USB outputs that you can install on the computer, and it gives you additional outputs for the computer itself.</p>\r\n\r\n<p>4 USB Outputs (1 USB Port Support QC3.0).</p>\r\n\r\n<p>Type C port to charge the power bank, and other devices can be charged from the same port.</p>\r\n\r\n<p>45W Charging power, and you can charge MacBooks and other devices.</p>\r\n\r\n<p>Resistant to shocks and falls, and this is what distinguishes this company with strong endurance.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>Double-click the power button to turn on the system for adding entries on the computer</p>\r\n\r\n<p>To activate the slow charging mode for earphones or small devices, press the power button for 5 seconds continuously.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن متنقل بقوة 20,100 مللي امبير ذو 4 منافذ يو اس بي ومنفذ بي دي من شركة Zendure.</p>\r\n\r\n<p>يتميز بوجود مخرجين يو اس بي تقدرون تركبونه على الكمبيوتر ويعطيكم مخارج إضافيه للكمبيوتر نفسه.</p>\r\n\r\n<p>يحتوي على 4 منافذ يو اس بي منهم واحد بتقنية QC3.0 للشحن سريع.</p>\r\n\r\n<p>منفذ تايب سي بتقنية PD للشحن سريع ويمكن شحن الباوربانك من نفس المدخل.</p>\r\n\r\n<p>قوة شحن 45 واط ويتقدرون تشحنون اجهزة الماك بوك وغيرها من الاجهزة.</p>\r\n\r\n<p>مقاوم للصدمات والسقوط وهذا مايميز هالشركة بقوة التحمل.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>لتشغيل نظام Hub للمنافذ الإضافية للكمبيوتر يتم الضغط على زر التشغيل مرتين.</p>\r\n\r\n<p>لتفعيل الشحن البطيئ للسماعات او الاجهزة الصغيرة يتم الضغط على زر التشغيل لمدة 5 ثواني مستمرة.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2