(239, NULL, 6, 0, NULL, NULL, 'Eufy By Anker Smart Scale C1', '319', 'ميزان ذكي ومقياس لكتلة الجسم C1 من Anker', NULL, 'uploads/products/408644_T9146011_TD01_V3_2048x_(1).jpg', NULL, NULL, '', '189', '116.10', '1', '<p>Product Details:</p>\r\n\r\n<p>Smart scale with a digital screen for the body from Anker.</p>\r\n\r\n<p>It is characterized by its high accuracy of daily body sensing when used.</p>\r\n\r\n<p>Intelligent analysis system that allows you to - share it with your family members and can save the data of up to 16 people.</p>\r\n\r\n<p>It can be controlled by your phone so you can follow up your data.</p>\r\n\r\n<p>Control app: EufyLife</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ميزان ذكي مع شاشة رقمية للجسم من شركة Anker.</p>\r\n\r\n<p>يتميز بدقته العالية لاستشعار الجسد يومياً عند استعمالة.</p>\r\n\r\n<p>نظام تحليل ذكي مما يتيح لك مشاركته مع افراد عائلتك ويمكنه حفظ بيانات ما يصل الى ١٦ شخص.</p>\r\n\r\n<p>يمكن التحكم به عن طريق هاتفك ومعرفة البيانات الخاصه بك.</p>\r\n\r\n<p>تطبيق التحكم: EufyLife</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-31 13:43:41', '2022-08-31 10:43:41', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
