(247, NULL, 5, 0, NULL, NULL, 'Rako Portable Blender 350ml', '20030', 'خلاط محمول صغير الحجم 350مل من Rako', NULL, 'uploads/products/432930_Rako-4-Blades-Tornado-Turbo-Portable-Blender3.jpg', NULL, NULL, '', '135', '80', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable blender 350ml compact size from Rako.</p>\r\n\r\n<p>It is characterized by its small size and strength in mixing, and you can take it with you anywhere.</p>\r\n\r\n<p>4 Internal mixing blades and a rotation speed of 18,000RPM.</p>\r\n\r\n<p>The mixer can be used as a cup for a mixed drink.</p>\r\n\r\n<p>It makes all kinds of juices from fruit, milkshakes, baby food and other things.</p>\r\n\r\n<p>The battery capacity is 1200 mAh, rechargeable and does not require batteries.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>خلاط محمول 350مل صغير الحجم من شركة Rako.</p>\r\n\r\n<p>يتميز بصغر حجمه وقوته في الخلط وتقدرون تاخذونه معاكم الى اي مكان.</p>\r\n\r\n<p>4 شفرات داخلية للخلط وسرعة دوران تصل الى 18,000RPM.</p>\r\n\r\n<p>يمكن استخدام الخلاط ككوب لشراب ماتم خلطة.</p>\r\n\r\n<p>يصنع جميع انواع العصائر من الفاكهة او الميلك شيك او طعام الاطفال وغيرها من الاشياء.</p>\r\n\r\n<p>سعة البطارية 1200 مللي امبير قابل للشحن ولا يحتاج الى بطاريات.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=e4fTAr3mtWQ&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 16:22:53', '2022-08-31 13:22:53', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '34'),
(248, NULL, 5, 0, NULL, NULL, 'Rako Popcorn Maker 280ML', '328', 'جهاز صانع الفشار 280مل من Rako', NULL, 'uploads/products/570112_popparazi_2_auto_x2.jpg', NULL, NULL, '', '100', '65', '1', '<p>Product Details:</p>\r\n\r\n<p>A Quick popcorn maker with a capacity of 280ml from Rako.</p>\r\n\r\n<p>It is characterized by the speed of making popcorn within 2 to 5 minutes max.</p>\r\n\r\n<p>Small size saves space and can be used in rooms or offices.</p>\r\n\r\n<p>Cover on the top of the machine so that the popcorn does not scatter to the outside, as well as a popcorn container at the bottom of the machine.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز يصنع الفشار بشكل سريع وبسعة 280 مل من شركة Rako.</p>\r\n\r\n<p>يتميز بسرعة صنع الفشار خلال 2 الى 5 دقائق كحد اقصى.</p>\r\n\r\n<p>حجم صغير يوفر من المساحة ويمكن استخدامة في الغرف او المكاتب.</p>\r\n\r\n<p>غطاء اعلى الجهاز حتى لا يتناثر الفشار الى الخارج وايضاً حاوي للفشار في اسفل الجهاز.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-31 16:24:14', '2022-08-31 13:24:14', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '34'),
(249, NULL, 10, 0, NULL, NULL, 'Moft Foldable Wireless Keyboard', '330', 'كيبورد لاسلكي قابل للطي من Moft', NULL, 'uploads/products/828471_kmoft4.jpg', NULL, NULL, '', '210', '147', '1', '<p>Product Details:</p>\r\n\r\n<p>Bluetooth keyboard from Moft.</p>\r\n\r\n<p>It is small in size and foldable, which makes it easy for you to carry it anywhere.</p>\r\n\r\n<p>The battery capacity is 210mAh, rechargeable and does not require batteries.</p>\r\n\r\n<p>It takes a two-hour charge and works for 2 to 3 days continuously.</p>\r\n\r\n<p>Easy to use and saves you a lot of space compared to any other keyboard.</p>\r\n\r\n<p>Compatible with all devices from phones, tablets or computers (IOS - Android - Windows).</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كيبورد لاسلكي يعمل عن طريق البلوتوث من شركة Moft.</p>\r\n\r\n<p>يتميز بصغر حجمه وقابليته للطي مما يسهل عليك حمله لأي مكان.</p>\r\n\r\n<p>سعة البطارية 210 مللي امبير قابل للشحن ولا يحتاج الى بطاريات.</p>\r\n\r\n<p>يستغرف شحنة ساعتين ويعمل لمدة 2 الى 3 ايام بشكل متواصل.</p>\r\n\r\n<p>سهل الاستخدام ويوفر عليكم مساحة كبيرة مقارنة بأي كيبورد اخر.</p>\r\n\r\n<p>متوافق مع جميع الأجهزة من الهواتف او الاجهزة اللوحية او الكمبيوتر ( IOS &ndash; Android &ndash; Windows ).</p>\r\n', NULL, 'https://www.youtube.com/watch?v=ZOoE1-tiAmU&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 16:27:57', '2022-08-31 13:27:57', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '29'),
(250, NULL, 6, 0, NULL, NULL, 'Reolink E1 Pro Smart Home Camera 4MP 360° Rotation', '333', 'كاميرا E1 Pro الذكية للمنزل 4 ميجابكسل ودوران 360 درجة من Reolink', NULL, 'uploads/products/998783_12121.jpg', NULL, NULL, '', '360', '290', '1', '<p>Product Details:</p>\r\n\r\n<p>Smart Camera E1 Pro (the latest version of the E1 category) works via Wi-Fi with high resolution and clear imaging for surveillance from Reolink.</p>\r\n\r\n<p>It features a high quality 4 megapixel camera and a natural high definition image.</p>\r\n\r\n<p>Movable in full 360-degree rotation and 50-degree elevation.</p>\r\n\r\n<p>Support night vision view through infrared.</p>\r\n\r\n<p>It has a two-way dual microphone allows you to talk through.</p>\r\n\r\n<p>It contains an intelligence system that recognizes human faces.</p>\r\n\r\n<p>Control Application: Reolink.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كاميرا ذكية E1 Pro ( الاصدار الاحدث من فئة E1 ) تعمل عن طريق الواي-فاي ذات دقة عالية وتصوير واضح للمراقبة من شركة Reolink.</p>\r\n\r\n<p>تتميز بجودة عالية 4 ميجابكسل وصورة طبيعية عالية الوضوح.</p>\r\n\r\n<p>متحركة بزاوية دوران كاملة 360 درجة وارتفاع بزاوية 50 درجة.</p>\r\n\r\n<p>تدعم نظام الرؤية الليلة عن طريق الاشعة تحت الحمراء.</p>\r\n\r\n<p>تحتوي على ميكروفون مزدوج مما يتيح لك التحدث من خلالها.</p>\r\n\r\n<p>تحتوي على نظام الذكاء الاصطناعي والذي يتعرف على الوجوه البشرية.</p>\r\n\r\n<p>تطبيق التحكم: Reolink.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=sSFd5ou_1FU&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 16:29:57', '2022-08-31 13:29:57', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '36'),
(251, NULL, 5, 0, NULL, NULL, 'Rako Multifunction Mirror', '20008', 'مرآة متعددة الاستخدام من Rako', NULL, 'uploads/products/849307_w2-1.jpg', NULL, NULL, '', '249', '120', '1', '<p>Product Details:</p>\r\n\r\n<p>Mirror with LED light and speaker, in addition to a 10W wireless charger from Rako.</p>\r\n\r\n<p>It features a speaker, mirror, and photo magnifier with LED lighting.</p>\r\n\r\n<p>The level of LED brightness can be controlled.</p>\r\n\r\n<p>It works by electricity and does not need charging or batteries.</p>\r\n\r\n<p>Input: Type C.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مرآة مع اضاءة ومكبر صوت بالإضافة الى شاحن لاسلكي بقوة 10 واط من شركة Rako.</p>\r\n\r\n<p>تتميز بوجود مكبر صوت وايضاً مرآة ومكبر صورة مع اضاءة LED.</p>\r\n\r\n<p>يمكن التحكم بمستوى الإضاءة.</p>\r\n\r\n<p>تعمل عن طريق الكهرباء ولا تحتاج الى شحن او بطارية.</p>\r\n\r\n<p>منفذ التشغيل: تايب سي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=3LvwWo6pqRA&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 16:31:27', '2022-08-31 13:31:27', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '34'),
(252, NULL, 5, 0, NULL, NULL, 'Rako Luqaimat Maker', '332', 'جهاز لاسلكي لصنع اللقيمات من Rako', NULL, 'uploads/products/262222_11-53.jpg', NULL, NULL, '', '200', '150', '1', '<p>Product Details:</p>\r\n\r\n<p>A wireless, rechargeable device without electricity wires for making sweet balls faster and easier, with the size of a 700ml bowl from Rako.</p>\r\n\r\n<p>This device is characterized by making 3 pills of sweet balls with each push of a button, and you can make 100 sweet balls per use.</p>\r\n\r\n<p>Digital display showing how many luqaimat were made.</p>\r\n\r\n<p>The battery capacity is 2600 mAh and it works for a maximum of 5 hours.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز لاسلكي قابل للشحن بدون اسلاك للكهرباء لصنع اللقيمات بشكل اسرع واسهل بحجم وعاء 700مل من شركة Rako.</p>\r\n\r\n<p>يتميز هالجهاز بصنع 3 حبات من اللقيمات مع كل ضغطة زر وتقدرون تسوون 100 حبة من اللقيمات في الاستخدام الواحد.</p>\r\n\r\n<p>شاشة رقمية توضح كم حبه من اللقيمات التي تم صنعها.</p>\r\n\r\n<p>سعة البطارية 2600 مللي امبير ويشتغل معاكم لمدة 5 ساعات كحد اقصى.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=TehoHThz4Z4&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 16:32:50', '2022-08-31 13:32:50', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '34'),
(253, NULL, 10, 0, NULL, NULL, 'Moft Stand & Case For iPad 12.9 inch', '20012', 'كفر وستاند للايباد 12.9 انش من Moft', NULL, 'uploads/products/675828_ipadfloat_0000_c09-0000_1800x1800_2_copy.jpg', NULL, NULL, '', '235', '150', '1', '<p>Product Details:</p>\r\n\r\n<p>Protective case and stand at the same time in different positions for iPad 12.9 inch from Moft.</p>\r\n\r\n<p>It is characterized by its small size and doesn&#39;t increase the thickness of the iPad when combined.</p>\r\n\r\n<p>4 Different positions that can be used as a base with different angles and ways or as a normal protection as desired.</p>\r\n\r\n<p>Suitable for watching lectures, movies, series, etc.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كفر حماية وستاند في نفس الوقت بوضعيات مختلفة للايباد 12.9 انش من شركة Moft.</p>\r\n\r\n<p>يتميز بحجمه الضئيل ومايكبر من حجم الايباد كثير عند تركيبة.</p>\r\n\r\n<p>4 وضعيات مختلفة يمكن استخدامة كقاعدة بزوايا وطرق مختلفة او كحماية عادية على حسب الرغبة.</p>\r\n\r\n<p>مناسب لمشاهدة المحاضرات او الافلام والمسلسلات وغيرها.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=EYwZjK0At98&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 16:35:12', '2022-08-31 13:35:12', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '29'),
(254, NULL, 5, 0, NULL, NULL, 'Rako Cordless Vacuum Cleaner With Digital Display', '329', 'مكنسة لاسلكية مع شاشة رقمية من Rako', NULL, 'uploads/products/334585_Untitled-1-1.jpg', NULL, NULL, '', '439', '410', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable, rechargeable, cordless vacuum cleaner from Rako.</p>\r\n\r\n<p>It has a high dirt pulling force and can be used to clean the house comfortably as it does not have any cord to operate.</p>\r\n\r\n<p>It contains a chip that enables it to adjust the suction power automatically and sense the amount of dust or dirt in the place.</p>\r\n\r\n<p>Touch-controlled digital display to change the sweeping force of the broom.</p>\r\n\r\n<p>Cleans all kind of hard floors and carpets.</p>\r\n\r\n<p>Suction power: 19,000 &ndash; 25,000 Pa.</p>\r\n\r\n<p>Battery capacity: 2500 mAh.</p>\r\n\r\n<p>Rotation speed: 85,000RPM.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مكنسة متنقلة قابلى للشحن تعمل من غير اسلاك من شركة Rako.</p>\r\n\r\n<p>تتميز بقوة سحب عالية للأوساخ ويمكن استخدامها لتنظيف المنزل بشكل مريح حيث انها لا تحتوي على اي سلك للتشغيل.</p>\r\n\r\n<p>تحتوي على شريحة تمكنها من تعديل قوة الشفط بشكل تلقائي واستشعار كمية الغبار او الاوساخ في المكان.</p>\r\n\r\n<p>شاشة رقمية يمكن التحكم بها عن طريق اللمس لتغيير قوة السحب للمكنسة.</p>\r\n\r\n<p>تنظيف جميع أنواع الأرضيات الصلبة والسجاد.</p>\r\n\r\n<p>قوة الشفط: 19,000 - 25,000 باكسال.</p>\r\n\r\n<p>سعة البطارية: 2500 مللي امبير.</p>\r\n\r\n<p>سرعة دوران: 85,000RPM.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-31 16:36:54', '2022-08-31 13:36:54', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '34'),
(255, NULL, 6, 0, NULL, NULL, 'Intelligent & Standard Device For Ambient Condition', '312', 'جهاز ذكي ومعيار لحالة الجو المحيط', NULL, 'uploads/products/953298_Hb7d5fbcb81bf4519840b1f198aa6da3fy.jpg', NULL, NULL, '', '250', '177.84', '1', '<p>Product Details:</p>\r\n\r\n<p>A Device equipped with a smart chip to examine the surrounding atmosphere in the place.</p>\r\n\r\n<p>It is characterized by accurate measurement of temperature and humidity, as well as the condition of the surrounding atmosphere in the place where it is located.</p>\r\n\r\n<p>Digital screen that shows the clock and the state of the surrounding atmosphere in degrees by color (green color means that the weather is pure / red means that the weather is not clean).</p>\r\n\r\n<p>Supports Wi-Fi and can be controlled by phone.</p>\r\n\r\n<p>It can be used as a clock and has a sleep alarm.</p>\r\n\r\n<p>It works by charging and can be used wired or wireless.</p>\r\n\r\n<p>Control Application: XiaoMei Smart.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز مزود بشريحة ذكية لفحص الجو المحيط في المكان.</p>\r\n\r\n<p>يتميز بقياسة الدقيق للحرارة والرطوبة وايضاً حالة الجو المحيط في المكان المتواجد فيه.</p>\r\n\r\n<p>شاشة رقمية توضح الساعة وحالة الجو المحيط بدرجات عن طريق الالوان (اللون الاخضر يعني ان الجو نقي / اللون الاحمر يعني ان الجو غير نقي).</p>\r\n\r\n<p>يدعم الواي-فاي ويمكن التحكم به عن طريق الهاتف.</p>\r\n\r\n<p>يمكن استخدامة كساعة ويوجد به منبه للنوم.</p>\r\n\r\n<p>يعمل عن طريق الشحن ويمكن تشغيله سلكي او لاسلكي.</p>\r\n\r\n<p>تطبيق التحكم: XiaoMei Smart.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=8NwScF4z89s&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 16:40:38', '2022-08-31 13:40:38', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(256, NULL, 6, 0, NULL, NULL, 'Smart Fingerprint Lock With App Control', '300', 'قفل ذكي مع خاصية التعرف على البصمة', NULL, 'uploads/products/417290_H39c01d23aabb438fbc489b9a918d5af1B.jpg', NULL, NULL, '', '159', '133.32', '1', '<p>Product Details:</p>\r\n\r\n<p>Smart bluetooth lock that can be controlled by its own application or by finger print.</p>\r\n\r\n<p>It is characterized by the presence of a smart chip to identify the fingerprint, as well as its speed in reading the fingerprint and opening the lock.</p>\r\n\r\n<p>It contains an identification memory that enables it to keep a maximum of 10 different fingerprints, so it can be shared with your family members or friends.</p>\r\n\r\n<p>Long-term battery that is charged once and works for about a year without charging.</p>\r\n\r\n<p>Made of high quality and unbreakable zinc material.</p>\r\n\r\n<p>IP65 Water Resistant.</p>\r\n\r\n<p>Control Application: Smart Home / Tuya App.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>قفل ذكي بلوتوث يمكن التحكم به عن طريق الابلكيشن الخاص به او باللمس.</p>\r\n\r\n<p>يتميز بوجود شريحة ذكية للتعرف على البصمة وايضاً سرعته في قراءة البصمة وفتح القفل.</p>\r\n\r\n<p>يحتوي على ذاكرة للتعرف تمكنه من الاحتفاظ لحد اقصى 10 بصمات مختلفة وبذلك يمكن مشاركته مع افراد عائلتك او اصدقائك.</p>\r\n\r\n<p>بطاريه طولية الامد يتم شحنه لمرة ويعمل لمدة سنة تقريباً بدون شحن.</p>\r\n\r\n<p>مصنوع من مادة الزنك عالية الجودة وغير قابل للكسر.</p>\r\n\r\n<p>مقاوم للماء بمعيار IP65.</p>\r\n\r\n<p>تطبيق التحكم: Smart Home / Tuya App.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=-c2x-m1qc0w&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 16:42:35', '2022-08-31 13:42:35', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL),
(257, NULL, 12, 0, NULL, NULL, 'Battery Life Measuring Tester', '306', 'جهاز لقياس عمر البطاريات', NULL, 'uploads/products/430049_H0bd3fd425f2f497e9f0177328773a733D-600x600.png', NULL, NULL, '', '120', '65.31', '1', '<p>Product Details:</p>\r\n\r\n<p>Simple portable device to check battery life.</p>\r\n\r\n<p>It has a digital display to show the battery life with different colors to know the level.</p>\r\n\r\n<p>Suitable for most sizes of batteries that we use regularly.</p>\r\n\r\n<p>Small and distinctive size for easy transportation from one place to another.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز بسيط محمول لمعرفة عمر البطارية.</p>\r\n\r\n<p>يحتوي على شاشة رقمية لتوضيح عمر البطارية مع الوان مختلفة لمعرفة المستوى.</p>\r\n\r\n<p>مناسب لأغلب احجام البطاريات التي نستعملها بشكل مستمر.</p>\r\n\r\n<p>حجم صغير ومميز ليسهل عملية نقله من مكان الى اخر.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Z9asDmNM88A&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 16:43:49', '2022-08-31 13:43:49', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(258, NULL, 12, 0, NULL, NULL, 'Electronic Bag Weight Scale With Digital Display', '299', 'جهاز قياس وزن الشنط الإلكتروني مع شاشة رقمية', NULL, 'uploads/products/208951_15.jpg', NULL, NULL, '', '119', '65.38', '1', '<p>Product Details:</p>\r\n\r\n<p>A portable device to measure the weight of bags with a digital screen to read the weight.</p>\r\n\r\n<p>Useful for travel if you want to measure the weight of bags before going to the airport.</p>\r\n\r\n<p>It works by batteries and does not require charging.</p>\r\n\r\n<p>Made of high quality materials to withstand heavy bag weights.</p>\r\n\r\n<p>Measurement unit: KG / G / LB / Oz.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز محمول لقياس وزن الشنط مع شاشة رقمية لقراءة الوزن.</p>\r\n\r\n<p>مفيد للسفر في حال الرغبة في قياس وزن الشنط قبل الذهاب الى المطار.</p>\r\n\r\n<p>يعمل عن طريق البطاريات ولا يحتاج الى شحن.</p>\r\n\r\n<p>مصنوع من مواد عالية الجودة ليستحمل اوزان الشنط الثقيلة.</p>\r\n\r\n<p>وحدة القياس: KG / G / LB / Oz.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=kcnvOKGkcGc&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 16:45:11', '2022-08-31 13:45:11', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(259, NULL, 12, 0, NULL, NULL, 'Slim Electric Wave Foot Massager', '302', 'جهاز مساج للقدم بتقنية الموجات الكهربائية', NULL, 'uploads/products/920361_H121b3b5e3b52441abb7e02e5c735b0b2r.jpg', NULL, NULL, '', '120', '70.82', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable massager with electric wave technology designed superficially to facilitate the process of moving from one place to another.</p>\r\n\r\n<p>6 Different positions for each position that defines a specific area in the foot.</p>\r\n\r\n<p>Slim and foldable surface design for easy storage.</p>\r\n\r\n<p>Input: Micro.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز مساج محمول بتقنية الموجات الكهربائية مصمم بشكل سطحي ليسهل عملية نقلة من مكان لاخر.</p>\r\n\r\n<p>6 اوضاع مختلفة لكل وضعيه تحدد منطقة معينه في القدم.</p>\r\n\r\n<p>تصميم سطحي نحيف ويمكن طيّه لتسهيل عملية التخزين.</p>\r\n\r\n<p>مدخل الشحن: مايكرو.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=U5vOBXl-Mqc&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 16:46:34', '2022-08-31 13:46:34', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, NULL),
(260, NULL, 12, 0, NULL, NULL, 'Portable Electronic Laser Distance Measurer', '275', 'جهاز إلكتروني محمول لقياس المسافات بالليزر', NULL, 'uploads/products/691040_dsada.jpg', NULL, NULL, '', '200', '119.60', '1', '<p>Product Details:</p>\r\n\r\n<p>Very accurate portable electronic device for measuring distances with a floor base from Duka.</p>\r\n\r\n<p>You can use it to measure anything like rooms, offices, or even at work for engineers.</p>\r\n\r\n<p>Small in size and you can take it with you anywhere.</p>\r\n\r\n<p>Comes with a floor stand in case you want to use it steadily.</p>\r\n\r\n<p>The battery size is 730 mAh, rechargeable and does not require batteries.</p>\r\n\r\n<p>Digital display for measurements.</p>\r\n\r\n<p>IP54 water resistant.</p>\r\n\r\n<p>Made of materials that are not capable of conducting electricity in the event of an electrical short.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز إلكتروني محمول لقياس المسافات دقيق جداً مع قاعدة ارضية من شركة Duka.</p>\r\n\r\n<p>تقدرون تستخدمونه لقياس اي شي مثل الغرف او المكاتب او حتى في العمل للمهندسين.</p>\r\n\r\n<p>حجمه صغير وتقدرون تشيلونه معاكم لاي مكان.</p>\r\n\r\n<p>يأتي مع قاعدة ارضية في حال الرغبة في استخدامه بشكل ثابت.</p>\r\n\r\n<p>حجم البطارية 730 مللي امبير قابلة للشحن ولا يحتاج الى بطاريات.</p>\r\n\r\n<p>شاشة رقمية لمعرفة القياسات.</p>\r\n\r\n<p>مقاوم للماء بمعيار IP54.</p>\r\n\r\n<p>مصنوع من مواد غير قابله لتوصيل الكهرباء في حال وجد التماس كهربائي.</p>\r\n', NULL, 'https://youtu.be/ThHmiBci89A', '', '1', NULL, NULL, '1', '2022-08-31 16:48:24', '2022-08-31 13:48:24', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL);
INSERT INTO `product` (`product_id`, `fk_lang_id`, `category_id`, `sub_category_id`, `child_category_id`, `unit_id`, `product_name`, `product_code`, `product_name_ar`, `product_in_marathi`, `image_name`, `pack_size`, `product_price`, `max_sell_limit`, `product_offer_price`, `product_purchase_price`, `listed_in_super_deal`, `description`, `description_ar`, `relatable_products`, `video_url`, `product_barcode`, `status`, `unit`, `mrp`, `stock_status`, `added_on`, `date_modified`, `popular`, `featured`, `best_selling`, `new_arrival`, `qty`, `supplier_id`, `currency_in_english`, `currency_in_arabic`, `product_offer`, `product_status`, `category_type`, `gift_card_stock`, `uniq_code`, `brand_id`) VALUES
(261, NULL, 12, 0, NULL, NULL, 'Foot Warmer & Massager', '301', 'جهاز مساج وتدفئه للقدم', NULL, 'uploads/products/522235_HC9149.jpg', NULL, NULL, '', '450', '247.20', '1', '<p>Product Details:</p>\r\n\r\n<p>Foot massager with 3 different strength modes in addition to a built-in heating.</p>\r\n\r\n<p>It is characterized by the presence of massage heads made of 3D gel, which gives you a sense of human touch for massage.</p>\r\n\r\n<p>Made of high quality soft fabric, it is open to all foot sizes.</p>\r\n\r\n<p>It is programmed to work for 15 minutes continuously to move the blood circulation in the body, so this period is suitable for daily use.</p>\r\n\r\n<p>Suitable for the elderly or people who suffer from foot pain.</p>\r\n\r\n<p>It works by electricity and does not need charging or batteries.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز مساج وتدليك للقدم مع 3 اوضاع مختلفة للقوة بالإضافة الى تدفئة مدمجه.</p>\r\n\r\n<p>يتميز بوجود رؤوس تدليك مصنوعه من الجل الثلاثي الابعاد مما يعطيكم احساس باللمسة البشرية للتدليك.</p>\r\n\r\n<p>مصنوع من القماش الناعم عالي الجودة وحجم مفتوح لجميع احجام القدم.</p>\r\n\r\n<p>مبرمج على ان يعمل لمدة 15 دقيقة متواصلة لتحريك الدورة الدموية فالجسم وبذلك تكون هذه الفترة مناسبة للأستعمال اليومي.</p>\r\n\r\n<p>مناسب لكبار السن او الاشخاص الذين يعانون من الاَم القدم.</p>\r\n\r\n<p>يعمل عن طريق الكهرباء ولا يحتاج الى شحن او بطاريات.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=3GNBEFZAR8Y&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 16:50:29', '2022-08-31 13:50:29', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(262, NULL, 8, 0, NULL, NULL, 'Rhythm RGB Motion Lighting - Gray', '305', 'إضاءة Rhythm RGB المتحركة - رصاصي', NULL, 'uploads/products/114242_H80988a19779e42549a1950794da55a27S.jpg', NULL, NULL, '', '149', '87.50', '1', '<p>Product Details:</p>\r\n\r\n<p>RGB lighting with a modern and distinctive shape.</p>\r\n\r\n<p>Built-in microphone, which gives the ability to interact with surrounding sounds.</p>\r\n\r\n<p>A 500mAh battery that can be charged and used wirelessly or wired as desired.</p>\r\n\r\n<p>Special system to know the state of charging the battery through the luminous squares (each square is 25%), and if the red color appears, it means that the battery has less than (5%).</p>\r\n\r\n<p>It works for 3 hours continuously when fully charged in the case of cordless use.</p>\r\n\r\n<p>It contains a wide range of different colours.</p>\r\n\r\n<p>Input: Type-C charging port.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>إضاءة RGB ذات شكل عصري ومميز.</p>\r\n\r\n<p>مايكروفون مدمج مما يعطي خاصية التفاعل مع الاصوات المحيطة.</p>\r\n\r\n<p>بطارية بسعة 500 مللي امبير يمكن شحنها واستعماله بشكل لاسلكي او سلكي على حسب الرغبة.</p>\r\n\r\n<p>نظام خاص لمعرفة حال شحن البطارية عن طريق المربعات المضيئة ( كل مربع %25 ) وفي حال ظهور اللون الاحمر يعني ان البطارية يوجد فيها اقل من ( %5 ).</p>\r\n\r\n<p>يعمل لمدة 3 ساعات متواصلة عند شحنة بالكامل في حال الاستعمال اللاسلكي.</p>\r\n\r\n<p>يحتوي على مجموعة واسعة من الالوان المختلفة.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=PP_gmYiuR24&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 16:52:09', '2022-08-31 13:52:09', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(263, NULL, 5, 0, NULL, NULL, 'Portable Folding Washing Machine - Blue', '307', 'غسالة صغيرة محمولة قابلة للطي - ازرق', NULL, 'uploads/products/663043_H06551e488895487c939e2d0a1adbf732F.jpg', NULL, NULL, '', '299', '167.99', '1', '<p>Product Details:</p>\r\n\r\n<p>Small portable foldable washing machine with a capacity of 7 liters.</p>\r\n\r\n<p>It is designed in a wonderful and distinctive way so that it does not take up much space in the house.</p>\r\n\r\n<p>Can wash underwear, baby clothes, towels, etc.</p>\r\n\r\n<p>Saves on using water when you need to wash small things.</p>\r\n\r\n<p>15 Minutes is enough to wash dirty clothes.</p>\r\n\r\n<p>Ozone disinfection technology during washing.</p>\r\n\r\n<p>It works by electricity and does not need charging or batteries.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>غسالة صغيرة ومحمولة قابلة للطي بسعة 7 لتر.</p>\r\n\r\n<p>مصممة بشكل رائع ومميز حتى لا تأخذ حيّز كبير في المنزل.</p>\r\n\r\n<p>قابلة لغسل الملابس الداخلية وملابس الاطفال والمناشف وغيرها.</p>\r\n\r\n<p>توفر من استخدام الماء عند الحاجة لغسيل الاشياء الصغيرة.</p>\r\n\r\n<p>15 دقيقة تكفيها لغسل الملابس المتسخة.</p>\r\n\r\n<p>تقنية التطهير بالاوزون اثناء الغسيل.</p>\r\n\r\n<p>تعمل عن طريق الكهرباء ولا تحتاج الى شحن او بطاريات.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=DCGQQUt0U3A&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 16:53:39', '2022-08-31 13:53:39', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(264, NULL, 5, 0, NULL, NULL, 'Smart Diamond Crystal Lamp Cylindrical Shape', '310', 'الأباجورة الذكية من الكريستال شكل اسطواني', NULL, 'uploads/products/621314_new1-1.jpg', NULL, NULL, '', '120', '72.35', '1', '<p>Product Details:</p>\r\n\r\n<p>Smart crystal lamp works by touch or remote control.</p>\r\n\r\n<p>It can be charged and used without wire and does not require batteries.</p>\r\n\r\n<p>Lightweight and gives a sweet look for occasions or bedrooms and others.</p>\r\n\r\n<p>16 Colors of lighting in addition to the colors we always use (white / warm / yellow).</p>\r\n\r\n<p>It comes with a charging cable and wireless controller inside the box.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ابجورة ذكية من الكريستال تعمل عن طريق اللمس او جهاز التحكم.</p>\r\n\r\n<p>يمكن شحنها ويتم استعمالها بدون واير ولا تحتاج الى بطاريات.</p>\r\n\r\n<p>خفيفة فالوزن وتعطي منظر حلو للمناسبات او غرف النوم وغيرها.</p>\r\n\r\n<p>16 لون من الاضاءة بالإضافه الى الالوان الي نستعملها دائماً ( ابيض / برتقالي وورم / اصفر ).</p>\r\n\r\n<p>يأتي معها واير الشحن وجهاز التحكم بداخل الصندوق.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=tZaqY-ciDD8&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 16:55:29', '2022-08-31 13:55:29', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(265, NULL, 15, 9, NULL, NULL, 'Anker MagGo Magnetic Battery - White', '339', 'باوربانك لاسلكي وستاند مغناطيسي بقوة 5000 مللي امبير من Anker - ابيض', NULL, 'uploads/products/333846_w1.jpg', NULL, NULL, '', '229', '215.11', '1', '<p>Product Details:</p>\r\n\r\n<p>Wireless charger with a capacity of 5000 mAh with Magsafe technology for iPhone from Anker.</p>\r\n\r\n<p>Supports fast wireless charging for iPhone 12 and above.</p>\r\n\r\n<p>It can be used as a phone stand to watch movies, series, etc.</p>\r\n\r\n<p>It is characterized by its small size and is considered half the size compared to other wireless chargers.</p>\r\n\r\n<p>Type C port to charge the power bank, and other devices can be charged from the same port.</p>\r\n', '', NULL, 'https://www.youtube.com/watch?v=vo0iWbKYI88&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-08-31 16:58:30', '2022-08-31 13:58:30', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '11'),
