(267, NULL, 5, 0, NULL, NULL, 'Portable Bukhoor Burner With Speaker - Black', '345', 'مبخرة إلكترونية متنقلة مع مكبر صوت - اسود', NULL, 'uploads/products/628920_Untitled-1-2.jpg', NULL, NULL, '', '250', '194.65', '1', '<p>Product Details:</p>\r\n\r\n<p>Newest design of portable bukhoor burner with speaker.</p>\r\n\r\n<p>It has a high-quality speaker, so it is a 2 in 1 incense burner.</p>\r\n\r\n<p>Suitable for cars, travel or offices at work and even at home.</p>\r\n\r\n<p>It works by charging and does not need batteries.</p>\r\n\r\n<p>Input: Type-C charging port.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>احدث اصدارات المبخرة الإلكترونية المتنقلة بالشكل الدائري.</p>\r\n\r\n<p>تتميز بوجود مكبر صوت عالي الجودة لذلك تعتبر مبخرة 2 في 1.</p>\r\n\r\n<p>مناسبة للسيارات او السفر او المكاتب في العمل وحتى المنزل.</p>\r\n\r\n<p>قابلة للشحن ولا تحتاج الى بطاريات.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-31 17:04:01', '2022-08-31 14:04:01', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(268, NULL, 6, 0, NULL, NULL, 'Porodo Body Composition Scale', '343', 'ميزان ذكي ومقياس لكتلة الجسم من Porodo', NULL, 'uploads/products/359895_bdfjifdj-smart_crop-c0-5__0-5-750x750-70-600x600.png', NULL, NULL, '', '149', '96.75', '1', '<p>Product Details:</p>\r\n\r\n<p>Smart scale with a digital screen for the body from Porodo.</p>\r\n\r\n<p>It is characterized by its high accuracy of daily body sensing when used.</p>\r\n\r\n<p>Intelligent analysis system that allows you to - share it with your family members and can save the data of up to 8 people.</p>\r\n\r\n<p>It can be controlled by your phone so you can follow up your data.</p>\r\n\r\n<p>Control Application: Dr.Weight.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ميزان ذكي مع شاشة رقمية للجسم من شركة Porodo.</p>\r\n\r\n<p>يتميز بدقته العالية لاستشعار الجسد يومياً عند استعمالة.</p>\r\n\r\n<p>نظام تحليل ذكي مما يتيح لك مشاركته مع افراد عائلتك ويمكنه حفظ بيانات ما يصل الى 8 شخص.</p>\r\n\r\n<p>يمكن التحكم به عن طريق هاتفك ومعرفة البيانات الخاصه بك.</p>\r\n\r\n<p>تطبيق التحكم: Dr.Weight</p>\r\n', NULL, 'https://www.youtube.com/watch?v=qokbKBYttOw&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 17:05:58', '2022-08-31 14:05:58', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '31'),
(269, NULL, 15, 10, NULL, NULL, 'Porodo Power Strip & Charger', '342', 'موصل كهرباء وشاحن من Porodo', NULL, 'uploads/products/768277_porodo-universal-power-socket-10a-with-3-usb-port-3a-1-qc-3-0pd-sc3302-bk-13346-1500x1500-1.jpg', NULL, NULL, '', '119', '66.75', '1', '<p>Product Details:</p>\r\n\r\n<p>Power strip &amp; charger at the same time from Porodo.</p>\r\n\r\n<p>It has 4 electrical outlets in addition to 4 USB ports for charging, one of them with QC3.0 technology for fast charging.</p>\r\n\r\n<p>It is also characterized by ease of installation and saves on electricity consumption.</p>\r\n\r\n<p>Multiple Safeguards: Gosund smart power strip with fire prevention and overload protection.</p>\r\n\r\n<p>Max Power: 2500w.</p>\r\n\r\n<p>Wire Length: 200CM.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>موصل الكهرباء وشاحن في نفس الوقت من Porodo.</p>\r\n\r\n<p>يوجد فيه 4 بلكات للكهرباء بالإضافة الى 4 منافذ يو اس بي للشحن منهم واحد بتقنية QC3.0 للشحن السريع.</p>\r\n\r\n<p>يتميز بسهولة التركيب والاستخدام ويوفر من استهلاك الكهرباء.</p>\r\n\r\n<p>مصنوع من مواد عالية الجودة وغير قابلة للحريق وحماية من الكهرباء الزائدة.</p>\r\n\r\n<p>قوة تحمل الموصل: 2500 واط</p>\r\n\r\n<p>طول السلك: 200 سانتي متر.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=hBCfiNux3OY&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 17:07:43', '2022-08-31 14:07:43', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '31'),
(270, NULL, 15, 10, NULL, NULL, 'Anker Power Strip & Charger', '495', 'موصل كهرباء وشاحن من Anker', NULL, 'uploads/products/773396_asassasas.jpg', NULL, NULL, '', '180', '99', '1', '<p>Product Details:</p>\r\n\r\n<p>Power strip &amp; charger at the same time from Anker.</p>\r\n\r\n<p>It has 3 power outlets, in addition to two USB ports with QC3.0 technology and a USB C port (PD) 18W.</p>\r\n\r\n<p>It is also characterized by ease of installation and saves on electricity consumption.</p>\r\n\r\n<p>Fire prevention and overload protection.</p>\r\n\r\n<p>Max Power: 2860w.</p>\r\n\r\n<p>Line length: 2m.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>موصل الكهرباء وشاحن في نفس الوقت من Anker.</p>\r\n\r\n<p>يوجد فيه 3 بلكات للكهرباء بالإضافة الى منفذين يو اس بي بتقنية QC3.0 ومنفذ يو اس بي سي ( PD ) بقوة 18 واط.</p>\r\n\r\n<p>يتميز بسهولة التركيب والاستخدام ويوفر من استهلاك الكهرباء.</p>\r\n\r\n<p>مصنوع من مواد عالية الجودة وغير قابلة للحريق وحماية من الكهرباء الزائدة.</p>\r\n\r\n<p>قوة تحمل الموصل: 2860 واط</p>\r\n\r\n<p>طول السلك: 2 متر.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=RT-VVkwjsbg&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 17:09:03', '2022-08-31 14:09:03', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(271, NULL, 15, 9, NULL, NULL, 'Powerology 10,000mAh 8 in 1 Power Bank Charging Dock - Black', '497', 'قاعدة شواحن باوربانك 8 في 1 بقوة 10,000 مللي امبير من Powerology - اسود', NULL, 'uploads/products/133065_I-00000060065-R-1.jpg', NULL, NULL, '', '899', '790', '1', '<p>Product Details:</p>\r\n\r\n<p>(New version) of the 8 portable chargers, each with a capacity of 10,000mAh from Powerology.</p>\r\n\r\n<p>Each portable charger contains two built-in wires, Type C and Lightning, in addition to a USB port and an 18W PD port for fast charging.</p>\r\n\r\n<p>Each charger supports 15W wireless charging technology.</p>\r\n\r\n<p>The charging base contains 4 additional USB ports.</p>\r\n\r\n<p>It is characterized by ease of movement and light weight.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>(الاصدار الجديد) من قاعدة الشواحن المتنقلة عدد 8 كل شاحن بقوة 10,000 مللي امبير من Powerology.</p>\r\n\r\n<p>كل شاحن متنقل يحتوي على وايرين مدمجين تايب سي و لايتننغ بالإضافة الى مدخل يو اس بي ومدخل PD 18 واط للشحن السريع.</p>\r\n\r\n<p>كل شاحن يدعم تقنية الشحن اللاسلكي بقوة 15 واط.</p>\r\n\r\n<p>تحتوي قاعدة الشواحن على 4 منافذ يو اس بي إضافية.</p>\r\n\r\n<p>يتميز بسهولة نقلة وخفة وزنة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=1cLKQEcnx0I&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-08-31 17:10:37', '2022-08-31 14:10:37', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '32'),
(272, NULL, 15, 9, NULL, NULL, 'Powerology 10,000mAh 8 in 1 Power Bank Charging Dock - White', '315', 'قاعدة شواحن باوربانك 8 في 1 بقوة 10,000 مللي امبير من Powerology - ابيض', NULL, 'uploads/products/I-00000060067-R-1.jpg', NULL, NULL, '', '999', '849.15', '1', '<p>Product Details:</p>\r\n\r\n<p>(New version) of the 8 portable chargers, each with a capacity of 10,000mAh from Powerology.</p>\r\n\r\n<p>Each portable charger contains two built-in wires, Type C and Lightning, in addition to a USB port and an 18W PD port for fast charging.</p>\r\n\r\n<p>Each charger supports 15W wireless charging technology.</p>\r\n\r\n<p>The charging base contains 4 additional USB ports.</p>\r\n\r\n<p>It is characterized by ease of movement and light weight.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>(الاصدار الجديد) من قاعدة الشواحن المتنقلة عدد 8 كل شاحن بقوة 10,000 مللي امبير من Powerology.</p>\r\n\r\n<p>كل شاحن متنقل يحتوي على وايرين مدمجين تايب سي و لايتننغ بالإضافة الى مدخل يو اس بي ومدخل PD 18 واط للشحن السريع.</p>\r\n\r\n<p>كل شاحن يدعم تقنية الشحن اللاسلكي بقوة 15 واط.</p>\r\n\r\n<p>تحتوي قاعدة الشواحن على 4 منافذ يو اس بي إضافية.</p>\r\n\r\n<p>يتميز بسهولة نقلة وخفة وزنة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=1cLKQEcnx0I&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 17:12:09', '2022-08-31 14:12:09', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '32'),
(273, NULL, 5, 0, NULL, NULL, 'Goui 4 in 1 Digital Clock', '344', 'ساعة 4 في 1 مع شاشة رقمية من Goui', NULL, 'uploads/products/Goui-OClock-Qi-Digital-Clock-Wireless-Charger-10W-Speaker-5W-Black.png', NULL, NULL, '', '160', '111.30', '1', '<p>Product Details:</p>\r\n\r\n<p>Bluetooth digital clock with a QC3.0 USB port for fast charging in addition to a 10W wireless charger from Goui.</p>\r\n\r\n<p>It features a digital LED screen, alarm clock, and speaker to play music, in addition to the ability to play radio channels.</p>\r\n\r\n<p>Screen brightness can be controlled at different levels as desired.</p>\r\n\r\n<p>It works for 3 hours continuously when playing music.</p>\r\n\r\n<p>Battery capacity: 1200 mAh, it can be used without wires, and it takes only 2 hours fully charge.</p>\r\n\r\n<p>Speaker power: 5W.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ساعة رقمية بلوتوث مع منفذ يو اس بي بتقنية QC3.0 للشحن السريع بالإضافة الى شاحن لاسلكي بقوة 10 واط من شركة Goui.</p>\r\n\r\n<p>تتميز بوجود شاشة رقمية LED ومنبه ومكبر صوت لتشغيل الموسيقى بالإضافة الى القدرة على تشغيل قنوات الراديو.</p>\r\n\r\n<p>يمكن التحكم بإضاءة الشاشة بمستويات مختلفة على حسب الرغبة.</p>\r\n\r\n<p>تعمل لمدة 3 ساعات متواصلة عند تشغيل الموسيقى.</p>\r\n\r\n<p>سعة البطارية: 1200 مللي امبير يمكن استخدامها بدون وايرات ويستغرق شحنها ساعتين فقط.</p>\r\n\r\n<p>قوة مكبر الصوت: 5 واط.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=doUXVGZZS6s&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-08-31 17:14:47', '2022-08-31 14:14:47', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '18'),
(274, NULL, 12, 0, NULL, NULL, 'Powerology Smart Refrigerator for Travel 20 Liter', '347', 'ثلاجة ذكية للرحلات حجم 20 لتر من Powerology', NULL, 'uploads/products/686669_23023020.jpg', NULL, NULL, '', '1400', '1189.15', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable refrigerator with a digital display suitable for road trips or personal use from Powerology.</p>\r\n\r\n<p>It is characterized by the ability to control it through mobile application or by touch through the control button.</p>\r\n\r\n<p>Cooling level: from 20 degrees Celsius to -20 degrees Celsius.</p>\r\n\r\n<p>1 USB port for charging phones etc.</p>\r\n\r\n<p>Charging port: It can be charged through the car lighter port or the wall charger.</p>\r\n\r\n<p>Battery capacity: 15,600mAh.</p>\r\n\r\n<p>Control Application: Tuya Smart.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ثلاجة متنقلة مع شاشة رقمية مناسبة للرحلات البرية او الاستخدام الشخصي من Powerology.</p>\r\n\r\n<p>تتميز بالقدرة على التحكم بها من خلال الهاتف عبر التطبيق الخاص او باللمس من خلال ازرة التحكم.</p>\r\n\r\n<p>مستوى التبريد: من 20 درجة مئوية الى 20- درجة مئوية.</p>\r\n\r\n<p>تحتوي على منفذ يو اس بي لشحن الهواتف وغيرها.</p>\r\n\r\n<p>مدخل الشحن: يمكن شحنها من خلال منفذ ولاعة السيارة او البلك المنزلي.</p>\r\n\r\n<p>سعة البطارية: 15,600 مللي امبير.</p>\r\n\r\n<p>تطبيق التحكم: Tuya Smart.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=VSCwIFQtBoQ&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 17:16:19', '2022-08-31 14:16:19', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '32'),
(275, NULL, 12, 0, NULL, NULL, 'Powerology Smart Refrigerator for Travel 45 Liter - Gray', '346', 'ثلاجة ذكية للرحلات حجم 45 لتر من Powerology', NULL, 'uploads/products/605056_1_1_1-600x600_copy.jpg', NULL, NULL, '', '1900', '1614.15', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable refrigerator with a digital display suitable for road trips or personal use from Powerology.</p>\r\n\r\n<p>It is characterized by the ability to control it through mobile application or by touch through the control button.</p>\r\n\r\n<p>Cooling level: from 20 degrees Celsius to -20 degrees Celsius.</p>\r\n\r\n<p>1 USB port for charging phones etc.</p>\r\n\r\n<p>Charging port: It can be charged through the car lighter port or the wall charger.</p>\r\n\r\n<p>Battery capacity: 15,600mAh.</p>\r\n\r\n<p>Control Application: Tuya Smart.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ثلاجة متنقلة مع شاشة رقمية مناسبة للرحلات البرية او الاستخدام الشخصي من Powerology.</p>\r\n\r\n<p>تتميز بالقدرة على التحكم بها من خلال الهاتف عبر التطبيق الخاص او باللمس من خلال ازرة التحكم.</p>\r\n\r\n<p>مستوى التبريد: من 20 درجة مئوية الى 20- درجة مئوية.</p>\r\n\r\n<p>تحتوي على منفذ يو اس بي لشحن الهواتف وغيرها.</p>\r\n\r\n<p>مدخل الشحن: يمكن شحنها من خلال منفذ ولاعة السيارة او البلك المنزلي.</p>\r\n\r\n<p>سعة البطارية: 15,600 مللي امبير.</p>\r\n\r\n<p>تطبيق التحكم: Tuya Smart.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=VSCwIFQtBoQ&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 17:17:56', '2022-08-31 14:17:56', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '32'),
(276, NULL, 15, 9, NULL, NULL, 'Anker 25,600mAh Laptop Charging Power Bank 4 Ports', '348', 'باوربانك بسعة 25,600 مللي امبير ذو 4 مخارج لأجهزة اللابتوب من Anker', NULL, 'uploads/products/636749_828391ujfdew.jpg', NULL, NULL, '', '460', '431.10', '1', '<p>Product Details:</p>\r\n\r\n<p>The latest versions of Anker power bank with two outputs PD technology with a power of 87W and two USB outputs with IQ technology for fast charging with a capacity of 25600 mAh.</p>\r\n\r\n<p>It is characterized by its ability to charge all types of laptops in just two hours, a full charge.</p>\r\n\r\n<p>Charges 4 devices at the same time at high speed.</p>\r\n\r\n<p>Two USB-C PD outputs.</p>\r\n\r\n<p>Two USB outputs IQ charging with a power of 18 W.</p>\r\n\r\n<p>Input: Type C.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>احدث اصدارات باوربانك Anker ذو مخرجين بتقنية PD بقوة 87 واط ومخرجين يو اس بي يتقنية IQ للشحن السريع بسعة 25600 مللي امبير.</p>\r\n\r\n<p>يتميز بقدرته على شحن جميع انواع اجهزة اللابتوب خلال ساعتين فقط شحن كامل.</p>\r\n\r\n<p>يشحن 4 اجهزة بنفس الوقت بسرعة عالية.</p>\r\n\r\n<p>مدخلين تايب سي بتقنية PD.</p>\r\n\r\n<p>مدخلين يو اس بي بتقنية IQ بقوة 18 واط.</p>\r\n\r\n<p>مدخل شحن الباوربانك تايب سي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=BQ-zQ5CXnHE&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 17:19:22', '2022-08-31 14:19:22', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '11'),
(277, NULL, 5, 0, NULL, NULL, 'Anker 3 in 1 Digital Clock', '351', 'ساعة 3 في 1 مع شاشة رقمية من Anker', NULL, 'uploads/products/574586_61uItS3pFFL__AC_SL1500_.jpg', NULL, NULL, '', '400', '287.28', '1', '<p>Product Details:</p>\r\n\r\n<p>Bluetooth digital clock with 2 USB port for fast charging in addition to a 10W wireless charger from Anker.</p>\r\n\r\n<p>The alarm can be set and controlled through the phone.</p>\r\n\r\n<p>It features a digital LED screen, alarm clock, and speaker to play music, in addition to the ability to play radio channels.</p>\r\n\r\n<p>It has a special sleep mode, as soon as you turn it on, it plays quiet sounds to sleep.</p>\r\n\r\n<p>Modern and distinctive design suitable for bedrooms or offices.</p>\r\n\r\n<p>Control Application: SoundCore.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ساعة رقمية بلوتوث مع منفذين يو اس بي للشحن السريع بالإضافة الى شاحن لاسلكي بقوة 10 واط من شركة Anker.</p>\r\n\r\n<p>يمكن ضبط المنبة والتحكم بها من خلال الهاتف.</p>\r\n\r\n<p>مكبر صوت لتشغيل الموسيقى بالإضافة الى القدرة على تشغيل قنوات الراديو.</p>\r\n\r\n<p>يوجد بها وضع خاص للنوم بمجرد تشغيلة تقوم بتشغيل اصوات هادئة للنوم.</p>\r\n\r\n<p>تصميم عصري ومميز مناسبة لغرف النوم او حتى المكاتب.</p>\r\n\r\n<p>تطبيق التحكم: SoundCore</p>\r\n', NULL, 'https://www.youtube.com/watch?v=cH7cg_WZs0I&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 17:20:45', '2022-08-31 14:20:45', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(278, NULL, 15, 11, NULL, NULL, 'Anker 48W Dual Port Type C Car Charger', '350', 'شاحن سريع ذو مدخلين تايب سي بقوة 48 واط للسيارة من Anker', NULL, 'uploads/products/314100_61kY2MStGVL__AC_SL1500_.jpg', NULL, NULL, '', '130', '92.88', '1', '<p>Product Details:</p>\r\n\r\n<p>Anker 48W Dual Port Fast Charging Type C Car Charger.</p>\r\n\r\n<p>Fast charging all types of phones, tablets and laptops.</p>\r\n\r\n<p>Safe usage with all-round protection, equipped with built-in protections against overheating, overcharging, and short-circuit to safeguard the charging process.</p>\r\n\r\n<p>Input: Type C.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن سريع&nbsp; بقوة 48 واط ذو مدخلين تايب سي من شركة Anker.</p>\r\n\r\n<p>يشحن جميع أنواع الهواتف والأجهزة اللوحية وايضاً أجهزة اللابتوب شحن سريع.</p>\r\n\r\n<p>استخدام آمن مع حماية شاملة مزود بوسائل حماية مدمجة ضد ارتفاع درجة الحرارة والشحن الزائد.</p>\r\n\r\n<p>نوع المدخل: تايب سي.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-31 17:26:14', '2022-08-31 14:26:14', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(279, NULL, 5, 0, NULL, NULL, 'Eufy S11 Go By Anker Cordless Vacuum Cleaner', '349', 'مكنسة لاسلكية يوڤي S11 من Anker', NULL, 'uploads/products/229523_xddda.jpg', NULL, NULL, '', '850', '611.28', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable, rechargeable, cordless vacuum cleaner from Anker.</p>\r\n\r\n<p>It has a high dirt pulling force and can be used to clean the house comfortably as it does not have any cord to operate.</p>\r\n\r\n<p>Contains additional tools and equipment for different cleaning modes.</p>\r\n\r\n<p>Cleans all kind of hard floors and carpets.</p>\r\n\r\n<p>Excellent battery that works for 40 minutes continuously.</p>\r\n\r\n<p>Suction power up to 20,000 Pa.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مكنسة متنقلة قابلة للشحن تعمل من غير اسلاك من شركة Anker.</p>\r\n\r\n<p>تتميز بقوة سحب عالية للأوساخ ويمكن استخدامها لتنظيف المنزل بشكل مريح حيث انها لا تحتوي على اي سلك للتشغيل.</p>\r\n\r\n<p>تحتوي على أدوات ومعدات إضافية لأوضاع مختلفة للتنظيف.</p>\r\n\r\n<p>تنظيف جميع أنواع الأرضيات الصلبة والسجاد.</p>\r\n\r\n<p>بطارية ممتازة تعمل لمدة 40 دقيقة متواصله.</p>\r\n\r\n<p>قوة الشفط تصل الى 20,000 باكسال.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-31 17:28:47', '2022-08-31 14:28:47', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(280, NULL, 6, 0, NULL, NULL, 'Govee Bluetooth TV Backlight 2 Meter', '355', 'شريط اضاءة ذكي بلوتوث للشاشات 2 متر من Govee', NULL, 'uploads/products/81zQdzmpOEL__AC_SL1500_.jpg', NULL, NULL, '', '150', '76.24', '1', '<p>Product Details:</p>\r\n\r\n<p>Voice &amp; App control smart led strip lights from Govee (2 meters) length for TV.</p>\r\n\r\n<p>Timer Function: Set a timer for your smart led schedule automatically switches on/off via your phone.</p>\r\n\r\n<p>It is also characterized by ease of installation and saves on electricity consumption.</p>\r\n\r\n<p>USB cable connection designed for TV so you don&rsquo;t need to worry about the extra sockets.</p>\r\n\r\n<p>Diy Colors: Color changing strip lights has 16 million colors with brightness and saturation adjustable.</p>\r\n\r\n<p>Output: USB.</p>\r\n\r\n<p>Control App: Govee.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شريط الاضاءة الذكي من Govee للشاشات يتميز بسهولة التحكم في شريط الإضاءة عن طريق هاتفك بتقنية البلوتوث.</p>\r\n\r\n<p>المؤقت والجدول الزمني: يمكن القيام بجدولة تشغيل / إيقاف تشغيل, الأضواء الذكية تلقائيًا عبر هاتفك.</p>\r\n\r\n<p>كما يتميز بسهولة التركيب ويوفر من استهلاك الكهرباء.</p>\r\n\r\n<p>مصمم خصيصاً للشاشات ويأتي مع سلك يو اس بي من غير شاحن.</p>\r\n\r\n<p>التحكم في مستوى قوة الإضاءة من 1٪ إلى 100٪.</p>\r\n\r\n<p>مخرج: يو اس بي.</p>\r\n\r\n<p>اسم التطبيق: Govee.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=FH-fVrIaDNc&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 17:30:37', '2022-08-31 14:30:37', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '19'),
(281, NULL, 6, 0, NULL, NULL, 'Govee Smart Mini Hygrometer Thermometer', '354', 'جهاز ذكي بلوتوث لقياس درجة الحرارة والرطوبة من Govee', NULL, 'uploads/products/651314_61kcEz7ArBL__SL1500_.jpg', NULL, NULL, '', '150', '90.24', '1', '<p>Product Details:</p>\r\n\r\n<p>A device equipped with a smart chip to check the ambient temperature and humidity in the place and can be controlled by phone.</p>\r\n\r\n<p>It is characterized by accurate measurement of temperature and humidity in the place where it is located.</p>\r\n\r\n<p>It supports Bluetooth and can be controlled by phone from a distance of up to 80 meters (without barriers).</p>\r\n\r\n<p>It works by batteries and does not require charging.</p>\r\n\r\n<p>Control Application: Govee.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز مزود بشريحة ذكية لفحص درجة حرارة الجو والرطوبة المحيطة في المكان ويمكن التحكم به عن طريق الهاتف.</p>\r\n\r\n<p>يتميز بقياسة الدقيق للحرارة والرطوبة في المكان المتواجد فيه.</p>\r\n\r\n<p>يدعم البلوتوث ويمكن التحكم به عن طريق الهاتف من مسافة تصل الى 80 متر (بدون جواجز).</p>\r\n\r\n<p>يعمل عن طريق البطارية ولا يحتاج الى شحن.</p>\r\n\r\n<p>تطبيق التحكم: Govee.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-31 17:34:34', '2022-08-31 14:34:34', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '19'),
(282, NULL, 6, 0, NULL, NULL, 'Govee Aura Wi-Fi Smart Table Lamp', '352', 'أباجورة ذكية واي-فاي من Govee', NULL, 'uploads/products/997233_61-pio80bL__AC_SL1500_.jpg', NULL, NULL, '', '350', '281.95', '1', '<p>Product Details:</p>\r\n\r\n<p>Govee Wi-Fi smart lamp can be controlled via the phone or its built-in control button.</p>\r\n\r\n<p>The smart lamp can be automatically scheduled to turn on / off via your phone as an alarm to wake up from sleep.</p>\r\n\r\n<p>Multiple types of different mods for lights.</p>\r\n\r\n<p>It is also characterized by ease of installation and saves on electricity consumption.</p>\r\n\r\n<p>Brightness control from 1% to 100%.</p>\r\n\r\n<p>Support Alexa &amp; Google Assistant.</p>\r\n\r\n<p>Control Application: Govee.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>أباجورة ذكية واي-فاي من Govee يمكن التحكم بها عن طريق الهاتف او ازرة التحكم المدمجة بها.</p>\r\n\r\n<p>يمكن القيام بجدولة تشغيل / إيقاف تشغيل الأباجورة الذكية تلقائيًا عبر هاتفك كمنبة للاستيقاظ من النوم.</p>\r\n\r\n<p>أنواع متعددة من المودات المختلفة للأنوار.</p>\r\n\r\n<p>كما تتميز بسهولة التركيب وتوفر من استهلاك الكهرباء.</p>\r\n\r\n<p>يمكن التحكم في مستوى قوة الإضاءة من 1٪ إلى 100٪.</p>\r\n\r\n<p>تدعم الأوامر الصوتية من اجهزة اليكسا وقوقل اسستنس الصوتية.</p>\r\n\r\n<p>تطبيق التحكم: Govee.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=fwNXYb62U4A&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 17:36:05', '2022-08-31 14:36:05', NULL, 1, NULL, NULL, 3, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(283, NULL, 7, 0, NULL, NULL, 'Anker Flare 2 Portable Wireless Speaker', '356', 'مكبر صوت لاسكلي محمول Flare 2 من Anker', NULL, 'uploads/products/169057_719yi_dzm3l__ac_sl1500__1_2-1_copy.jpg', NULL, NULL, '', '349', '214.72', '1', '<p>Product Details:</p>\r\n\r\n<p>Anker Flare 2 Series 20W Waterproof Portable Wireless Speaker.</p>\r\n\r\n<p>Broadcast Mode to Sync Sound Across 100+ Speakers.</p>\r\n\r\n<p>Designed in a distinctive cylindrical shape with LED lighting.</p>\r\n\r\n<p>Up to 12 hours of Playtime.</p>\r\n\r\n<p>Battery: 5200mAh.</p>\r\n\r\n<p>Control Application: Soundcore.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مكبر صوت Flare 2 سيريس لاسلكي محمول مقاوم للماء بقوة 20 واط من شركة Anker.</p>\r\n\r\n<p>يمكن اقتران 100 مكبر صوت من نفس المنتج في وقت واحد.</p>\r\n\r\n<p>مصممة بشكل اسطواني مميز مع اضاءة ال أي دي.</p>\r\n\r\n<p>تعمل لمدة 12 ساعة باشتغال متواصل.</p>\r\n\r\n<p>قوة البطارية: 5200 مللي امبير.</p>\r\n\r\n<p>تطبيق التحكم: Soundcore</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-31 17:43:51', '2022-08-31 14:43:51', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
