(299, NULL, 10, 0, NULL, NULL, 'UNIQ Hybrid iPhone 13 Pro Heldro Mount Series - Matte Clear', '20002', 'كڤر مع مسكة ومغناطيس مدمج للايفون 13 برو من UNIQ - شفاف مطفي', NULL, 'uploads/products/dsd83m3dxc.jpg', NULL, NULL, '', '70', '65', '1', '<p>Product Details:</p>\r\n\r\n<p>UNIQ Heldro Series case to protect the mobile with a grip and a built-in magnet for Apple phones.</p>\r\n\r\n<p>Excellent protects the phone in addition to the screen from scratches or drops.</p>\r\n\r\n<p>It is characterized by the presence of a grip at the back that also gives more protection and makes it easier to carry the phone.</p>\r\n\r\n<p>It has a built-in magnet and is suitable for any type of magnetic car mounts and others.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كڤر Heldro سيريس لحماية الجوال مع مسكة ومغناطيس مدمج لهواتف ابل من شركة UNIQ.</p>\r\n\r\n<p>يحمي الهاتف بشكل ممتاز بالإضافة الى الشاشة من الخدوش او السقطات.</p>\r\n\r\n<p>يتميز بوجود مسكة في الخلف ايضاً تعطي حماية اكثر وتسهل حمل الهاتف.</p>\r\n\r\n<p>فيه مغناطيس مدمج ومناسب لاي نوع من الستاندات المغناطيسية للسيارة وغيرها.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=x87JO1huYg0&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '0', NULL, NULL, '1', '2022-08-31 18:34:14', '2022-08-31 15:34:14', NULL, NULL, NULL, NULL, 6, 0, 'QAR', 'ر.ق', '1', '0', 'Normal', '1', NULL, '45'),
