(306, NULL, 5, 0, NULL, NULL, 'Rako 3 in 1 Coffee Machine - Black', '20004', 'مكينة تحضير القهوة 3 في 1 من Rako - اسود', NULL, 'uploads/products/453222_qsasa2312.jpg', NULL, NULL, '', '450', '360', '1', '<p>Product Details:</p>\r\n\r\n<p>Multifunctional coffee maker from Rako.</p>\r\n\r\n<p>It is characterized by preparing coffee types from ready-made capsules or regular coffee powder.</p>\r\n\r\n<p>Compatible with Nespresso and Dolce Gusto capsules.</p>\r\n\r\n<p>Water tank capacity: 1 liter.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مكينة تحضير القهوة متعددة الاستخدام من شركة Rako.</p>\r\n\r\n<p>تتميز بأنها تحضر انواع القهوة من الكبسولات الجاهزة او مسحوق القهوة العادي.</p>\r\n\r\n<p>متوافقة مع كبسولات نسبرسو و دولتشي غوستو.</p>\r\n\r\n<p>سعة خزان الماء: 1 لتر.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=QHgQvHk7wb8&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 18:44:16', '2022-08-31 15:44:16', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '34'),
