(309, NULL, 10, 13, NULL, NULL, 'uGreen Car Trunk Organizer Bag 55L', '20005', 'حقيبة للرحلات حجم 55 لتر من uGreen', NULL, 'uploads/products/111157_dee232d.jpg', NULL, NULL, '', '200', '110', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable foldable bag suitable for road trips or personal use from uGreen.</p>\r\n\r\n<p>It is characterized by its high quality and small size, made of nylon and aluminum alloy bases.</p>\r\n\r\n<p>It can be folded when finished, so it does not take up space in the trunk of the car.</p>\r\n\r\n<p>It has removable partitioned to organize items.</p>\r\n\r\n<p>Capacity: 55L.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>حقيبة متنقلة قابلة للطي مناسبة للرحلات البرية او الاستخدام الشخصي من uGreen.</p>\r\n\r\n<p>تتميز بجودتها العالية وحجمها الصغير مصنوعة من النايلون وقواعدها من الالمنيوم المقوى.</p>\r\n\r\n<p>يمكن طيّها عند الانتهاء منها وبذلك لا تأخذ مساحة من صندوق السيارة.</p>\r\n\r\n<p>يوجد فيها حواجز داخلية قابلة للتحريك لتنظيم الاغراض.</p>\r\n\r\n<p>سعة التخزين: 55 لتر.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=M0owCeCiEyo&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 18:54:28', '2022-08-31 15:54:28', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '46'),
(310, NULL, 5, 0, NULL, NULL, 'Portable Bukhoor Burner Large Size - Black', '357', 'مبخرة إلكترونية متنقلة الحجم الكبير - اسود', NULL, 'uploads/products/141710_sd23sd5w1.jpg', NULL, NULL, '', '250', '124.21', '1', '<p>Product Details:</p>\r\n\r\n<p>Newest design of portable bukhoor burner.</p>\r\n\r\n<p>Suitable for cars, travel or offices at work and even at home.</p>\r\n\r\n<p>It works by charging and does not need batteries.</p>\r\n\r\n<p>New slim and distinctive shape.</p>\r\n\r\n<p>Input: Type-C charging port.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>احدث اصدارات المبخرة الإلكترونية المتنقلة.</p>\r\n\r\n<p>مناسبة للسيارات او السفر او المكاتب في العمل وحتى المنزل.</p>\r\n\r\n<p>قابلة للشحن ولا تحتاج الى بطاريات.</p>\r\n\r\n<p>شكل جديد نحيفه ومميزة.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-31 18:56:01', '2022-08-31 15:56:01', NULL, NULL, NULL, NULL, 6, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(311, NULL, 10, 0, NULL, NULL, 'ShellBox Waterproof Diving Case', '362', 'كڤر للهواتف ضد الماء من ShellBox', NULL, 'uploads/products/373145_H6bfbbd856f2f43b2a7d7decac803f6b45.jpg', NULL, NULL, '', '169', '99.92', '1', '<p>Product Details:</p>\r\n\r\n<p>Case for phones for diving into the depths, waterproof and withstands up to 15M from ShellBox.</p>\r\n\r\n<p>It protects the phone perfectly, in addition to the fact that the phone can be used underwater for photography and more.</p>\r\n\r\n<p>It is the ideal solution for summer and cruises.</p>\r\n\r\n<p>Suitable for all kinds of Apple phones from iPhone 6 to iPhone 13, as well as Samsung phones from S6 to S10, in addition to Samsung Note 8 to 10+.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كڤر للهواتف لمحبين الغطس في الاعماق ضد الماء ويتحمل لحد 15 متر من شركة ShellBox.</p>\r\n\r\n<p>يحمي الهاتف بشكل ممتاز بالإضافة الى انه يمكن استخدام الهاتف تحت الماء للتصوير وغيره.</p>\r\n\r\n<p>يعتبر الحل الامثل للصيف والرحلات البحرية.</p>\r\n\r\n<p>مناسب لهواتف ابل من ايفون 6 الى ايفون 13 بجميع انوعه وايضاً هواتف سامسونج من اس 6 الى اس 10 بالإضافة الى سامسونج نوت من 8 الى 10+.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=snlA-JLBzys&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 18:58:26', '2022-08-31 15:58:26', NULL, 1, NULL, NULL, 3, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(312, NULL, 8, 0, NULL, NULL, 'Tiktok RGB Light', '366', 'ستاند اضاءة Tiktok', NULL, 'uploads/products/747540_0909.jpg', NULL, NULL, '', '129', '87.36', '1', '<p>Product Details:</p>\r\n\r\n<p>RGB lighting with a modern and distinctive shape, suitable for table decoration.</p>\r\n\r\n<p>It contains a wide range of different colors and also supports music sync.</p>\r\n\r\n<p>It can be controlled by mobile phone or via the wireless remote control.</p>\r\n\r\n<p>It works by electricity and does not need charging or batteries.</p>\r\n\r\n<p>Output: USB.</p>\r\n\r\n<p>Control Application: LED LAMP.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>إضاءة RGB ذات شكل عصري ومميز ومناسبه ديكور للطاولة.</p>\r\n\r\n<p>تحتوي على مجموعة واسعة من الالوان المختلفة وايضاً تدعم نظام التفاعل مع الاصوات المحيطة.</p>\r\n\r\n<p>يمكن التحكم بها عن طريق الهاتف او عن طريق جهاز التحكم اللاسلكي.</p>\r\n\r\n<p>تعمل عن طريق الكهرباء ولا تحتاج الى شحن او بطاريات.</p>\r\n\r\n<p>مخرج التشغيل يو اس بي.</p>\r\n\r\n<p>تطبيق التحكم: LED LAMP.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Fu7jVmncn2U&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 18:59:57', '2022-08-31 15:59:57', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL),
(546, NULL, 10, 0, NULL, NULL, 'MOFT Snap-On MagSafe Phone Stand – Windy Blue', '20009', 'ستاند ومحفظة للجوال MagSafe من موفت – ازرق وندي', NULL, 'uploads/products/screen_shot_2022-03-27_at_12_04_31_am_copy1.jpg', NULL, NULL, '', '109', '65', '1', '<p>Product Details:</p>\r\n\r\n<p>Grip, Stand and Wallet from Moft, supports MagSafe technology.</p>\r\n\r\n<p>Suitable for all Apple 12 phones via magnet ( MagSafe ) without need for any adhesive.</p>\r\n\r\n<p>It can be used as a base in length or width at an angle of 60 degrees, as desired and enjoy watching Movies or Youtube.</p>\r\n\r\n<p>It features magnets to attach it to any magnetic bases in the car.</p>\r\n\r\n<p>It has a wallet for cards, and a maximum of 3 cards can be placed.</p>\r\n\r\n<p>Small in size, suitable and does not increase the thickness of the phone.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مسكة وستاند ومحفظة من شركة موفت والتي تدعم تقنية MagSafe.</p>\r\n\r\n<p>مناسبة لجميع هواتف ابل 12 عن طريق المغناطيس ( MagSafe ) دون الحاجة الى أي لاصق.</p>\r\n\r\n<p>يمكن استخدامها كقاعدة بالطول او العرض بزاوية 60 درجة على حسب الرغبة لمشاهدة الأفلام او اليوتيوب.</p>\r\n\r\n<p>تتميز بوجود مغناطيس لتثبيتها بقواعد مغناطيسية في السيارة وغيرها.</p>\r\n\r\n<p>يوجد فيها محفظة للبطاقات ويمكن وضع 3 بطاقات كحد اقصى.</p>\r\n\r\n<p>صغيرة الحجم ومناسبة ولا تزيد من سماكة الهاتف.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-10-28 16:19:54', '2022-10-28 13:19:54', NULL, NULL, NULL, NULL, 5, 3, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '29'),
(313, NULL, 5, 0, NULL, NULL, 'Deerma 4 in 1 Mite & Dust Removal', '370', 'مكنسة كهربائية للفرش 4 في 1 لإزالة الغبار والعث من Deerma', NULL, 'uploads/products/874569_H30793e3d4a4a4e0ebafb4ba6e2f265cc3.jpg', NULL, NULL, '', '249', '131.68', '1', '<p>Product Details:</p>\r\n\r\n<p>This compact and lightweight vacuum cleaner is the ideal tool for cleaning brushes in four different ways from DEERMA.</p>\r\n\r\n<p>Equipped with a strong suction feature, a beating tool, and UV for sterilization, in addition to heating, to clean all kinds of dirt, such as food crumbs, dust, mites in brushes, and more.</p>\r\n\r\n<p>Suitable for mattresses, chairs, and even the bed, as it beat the place from the front with heat to raise mites and dust, then suctions and sterilizes it at the end.</p>\r\n\r\n<p>The internal filter of the vacuum cleaner can be washed and reused.</p>\r\n\r\n<p>It is characterized by ease of use and high suction power of up to 13kPa.</p>\r\n\r\n<p>The power of the beats is up to 8000 high frequency per minute.</p>\r\n\r\n<p>It works by electricity and does not need charging or batteries.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>تعتبر هذه المكنسة المدمجة وخفيفة الوزن أداة مثالية لتنظيف الفرش بأربع طرق مختلفة من DEERMA.</p>\r\n\r\n<p>مزودة بميزة الشفط القوي واداة الضرب واشعة فوق البنفسجية للتعقيم بالإضافة الى التسخين لتنظيف جميع أنواع الأوساخ كفتات الطعام والغبار والعث في الفرش وغيرها.</p>\r\n\r\n<p>مناسبة للفرش او الكراسي وحتى السرير حيث انها تقوم بضرب المكان في الامام مع الحرارة لرفع العث والغبار ثم شفطة وتعقيمة في النهاية عن طريق الاشعة فوق البنفسجية.</p>\r\n\r\n<p>يمكن غسيل الفلتر الداخلي للمكنسة واعادة استخدامه مرة اخرى.</p>\r\n\r\n<p>تتميز بسهولة الاستخدام وقوة شفط عالية تصل الى 13,000 باسكال.</p>\r\n\r\n<p>قوة اداة الضرب تصل الى 8000 عالية التردد في الدقيقة.</p>\r\n\r\n<p>تعمل عن طريق الكهرباء ولا تحتاج الى شحن او بطاريات.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=aqsWTPfDCvI&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 19:01:39', '2022-08-31 16:01:39', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(314, NULL, 10, 0, NULL, NULL, 'Budi Phone Multi-Functional Box With Wireless Charger', '365', 'صندوق اكسسوارات الهاتف متعدد الاستخدام مع شاحن لاسلكي من Budi', NULL, 'uploads/products/796964_H7bede4ac0f624719bb78c6e4f7fb3763Q-600x600.jpg', NULL, NULL, '', '169', '95.91', '1', '<p>Product Details:</p>\r\n\r\n<p>Storage box that contains everything you need from phone connections, as well as a TF card reader from Budi.</p>\r\n\r\n<p>It features the includes Type C cable &amp; Lightning + Micro + USB connections, and it can also be used as a stand with 5W wireless charging.</p>\r\n\r\n<p>Through the product, it can be used as a hub to upload data from any phone that supports the mentioned ports.</p>\r\n\r\n<p>It has ambient LED lighting for useful illumination in dark places.</p>\r\n\r\n<p>Note:</p>\r\n\r\n<p>The box contains (SIM decoder for iPhone + Type C cable + Lightning to Type C connector + Micro to Type C connector + USB to Type C connector)</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>صندوق تخزين يوجد به كل ماتحتاجه من وصلات للهواتف وايضاً قارئ لشريحة الميموري TF كارد من شركة Budi.</p>\r\n\r\n<p>يتميز بوجود واير تايب سي ووصلات لايتننغ + مايكرو + يو اس بي وايضاً يمكن استخدامة كستاند مع شحن لاسلكي بقوة 5 واط.</p>\r\n\r\n<p>يمكن من خلال المنتج ان يتم استخدامة كوصلة لرفع البيانات من اي هاتف يدعم المنافذ المذكورة.</p>\r\n\r\n<p>يوجد به إضاءة ال اي دي محيطة للإنارة مفيدة في الاماكن المظلمة.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>الصندوق يحتوي على ( قطعة فك الشريحة للأيفون + واير تايب سي&nbsp; + وصلة لايتننغ الى تايب سي&nbsp; + وصلة مايكرو الى تايب سي + وصلة يو اس بي الى تايب سي )</p>\r\n', NULL, 'https://www.youtube.com/watch?v=VlLimoKmEus&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 19:06:05', '2022-08-31 16:06:05', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '52'),
(315, NULL, 8, 0, NULL, NULL, 'Rechargeable Electric Air Duster', '360', 'منفضة هواء كهربائية قابلة للشحن', NULL, 'uploads/products/H9ee93c2234ac48ca9614e593d30630a7B.jpg', NULL, NULL, '', '210', '126.18', '1', '<p>Product Details:</p>\r\n\r\n<p>68W Air duster with extra parts for tough places.</p>\r\n\r\n<p>Suitable for cleaning cars, computers, etc.</p>\r\n\r\n<p>It is characterized by its power of up to 51,000 RPM in addition to its small size.</p>\r\n\r\n<p>3 modes of air force weak, medium and strong so that you can control the air force of fine objects.</p>\r\n\r\n<p>Type C input, its takes 3 to 4 hours to fully charge, and it works for 30 minutes continuously when fully charged.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>منفضة هواء بقوة 68 واط مع قطع إضافية للأماكن الصعبة.</p>\r\n\r\n<p>مناسبة لتنظيف السيارات او اجهزة الكمبيوتر وغيرها.</p>\r\n\r\n<p>تتميز بقوتها التي تصل الى 51,000 دورة في الدقيقة بالإضافة الى حجمها الصغير.</p>\r\n\r\n<p>3 اوضاع لقوة الهواء ضعيف, وسط, قوي وذلك حتى تتمكن من التحكم بقوة الهواء للأشياء الدقيقة.</p>\r\n\r\n<p>مدخل الشحن تايب سي وتستغرف مدة الشحن من 3 الى 4 ساعات وتعمل لمدة 30 دقيقة متواصلة عند شحنها بالكامل.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=4Acgy6hK0iA&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 19:10:03', '2022-08-31 16:10:03', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, NULL),
(316, NULL, 8, 0, NULL, NULL, 'Onikuma RGB Gaming Headphone Stand', '369', 'ستاند مع إضاءة لسماعات الرأس من Onikuma', NULL, 'uploads/products/763886_Hab818e299a4d4f2dbe6da6926b777887r.jpg', NULL, NULL, '', '150', '80.21', '1', '<p>Product Details:</p>\r\n\r\n<p>Stand for gaming headphones with additional inputs from ONIKUMA.</p>\r\n\r\n<p>It is made of high quality materials and modernly designed with RGB lighting to give a beautiful decoration on the table.</p>\r\n\r\n<p>It features 3 additional USB ports for charging devices, as well as an AUX port for headphones.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ستاند لاصحاب الجيمنغ لسماعات الرأس مع مداخل إضافية من شركة ONIKUMA.</p>\r\n\r\n<p>مصنوع من مواد عالية الجودة ومصمم بشكل عصري مع إضاءة RGB ليعطي ديكور جميل على الطاولة.</p>\r\n\r\n<p>يتميز بوجود 3 مداخل يو اس بي إضافية لشحن الأجهزة وايضاً مدخل AUX للسماعات.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=eE8MzWjlZQQ&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 19:13:32', '2022-08-31 16:13:32', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(317, NULL, 10, 0, NULL, NULL, 'Screen Cleaner With Microfiber', '361', 'منظف للشاشات مع طبقة ماكيرو فايبر', NULL, 'uploads/products/211905_Hefd68372c02f4983a0862b8b03a321487.jpg', NULL, NULL, '', '99', '39.69', '1', '<p>Product Details:</p>\r\n\r\n<p>Small size screen cleaner.</p>\r\n\r\n<p>Portable &amp; small in size can be carried outside home.</p>\r\n\r\n<p>Coated with a layer of microfiber and is considered the best for cleaning screens.</p>\r\n\r\n<p>Suitable for phones and tablets, as well as computer screens.</p>\r\n\r\n<p>Easy to use, just put alcohol or water inside it and spray a little of it on the screen and wipe it with the same product.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>منظف للشاشات صغير الحجم.</p>\r\n\r\n<p>حجمة صغير ويمكن حمله خارج المنزل.</p>\r\n\r\n<p>مغلف بطبقة من المايكرو فايبر وتعتبر الافضل لتنظيف الشاشات.</p>\r\n\r\n<p>مناسب للهواتف وأجهزة التابليت وايضاً شاشات الكمبيوتر.</p>\r\n\r\n<p>سهل الاستخدام فقط يتم وضع الكحول او الماء بداخله ورش القليل منه على الشاشة ومسحها بنفس المنتج.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=utNBTzr6z1M&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 19:15:12', '2022-08-31 16:15:12', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(318, NULL, 5, 0, NULL, NULL, 'Cup Warmer With Wireless Charging', '368', 'جهاز تسخين المشروبات مع شاحن لاسلكي', NULL, 'uploads/products/300370_Hf3abcff3058f41cea2a89af930e0b49dj.jpg', NULL, NULL, '', '250', '100.25', '1', '<p>Product Details:</p>\r\n\r\n<p>A device that heats any type of drink by heating the cup itself, as well as a wireless charger for phones.</p>\r\n\r\n<p>It is characterized by its ability to keep the drink warm and its temperature does not drop below 55 degrees.</p>\r\n\r\n<p>Can be used as a wireless charger with a power of 15W fast charging.</p>\r\n\r\n<p>Suitable for home or office.</p>\r\n\r\n<p>An additional USB port that can charge any other device.</p>\r\n\r\n<p>Type C port to operate the device, and it comes with a wire and an wall charger.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز يسخن اي نوع من المشروبات عن طريق تسخين الكوب نفسه وايضاً شاحن لاسلكي للهواتف.</p>\r\n\r\n<p>يتميز بقدرته على ابقاء المشروب ساخناً ولا تنزل درجة حرارته اقل من 55 درجة مئوية.</p>\r\n\r\n<p>يمكن استخدانة كشاحن لاسلكي بقوة 15 واط شحن سريع.</p>\r\n\r\n<p>مناسب للمنزل او المكتب.</p>\r\n\r\n<p>مدخل يو اس بي اضافي يمكن شحن اي جهاز اخر.</p>\r\n\r\n<p>مدخل تايب سي لتشغيل الجهاز ويأتي معه واير وشاحن التشغيل.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-08-31 19:17:20', '2022-08-31 16:17:20', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(319, NULL, 12, 0, NULL, NULL, 'Measurements Ruler Device', '467', 'جهاز قياس الجسم الاوتوماتيكي', NULL, 'uploads/products/344043_H0f378521bc1b48a49758c624077aaf430.jpg', NULL, NULL, '', '89', '19.33', '1', '<p>Product Details:</p>\r\n\r\n<p>A device for measuring the body with the feature of automatic withdrawal suitable for men and women.</p>\r\n\r\n<p>The device makes it easy for you to measure operations. You just have to pull the scale and roll it on the place you want to measure then press the button.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز لقياس الجسم مع ميزة السحب الاوتماتيكي مناسب للرجال والنساء.</p>\r\n\r\n<p>يسهل عليك الجهاز عمليات القياس فقط عليك ان تقوم بسحب المقياس ولفه على المكان الذي ترغب بقياسه والضغط على الزر.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=OHlvWMSlLj4&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 19:18:44', '2022-08-31 16:18:44', NULL, NULL, NULL, NULL, 9, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(320, NULL, 12, 0, NULL, NULL, 'LED Magnifying Glass', '367', 'نظارة مع عدسات مكبرة وإضاءة', NULL, 'uploads/products/437285_H9c682c7199b04598bd5183f0eb2208b0Q.jpg', NULL, NULL, '', '120', '45.53', '1', '<p>Product Details:</p>\r\n\r\n<p>Glasses with LED lighting and magnifying lenses suitable for all sizes.</p>\r\n\r\n<p>It is characterized by the ability to control the light and also control the lenses as desired.</p>\r\n\r\n<p>Suitable for craftsmen and those who work in delicate things.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>نظارة مع إضاءة ال اي دي وعدسات مكبرة مناسبة لجميع المقاسات.</p>\r\n\r\n<p>تتميز بالقدرة على التحكم بالاضاءة وايضاً التحكم بالعدسات على حسب الرغبة.</p>\r\n\r\n<p>مناسب لاصحاب الحرف والذين يعملون في الاشياء الدقيقة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=z97Lj0vyp0A&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 19:19:56', '2022-08-31 16:19:56', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(321, NULL, 10, 0, NULL, NULL, 'MOFT Snap-On MagSafe Phone Stand – Light Blue', '20009', 'ستاند ومحفظة للجوال MagSafe من موفت – ازرق فاتح', NULL, 'uploads/products/Untitled-32.jpg', NULL, NULL, '', '109', '65', '1', '<p>Product Details:</p>\r\n\r\n<p>Grip, Stand and Wallet from Moft, supports MagSafe technology.</p>\r\n\r\n<p>Suitable for all Apple 12 phones via magnet ( MagSafe ) without need for any adhesive.</p>\r\n\r\n<p>It can be used as a base in length or width at an angle of 60 degrees, as desired and enjoy watching Movies or Youtube.</p>\r\n\r\n<p>It features magnets to attach it to any magnetic bases in the car.</p>\r\n\r\n<p>It has a wallet for cards, and a maximum of 3 cards can be placed.</p>\r\n\r\n<p>Small in size, suitable and does not increase the thickness of the phone.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مسكة وستاند ومحفظة من شركة موفت والتي تدعم تقنية MagSafe.</p>\r\n\r\n<p>مناسبة لجميع هواتف ابل 12 عن طريق المغناطيس ( MagSafe ) دون الحاجة الى أي لاصق.</p>\r\n\r\n<p>يمكن استخدامها كقاعدة بالطول او العرض بزاوية 60 درجة على حسب الرغبة لمشاهدة الأفلام او اليوتيوب.</p>\r\n\r\n<p>تتميز بوجود مغناطيس لتثبيتها بقواعد مغناطيسية في السيارة وغيرها.</p>\r\n\r\n<p>يوجد فيها محفظة للبطاقات ويمكن وضع 3 بطاقات كحد اقصى.</p>\r\n\r\n<p>صغيرة الحجم ومناسبة ولا تزيد من سماكة الهاتف.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=JgNyIMvivZ4&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-08-31 19:21:39', '2022-08-31 16:21:39', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '29'),
