(331, NULL, 6, 0, NULL, NULL, 'Eufy By Anker Smart Scale P1 - White', '372', 'ميزان ذكي ومقياس لكتلة الجسم P1 من Anker - ابيض', NULL, 'uploads/products/951967_adsadaksjd3.jpg', NULL, NULL, '', '200', '134.10', '1', '<p>Product Details:</p>\r\n\r\n<p>Smart scale (new version) with a digital screen for the body from Anker.</p>\r\n\r\n<p>It is characterized by its high accuracy of daily body sensing when used.</p>\r\n\r\n<p>Intelligent analysis system that allows you to - share it with your family members and can save the data of up to 16 people.</p>\r\n\r\n<p>It can be controlled by your phone so you can follow up your data.</p>\r\n\r\n<p>Control app: EufyLife</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ميزان ذكي ( الاصدار الجديد ) مع شاشة رقمية للجسم من شركة Anker.</p>\r\n\r\n<p>يتميز بدقته العالية لاستشعار الجسد يومياً عند استعمالة.</p>\r\n\r\n<p>نظام تحليل ذكي مما يتيح لك مشاركته مع افراد عائلتك ويمكنه حفظ بيانات ما يصل الى 16 شخص.</p>\r\n\r\n<p>يمكن التحكم به عن طريق هاتفك ومعرفة البيانات الخاصه بك.</p>\r\n\r\n<p>تطبيق التحكم: EufyLife</p>\r\n', NULL, 'https://www.youtube.com/watch?v=ykkq9YeapoE&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 10:25:56', '2022-09-01 07:25:56', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11');
