(332, NULL, 7, 0, NULL, NULL, 'Anker Soundcore R500 Wireless Headphone – Black', '484', 'سماعة لاسلكية R500 من Anker - اسود', NULL, 'uploads/products/110894_sakdjaskdjsc.jpg', NULL, NULL, '', '129', '77', '1', '<p>Product Details:</p>\r\n\r\n<p>Anker R500 Soundcore wireless high definition headphone.</p>\r\n\r\n<p>Small in size, suitable for sports and outdoor uses, and supports all types of phones.</p>\r\n\r\n<p>Battery Capacity: 195mAh, it works 20 hours continuously when fully charged.</p>\r\n\r\n<p>Input: Type C and charging time about 1 hour.</p>\r\n\r\n<p>IPX5 Water Resistant.</p>\r\n', '<p>مواصفات المنتج :</p>\r\n\r\n<p>سماعة R500 Soundcore لاسلكية عالية الوضوح من Anker.</p>\r\n\r\n<p>صغيرة الحجم ومناسبة للرياضة وللأستعمالات الخارجية وتدعم جميع انواع الهواتف.</p>\r\n\r\n<p>سعة البطارية: 195 مللي امبير وتعمل لمدة 20 ساعة عند شحنها بالكامل.</p>\r\n\r\n<p>مدخل الشحن: تايب سي ويستغرق شحنها حوالي ساعة.</p>\r\n\r\n<p>مقاومة للماء بمعيار IPX5.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 10:32:01', '2022-09-01 07:32:01', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(333, NULL, 5, 0, NULL, NULL, 'Smart Qur\'an Multi-Color Lamp', '375', 'أباجورة القرآن الكريم الذكية متعددة الألوان', NULL, 'uploads/products/588471_ded3kje28e2.jpg', NULL, NULL, '', '150', '109.65', '1', '<p>Product Details:</p>\r\n\r\n<p>Smart lamp with a speaker to read Qur&rsquo;an that works by touch, remote control or phone through its own application.</p>\r\n\r\n<p>It features 16 different voices and 16 additional languages ​​of Qur&#39;an.</p>\r\n\r\n<p>It can be charged and used without wire and does not require batteries.</p>\r\n\r\n<p>Lightweight and gives a sweet look for bedrooms and others.</p>\r\n\r\n<p>It has 7 different colors.</p>\r\n\r\n<p>It comes with a charging cable and wireless controller inside the box.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ابجورة ذكية مع مكبر صوت لقراءة القرآن الكريم تعمل عن طريق اللمس او جهاز التحكم او الهاتف من خلال الابلكيشن الخاص بها.</p>\r\n\r\n<p>تتميز بوجود 16 صوت مختلف و 16 لغة إضافية للقرآن الكريم.</p>\r\n\r\n<p>يمكن شحنها ويتم استعمالها بدون واير ولا تحتاج الى بطاريات.</p>\r\n\r\n<p>خفيفة فالوزن وتعطي منظر حلو لغرف النوم وغيرها.</p>\r\n\r\n<p>7 الوان من الاضاءة.</p>\r\n\r\n<p>يأتي معها واير الشحن وجهاز التحكم بداخل الصندوق.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=yAzWrTjbzM4&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 10:33:46', '2022-09-01 07:33:46', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(334, NULL, 15, 10, NULL, NULL, 'Zendure 30W 4-Port USB-C PD Wall Charger', '376', 'شاحن سريع للسفر ذو 4 مداخل بقوة 30 واط من Zendure', NULL, 'uploads/products/324007_zendure-a-series-4-port-usb-charger-1-600x600.jpg', NULL, NULL, '', '140', '90.30', '1', '<p>Product Details:</p>\r\n\r\n<p>4 Port charger with fast charging from Zendure.</p>\r\n\r\n<p>It is characterized by the presence of additional pieces of interchangeable plugs for use in the US, UK, and Europe.</p>\r\n\r\n<p>PD technology for fast charging and 3 USB ports with a power of 30 watts, and four devices can be charged at the same time.</p>\r\n\r\n<p>Supports all types of devices in addition to the ability to charge the MacBook.</p>\r\n\r\n<p>Overpower and over-charge protection.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن ذو اربع منافذ للشحن السريع من شركة Zendure.</p>\r\n\r\n<p>يتميز بوجود قطع إضافية للبلكات مختلفة ليتناسب مع كل الدول.</p>\r\n\r\n<p>مدخل بتقنية PD للشحن السريع و 3 مداخل USB بقوة 30 واط ويمكن شحن اربع اجهزة بنفس الوقت.</p>\r\n\r\n<p>يدعم جميع انواع الأجهزة بالاضافة الى القدرة على شحن الماك بوك.</p>\r\n\r\n<p>حماية من القوة الزائدة او الشحن الزائد.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 10:35:25', '2022-09-01 07:35:25', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '49'),
(335, NULL, 15, 9, NULL, NULL, 'Zendure A5PD Power Bank 2 Ports 16,750mAh', '377', 'شاحن متنقل A5PD بسعة 16,750 مللي امبير من Zendure', NULL, 'uploads/products/841222_Zendure-A3PD-External-Battery-1000mAh-2.jpg', NULL, NULL, '', '280', '195.30', '1', '<p>Product Details:</p>\r\n\r\n<p>Zendure Power Bank with a capacity of 16,750 mAh with two ports Type-C with PD technology and USB port with QC3.0 technology for fast charging.</p>\r\n\r\n<p>Small in size, made of high-quality materials withstands bumps and falls from high places.</p>\r\n\r\n<p>The power bank is distinguished by its 95% charge retention for 6 months when not in use.</p>\r\n\r\n<p>Two devices can be charged at the same time.</p>\r\n\r\n<p>The power bank can be fully charged in 5 hours when using the Type C port for fast charging.</p>\r\n\r\n<p>Type-C input with a power of 18W, and the power bank can be charged from the same input.</p>\r\n\r\n<p>USB port with QC3.0 technology for fast charging.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>باوربانك بسعة 16,750 مللي امبير ذو مدخلين تايب سي بتقنية PD ومدخل يو اس بي بتقنية QC3.0 للشحن السريع من شركة Zendure.</p>\r\n\r\n<p>صغير الحجم ومصنوع من مواد عالية الجودة ويتحمل الضربات والسقوط من اماكن عالية.</p>\r\n\r\n<p>يتميز الباوربانك بالاحتفاظ على شحنه بنسبة 95% لمدة 6 شهور عند عدم الاستعمال.</p>\r\n\r\n<p>يمكن شحن جهازين في نفس الوقت.</p>\r\n\r\n<p>مدة شحن الباوربانك شحن كامل في 5 ساعات عند استعمال مدخل التايب سي للشحن السريع.</p>\r\n\r\n<p>مدخل تايب سي بقوة 18 واط ويمكن شحن الباوربانك من نفس المكان.</p>\r\n\r\n<p>مدخل يو اس بي بتقنية QC3.0 للشحن السريع.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Zqp7jpiZwi4&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 10:37:25', '2022-09-01 07:37:25', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '49'),
(336, NULL, 15, 12, NULL, NULL, 'Zendure 10W Fast Wireless Charger', '378', 'شاحن لاسلكي بقوة 10 واط من Zendure', NULL, 'uploads/products/316449_zendure-q3-pad-3.jpg', NULL, NULL, '', '130', '90.30', '1', '<p>Product Details:</p>\r\n\r\n<p>Fast wireless charger from ZENDURE.</p>\r\n\r\n<p>Unti-slip rubber on the top to protect the phones from falling.</p>\r\n\r\n<p>Works with all types of devices that support QI charging technology.</p>\r\n\r\n<p>Wireless Charger: 10W.</p>\r\n\r\n<p>Input: Micro.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن سريع لاسلكي من شركة ZENDURE.</p>\r\n\r\n<p>يتميز بوجود طبقة من الربل لحماية الهاتف من الانزلاق والسقوط.</p>\r\n\r\n<p>يدعم جميع انواع الاجهزة التي تدعم تقنية شحن QI.</p>\r\n\r\n<p>قوة شاحن الوايرليس: 10واط.</p>\r\n\r\n<p>مدخل: مايكرو.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=uFUeiJUlNjc&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 10:38:38', '2022-09-01 07:38:38', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '49'),
(337, NULL, 5, 0, NULL, NULL, 'Lofans By Xiaomi Portable Mini Iron', '359', 'مكواة محمولة قابلة للشحن صغيرة الحجم من Xiaomi', NULL, 'uploads/products/685063_Untitled-1-11.jpg', NULL, NULL, '', '250', ' 120.50', '1', '<p>Product Details:</p>\r\n\r\n<p>Rechargeable mini portable iron from LOFANS.</p>\r\n\r\n<p>It is characterized by the presence of 3 degrees of heat according to your desire, as well as the speed of heating and ironing clothes, and it can be carried anywhere outside the house.</p>\r\n\r\n<p>Suitable for travel or outdoor use when necessary.</p>\r\n\r\n<p>Charging port: Type C, Charging time ranges from one to two hours and works for 30 minutes continuously.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مكواة صغيرة الحجم محمولة قابلة للشحن من شركة LOFANS.</p>\r\n\r\n<p>تتميز بوجود 3 درجات للحرارة على حسب رغبتكم وايضاً سرعة التسخين وكوي الملابس ويمكن حملها لاي مكان خارج المنزل.</p>\r\n\r\n<p>مناسبة للسفر او الاستعمالات الخارجية وقت الضرورة.</p>\r\n\r\n<p>مدخل الشحن: تايب سي وتتراوح مدة الشحن من ساعة الى ساعتين ويعمل لمدة 30 دقيقة متواصلة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Ze94SV_92FE&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-09-01 10:44:23', '2022-09-01 07:44:23', NULL, 1, NULL, NULL, 11, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(338, NULL, 5, 0, NULL, NULL, 'Rako Smart Multimedia Table - Light Brown', '20003', 'طاولة مع سماعة وشاحن لاسلكي من Rako - بني فاتح', NULL, 'uploads/products/285220_asasdasd.jpg', NULL, NULL, '', '345', '245', '1', '<p>Product Details:</p>\r\n\r\n<p>Multifunctional smart table with bluetooth from Rako.</p>\r\n\r\n<p>Equipped with two circular speakers to give surround sound, in addition to a 10w fast wireless charger.</p>\r\n\r\n<p>It can be used as a home decoration, to charge phones, and also to play music and more.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>طاولة ذكية متعددة الاستخدام مع تقنية البلوتوث من شركة Rako.</p>\r\n\r\n<p>مزودة بسماعتين بشكل دائري لتعطي صوت محيطي بالإضافة الى شاحن لاسكلي بقوة 10 واط شحن سريع.</p>\r\n\r\n<p>يمكن استخدامها كديكور للمنزل ولشحن الهواتف وايضاً لتشغيل الموسيقى وغيرها.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=EAiZYdlOkHA&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 10:49:21', '2022-09-01 07:49:21', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '34'),
(339, NULL, 5, 0, NULL, NULL, 'Rako Smart Multimedia Table - Black', '20003', 'طاولة مع سماعة وشاحن لاسلكي من Rako - اسود', NULL, 'uploads/products/589098_xsdh3287ry23rfw.jpg', NULL, NULL, '', '345', '245', '1', '<p>Product Details:</p>\r\n\r\n<p>Multifunctional smart table with bluetooth from Rako.</p>\r\n\r\n<p>Equipped with two circular speakers to give surround sound, in addition to a 10w fast wireless charger.</p>\r\n\r\n<p>It can be used as a home decoration, to charge phones, and also to play music and more.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>طاولة ذكية متعددة الاستخدام مع تقنية البلوتوث من شركة Rako.</p>\r\n\r\n<p>مزودة بسماعتين بشكل دائري لتعطي صوت محيطي بالإضافة الى شاحن لاسكلي بقوة 10 واط شحن سريع.</p>\r\n\r\n<p>يمكن استخدامها كديكور للمنزل ولشحن الهواتف وايضاً لتشغيل الموسيقى وغيرها.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=EAiZYdlOkHA&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 10:50:21', '2022-09-01 07:50:21', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '34'),
(340, NULL, 6, 0, NULL, NULL, 'Xiaomi Mi Smart Kettle Pro', '221', 'كتل تسخين الماء الذكي من Xiaomi', NULL, 'uploads/products/812408_Mi-Smart-Kettle-Pro-EU-1.jpg', NULL, NULL, '', '199', '139', '1', '<p>Product Details:</p>\r\n\r\n<p>Xiaomi Smart kettle water heater 1.5L water capacity and 1800W power.</p>\r\n\r\n<p>It boils water in just 5 minutes and you can control the temperature with your phone or the device itself.</p>\r\n\r\n<p>You can use it continuously or hold it at a temperature for a long time with one touch of a button.</p>\r\n\r\n<p>It stops automatically when a certain temperature is reached which is carried over by you.</p>\r\n\r\n<p>Digital LED screen of the water temperature.</p>\r\n\r\n<p>Made of high quality stainless steel.</p>\r\n\r\n<p>Control Application: Mi Home.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز تسخين الماء الذكي بقوة 1800 واط وسعة خزان ماء 1.5 لتر من شركة XIAOMI.</p>\r\n\r\n<p>يقوم بغلي الماء في 5 دقائق فقط وتستطيع التحكم بدرجة الحرارة عن طريق هاتفك او الجهاز نفسة.</p>\r\n\r\n<p>تقدرون تستخدمونة بشكل متواصل او تثبتونة على درجة حرارة معينة لفترة طويلة بلمسة زر واحدة.</p>\r\n\r\n<p>يتوقف تلقائياً عند الوصول الى درجة حرارة معينة يتم اختيارها من قبلكم.</p>\r\n\r\n<p>فيه شاشة رقمية بدرجة الحرارة الحالية.</p>\r\n\r\n<p>مصنوع من الفولاذ ذو جودة عالية مقاوم للصدأ.</p>\r\n\r\n<p>تطبيق التحكم: Mi Home</p>\r\n', NULL, 'https://www.youtube.com/watch?v=iJfEM_E2RDo&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 10:51:44', '2022-09-01 07:51:44', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(341, NULL, 5, 0, NULL, NULL, 'Xiaomi Mi Box S 4K Android TV', '217', 'جهاز تي ڤي بوكس 4K من Xiaomi', NULL, 'uploads/products/967952_xiaomi-mi-box-s-international-version-1571987401918.jpg', NULL, NULL, '', '279', '229', '1', '<p>Product Details:</p>\r\n\r\n<p>Xiaomi Mi 4K box turns any TV into a smart TV.</p>\r\n\r\n<p>It contains all the programs found in Android, such as Netflix, YouTube and you can also download external programs via flash.</p>\r\n\r\n<p>It supports the Android system, allowing you to control it with ease.</p>\r\n\r\n<p>It has a very high image clarity with 4k ultra HD resolution.</p>\r\n\r\n<p>Inputs type: HDMI + USB</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز تي ڤي بوكس يحول اي تلفزيون الى تلفزيون ذكي.</p>\r\n\r\n<p>فيه جميع البرامج الموجودة في الاندرويد مثل نتفليكس ويوتيوب وايضاً تقدرون تنزلون برامج خارجية عن طريق الفلاش.</p>\r\n\r\n<p>يدعم نظام اندرويد مما يتيح لك التحكم فيه بكل سهولة.</p>\r\n\r\n<p>يتميز بوضوح عالي جداً للصورة.</p>\r\n\r\n<p>نوع المداخل: HDMI + USB</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 10:54:32', '2022-09-01 07:54:32', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(342, NULL, 5, 0, NULL, NULL, 'Xiaomi Mi Smart Projector 2', '474', 'بروجكتر 2 Mi صغير الحجم من Xiaomi', NULL, 'uploads/products/505014_Mi-Smart-Compact-Projector-1.jpg', NULL, NULL, '', '1950', '1805', '1', '<p>Product Details:</p>\r\n\r\n<p>Xiaomi Mi 2 projector is very small and has a high definition 1080P resolution.</p>\r\n\r\n<p>Very fast in control and covers a wide size of up to 120 inches with high definition.</p>\r\n\r\n<p>It is characterized by its small size and can be moved from one place to another easily.</p>\r\n\r\n<p>Built-in stereo speaker.</p>\r\n\r\n<p>Eyes Protection princible.</p>\r\n\r\n<p>Official certificated Netflix &amp; Android system.</p>\r\n\r\n<p>Supports voice commands Google Assistant.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز بروجكتور Mi 2&nbsp;صغير الحجم جداً ودقه عالية الجودة 1080P من شركة XIAOMI.</p>\r\n\r\n<p>سريع جداً في التحكم ويغطي حجم واسع يصل الى 120 بوصه بوضوح عالي.</p>\r\n\r\n<p>يتميز بصغر حجمه ويمكن نقله من مكان الى اخر بسهولة.</p>\r\n\r\n<p>يدعم نظام اندرويد ونتفلكس بشكل رسمي وبوضوح عالي.</p>\r\n\r\n<p>صوت محيطي بسماعات مدمجه.</p>\r\n\r\n<p>نظام حماية للعين.</p>\r\n\r\n<p>يدعم الاوامر الصوتية من مساعد قوقل.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 10:55:59', '2022-09-01 07:55:59', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(343, NULL, 10, 0, NULL, NULL, 'Xiaomi Mi Dual Mode Wireless Mouse', '380', 'ماوس لاسلكي صغير من Xiaomi', NULL, 'uploads/products/469991_Mi-Dual-Mode-Wireless-Mouse-Silent-Edition-White.jpg', NULL, NULL, '', '99', '48', '1', '<p>Product Details:</p>\r\n\r\n<p>Lightweight wireless mouse from Xiaomi.</p>\r\n\r\n<p>1300 DPI.</p>\r\n\r\n<p>Suitable for office or business use.</p>\r\n\r\n<p>3 Keys + 2 Function Keys.</p>\r\n\r\n<p>8 Meters connection distance.</p>\r\n\r\n<p>Wireless: 2.4GHZ.</p>\r\n\r\n<p>Supports all types of computers (Windows, Mac, Andriod)</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ماوس لاسلكي خفيف الوزن من شركة XIAOMI.</p>\r\n\r\n<p>اعلى سرعة 1300 دي بي أي.</p>\r\n\r\n<p>مناسب للمكتب او استعمال العمل.</p>\r\n\r\n<p>عدد 2 مفاتيح وظيفية + 3 مفاتيح إضافية.</p>\r\n\r\n<p>مسافة اتصال تصل الى 8 متر.</p>\r\n\r\n<p>لاسلكي يدعم: 2.4 جيجا هيرتز فقط.</p>\r\n\r\n<p>يدعم جميع انواع اجهزة الكمبيوتر من ( Windows , Mac , Andriod )</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 10:57:39', '2022-09-01 07:57:39', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(344, NULL, 6, 0, NULL, NULL, 'Xiaomi Smart Air Fryer 3.5L', '382', 'مقلاة هوائية ذكية بسعة 3.5 لتر من Xiaomi', NULL, 'uploads/products/972591_hjfdfgfd658.jpg', NULL, NULL, '', '299', '245', '1', '<p>Product Details:</p>\r\n\r\n<p>Smart air fryer that can be controlled through the control panel or by phone from Xiaomi.</p>\r\n\r\n<p>The air fryer is characterized by fast food preparation with a 24 hour timer that makes it easy for you to prepare food without being at home.</p>\r\n\r\n<p>The temperature can be controlled from 40 to 200 degrees Celsius.</p>\r\n\r\n<p>Distinctive shape and spacious interior with a capacity of 3.5 liters.</p>\r\n\r\n<p>Digital display showing the temperature and time, in addition to what was chosen from the recipe for preparation.</p>\r\n\r\n<p>It contains 100 different recipes that can be viewed through the control application, which makes it unique.</p>\r\n\r\n<p>Control Application: Xiaomi Home.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مقلاة هوائية ذكية يمكن التحكم بها من خلال لوحة التحكم او عن طريق الهاتف من شركة XIAOMI.</p>\r\n\r\n<p>تتميز المقلاة الهوائية بسرعة تحضير الطعام مع وجود مؤقت زمني 24 ساعة وذلك يسهل عليك تحضير الطعام دون وجودك في المنزل.</p>\r\n\r\n<p>يمكن التحكم بدرجة الحرارة من 40 الى 200 درجة مئوية.</p>\r\n\r\n<p>شكل مميز وواسع من الداخل بسعة 3.5 لتر.</p>\r\n\r\n<p>شاشة رقمية توضح درجة الحرارة والوقت الزمني بالإضافة الى ماتم اختيارة من وصفة للتحضير.</p>\r\n\r\n<p>تحتوي على 100 وصفة مختلفة يمكن الاطلاع عليها من خلال تطبيق التحكم وذلك مايجعلها فريدة من نوعها.</p>\r\n\r\n<p>تطبيق التحكم: Xiaomi Home.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=S5pu_7Plywk&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 11:01:47', '2022-09-01 08:01:47', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(345, NULL, 10, 13, NULL, NULL, 'Xiaomi Portable Electric Air Compressor', '381', 'منفاخ إلكتروني محمول قابل للشحن من Xiaomi', NULL, 'uploads/products/943673_41lskoN8llL__SY3swdswed1.jpg', NULL, NULL, '', '199', '149', '1', '<p>Product Details:</p>\r\n\r\n<p>Xiaomi Multifunctional Rechargeable Air Compressor.</p>\r\n\r\n<p>It is characterized by its small size and its ability to inflate bicycle and car tires, as well as football.</p>\r\n\r\n<p>It has a display screen to know the percentage of air.</p>\r\n\r\n<p>Input: Type-C charging port.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>منفاخ هواء قابل للشحن متعدد الاستخدام من شركة XIAOMI.</p>\r\n\r\n<p>يتميز بصغر حجمه وقدرته على نفخ اطارات الدراجات والسيارات وايضاً كرة القدم.</p>\r\n\r\n<p>يحتوي على شاشة عرض لمعرفة نسبة الهواء.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Gp7lJMlE8Qw&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 11:05:15', '2022-09-01 08:05:15', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(346, NULL, 5, 0, NULL, NULL, 'Xiaomi Mi AC1200 Wi-Fi Range Extender', '383', 'مقوي ارسال AC1200 صغير الحجم من Xiaomi', NULL, 'uploads/products/338111_DVB4270GL_wr_03.jpg', NULL, NULL, '', '125', '74', '1', '<p>Product Details:</p>\r\n\r\n<p>Xiaomi ( New Version ) Wi-Fi extender.</p>\r\n\r\n<p>It is characterized by its small size and strong signal of the Internet in the place in which it is located.</p>\r\n\r\n<p>Supports 2.4G and 5G, and internet speeds up to 867Mbps (the old version only supports 2.4G).</p>\r\n\r\n<p>Compatible with all Wi-Fi devices.</p>\r\n\r\n<p>Control Application: Xiaomi Home / Mi Home.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مقوي ارسال AC1200 ( الأصدار الجديد ) من شركة XIAOMI.</p>\r\n\r\n<p>يتميز بصغر حجمه وتوزيعه القوي للأنترنت في المكان الذي يتواجد فيه.</p>\r\n\r\n<p>يدعم 2.4G و 5G وسرعة انترنت تصل الى 867 ميجا بت في الثانية ( الاصدار القديم فقط يدعم 2.4G ).</p>\r\n\r\n<p>يتوافق مع جميع اجهزة الواي-فاي.</p>\r\n\r\n<p>تطبيق التحكم: Mi Home / Xiaomi Home.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=jz-N_SGCV4g&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 11:13:34', '2022-09-01 08:13:34', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
