(358, NULL, 8, 0, NULL, NULL, 'Smart RGB Led Atmosphere Light', '387', 'ستاند اضاءة ديكور جانبية LED للشاشات', NULL, 'uploads/products/353797_Hfc2136f8fd2a4afa89f6a640bff7b66a9.jpg', NULL, NULL, '', '199', '120.33', '1', '<p>Product Details:</p>\r\n\r\n<p>RGB lighting with a modern and distinctive shape, suitable for screen decoration.</p>\r\n\r\n<p>It contains a wide range of different colours.</p>\r\n\r\n<p>It can be controlled manually with the control button or via the wireless remote control.</p>\r\n\r\n<p>It works by electricity and does not need charging or batteries.</p>\r\n\r\n<p>Control Application: HappyLightning-Life With Smart.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>إضاءة RGB ذات شكل عصري ومميز ومناسبه ديكور للشاشات.</p>\r\n\r\n<p>تحتوي على مجموعة واسعة من الالوان المختلفة.</p>\r\n\r\n<p>يمكن التحكم بها يدوياً في زر التحكم او عن طريق جهاز التحكم اللاسلكي.</p>\r\n\r\n<p>تعمل عن طريق الكهرباء ولا تحتاج الى شحن او بطاريات.</p>\r\n\r\n<p>تطبيق التحكم: HappyLightning-Life With Smart.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=mgfLXxbuBxc&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-09-01 11:43:39', '2022-09-01 08:43:39', NULL, NULL, NULL, NULL, 6, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(359, NULL, 5, 0, NULL, NULL, 'Portable 28 in 1 Electric Screwdriver', '385', 'مفك براغي إلكتروني قابل للشحن 28 في 1', NULL, 'uploads/products/909534_e2kje2e.jpg', NULL, NULL, '', '200', '102.33', '1', '<p>Product Details:</p>\r\n\r\n<p>28 in 1 electric screwdriver has everything you need from a variety of different heads.</p>\r\n\r\n<p>It is characterized by its high quality, small size, and its power, which reaches 200r per minute.</p>\r\n\r\n<p>Battery capacity: 330mAh, it takes 50 minutes to fully charge and lasts for a very long time.</p>\r\n\r\n<p>Easy to use, just put the required head in the screwdriver and press the release or installation button.</p>\r\n\r\n<p>It has LED lighting that is useful when used in dark places.</p>\r\n\r\n<p>It can be carried anywhere outside the house due to its small size.</p>\r\n\r\n<p>Input: Type-C charging port.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>Please charge the device when you buy it for two and a half hours or until the light appears in green, so that the battery lasts with you for a longer period.</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مفك براغي إلكتروني 28 في 1 فيه كل الي تحتاجونه من رؤوس مختلفة ومتنوعة.</p>\r\n\r\n<p>يتميز بجودته العالية وصغر حجمه وايضاً بقوته التي تصل الى 200r في الدقيقة.</p>\r\n\r\n<p>سعة البطارية: 330 مللي مبير ويستغرق شحنة 50 دقيقة ويستمر معكم لفترة طويلة جداً.</p>\r\n\r\n<p>سهل الاستخدام فقط يتم وضع الرأس المطلوب في المفك والضغط على زر الفك او التثبيت.</p>\r\n\r\n<p>يوجد به اضاءة LED مفيد عند استعماله في الاماكن المظلمة.</p>\r\n\r\n<p>يمكن حمله لاي مكان خارج المنزل بسبب صغر حجمة.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>يرجى شحن الجهاز عند شرائة لمدة ساعتين ونصف او حتى تظهر الاضاءة باللون الاخضر وذلك حتى تدوم البطارية معكم لمدة اطول.</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', NULL, 'https://www.youtube.com/watch?v=uei0UoWeHb8&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 11:51:29', '2022-09-01 08:51:29', NULL, NULL, NULL, NULL, 6, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(360, NULL, 6, 0, NULL, NULL, 'Smart Wi-Fi Door & Window Sensor', '388', 'حساس واي-فاي ذكي للابواب والنوافذ', NULL, 'uploads/products/864513_sdasdkajsdas.jpg', NULL, NULL, '', '149', '77.88', '1', '<p>Product Details:</p>\r\n\r\n<p>Wi-Fi sensor for doors and windows, through which you can tell if the door or window is open or closed.</p>\r\n\r\n<p>It is characterized by recording all movements and showing alerts by phone while you are outside the house, specified by the date and time when the door or window was opened.</p>\r\n\r\n<p>It is easy to use and can be installed any adhesive in the two pieces and does not require screws for installation.</p>\r\n\r\n<p>Support Alexa &amp; Google Assistant.</p>\r\n\r\n<p>It works by batteries and does not require charging.</p>\r\n\r\n<p>Control App: Smart Life.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>The two pieces must be installed with a maximum distance of 20mm between the first and second device.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>حساس واي-فاي للابواب والنوافذ يمكنكم من خلاله معرفة اذا كان الباب او النافذة مفتوحة ام مغلقه.</p>\r\n\r\n<p>يتميز بتسجيل كل الحركات وتظهر التنبيهات عن طريق الهاتف وانتم خارج المنزل محدده بالتاريخ والوقت التي تم فتح فيها الباب او النافذة.</p>\r\n\r\n<p>سهل الاستخدام ويمكن تركيبه عن طريق وضع لاصق في القطعتين ولا يحتاج الى مسامير للتثبيت.</p>\r\n\r\n<p>يدعم اجهزة الاوامر الصوتية من اليكسا وقوقل اسستنس.</p>\r\n\r\n<p>يعمل عن طريق البطاريات ولا يحتاج الى شحن.</p>\r\n\r\n<p>تطبيق التحكم: Smart Life.</p>\r\n\r\n<p><strong>ملاحظة</strong><strong>:</strong></p>\r\n\r\n<p>يجب تركيب القطعتين بمسافة 20 مليمتر كحد اقصى بين الجهاز الاول والثاني.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 11:53:19', '2022-09-01 08:53:19', NULL, 1, NULL, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(361, NULL, 12, 0, NULL, NULL, 'Portable Foldable & Inflatable Travel Bed - Light Blue', '389', 'سرير الرحلات المحمول قابل للطي والنفخ بشكل تلقائي - ازرق فاتح', NULL, 'uploads/products/280158_O1CN01UaCq2F2LCV9v9sAxd_3488629656-0-cib.jpg', NULL, NULL, '', '420', '219.50', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable foldable bed with automatic lightweight feature for home or road trips.</p>\r\n\r\n<p>It is characterized by its ability to automatically inflate with one press of a button in only 60 seconds and does not require an air blower or anything else.</p>\r\n\r\n<p>It is medically designed to give more comfort when lying on it, and also suitable for the elderly, and it bears a maximum weight of 150 kg.</p>\r\n\r\n<p>The battery power is 2600mAh and it has a USB port to charge phones.</p>\r\n\r\n<p>The raw material is made of nylon and rubber that is resistant to sharp or rough surfaces and is water resistant with IP34 standard.</p>\r\n\r\n<p>Charging port: Type C, charging time is 3 to 4 hours.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>سرير محمول قابل للطي مع خاصية النفخ التلقائي خفيف الوزن للمنزل او الرحلات البرية.</p>\r\n\r\n<p>يتميز بقدرته على النفخ التلقائي بضغطة زر واحدة في 60 ثانية فقط ولا يحتاج الى منفاخ هواء او غيره.</p>\r\n\r\n<p>مصمم بشكل طبي ليعطي راحة اكثر عند الاستلقاء عليه وايضاً مناسب لكبار السن ويتحمل وزن 150 كيلوجرام كحد اقصى.</p>\r\n\r\n<p>قوة البطارية 2600 مللي امبير ويحتوي على منفذ يو اس بي لشحن الهواتف.</p>\r\n\r\n<p>الخام مصنوع من النايلون والمطاط المقاوم للاسطح الحاده او الخشنه ومقاوم للماء بمعيار IP34.</p>\r\n\r\n<p>مدخل الشحن: تايب سي وتستغرق مدة الشحن من 3 الى 4 ساعات.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=UI2nlF3vfPs', '', '1', NULL, NULL, '1', '2022-09-01 11:55:18', '2022-09-01 08:55:18', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(362, NULL, 12, 0, NULL, NULL, 'Portable Mini Bicycle Horn - Black', '391', 'بوق محمول وصغير للدراجات - اسود', NULL, 'uploads/products/528468_kfjwk432rqr-1.jpg', NULL, NULL, '', '99', '43.89', '1', '<p>Product Details:</p>\r\n\r\n<p>Very small size and high quality bicycle horn.</p>\r\n\r\n<p>It is characterized by its small size, its sound strength of up to 90 decibels, and it is also water-resistant.</p>\r\n\r\n<p>It contains three types of horn sounds that can be changed by pressing and holding it for 3 seconds.</p>\r\n\r\n<p>Made of silicone to fit all types of bicycles.</p>\r\n\r\n<p>Suitable for alerting pedestrians while you are exercising in crowded places.</p>\r\n\r\n<p>It works by batteries and does not require charging.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>بوق بحجم صغير جداً وجودة عاليه للدراجات.</p>\r\n\r\n<p>يتميز بصغر حجمه وقوة صوته التي تصل الى 90 ديسيبل وايضاً مقاوم للماء.</p>\r\n\r\n<p>يحتوي على ثلاث انواع من اصوات البوق يمكن تغييرها بضغطه مطوله لمدة 3 ثواني.</p>\r\n\r\n<p>مصنوع من مادة السيليكون ليتناسب مع جميع انواع الدراجات الهوائية.</p>\r\n\r\n<p>مناسب لتنبيه الماره اثناء ممارستك الرياضه في الاماكن المزدحمة.</p>\r\n\r\n<p>يعمل عن طريق البطاريات ولا يحتاج الى شحن.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=ifHrk97zllg&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 11:56:48', '2022-09-01 08:56:48', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(363, NULL, 5, 0, NULL, NULL, 'Seemagic By Xiaomi Nail Clipper Device', '384', 'جهاز محمول لتقليم الأظافر من Seemagic', NULL, 'uploads/products/994903_Ha69f1426b26a4b86a0d6c0a9326df60d4-1.jpg', NULL, NULL, '', '199', '91.75', '1', '<p>Product Details:</p>\r\n\r\n<p>Mini Portable Rechargeable Nail Clipper from XIAOMI SEEMAGIC.</p>\r\n\r\n<p>It is characterized by its high performance and speed on nail trimming for its small size, anti-vibration system and a very light sound.</p>\r\n\r\n<p>Designed in an arc shape to protect the fingers from wounds and also give a great look to the nails.</p>\r\n\r\n<p>It has dim lighting to help in case the lighting is not strong in the place.</p>\r\n\r\n<p>Suitable for children and the elderly.</p>\r\n\r\n<p>Charging port: Type C, the charging time takes from 2 to 3 hours, and it works for 3 hours continuously.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز صغير الحجم محمول وقابل للشحن لتقليم الأظافر من SEEMAGIC التابعة لشركة XIAOMI.</p>\r\n\r\n<p>يتميز بأدائه العالي وسرعته على تقليم الاظافر بالنسبة لصغر حجمه ونظام مانع للاهتزاز وصوت خفيف جداً.</p>\r\n\r\n<p>مصمم بشكل مقوس لحماية الاصابع من الجروح وايضاً يعطي منظر رائع للأظافر.</p>\r\n\r\n<p>يوجد به اضاءة خافته للمساعدة في حال لم تكن الاضاءة قوية في المكان.</p>\r\n\r\n<p>مناسب للأطفال وكبار السن.</p>\r\n\r\n<p>مدخل الشحن: تايب سي وتستغرق مدة شحنه من 2 الى 3 ساعات ويعمل لمدة 3 ساعات متواصلة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=oaq3bY42my0&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 11:58:16', '2022-09-01 08:58:16', NULL, 1, NULL, NULL, 11, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(364, NULL, 5, 0, NULL, NULL, 'Vacuum Sealer Device', '390', 'جهاز حراري 2 في 1 لتغليف الأكياس', NULL, 'uploads/products/677804_Vaccum-Sealer-1-1.jpg', NULL, NULL, '', '139', '53.78', '1', '<p>Product Details:</p>\r\n\r\n<p>Small vacuum sealer device for packing bags and internal air suction feature.</p>\r\n\r\n<p>The device is easy to use and can be controlled through the device&rsquo;s built-in control panel.</p>\r\n\r\n<p>It contains two buttons, the first for heat packaging and the second button for air suction and packaging at the same time.</p>\r\n\r\n<p>Suitable for food preservation and long-term storage.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز صغير حراري لتغليف الاكياس وخاصية شفط الهواء الداخلي.</p>\r\n\r\n<p>يتميز الجهاز بسهولة استخدامه ويمكن التحكم به من خلال لوحة التحكم المدمجة فالجهاز.</p>\r\n\r\n<p>يحتوي على زرين الاول للتغليف بالحرارة والزر الثاني لشفط الهواء والتغليف بنفس الوقت.</p>\r\n\r\n<p>مناسب للحفاظ على الطعام والتخزين لفترات طويلة.</p>\r\n', NULL, 'https://youtu.be/KunWpO-cC-8', '', '1', NULL, NULL, '1', '2022-09-01 11:59:41', '2022-09-01 08:59:41', NULL, 1, NULL, NULL, 4, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(365, NULL, 5, 0, NULL, NULL, 'Hoto By Xiaomi Wireless Portable Glue Gun', '386', 'مسدس لاسلكي محمول لتسخين الغراء من Xiaomi', NULL, 'uploads/products/620426_H77a57b73d71c4c28b7fcec98e2a845ffD11.jpg', NULL, NULL, '', '249', '135.55', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable hot glue gun from HOTO of XIAOMI.</p>\r\n\r\n<p>It is characterized by its speed on heating the glue in only 30 seconds due to its small size, as well as a smart shutdown system when not in use.</p>\r\n\r\n<p>It contains a smart chip that automatically controls the temperature to prevent excessive glue melting.</p>\r\n\r\n<p>When fully charged, the device creates glue for a distance of 100 meters without stopping.</p>\r\n\r\n<p>It contains a 2000mAh battery and it takes 2 to 3 hours to fully charge.</p>\r\n\r\n<p>Input: Type-C charging port.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مسدس محمول سريع جداً في تسخين الغراء من HOTO التابعة لشركة XIAOMI.</p>\r\n\r\n<p>يتميز بسرعته على تسخين الغراء في 30 ثانية فقط بالنسبة لصغر حجمه وايضاً نظام ايقاف تشغيل ذكي عند عدم استعماله.</p>\r\n\r\n<p>يحتوي على شريحة ذكيه تتحكم بدرجة الحرارة بشكل تلقائي لمنع ذوبان الغراء المفرط.</p>\r\n\r\n<p>عند شحنه بالكامل فأن الجهاز ينشأ الغراء لمسافة 100 متر بدون توقف.</p>\r\n\r\n<p>يحتوي على بطارية بقوة 2000 مللي امبير ويستغرق شحنه من 2 الى 3 ساعات.</p>\r\n\r\n<p>مدخل الشحن: Type C.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=ocWYn9hXQxY&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 12:02:07', '2022-09-01 09:02:07', NULL, NULL, 1, NULL, 6, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(366, NULL, 10, 0, NULL, NULL, 'Phone Multi-Functional Stand & Box', '10019', 'صندوق وستاند لإكسسوارات الهاتف متعدد الاستخدام', NULL, 'uploads/products/61xBLfNduEL__SL1500_.jpg', NULL, NULL, '', '140', '109', '1', '<p>Product Details:</p>\r\n\r\n<p>A storage box that contains everything you need from phone connections.</p>\r\n\r\n<p>It features a Wireless Type-C and Lightning + Micro + USB connections, and it can also be used as a phone stand.</p>\r\n\r\n<p>Through the product, it can be used as a hub to upload data from any phone that supports the mentioned ports.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>The box contains (SIM decoder for iPhone + Type C cable + Lightning to Type C connector + Micro to Type C connector + USB to Type C connector)</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>صندوق تخزين يوجد به كل ماتحتاجه من وصلات للهواتف.</p>\r\n\r\n<p>يتميز بوجود واير تايب سي ووصلات لايتننغ + مايكرو + يو اس بي وايضاً يمكن استخدامة كستاند للهاتف.</p>\r\n\r\n<p>يمكن من خلال المنتج ان يتم استخدامة كوصلة لرفع البيانات من اي هاتف يدعم المنافذ المذكورة.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>الصندوق يحتوي على ( قطعة فك الشريحة للأيفون + واير تايب سي&nbsp; + وصلة لايتننغ الى تايب سي&nbsp; + وصلة مايكرو الى تايب سي + وصلة يو اس بي الى تايب سي )</p>\r\n', NULL, 'https://www.youtube.com/watch?v=AAm-3bpkFD0&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 12:03:49', '2022-09-01 09:03:49', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(367, NULL, 9, 0, NULL, NULL, 'inCharge 6 in 1 Cable Hub 60W', '10020', 'وصله وشاحن 6 في 1 بقوة 60 واط من inCharge', NULL, 'uploads/products/incharge-1.jpg', NULL, NULL, '', '179', '159', '1', '<p>Product Details:</p>\r\n\r\n<p>6-in-1 Cable Hub from INCHARGE Type C + USB for all devices.</p>\r\n\r\n<p>60W PD fast charging, you can charge your device through the hub as well.</p>\r\n\r\n<p>Metal Luxury No Overheating.</p>\r\n\r\n<p>Interface Inputs: USB + Type C + Lightning.</p>\r\n\r\n<p>Applicable Model: All devices that support Type C or USB.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>وصله 6 في 1 من شركة INCHARGE تايب سي + يو اس بي لجميع الاجهزة.</p>\r\n\r\n<p>قوة شحن 60 واط بتقنية PD للشحن السريع تقدر تشحن جهازك ونقل البيانات في نفس الوقت.</p>\r\n\r\n<p>تصميم رائع من الحديد العازل للحرارة.</p>\r\n\r\n<p>مداخل الوصله: USB + Type C + Lightning.</p>\r\n\r\n<p>الموديل المناسب: كل الأجهزة التي تدعم مدخل تايب سي او يو اس بي.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 12:07:06', '2022-09-01 09:07:06', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, NULL),
(368, NULL, 10, 0, NULL, NULL, 'inAteck Travel Mobile Accessories Bag', '10021', 'حقيبة لأكسسوارات الهاتف من inAteck', NULL, 'uploads/products/230767_inateck-1.jpg', NULL, NULL, '', '179', '169', '1', '<p>Product Details:</p>\r\n\r\n<p>Accessories organizer bag from INATECK.</p>\r\n\r\n<p>Small in size, convenient and light in weight.</p>\r\n\r\n<p>Organizes your charging wires and mobile phones.</p>\r\n\r\n<p>Suitable for use outside home or travel.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>حقيبة لتنظيم الاكسسوارات وترتيبها من INATECK.</p>\r\n\r\n<p>صغيرة الحجم ومريحة وخفيفة فالوزن.</p>\r\n\r\n<p>تنظم لكم وايرات الشحن والهواتف.</p>\r\n\r\n<p>مناسبة للاستعمال خارج المنزل او السفر.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=ktTA_DeSaiY&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 12:08:22', '2022-09-01 09:08:22', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '51'),
(369, NULL, 10, 14, NULL, NULL, 'UNIQ Apple Watch Silicon Strap 42mm & 44mm & 45mm - Yellow/Grey', '20001', 'سير سيليكون لساعة ابل حجم 42 و 44 و 45 - اصفر ورمادي من UNIQ', NULL, 'uploads/products/394206_uniqstrapyellow-1.jpg', NULL, NULL, '', '109', '57', '1', '<p>Product Details:</p>\r\n\r\n<p>Two-tone silicone strap for Apple Watch, comfortable to use from UNIQ.</p>\r\n\r\n<p>Suitable for size 42mm/44mm/45mm.</p>\r\n\r\n<p>It is characterized by the fact that it can be used on two sides to change colors as desired.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>سير لساعة ابل من السيليكون بلونين مريح عند الاستخدام.</p>\r\n\r\n<p>مناسب لحجم 42 و 44 و 45.</p>\r\n\r\n<p>يتميز بأنه يمكن استخدامه بجهتين لتبديل الالوان على حسب الرغبة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=8RSnpaLLsek&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 12:10:39', '2022-09-01 09:10:39', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '45'),
