(375, NULL, 10, 0, NULL, NULL, 'UNIQ Cavalier Laptop Brief Up to 15inch Size - Silver', '20014', 'شنطة لأجهزة اللابتوب تناسب احجام اقل من 15 انش من UNIQ – رصاصي', NULL, 'uploads/products/743295_uniqbag-223dx.jpg', NULL, NULL, '', '119', '55', '1', '<p>Product Details:</p>\r\n\r\n<p>Laptop brief with a stylish and distinctive shape from UNIQ.</p>\r\n\r\n<p>It can be used as a laptop storage with the charger and also cables.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شنطة ذات شكل انيق ومميز لأجهزة اللابتوب من شركة UNIQ.</p>\r\n\r\n<p>يمكن استخدامها كتخزين للابتوب مع الشاحن وايضاً الاسلاك.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=w4uvTaT2gtE&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 16:21:44', '2022-09-01 13:21:44', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '45'),
(376, NULL, 15, 10, NULL, NULL, 'uGreen Gan 4 Ports 100w Charger', '20015', 'شاحن سريع جداً ذو 4 مداخل بقوة 100 واط من uGreen', NULL, 'uploads/products/274839_ugreen97654.jpg', NULL, NULL, '', '220', '155', '1', '<p>Product Details:</p>\r\n\r\n<p>Fast charging 4 ports charger from UGREEN.</p>\r\n\r\n<p>It is characterized by its power of up to 100W and can charge all devices very fast charging.</p>\r\n\r\n<p>3 PD inputs for fast charging, two with a power of 100W, and a PD port, as well as a USB with a power of 22.5W, and 4 devices can be charged at the same time.</p>\r\n\r\n<p>Supports all types of devices in addition to computers.</p>\r\n\r\n<p>Protection against overpowering or overcharging.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن ذو 4 مداخل للشحن السريع من شركة uGreen.</p>\r\n\r\n<p>يتميز بقوته التي تصل الى 100 واط ويمكنه شحن جميع الاجهزة شحن سريع جداً.</p>\r\n\r\n<p>3 مداخل بتقنية PD للشحن السريع اثنين بقوة 100 واط ومدخل PD&nbsp; وايضاً يو اس بي بقوة 22.5 واط ويمكن شحن 4 اجهزة في نفس الوقت.</p>\r\n\r\n<p>يدعم جميع انواع الأجهزة بالإضافة الى اجهزة الكمبيوتر.</p>\r\n\r\n<p>حماية من القوة الزائدة او الشحن الزائد.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=dBZ1hMfQy0o&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 16:23:43', '2022-09-01 13:23:43', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '46'),
(377, NULL, 7, 0, NULL, NULL, 'Anker Life P2 Mini Earphone', '393', 'سماعة Life P2 Mini من Anker', NULL, 'uploads/products/172589_Soundcore-by-Anker-Life-P2-Min-6.jpg', NULL, NULL, '', '150', '95', '1', '<p>Product Details:</p>\r\n\r\n<p>Soundcore Life P2 Mini wireless earphone is suitable for Apple and Android devices from Anker.</p>\r\n\r\n<p>The recognition feature to turn on and off when placed in the ear or removed, in addition to the presence of many features with touch technology.</p>\r\n\r\n<p>It is characterized by its fast charging and can be used for an hour continuously when charged for only 10 minutes.</p>\r\n\r\n<p>3 EQ Modes.</p>\r\n\r\n<p>Supports the latest side noise cancellation technologies.</p>\r\n\r\n<p>It contains the latest Bluetooth 5.2 technology.</p>\r\n\r\n<p>Input: Type-C charging port.</p>\r\n\r\n<p>Warranty: 1 Year</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>سماعة Soundcore Life P2 Mini لاسلكية مناسبة لأجهزة ابل والاندرويد من شركة Anker.</p>\r\n\r\n<p>ميزة التعرف للتشغيل وايقاف التشغيل عند وضعها بالاذن او ازالتها بالإضافه الى وجود مميزات عديدة بتقنية اللمس.</p>\r\n\r\n<p>تتميز بسرعة شحنها ويمكن استعمالها لمدة ساعة متواصله عند شحنها لمدة 10 دقائق فقط.</p>\r\n\r\n<p>3 اوضاع مختلفة لأخراج الصوت على حسب الرغبة.</p>\r\n\r\n<p>تدعم احدث تقنيات عزل الضوضاء الجانبية.</p>\r\n\r\n<p>تحتوي على تقنية البلوتوث الحديثة 5.2.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n\r\n<p>ضمان لمدة سنة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=_PXk0mYO8T0&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 16:26:13', '2022-09-01 13:26:13', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(378, NULL, 7, 0, NULL, NULL, 'Anker Soundcore Life Q10 Wireless Headphone - Blue', '395', 'سماعة رأس Life Q10 لاسلكية من Anker - ازرق', NULL, 'uploads/products/391088_soundcore-life-q10-1.jpg', NULL, NULL, '', '150', '107.28', '1', '<p>Product Details:</p>\r\n\r\n<p>Soundcore Life Q10 wireless headphones suitable for sports or watching movies from Anker.</p>\r\n\r\n<p>Touch control feature via the built-in control button in the headset.</p>\r\n\r\n<p>Automatic noise reduction technology.</p>\r\n\r\n<p>Convenient and can be folded to make it easy for you to move it from one place to another.</p>\r\n\r\n<p>When charged for 5 minutes, it works for 5 continuous hours, and 60 hours continuously if fully charged.</p>\r\n\r\n<p>Input: Type-C charging port.</p>\r\n', '<p>مواصفات المنتج :</p>\r\n\r\n<p>سماعة رأس Soundcore Life Q10 لاسلكية مناسبة للرياضيين او لمتابعة الافلام من شركة Anker.</p>\r\n\r\n<p>خاصية التحكم باللمس عن طريق ازرة التحكم المدمجه في السماعة.</p>\r\n\r\n<p>تتميز بتقنية عزل الازعاج الاوتوماتيكي.</p>\r\n\r\n<p>مريحة ويمكن طيها ليسهل عليكم نقلها من مكان الى اخر.</p>\r\n\r\n<p>عند شحنها لمدة 5 دقائق تعمل لمدة 5 ساعات متواصله و 60 ساعة متواصله في حال تم شحنها بالكامل.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=NBzt-GT3Ymc&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 16:27:54', '2022-09-01 13:27:54', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(379, NULL, 15, 10, NULL, NULL, 'Green 5 Ports Travel Charger', '396', 'شاحن السفر ذو 5 مداخل من Green', NULL, 'uploads/products/green-adapter-travel-1.jpg', NULL, NULL, '', '149', '111.75', '1', '<p>Product Details:</p>\r\n\r\n<p>The travel charger has 5 ports, including two Type-C inputs, one 20W PD technology and 3 USB ports, 35W, from Green.</p>\r\n\r\n<p>Small in size and easy to move around in travel.</p>\r\n\r\n<p>Can be used with all countries of the world.</p>\r\n\r\n<p>5 Devices can be charged at the same time.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن السفر ذو 5 مداخل منهم مدخلين تايب سي واحد بتقنية PD بقوة 20 واط و 3 مداخل USB بقوة 35 واط من شركة Green.</p>\r\n\r\n<p>صغير الحجم ويسهل نقلة فالسفر.</p>\r\n\r\n<p>يمكن استخدامة مع جميع دول العالم.</p>\r\n\r\n<p>يمكن شحن 5 اجهزة ف نفس الوقت.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=7yE2x1G8z8w&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 16:30:39', '2022-09-01 13:30:39', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '20'),
(380, NULL, 15, 9, NULL, NULL, 'Powerology 10,000mAh 4 in 1 Power Bank Charging Dock - Black', '397', 'قاعدة شواحن باوربانك 4 في 1 بقوة 10,000 مللي امبير من Powerology - اسود', NULL, 'uploads/products/untitled-1-1.jpeg', NULL, NULL, '', '699', '593.81', '1', '<p>Product Details:</p>\r\n\r\n<p>(New version) of the 4 portable chargers, each with a capacity of 10,000mAh from Powerology.</p>\r\n\r\n<p>Each portable charger contains two built-in wires, Type C and Lightning, in addition to a USB port and an 18W PD port for fast charging.</p>\r\n\r\n<p>Each charger supports 15W wireless charging technology.</p>\r\n\r\n<p>The charging base contains 4 additional USB ports.</p>\r\n\r\n<p>It is characterized by ease of movement and light weight.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>(الاصدار الجديد) من قاعدة الشواحن المتنقلة عدد 4 كل شاحن بقوة 10,000 مللي امبير من Powerology.</p>\r\n\r\n<p>كل شاحن متنقل يحتوي على وايرين مدمجين تايب سي و لايتننغ بالإضافة الى مدخل يو اس بي ومدخل PD 18 واط للشحن السريع.</p>\r\n\r\n<p>كل شاحن يدعم تقنية الشحن اللاسلكي بقوة 15 واط.</p>\r\n\r\n<p>تحتوي قاعدة الشواحن على 4 منافذ يو اس بي إضافية.</p>\r\n\r\n<p>يتميز بسهولة نقلة وخفة وزنة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=XEjmELfpxyI&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 16:39:00', '2022-09-01 13:39:00', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '32'),
(381, NULL, 15, 9, NULL, NULL, 'Powerology 10,000mAh 4 in 1 Power Bank Charging Dock - Blue', '397', 'قاعدة شواحن باوربانك 4 في 1 بقوة 10,000 مللي امبير من Powerology - ازرق', NULL, 'uploads/products/888768_untitled-1-3_copy.jpg', NULL, NULL, '', '699', '593.81', '1', '<p>Product Details:</p>\r\n\r\n<p>(New version) of the 4 portable chargers, each with a capacity of 10,000mAh from Powerology.</p>\r\n\r\n<p>Each portable charger contains two built-in wires, Type C and Lightning, in addition to a USB port and an 18W PD port for fast charging.</p>\r\n\r\n<p>Each charger supports 15W wireless charging technology.</p>\r\n\r\n<p>The charging base contains 4 additional USB ports.</p>\r\n\r\n<p>It is characterized by ease of movement and light weight.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>(الاصدار الجديد) من قاعدة الشواحن المتنقلة عدد 4 كل شاحن بقوة 10,000 مللي امبير من Powerology.</p>\r\n\r\n<p>كل شاحن متنقل يحتوي على وايرين مدمجين تايب سي و لايتننغ بالإضافة الى مدخل يو اس بي ومدخل PD 18 واط للشحن السريع.</p>\r\n\r\n<p>كل شاحن يدعم تقنية الشحن اللاسلكي بقوة 15 واط.</p>\r\n\r\n<p>تحتوي قاعدة الشواحن على 4 منافذ يو اس بي إضافية.</p>\r\n\r\n<p>يتميز بسهولة نقلة وخفة وزنة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=XEjmELfpxyI&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 16:39:20', '2022-09-01 13:39:20', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '32'),
(382, NULL, 10, 0, NULL, NULL, 'Apple AirTag - 1 Piece', '410', 'قطعة AirTag للتعقب من Apple', NULL, 'uploads/products/135499_airtag-2.jpg', NULL, NULL, '', '175', '135', '1', '<p>Product Details:</p>\r\n\r\n<p>The AirTag tracking piece, through which you can track all your personal items and also locate them in case of loss from Apple.</p>\r\n\r\n<p>It is characterized by being programmed in a way that gives coordinates without the Internet, so that it picks up the signal from any Apple device close to it and determines its coordinates based on that.</p>\r\n\r\n<p>It can be controlled through the Find My application on Apple devices and locates it in case you lose it by turning on the alert sounds through the program.</p>\r\n\r\n<p>Easy to use, all you have to do is press the link button and connect it with your phone and no one will be able to control or track it.</p>\r\n\r\n<p>Can be used for keys, bags, in the car, etc.</p>\r\n\r\n<p>It works for a continuous year from the date of use and the battery can be replaced later (Battery type CR2032).</p>\r\n\r\n<p>Warranty: 1 Year</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>قطعة التعقب AirTag والتي يمكن من خلالها تعقب جميع اغراضك الشخصية وايضاً تحديد اماكنها في حال الضياع من شركة Apple.</p>\r\n\r\n<p>تتميز بأنها مبرجمه بطريقة تقوم بأعطاء الاحداثيات من غير انترنت بحيث انها تلتقط الاشارة من اي جهاز ابل قريب منها وتحدد احداثياتها بناء على ذلك.</p>\r\n\r\n<p>يمكن التحكم بها عن طريق برنامج Find My في اجهزة ابل وتحديد مكانها في حال اضعتها عن طريق تشغيل اصوات التنبية من خلال البرنامج.</p>\r\n\r\n<p>سهل استخدامها كل ماعليك هو الضغط على زر الارتباط وشبكها مع هاتفك ولن يستطيع اي شخص التحكم بها او تتبعها.</p>\r\n\r\n<p>يمكن استخدامها للمفاتيح او للشنط او في السيارة وغيرها.</p>\r\n\r\n<p>تعمل لمدة سنة متواصلها من تاريخ تشغيلها ويمكن استبدال البطارية لاحقاً ( نوع البطارية CR2032 ).</p>\r\n\r\n<p>ضمان سنة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=IA6_Tw1Ov4E&feature=emb_imp_woyt&ab_channel=AppleSupport', '', '1', NULL, NULL, '1', '2022-09-01 16:41:54', '2022-09-01 13:41:54', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '10'),
(383, NULL, 7, 0, NULL, NULL, 'Apple Earphones', '505', 'سماعة اذن واير من Apple', NULL, 'uploads/products/737772_earpods-lightning-connector-1.jpg', NULL, NULL, '', '120', '69', '1', '<p>Product Details:</p>\r\n\r\n<p>Apple wired earphones.</p>\r\n\r\n<p>Input: Lightning.</p>\r\n', '<p>تفاصيل المنتج:</p>\r\n\r\n<p>سماعة اذن واير من شركة Apple.</p>\r\n\r\n<p>مدخل: لايتننغ.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 16:43:48', '2022-09-01 13:43:48', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '10'),
(384, NULL, 10, 0, NULL, NULL, 'MOFT Snap-On MagSafe Phone Stand – Peachy', '20009', 'ستاند ومحفظة للجوال MagSafe من موفت – وردي', NULL, 'uploads/products/800001_moft-pink-1.jpg', NULL, NULL, '', '109', '65', '1', '<p>Product Details:</p>\r\n\r\n<p>Grip, Stand and Wallet from Moft, supports MagSafe technology.</p>\r\n\r\n<p>Suitable for all Apple 12 phones via magnet ( MagSafe ) without need for any adhesive.</p>\r\n\r\n<p>It can be used as a base in length or width at an angle of 60 degrees, as desired and enjoy watching Movies or Youtube.</p>\r\n\r\n<p>It features magnets to attach it to any magnetic bases in the car.</p>\r\n\r\n<p>It has a wallet for cards, and a maximum of 3 cards can be placed.</p>\r\n\r\n<p>Small in size, suitable and does not increase the thickness of the phone.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مسكة وستاند ومحفظة من شركة موفت والتي تدعم تقنية MagSafe.</p>\r\n\r\n<p>مناسبة لجميع هواتف ابل 12 عن طريق المغناطيس ( MagSafe ) دون الحاجة الى أي لاصق.</p>\r\n\r\n<p>يمكن استخدامها كقاعدة بالطول او العرض بزاوية 60 درجة على حسب الرغبة لمشاهدة الأفلام او اليوتيوب.</p>\r\n\r\n<p>تتميز بوجود مغناطيس لتثبيتها بقواعد مغناطيسية في السيارة وغيرها.</p>\r\n\r\n<p>يوجد فيها محفظة للبطاقات ويمكن وضع 3 بطاقات كحد اقصى.</p>\r\n\r\n<p>صغيرة الحجم ومناسبة ولا تزيد من سماكة الهاتف.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 16:46:57', '2022-09-01 13:46:57', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '29'),
(385, NULL, 10, 0, NULL, NULL, 'MOFT Snap-On MagSafe Phone Stand – Sprout', '20009', 'ستاند ومحفظة للجوال MagSafe من موفت – اخضر فسفوري', NULL, 'uploads/products/319680_moft-sprout-1.jpg', NULL, NULL, '', '109', '65', '1', '<p>Product Details:</p>\r\n\r\n<p>Grip, Stand and Wallet from Moft, supports MagSafe technology.</p>\r\n\r\n<p>Suitable for all Apple 12 phones via magnet ( MagSafe ) without need for any adhesive.</p>\r\n\r\n<p>It can be used as a base in length or width at an angle of 60 degrees, as desired and enjoy watching Movies or Youtube.</p>\r\n\r\n<p>It features magnets to attach it to any magnetic bases in the car.</p>\r\n\r\n<p>It has a wallet for cards, and a maximum of 3 cards can be placed.</p>\r\n\r\n<p>Small in size, suitable and does not increase the thickness of the phone.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مسكة وستاند ومحفظة من شركة موفت والتي تدعم تقنية MagSafe.</p>\r\n\r\n<p>مناسبة لجميع هواتف ابل 12 عن طريق المغناطيس ( MagSafe ) دون الحاجة الى أي لاصق.</p>\r\n\r\n<p>يمكن استخدامها كقاعدة بالطول او العرض بزاوية 60 درجة على حسب الرغبة لمشاهدة الأفلام او اليوتيوب.</p>\r\n\r\n<p>تتميز بوجود مغناطيس لتثبيتها بقواعد مغناطيسية في السيارة وغيرها.</p>\r\n\r\n<p>يوجد فيها محفظة للبطاقات ويمكن وضع 3 بطاقات كحد اقصى.</p>\r\n\r\n<p>صغيرة الحجم ومناسبة ولا تزيد من سماكة الهاتف.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 16:47:40', '2022-09-01 13:47:40', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '29'),
