(387, NULL, 10, 0, NULL, NULL, 'MOFT Snap-On MagSafe Phone Stand – Cedar Lake', '20009', 'ستاند ومحفظة للجوال MagSafe من موفت – اخضر غامج', NULL, 'uploads/products/726049_moft-green-1.jpg', NULL, NULL, '', '109', '65', '1', '<p>Product Details:</p>\r\n\r\n<p>Grip, Stand and Wallet from Moft, supports MagSafe technology.</p>\r\n\r\n<p>Suitable for all Apple 12 phones via magnet ( MagSafe ) without need for any adhesive.</p>\r\n\r\n<p>It can be used as a base in length or width at an angle of 60 degrees, as desired and enjoy watching Movies or Youtube.</p>\r\n\r\n<p>It features magnets to attach it to any magnetic bases in the car.</p>\r\n\r\n<p>It has a wallet for cards, and a maximum of 3 cards can be placed.</p>\r\n\r\n<p>Small in size, suitable and does not increase the thickness of the phone.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مسكة وستاند ومحفظة من شركة موفت والتي تدعم تقنية MagSafe.</p>\r\n\r\n<p>مناسبة لجميع هواتف ابل 12 عن طريق المغناطيس ( MagSafe ) دون الحاجة الى أي لاصق.</p>\r\n\r\n<p>يمكن استخدامها كقاعدة بالطول او العرض بزاوية 60 درجة على حسب الرغبة لمشاهدة الأفلام او اليوتيوب.</p>\r\n\r\n<p>تتميز بوجود مغناطيس لتثبيتها بقواعد مغناطيسية في السيارة وغيرها.</p>\r\n\r\n<p>يوجد فيها محفظة للبطاقات ويمكن وضع 3 بطاقات كحد اقصى.</p>\r\n\r\n<p>صغيرة الحجم ومناسبة ولا تزيد من سماكة الهاتف.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 16:49:42', '2022-09-01 13:49:42', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '29'),
(388, NULL, 10, 13, NULL, NULL, 'Newtech Android Interface Box', '30000', 'قطعة اندرويد انترفيس لتغيير نظام شاشات السيارات من Newtech', NULL, 'uploads/products/Image-2022-07-18-at-1_09_35-PM.jpeg', NULL, NULL, '', '1000', '900', '1', '<p>Product Details:</p>\r\n\r\n<p>Apple CarPlay to Android 11 car screen system conversion box from NEWTECH.</p>\r\n\r\n<p>It is characterized by its high speed, which allows you to watch YouTube, Netflix and other programs in Google Play without changing the original car screen.</p>\r\n\r\n<p>The screen can be divided to open more than one program at the same time, and you can also return to the original car system with just one click.</p>\r\n\r\n<p>It is characterized by its small size and ease of installation and use by connecting the operating wire to the Apple CarPlay port from the car to the box.</p>\r\n\r\n<p>It supports all cars that have Apple CarPlay and can be installed on more than one car.</p>\r\n\r\n<p>It can be connected to the Internet via Wi-Fi or by installing an internet SIM card.</p>\r\n\r\n<p>Storage space of up to 32 GB in addition to the presence of random memory 3 GB.</p>\r\n\r\n<p>It contains two ports, the first for additional memory and supports 128 GB, and the second port for the internet SIM card.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>This product only supports cars that have Apple CarPlay system. Please Click&nbsp;<a href=\"https://www.apple.com/sa-ar/ios/carplay/available-models/\">here</a>&nbsp;to see if the car type supports this system or not.</p>\r\n\r\n<p>Works with some well-known cars ( Toyota Land Cruiser 2022 only - Lexus 2022 only - Land Rover Defender - Mercedes G-Class - New American cars - German cars with the exception of&nbsp;<strong>BMW</strong>&nbsp;has a special system )</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>قطعة تحويل نظام شاشة السيارات من Apple CarPlay الى نظام Android 11 من شركة NEWTECH.</p>\r\n\r\n<p>تتميز بسرعتها العالية والتي تتيح لك مشاهدة برامج اليوتيوب ونتفلكس وغيرها من البرامج الموجودة في Google Play دون الحاجة الى تغيير شاشة السيارة الاصلية.</p>\r\n\r\n<p>يمكن تقسيم الشاشة لفتح اكثر من برنامج في وقت واحد وايضاً يمكن الرجوع الى نظام السيارة الاصلي بضغطة زر واحدة فقط.</p>\r\n\r\n<p>تتميز بصغر حجمها وبسهولة تركيبها واستخدامها بتوصيل واير التشغيل منفذ Apple CarPlay من السيارة الى القطعة.</p>\r\n\r\n<p>تدعم جميع السيارات التي تحتوي على نظام Apple CarPlay ويمكن تركيبها على اكثر من سيارة.</p>\r\n\r\n<p>يمكن توصيلها بالانترنت عن طريق الواي-فاي او تركيب شريحة انترنت.</p>\r\n\r\n<p>مساحة تخزين تصل الى 32 جيجابايت بالإضافة الى وجود ذاكرة عشوائية 3 جيجابايت.</p>\r\n\r\n<p>تحتوي على منفذين الأول للذاكرة الإضافية ويدعم 128 جيجابايت والمنفذ الثاني لشريحة الانترنت.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>هذا المنتج يدعم السيارات التي تحتوي على نظام Apple CarPlay فقط ويرجى <a href=\"https://www.apple.com/sa-ar/ios/carplay/available-models/\">الضعط هنا</a> لمعرفة اذا كان نوع السيارة يدعم هذا النظام ام لا.</p>\r\n\r\n<p>يعمل مع بعض السيارات المتعارف عليها ( تويوتا لاندكروزر 2022 - لكزس 2022 - لاندروفر دفندر - مرسيدس جي كلاس - السيارات الامريكية الجديدة - السيارات الألمانية بأستثناء البي ام دبليو لها نظام خاص )</p>\r\n', NULL, 'https://www.youtube.com/watch?v=QoIvSwwuvIQ&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '0', NULL, NULL, '1', '2022-09-01 16:56:23', '2022-09-01 13:56:23', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(389, NULL, 15, 9, NULL, NULL, 'REMAX Hunergy Series 5 Charging Port 60000mAh Power Bank – White', '416', 'شاحن متنقل ذو 5 مخارج Hunergy سيريس من Remax بسعة 60000 مللي امبير - ابيض', NULL, 'uploads/products/393485_H70789cf91bb94e89a07dc907f9cc58784.jpg', NULL, NULL, '', '300', '104.99', '1', '<p>Product Details:</p>\r\n\r\n<p>REMAX Hunergy series 60000mah power bank 4 USB port with QC3.0 &amp; 1 PD 22.5W port.</p>\r\n\r\n<p>Portable and comfortable.</p>\r\n\r\n<p>Digital screen battery indicator.</p>\r\n\r\n<p>LED soft night light helps you to find small lost items in the dark for rooms.</p>\r\n\r\n<p>Support simultaneous charging of 5 devices.</p>\r\n\r\n<p>4 USB Outputs (1 USB Port Support QC3.0).</p>\r\n\r\n<p>Type C port with PD technology for fasting charging.</p>\r\n\r\n<p>3 Power bank charging Inputs.</p>\r\n\r\n<p>Input: Type C + Lightning + Micro.</p>\r\n\r\n<p>Warranty: 1 Year</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن متنقل Hunergy سيريس ذو 4 مخارج يو اس بي يدعم تنقية كوال كوم 3.0 ومخرج بي دي 22.5 واط من REMAX بقوة 60000 مللي امبير.</p>\r\n\r\n<p>مريح وسهل نقلة من مكان الى اخر.</p>\r\n\r\n<p>شاشة رقمية لحالة شحن البطارية.</p>\r\n\r\n<p>اضاءة خافته ال أي دي يساعدك في إيجاد الأشياء في الأماكن المظلمة مثل الغرف.</p>\r\n\r\n<p>يشحن 5 أجهزة بسرعة عالية.</p>\r\n\r\n<p>4 منافذ للشحن يو اس بي منها منفذ واحد بتقنية QC3.0 للشحن السريع.</p>\r\n\r\n<p>منفذ تايب سي بتقنية PD للشحن السريع.</p>\r\n\r\n<p>3 مداخل لشحن الباوربانك.</p>\r\n\r\n<p>يمكن شحنة بمدخل: لايتننغ + مايكرو + تايب سي.</p>\r\n\r\n<p>ضمان لمدة سنة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=l9e1-htLzxk&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 16:57:48', '2022-09-01 13:57:48', NULL, NULL, NULL, NULL, 8, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(390, NULL, 15, 11, NULL, NULL, 'Anker 613 Magnetic Wireless Charger (MagGo)', '401', 'شاحن لاسلكي بتقنية Magsafe للسيارات مع قاعدة قابله للتحريك من Anker', NULL, 'uploads/products/237114_mnbbvcvb-1.jpg', NULL, NULL, '', '249', '215', '1', '<p>Product Details:</p>\r\n\r\n<p>Wireless charger with a base on the car dashboard from ANKER.</p>\r\n\r\n<p>Movable base 134 degrees.</p>\r\n\r\n<p>Easy to install, all you have to do is install it on the car dashboard and charge your phone.</p>\r\n\r\n<p>Distinctive design and does not take up a large area of ​​the car.</p>\r\n\r\n<p>Input: Type C</p>\r\n\r\n<p>Box contains: Wireless charger / Power cable / Car charger with USB port and Type C port to operate / Additional base.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>The charger supports all iPhone 12 and iPhone 13 models only.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن لاسلكي مع قاعدة تركب على طبلون السيارة من شركة ANKER.</p>\r\n\r\n<p>قاعدة قابلة للتحريك 134 درجة.</p>\r\n\r\n<p>سهل في التركيب كل ماعليك تثبيتها على طبلون السيارة وشحن هاتفك.</p>\r\n\r\n<p>تصميم مميز ولا تأخذ مساحه كبيرة من السيارة.</p>\r\n\r\n<p>مدخل: تايب سي.</p>\r\n\r\n<p>الصندوق يحتوي على: الشاحن الاسلكي / كيبل التشغيل / شاحن للسيارة بمنفذين يو اس بي وتايب سي للتشغيل / قاعدة إضافية.</p>\r\n\r\n<p><strong>ملاحظة</strong></p>\r\n\r\n<p>الشاحن يدعم جيمع انواع الايفون 12 والايفون 13 فقط.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=IzNCpxB9bL8&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 16:59:36', '2022-09-01 13:59:36', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '11'),
(391, NULL, 5, 0, NULL, NULL, 'Rako Vapour Handy Portable Garment Steamer', '20016', 'مكواة بخار صغيرة الحجم يدوية قابلة للطي من Rako', NULL, 'uploads/products/152447_rakepotrable-4.jpg', NULL, NULL, '', '199', '160', '1', '<p>Product Details:</p>\r\n\r\n<p>Rako handy vapour foldable iron steamer.</p>\r\n\r\n<p>It is characterized by its speed of operation and turns water into steam in only 25 seconds. It also irons clothes fast and can be carried anywhere outside the house.</p>\r\n\r\n<p>Suitable for travel or outdoor use when necessary.</p>\r\n\r\n<p>Water capacity 250ML and the device reach up to 1500W.</p>\r\n\r\n<p>Contains 2 additional pieces for other uses in ironing clothes.</p>\r\n\r\n<p>It works by electricity and does not need charging or batteries.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مكواة بخار صغيرة الحجم يدوية قابلة للطي من شركة RAKO.</p>\r\n\r\n<p>تتميز بسرعة اشتغالها وتحويل الماء الى بخار في 25 ثانية فقط وايضاً كوي الملابس ويمكن حملها لاي مكان خارج المنزل.</p>\r\n\r\n<p>مناسبة للسفر او الاستعمالات الخارجية وقت الضرورة.</p>\r\n\r\n<p>سعة خزان الماء 250 مل وقوة تصل الى 1500 واط.</p>\r\n\r\n<p>تحتوي على عدد 2 قطع إضافية للاستخدامات الاخرى في كوي الملابس.</p>\r\n\r\n<p>يمكن تشغيلها عن طريق الكهرباء ولا تحتاج الى شحن او بطاريات.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=QbhWhTRZk1s&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 17:00:49', '2022-09-01 14:00:49', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '34'),
