(396, NULL, 9, 0, NULL, NULL, 'inCharge 6 in 1 New Version Cable Hub 100W - Black', '10022', 'وصله وشاحن 6 في 1 الاصدار الجديد بقوة 100 واط من inCharge - اسود', NULL, 'uploads/products/200768_inCharge-X-The-100W-Swiss-Army-1.jpg', NULL, NULL, '', '219', '179', '1', '<p>Product Details:</p>\r\n\r\n<p>6-in-1 Cable Hub from INCHARGE Type C + USB for all devices.</p>\r\n\r\n<p>100W PD fast charging, you can charge your device through the hub as well.</p>\r\n\r\n<p>Metal Luxury No Overheating.</p>\r\n\r\n<p>Interface Inputs: USB + Type C + Lightning.</p>\r\n\r\n<p>Applicable Model: All devices that support Type C or USB.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>وصله 6 في 1 من شركة INCHARGE تايب سي + يو اس بي لجميع الاجهزة.</p>\r\n\r\n<p>قوة شحن 100 واط بتقنية PD للشحن السريع تقدر تشحن جهازك ونقل البيانات في نفس الوقت.</p>\r\n\r\n<p>تصميم رائع من الحديد العازل للحرارة.</p>\r\n\r\n<p>مداخل الوصله: USB + Type C + Lightning.</p>\r\n\r\n<p>الموديل المناسب: كل الأجهزة التي تدعم مدخل تايب سي او يو اس بي.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 17:12:40', '2022-09-01 14:12:40', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
