(398, NULL, 15, 12, NULL, NULL, 'Anker Portable Cordless Charger For Apple Watch', '10024', 'شاحن محمول من غير سلك لساعة ابل من Anker', NULL, 'uploads/products/805839_51JDh1JfE6L_800x800.jpg', NULL, NULL, '', '219', '185', '1', '<p>Product Details:</p>\r\n\r\n<p>Apple watch MFI certified magnetic wireless charger from ANKER.</p>\r\n\r\n<p>It is characterized by no cables, but only to be connected to a home charger, power bank or laptop for operation.</p>\r\n\r\n<p>Distinctive and compact design that does not take up space in the house or car.</p>\r\n\r\n<p>Output: USB.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن لاسلكي مغناطيسي لساعة ابل معتمد من شركة Apple من شركة ANKER.</p>\r\n\r\n<p>يتميز بعدم وجود اسلاك وانما فقط يتم توصيله بشاحن المنزل او باوربانك او لابتوب للتشغيل.</p>\r\n\r\n<p>تصميم مميز وصغير الحجم لا يأخذ حيز فالمنزل او السيارة.</p>\r\n\r\n<p>منفذ التشغيل: يو اس بي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=C8UczHWEn74&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 17:17:30', '2022-09-01 14:17:30', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(399, NULL, 5, 0, NULL, NULL, 'Rako New Version Portable Blender 450ML - White', '20017', 'خلاط محمول الاصدار الجديد صغير الحجم 450مل من Rako - ابيض', NULL, 'uploads/products/942187_rako-blender-5.jpg', NULL, NULL, '', '160', '115', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable blender 450ml compact size from Rako.</p>\r\n\r\n<p>It is characterized by its small size and strength in mixing, and you can take it with you anywhere.</p>\r\n\r\n<p>6 Internal mixing blades and a rotation speed of 16,500RPM.</p>\r\n\r\n<p>The mixer can be used as a cup for a mixed drink.</p>\r\n\r\n<p>It makes all kinds of juices from fruit, milkshakes, baby food and other things.</p>\r\n\r\n<p>The battery capacity is 2500mAh, rechargeable and does not require batteries.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>خلاط محمول 450مل صغير الحجم من شركة Rako.</p>\r\n\r\n<p>يتميز بصغر حجمه وقوته في الخلط وتقدرون تاخذونه معاكم الى اي مكان.</p>\r\n\r\n<p>6 شفرات داخلية للخلط وسرعة دوران تصل الى 16,500RPM.</p>\r\n\r\n<p>يمكن استخدام الخلاط ككوب لشراب ماتم خلطة.</p>\r\n\r\n<p>يصنع جميع انواع العصائر من الفاكهة او الميلك شيك او طعام الاطفال وغيرها من الاشياء.</p>\r\n\r\n<p>سعة البطارية 2500 مللي امبير قابل للشحن ولا يحتاج الى بطاريات.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 17:19:45', '2022-09-01 14:19:45', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '34'),
