(401, NULL, 10, 0, NULL, NULL, 'UNIQ Moven iPad Pro 11 Inch 2020-2021 Case & Stand - Maroon', '20018', 'كڤر وستاند من نوع Moven للايباد 11 برو انش 2020-2021 من UNIQ - عنابي', NULL, 'uploads/products/940457_moven-maroon-ipadpro-11-01-high-res-_copy.jpg', NULL, NULL, '', '139', '69', '1', '<p>Product Details:</p>\r\n\r\n<p>iPad pro 11 inch Moven case with stand transparent from the back from UNIQ.</p>\r\n\r\n<p>It is characterized by its small size and doesn&#39;t enlarge the size of the iPad when it is installed and also strongly protecting the iPad with thick corners for more protection in the event of the device falling.</p>\r\n\r\n<p>Different positions that can be used as a base with different angles and ways or as a normal protection as desired.</p>\r\n\r\n<p>It has a place to store Apple smart pencil.</p>\r\n\r\n<p>Suitable for watching lectures, movies, series, etc.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كفر حماية وستاند في نفس الوقت شفاف من الخلف للايباد 11 برو انش من شركة UNIQ.</p>\r\n\r\n<p>يتميز بحجمه الضئيل ومايكبر من حجم الايباد كثير عند تركيبة وايضاً بقوة حمايته للايباد مع وجود زوايا سميكة لحمايه اكثر في حال سقوط الجهاز.</p>\r\n\r\n<p>يمكن تشكيله بوضعيات مختلفة يمكن استخدامة كقاعدة بزوايا وطرق مختلفة او كحماية عادية على حسب الرغبة.</p>\r\n\r\n<p>يحتوي على مكان لتخزين قلم ابل.</p>\r\n\r\n<p>مناسب لمشاهدة المحاضرات او الافلام والمسلسلات وغيرها.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 17:22:28', '2022-09-01 14:22:28', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '45'),
(402, NULL, 10, 0, NULL, NULL, 'UNIQ Moven iPad Pro 11 Inch 2020-2021 Case & Stand - Grey', '20018', 'كڤر وستاند من نوع Moven للايباد 11 برو انش 2020-2021 من UNIQ - رمادي', NULL, 'uploads/products/322659_moven-grey-ipadpro-11-01-high-res-jhhhhh.jpg', NULL, NULL, '', '139', '69', '1', '<p>Product Details:</p>\r\n\r\n<p>iPad pro 11 inch Moven case with stand transparent from the back from UNIQ.</p>\r\n\r\n<p>It is characterized by its small size and doesn&#39;t enlarge the size of the iPad when it is installed and also strongly protecting the iPad with thick corners for more protection in the event of the device falling.</p>\r\n\r\n<p>Different positions that can be used as a base with different angles and ways or as a normal protection as desired.</p>\r\n\r\n<p>It has a place to store Apple smart pencil.</p>\r\n\r\n<p>Suitable for watching lectures, movies, series, etc.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كفر حماية وستاند في نفس الوقت شفاف من الخلف للايباد 11 برو انش من شركة UNIQ.</p>\r\n\r\n<p>يتميز بحجمه الضئيل ومايكبر من حجم الايباد كثير عند تركيبة وايضاً بقوة حمايته للايباد مع وجود زوايا سميكة لحمايه اكثر في حال سقوط الجهاز.</p>\r\n\r\n<p>يمكن تشكيله بوضعيات مختلفة يمكن استخدامة كقاعدة بزوايا وطرق مختلفة او كحماية عادية على حسب الرغبة.</p>\r\n\r\n<p>يحتوي على مكان لتخزين قلم ابل.</p>\r\n\r\n<p>مناسب لمشاهدة المحاضرات او الافلام والمسلسلات وغيرها.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 17:23:39', '2022-09-01 14:23:39', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '45'),
