(406, NULL, 15, 11, NULL, NULL, 'Bestek Car Power Inverter 400W', '20021', 'موصل لتحويل كهرباء السيارة الى كهرباء منزلية بقوة 400 واط من BESTEK', NULL, 'uploads/products/994240_12-25.jpg', NULL, NULL, '', '180', '120', '1', '<p>Product Details:</p>\r\n\r\n<p>A Device for converting car electricity into home electricity with a power of 400W from BESTEK.</p>\r\n\r\n<p>Easy to use, all you have to do is install the car entrance and operate any device you have less than 400W.</p>\r\n\r\n<p>It has home socket UK version and 4 USB outputs for charging.</p>\r\n\r\n<p>Two ways to operate, either through the car input or through the battery.</p>\r\n\r\n<p>Made of high quality and efficient materials.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز تحويل كهرباء السيارة الى كهرباء منزل بقوة 400 واط من شركة BESTEK.</p>\r\n\r\n<p>سهل الاستخدام كل ماعليكم تركبون مدخل السيارة او واير البطارية وتشغلون اي جهاز عندكم اقل من 400 واط.</p>\r\n\r\n<p>يحتوي على منفذ جداري ثلاثي بالإضافة الى 4 منافذ يو اس بي للشحن.</p>\r\n\r\n<p>طريقتين للتشغيل اما عن طريق منفذ السيارة او عن طريق البطارية.</p>\r\n\r\n<p>مصنوع من مواد عالية الجودة والكفاءة.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 17:32:27', '2022-09-01 14:32:27', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '53'),
(407, NULL, 11, 0, NULL, NULL, 'Rako Selfie Mobile Phone Ring Light With Stand', '20022', 'قاعدة مع ستاند سلفي واضاءة للهاتف من Rako', NULL, 'uploads/products/605593_rak1.jpg', NULL, NULL, '', '230', '150', '1', '<p>Product Details:</p>\r\n\r\n<p>Multi-color selfie ring light from RAKO.</p>\r\n\r\n<p>Movable phone holder with wireless remote control for lighting and can be controlled by phone as well.</p>\r\n\r\n<p>It features a base that can be used for photography without the ring light for travel or outside the home.</p>\r\n\r\n<p>Stepless dimming.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>قاعدة مع اضاءة متعددة الالوان لصور السيلفي.</p>\r\n\r\n<p>حامل هاتف قابل للحركة مع جهاز تحكم لاسلكي للإضاءة ويمكن التحكم بها عن طريق الهاتف ايضاً.</p>\r\n\r\n<p>يتميز بوجود قاعدة يمكن استخدامها للتصوير من غير الإضاءة للسفر او خارج المنزل.</p>\r\n\r\n<p>سطوع قابل للتعتيم.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 17:37:35', '2022-09-01 14:37:35', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '34'),
(408, NULL, 10, 0, NULL, NULL, 'UNIQ Cyprus Neoprene Laptop Sleeve 14inch Size - Abyss Blue', '413', 'شنطة Cyprus لأجهزة اللابتوب تناسب احجام اقل من 14 انش من UNIQ - كحلي', NULL, 'uploads/products/501964_3-1.png', NULL, NULL, '', '99', '52', '1', '<p>Product Details:</p>\r\n\r\n<p>Laptop brief with a stylish and distinctive shape from UNIQ.</p>\r\n\r\n<p>Can be used as storage for laptops, books.</p>\r\n\r\n<p>Made of 3 layers of waterproof neoprene.</p>\r\n\r\n<p>The interior of the bag is very soft so as not to cause scratches to the devices.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شنطة ذات شكل انيق ومميز لأجهزة اللابتوب من شركة UNIQ.</p>\r\n\r\n<p>يمكن استخدامها كتخزين للابتوب او الكتب وغيرها.</p>\r\n\r\n<p>مصنوعة من 3 طبقات حماية قوية من مادة النيوبرين المقاوم للماء .</p>\r\n\r\n<p>داخلية الشنطة ناعمة جداً حتى لا تسبب خدوش للأجهزة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=CliZfwI9pB4&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 17:41:31', '2022-09-01 14:41:31', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '45');
