(415, NULL, 15, 12, NULL, NULL, 'Green 6 in 1 Wireless Charger 15W', '406', 'قاعدة شحن لاسلكي لجميع الإجهزة 6 في 1 من Green', NULL, 'uploads/products/881994_green-lion-6-in-1-1-600x600.jpg', NULL, NULL, '', '159', '112', '1', '<p>Product Details:</p>\r\n\r\n<p>Green Wireless charger with luxurious and modern style for office.</p>\r\n\r\n<p>Simultaneously charge 4 device at the same time, 3 via wireless charger and extrs USB output to charge extra 4th device.</p>\r\n\r\n<p>15W Charging power with built-in smart chip to identify the devices and distribute the watts according to the device needs.</p>\r\n\r\n<p>It contains a base that can be hidden to charge the Apple Watch, and it can also charge any wireless headset that supports wireless charging technology.</p>\r\n\r\n<p>Digital clock screen with alarm.</p>\r\n\r\n<p>It can be used to watch seasons or movies as your desire.</p>\r\n\r\n<p>Overcharging and Overheating protection.</p>\r\n\r\n<p>Suitable for offices in work or home.</p>\r\n\r\n<p>Input: Type C.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>The Product contains power cord and does not contain the power charger.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن لاسلكي مع قاعدة وساعة رقمية للمكاتب بشكل عصري وفخم من شركة GREEN.</p>\r\n\r\n<p>يمكن شحن 4 اجهزة في نفس الوقت، 3 عن طريق الشحن لاسلكي ومخرج إضافي يو اس بي لشحن الجهاز الرابع.</p>\r\n\r\n<p>قوة الشاحن اللاسلكي 15 واط مع وجود شريحه ذكية للتعرف على الاجهزة وتوزيع قوة الواط على حسب نوع الجهاز.</p>\r\n\r\n<p>يحتوي على قاعدة يمكن اخفائها لشحن ساعة ابل وايضاً يمكن شحن اي سماعة لاسلكية تدعم تقنية الشحن اللاسلكي.</p>\r\n\r\n<p>ساعة رقمية مدمجة مع امكانية تشغيل المنبة.</p>\r\n\r\n<p>يمكنكم استخدام القاعدة لمشاهدة الافلام او المسلسلات على حسب الرغبة.</p>\r\n\r\n<p>يتميز بوجود حماية من توصيل شحن زائد وايضاً حماية من ارتفاع درجة الحرارة.</p>\r\n\r\n<p>مناسبة للمكاتب للعمل او المنزل.</p>\r\n\r\n<p>مدخل: تايب سي</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>القاعدة تحتوي على سلك التشغيل ولا تحتوي على شاحن التشغيل.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=3n2rOfZRjk0&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 17:51:48', '2022-09-01 14:51:48', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '20'),
(416, NULL, 11, 0, NULL, NULL, 'Green Pocket Size Mobile & Tablet Stand', '405', 'ستاند صغير جداً للهواتف واجهزة التابليت من Green', NULL, 'uploads/products/138846_121.png', NULL, NULL, '', '59', '30', '1', '<p>Product Details:</p>\r\n\r\n<p>Very small adjustable stand that is compatible with all devices from Green.</p>\r\n\r\n<p>Adjustable height for more than one angle, up or down.</p>\r\n\r\n<p>The stand has natural layer of soft leather on the back &amp; bottom so it not cause any scratch your device.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ستاند صغير جداً قابل للتعديل متوافق مع جميع الأجهزة.</p>\r\n\r\n<p>ارتفاع قابل للتعديل لأكثر من زاوية للاعلى او للاسفل.</p>\r\n\r\n<p>يتميز بوجود طبقة من الجلد طبيعي في الخلف والزوايه السفلية حتى لا يسبب خدوش في اجهزتكم.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=sqBItlmgq1o&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 17:54:26', '2022-09-01 14:54:26', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '20'),
(417, NULL, 10, 0, NULL, NULL, 'Green Magic Keyboard For iPad 12.9 inch Arabic\\English', '407', 'لوحة مفاتيح Magic Keyboard للايباد 12.9 انش عربي/انجليزي من Green', NULL, 'uploads/products/381622_00f8303eb0c3dede41315d73feb44fc26f6709c9_0d2f956045c5423b99fa9595817881ce-600x600.jpg', NULL, NULL, '', '469', '434', '1', '<p>Product Details:</p>\r\n\r\n<p>Protective cover and stand in different positions with keyboard at the same time in Arabic + English for iPad 12.9 inch from GREEN.</p>\r\n\r\n<p>This product features completely transforming your iPad into a laptop with a keyboard and mouse, making it easier for you to work outside the home.</p>\r\n\r\n<p>It contains a 500mAh battery and it takes 3 hours to fully charge.</p>\r\n\r\n<p>Small in size and it does not enlarge the ipad when it is installed.</p>\r\n\r\n<p>Suitable for watching lectures, movies, series, etc.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كڤر حماية وستاند مع كيبورد في نفس الوقت باللغتين عربي + انجليزي بوضعيات مختلفة للايباد 12.9 انش من شركة GREEN.</p>\r\n\r\n<p>يتميز هذا المنتج بتحويل الايباد الى لابتوب بشكل كامل من كيبورد وماوس مما يسهل عليك العمل خارج المنزل.</p>\r\n\r\n<p>يحتوي على بطارية بقوة 500 مللي امبير تستغرق مدة الشحن 3 ساعات.</p>\r\n\r\n<p>حجمه ضئيل ومايكبر من حجم الايباد كثير عند تركيبة.</p>\r\n\r\n<p>مناسب لمشاهدة المحاضرات او الافلام والمسلسلات وغيرها.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=lQQT3CWKv98&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 18:07:33', '2022-09-01 15:07:33', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '20'),
(418, NULL, 15, 9, NULL, NULL, 'Devia iPhone Portable Power Bank 4800mAh', '403', 'شاحن متنقل بسعة 4800 مللي امبير للايفون من Devia', NULL, 'uploads/products/247363_devia-mini-powerbank-1.jpg', NULL, NULL, '', '150', '78', '1', '<p>Product Details:</p>\r\n\r\n<p>Very compact power bank with a capacity of 4,800mAh with a built-in Lightning output from DEVIA.</p>\r\n\r\n<p>It is characterized by its small size and it does not need to carry any other wires to charge the phone.</p>\r\n\r\n<p>Suitable for outdoor uses. You can put it in the bag or in your clothes due to its small size.</p>\r\n\r\n<p>Supports PD 20W fast charging technology that charges the iPhone 50% in just 30 minutes.</p>\r\n\r\n<p>Input: Type C.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>باوربانك صغير الحجم جداً بسعة 4,800 مللي امبير مع مخرج لايتننغ مدمج من شركة DEVIA.</p>\r\n\r\n<p>يتميز بحجمة الصغير ويوفر من عدم حمل اي وايرات اخرى لشحن الهاتف.</p>\r\n\r\n<p>مناسب للأستعمالات الخارجية تقدرون تحطونة فالشنطة او في ملابسك بحكم حجمة الصغير.</p>\r\n\r\n<p>يدعم تقنية PD للشحن السريع بقوة 20 واط يشحن الايفون 50% خلال 30 دقيقة فقط.</p>\r\n\r\n<p>مدخل شحن الباوربانك تايب سي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=ukfCN-P6Qvs&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 18:10:21', '2022-09-01 15:10:21', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '54'),
(419, NULL, 15, 9, NULL, NULL, 'Anker Power Core Essential 20,000mAh Power Bank 2 Ports', '404', 'باوربانك بسعة 20,000 مللي امبير ذو مخرجين من Anker', NULL, 'uploads/products/303602_Anker-325-Power-Bank-PowerCore-20K-5.jpg', NULL, NULL, '', '199', '140', '1', '<p>Product Details:</p>\r\n\r\n<p>Power bank with 2 USB outputs IQ technology for fast charging and a capacity of 20,000mAh from ANKER.</p>\r\n\r\n<p>It is characterized by its light weight and is considered the weight of an iPhone.</p>\r\n\r\n<p>Charges two devices at the same time at high speed.</p>\r\n\r\n<p>Two inputs to charge the power bank Type-C &amp; Micro.</p>\r\n\r\n<p>The front cover of the power bank is made of fire retardant materials.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>باوربانك ذو مخرجين يو اس بي بتقنية IQ للشحن السريع بسعة 20,000 مللي امبير من شركة ANKER.</p>\r\n\r\n<p>يتميز بوزنه الخفيف ويعتبر بوزن هاتف ايفون.</p>\r\n\r\n<p>يشحن جهازين بنفس الوقت بسرعة عالية.</p>\r\n\r\n<p>مدخلين لشحن الباوربانك مدخل تايب سي ومدخل مايكرو.</p>\r\n\r\n<p>الغطاء الامامي للباوربانك مصنوع من مواد مضادة للحريق.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 18:12:10', '2022-09-01 15:12:10', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(420, NULL, 10, 13, NULL, NULL, 'Porodo Rechargeable Portable Car Washer Device', '442', 'جهاز غسيل السيارات المتنقل قابل للشحن من Porodo', NULL, 'uploads/products/837853_0g-58df4c31ea5118eba621253cc4d1b5aa_copy.jpg', NULL, NULL, '', '330', '', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable car washer with 4000mAh rechargeable battery from PORODO.</p>\r\n\r\n<p>It is characterized by its power of 41W/21V, as well as its light weight, making it easy to transport and use.</p>\r\n\r\n<p>The Box Contains: Washing device + Operating battery + Battery charger + Different front heads + Soap bowl + Water hose + User guide.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز غسيل السيارات المتنقل مع بطارية قابلة للشحن بقوة 4000 مللي امبير من شركة PORODO.</p>\r\n\r\n<p>يتميز بقوته التي تصل الى 41 واط/ 21 فولت وايضاً بخفة وزنه ممها يسهل عملية نقله واستخدامة.</p>\r\n\r\n<p>الصندوق يحتوي على: جهاز الغسيل المتنقل + بطارية التشغيل + شاحن البطارية + رؤوس مختلفة امامية + وعاء الصابون + خرطوم الماء + دليل الاستخدام.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=5FQKiAk2PTM', '', '1', NULL, NULL, '1', '2022-09-01 18:13:49', '2022-09-01 15:13:49', 1, NULL, NULL, 1, 6, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '31'),
(421, NULL, 10, 0, NULL, NULL, 'UNIQ Lyft Snap-On MagSafe Phone Stand & Card Holder - Green', '411', 'ستاند ومحفظة للجوال MagSafe من UNIQ - اخضر', NULL, 'uploads/products/720306_uniq-lyft-green-1.jpg', NULL, NULL, '', '99', '66', '1', '<p>Product Details:</p>\r\n\r\n<p>Grip, Stand and Wallet from UNIQ, supports MagSafe technology.</p>\r\n\r\n<p>Suitable for all Apple 12 &amp; 13 iphones via magnet ( MagSafe ) without need for any adhesive.</p>\r\n\r\n<p>It can be used as a base in length or width at an angle of 60 degrees, as desired and enjoy watching Movies or Youtube.</p>\r\n\r\n<p>It has a wallet for cards, and a maximum of 3 cards can be placed.</p>\r\n\r\n<p>Small in size, suitable and does not increase the thickness of the phone.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>This product only supports iPhone 12 and 13 of all kinds that support MagSafe technology, and if your phone does not support magnets, the product comes with a double-sided adhesive to install the product without the need for magnets.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مسكة وستاند ومحفظة Lyft والتي تدعم تقنية MagSafe من شركة UNIQ.</p>\r\n\r\n<p>مناسبة لجميع هواتف ابل 12 و 13 عن طريق المغناطيس ( MagSafe ) دون الحاجة الى أي لاصق.</p>\r\n\r\n<p>يمكن استخدامها كقاعدة بالطول او العرض بزاوية 60 درجة على حسب الرغبة لمشاهدة الأفلام او اليوتيوب.</p>\r\n\r\n<p>يوجد فيها محفظة للبطاقات ويمكن وضع 3 بطاقات كحد اقصى.</p>\r\n\r\n<p>صغيرة الحجم ومناسبة ولا تزيد من سماكة الهاتف.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>هذا المنتج يدعم هواتف الايفون 12 و 13 بجميع انواعها فقط والتي تدعم تقنية MagSafe، وفي حال كان هاتف لا يدعم المغناطيس فأن المنتج يأتي معه لاصق ذو وجهين لتركيب المنتج دون الحاجه لمغناطيس.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=BIfjt2M1pVg&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-09-01 18:18:35', '2022-09-01 15:18:35', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '45'),
(422, NULL, 10, 0, NULL, NULL, 'UNIQ Lyft Snap-On MagSafe Phone Stand & Card Holder - Pink', '411', 'ستاند ومحفظة للجوال MagSafe من UNIQ - وردي', NULL, 'uploads/products/351779_uniq-lyft-pink-2.jpg', NULL, NULL, '', '99', '66', '1', '<p>Product Details:</p>\r\n\r\n<p>Grip, Stand and Wallet from UNIQ, supports MagSafe technology.</p>\r\n\r\n<p>Suitable for all Apple 12 &amp; 13 iphones via magnet ( MagSafe ) without need for any adhesive.</p>\r\n\r\n<p>It can be used as a base in length or width at an angle of 60 degrees, as desired and enjoy watching Movies or Youtube.</p>\r\n\r\n<p>It has a wallet for cards, and a maximum of 3 cards can be placed.</p>\r\n\r\n<p>Small in size, suitable and does not increase the thickness of the phone.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>This product only supports iPhone 12 and 13 of all kinds that support MagSafe technology, and if your phone does not support magnets, the product comes with a double-sided adhesive to install the product without the need for magnets.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مسكة وستاند ومحفظة Lyft والتي تدعم تقنية MagSafe من شركة UNIQ.</p>\r\n\r\n<p>مناسبة لجميع هواتف ابل 12 و 13 عن طريق المغناطيس ( MagSafe ) دون الحاجة الى أي لاصق.</p>\r\n\r\n<p>يمكن استخدامها كقاعدة بالطول او العرض بزاوية 60 درجة على حسب الرغبة لمشاهدة الأفلام او اليوتيوب.</p>\r\n\r\n<p>يوجد فيها محفظة للبطاقات ويمكن وضع 3 بطاقات كحد اقصى.</p>\r\n\r\n<p>صغيرة الحجم ومناسبة ولا تزيد من سماكة الهاتف.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>هذا المنتج يدعم هواتف الايفون 12 و 13 بجميع انواعها فقط والتي تدعم تقنية MagSafe، وفي حال كان هاتف لا يدعم المغناطيس فأن المنتج يأتي معه لاصق ذو وجهين لتركيب المنتج دون الحاجه لمغناطيس.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=BIfjt2M1pVg&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-09-01 18:19:48', '2022-09-01 15:19:48', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '45'),
