(429, NULL, 6, 0, NULL, NULL, 'Sensibo Sky Wi-Fi AC Remote Controller', '437', 'جهاز ذكي للتكييف من Sensibo', NULL, 'uploads/products/580201_layer0_1024x1024_copy.jpg', NULL, NULL, '', '450', '296.81', '1', '<p>Product Details:</p>\r\n\r\n<p>Sensibo smart device that allows you to control the air conditioning by phone while you are away from home.</p>\r\n\r\n<p>You can change the temperature of the air conditioning as desired.</p>\r\n\r\n<p>Modes: Automatic timer On/Off, operating the air conditioner according to the selected temperatures in the room and other features.</p>\r\n\r\n<p>It has a sensor to measure the temperature and humidity in the room.</p>\r\n\r\n<p>Easy installation.</p>\r\n\r\n<p>Supports Alexa and Google Assistant.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز ذكي من شركة سنسيبو يمكن التحكم بالتكييف عن طريق الهاتف وانت خارج المنزل.</p>\r\n\r\n<p>يمكنك تغيير درجة الحرارة على حسب الرغبة.</p>\r\n\r\n<p>يتميز بوجود أكثر من وضع للجهاز منها التشغيل التلقائي بالوقت المحدد، او التشغيل على حسب درجات الحرارة المختارة في للغرفة وغيرها من المميزات.</p>\r\n\r\n<p>يتميز بسهولة التركيب.</p>\r\n\r\n<p>يوجد به حساس لقياس درجة الحرارة والرطوبة في الغرفة.</p>\r\n\r\n<p>يدعم الأوامر الصوتية من اليكسا وقوقل اسستنس.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=jWaiEGH0CtI&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 18:40:17', '2022-09-01 15:40:17', NULL, NULL, 1, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '40'),
(430, NULL, 5, 0, NULL, NULL, 'Torras Coolify 2 Nick Air Conditioner - Black', '20023', 'مكيف Coolify 2 المتنقل قابل للشحن من Torras - اسود', NULL, 'uploads/products/913930_71JlB0likSL__AC_SX679_.jpg', NULL, NULL, '', '609', '609', '1', '<p>Product Details:</p>\r\n\r\n<p>TORRAS Portable 4000mAh Bladeless Personal Air Cooler that cools the hot air around you in a unit second and makes it amazingly cool.</p>\r\n\r\n<p>It cools the air 15 degrees Celsius less than the temperature of the surrounding air and also contains two side panels to give more cooling and 360 degrees ambient air.</p>\r\n\r\n<p>It is characterized by its lightweight design and is also very well secured on the neck so as not to cause you inconvenience.</p>\r\n\r\n<p>The possibility of cooling and heating at the same time, so it is suitable for all seasons, summer or winter.</p>\r\n\r\n<p>3 Fan speeds you can choose the ideal wind power as needed.</p>\r\n\r\n<p>Ultra-quite fan comfortable and can be used for sports or at work.</p>\r\n\r\n<p>Input: Type C, It takes 3 hours to fully charge and works for 1.5 to 18 hours, depending on usage.</p>\r\n\r\n<p>Warranty: 1 Year</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مبرد هواء شخصي من غير شفرات بسعة 4000 مللي امبير محمول يمكنه تبريد الهواء الساخن من حولك خلال ثانية وحدة ويجعله بارد بشكل مذهل من شركة TORRAS.</p>\r\n\r\n<p>يبرد الهواء بـ 15 درجة مؤيه اقل من درجة حرارة الجو المحيط بك وايضاً يحتوي على لوحتين جانبيه لتعطي تبريد اكثر وهواء محيطي 360 درجة.</p>\r\n\r\n<p>يتميز بتصميمه وخفة وزنه وايضاً محكم بشكل جيد جداً على الرقبه حتى لا يسبب لك ازعاج.</p>\r\n\r\n<p>إمكانية التبريد والتسخين في نفس الوقت لذلك فهو مناسب لجميع الفصول الصيف او الشتاء.</p>\r\n\r\n<p>3 سرعات للمروحة يمكنك اختيار طاقة الرياح المثالية حسب الحاجة.</p>\r\n\r\n<p>صوت المبرد خفيف للغاية ويمكن استخدامه للرياضة أو في العمل.</p>\r\n\r\n<p>مدخل: تايب سي ويستغرق شحنة 3 ساعات ويعمل لمدة 1.5 الى 18 ساعة على حسب الاستخدام.</p>\r\n\r\n<p>ضمان سنة</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 18:45:22', '2022-09-01 15:45:22', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '44'),
