-01 18:45:37', '2022-09-01 15:45:37', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '44'),
(432, NULL, 5, 0, NULL, NULL, 'Xiaomi Mi Mini Vacuum Cleaner', '433', 'Xiaomi مكنسة كهربائية محمولة صغيرة الحجم من ', NULL, 'uploads/products/670441_1826436-01.jpg', NULL, NULL, '', '179', '125', '1', '<p>Product Details:</p>\r\n\r\n<p>Small size vacuum cleaner with high performance motor and distinctive cylindrical shape from Xiaomi.</p>\r\n\r\n<p>The device has an innovative 2-in-1 nozzle that can be used separately or togther.</p>\r\n\r\n<p>It is characterized by ease of use and high suction power of up to 13kPa.</p>\r\n\r\n<p>Comfortable and you can use it for home, car or cleaning difficult places.</p>\r\n\r\n<p>The internal filter of the vacuum cleaner can be washed and reused.</p>\r\n\r\n<p>It works by charging and does not need batteries.</p>\r\n\r\n<p>Input: Type C</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مكنسة كهربائية صغيرة الحجم بمحرك عالي الاداء وشكل اسطواني مميز من شركة XIAOMI.</p>\r\n\r\n<p>الجهاز يحتوي على فوهة مبتكرة 2 في 1 والتي يمكن استخدامها بشكل منفصل او مع الفرشاة.</p>\r\n\r\n<p>تتميز بسهولة الاستخدام وقوة شفط عالية تصل الى 13 كيلو باسكال.</p>\r\n\r\n<p>مريحة وتقدرون تستخدمونها للبيت او السيارة او تنظيف الاماكن الصعبة.</p>\r\n\r\n<p>يمكن غسيل الفلتر الداخلي للمكنسة واعادة استخدامه مرة اخرى.</p>\r\n\r\n<p>تعمل عن طريق الشحن ولا تحتاج الى بطاريات.</p>\r\n\r\n<p>مدخل: تايب سي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=2CtxHQ6d0QM&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 18:47:15', '2022-09-01 15:47:15', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(433, NULL, 6, 0, NULL, NULL, 'Xiaomi Smart T500 Portable Toothbrush', '434', 'فرشاة اسنان ذكية قابلة للشحن من Xiaomi', NULL, 'uploads/products/218828_41fpqeaij5l__sl1000_-2_photos_v2_x2.jpg', NULL, NULL, '', '170', '127', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable rechargeable smart toothbrush with bluetooth technology that enables you to learn many advantages by phone from Xiaomi.</p>\r\n\r\n<p>It is characterized by the presence of a memory to save the way you use the brush, so that it is recorded, in addition to the presence of the alert feature in the event that it is used in a strong and incorrect way on the teeth.</p>\r\n\r\n<p>3 Different brush modes: Standard for normal cleaning, Soft for sensitive gums and for those who face dental problems, Default Beginner, which you can prepare the brush in the manual way that suits you.</p>\r\n\r\n<p>Battery capacity is 700mAh, and it includes a wireless charging base. It takes 4 to 5 hours to charge, and it works for about 18 days.</p>\r\n\r\n<p>IPX7 Water Resistant.</p>\r\n\r\n<p>Control Application: Xiaomi Mi Home.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>فرشاة اسنان ذكية محمولة قابلة للشحن مع تقنية بلوتوث تمكّنكم من معرفة مزايا كثيرة عن طريق الهاتف من شركة XIAOMI.</p>\r\n\r\n<p>تتميز بوجود ذاكرة لحفظ طريقة استخدامكم للفرشاة وبذلك يتم تسجيلها بالإضافة الى وجود خاصية التنبية في حال تم استخدامها بشكل قوي وخاطئ على الاسنان.</p>\r\n\r\n<p>3 اوضاع مختلفة للفرشاة Standard للتنظيف العادي، Soft للثه الحساسه وللذين يواجهون مشاكل في الاسنان، Default Beginner والذي يمكنك اعداد الفرشاه بالطريقة اليدوية التي تناسبك.</p>\r\n\r\n<p>سعة البطارية 700 مللي امبير وتحتوي على قاعدة للشحن اللاسلكي ويستغرق شحنها من 4 الى 5 ساعات وتعمل لمدة 18 يوم تقريباً.</p>\r\n\r\n<p>مقاومة للماء بمعيار IPX7.</p>\r\n\r\n<p>تطبيق التحكم: Xiaomi Mi Home.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=5qrETxS0cgE&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-09-01 18:48:42', '2022-09-01 15:48:42', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(434, NULL, 7, 0, NULL, NULL, 'Xiaome Redmi Buds 4 Pro - Black', '430', 'سماعة Buds 4 Pro الأصدار الجديد من Xiaomi - اسود', NULL, 'uploads/products/937660_redmi_buds_4_pro.png', NULL, NULL, '', '299', '234', '1', '<p>Product Details:</p>\r\n\r\n<p>Redmi wireless headphones the latest version of the Buds , compatible with Apple and Android devices from Xiaomi.</p>\r\n\r\n<p>The recognition feature to turn on and off when placed in the ear or removed, in addition to the presence of many features with touch technology.</p>\r\n\r\n<p>It has 360 degree surround sound technology to give better sound for watching movies and series.</p>\r\n\r\n<p>Charging time takes about 3 hours and works for 7 hours continuously.</p>\r\n\r\n<p>Supports the latest 43db side noise cancellation technologies.</p>\r\n\r\n<p>It contains the latest Bluetooth 5.3 technology.</p>\r\n\r\n<p>IP54 Water Resistant.</p>\r\n\r\n<p>Input: Type-C charging port.</p>\r\n\r\n<p>Inside Box: Charging Case + Wireless Earphone + Eartips + Cable + Bag.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>سماعة لاسلكية الأصدار الأحدث من فئة Buds متوافقة مع أجهزة ابل والاندرويد من شركة XIAOMI.</p>\r\n\r\n<p>ميزة التعرف للتشغيل وايقاف التشغيل عند وضعها بالاذن او ازالتها بالإضافه الى وجود مميزات عديدة بتقنية اللمس.</p>\r\n\r\n<p>تحتوي على تقنية الصوت المحيطي 360 درجة لتعطي صوت افضل لمشاهدة الافلام والمسلسلات.</p>\r\n\r\n<p>يستغرق شحنها 3 ساعات وتعمل لمدة 7 ساعات متواصله.</p>\r\n\r\n<p>تدعم احدث تقنيات عزل الضوضاء الجانبية 43 ديسيبل.</p>\r\n\r\n<p>تحتوي على تقنية البلوتوث الحديثة 5.3.</p>\r\n\r\n<p>مقاومة للماء بمعيار IP54.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n\r\n<p>الصندوق الداخلي: علبة شحن + سماعة اذن لاسلكية + قطع للأذن + واير الشحن.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=eOjIQ5fby1U&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-01 18:50:07', '2022-09-01 15:50:07', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(435, NULL, 6, 0, NULL, NULL, 'Xiaomi Smart Air Purifier 4 Compact', '431', 'منقي الهواء الذكي الاصدار الرابع الحديث صغير الحجم من Xiaomi', NULL, 'uploads/products/344324_purificador_de_aire_xiaomi_smart_air_purifier_4_compact_01_l.jpg', NULL, NULL, '', '330', '270', '1', '<p>Product Details:</p>\r\n\r\n<p>The smart air purifier fourth generation, is a portable and compact air purifier that can be carried anywhere and covers 48 square meters from Xiaomi.</p>\r\n\r\n<p>Designed to fit on tables or floors and move more easily due to its size and does not take up much space.</p>\r\n\r\n<p>It contains three layers of filters with automatic mode to purify the air perfectly and remove 99.97% of harmful particles and substances.</p>\r\n\r\n<p>It can be controlled by phone with the child safety lock feature, in addition to that it supports voice commands from Alexa and Google assistance.</p>\r\n\r\n<p>Night mode for sleeping and the sound rate is up to 20DB as not to disturb you at bedtime, as well as a screen dimming mode.</p>\r\n\r\n<p>Filters are changeable and have a shelf life of 6 to 12 months and can be purchased from an authorized Xiaomi dealer.</p>\r\n\r\n<p>Control Application: Xiaomi Mi Home.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>منقي هواء ذكي الأصدار الرابع الحديث محمول وصغير الحجم يمكن حمله لأي مكان ويغطي 48 متر مربع من شركة XIAOMI.</p>\r\n\r\n<p>مصمم بشكل يناسب وضعه على الطاولات او الارضيات وتحريك اكثر سهولة بسبب حجمه ولا يأخذ حيز كبير من المكان.</p>\r\n\r\n<p>يحتوي على ثلاث طبقات من الفلاتر مع وضع اوتوماتيكي لينقي الهواء بشكل ممتاز ويزيل 99.97% من الجزئيات والمواد الضارة.</p>\r\n\r\n<p>يمكن التحكم به عن طريق الهاتف مع خاصية قفل الامان للأطفال بالإضافة الى انه يدعم الأوامر الصوتية من اليكسا وقوقل اسستنس.</p>\r\n\r\n<p>وضع ليلي للنوم وتصل نسبة الصوت الى 20 ديسيبل غير مسموع لعدم ازعاجكم وقت النوم وايضاً وضع تعتيم للشاشة.</p>\r\n\r\n<p>الفلاتر قابله للتغيير ويصل عمرها الافتراضي من 6 شهور الى 12 شهر ويمكن شرائها من الوكيل المعتمد لشركة شاومي.</p>\r\n\r\n<p>تطبيق التحكم: Xiaomi Mi Home.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 18:51:34', '2022-09-01 15:51:34', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(436, NULL, 6, 0, NULL, NULL, 'Xiaomi Smart Doorbell 4th Generation', '432', 'الجيل الثالث من الجرس الذكي مع كاميرا مراقبة بدقة 2k وزاوية 180 درجة من Xiaomi', NULL, 'uploads/products/638112_1-2.png', NULL, NULL, '', '309', '269', '1', '<p>Product Details:</p>\r\n\r\n<p>The new version of the smart bell with a high-resolution Wi-Fi camera and clear surveillance imaging from Xiaomi.</p>\r\n\r\n<p>This bell is characterized by giving you an alert and making you see who is on the door and communicate with by voice through your phone while you are outside the house.</p>\r\n\r\n<p>It contains a sensor for moving objects and detects pedestrians in front of the house and covers an open angle of 180 degrees and clearly.</p>\r\n\r\n<p>Supports sound recording system, so you can record a specific sound and it works automatically every time the bell rings.</p>\r\n\r\n<p>Battery capacity is 5200mAh, and it supports battery saving mode, thus it works for 4 months continuously, and it is estimated to be charged at a rate of 4 times a year.</p>\r\n\r\n<p>Video saving system with automatic deleting every 3 days and free cloud storage that can only be viewed by the account holder.</p>\r\n\r\n<p>Wireless speaker with a very strong sound rate of up to 79DB for the bell and works without the Internet with 4 different sound modes, the most important of which is the Do Not Disturb mode.</p>\r\n\r\n<p>It can be installed through adhesive or screws, and it has an anti-theft system if someone tried to steal it, it will ring very loud and record a video automatically so it will capture the thief face.</p>\r\n\r\n<p>Support night vision view through infrared.</p>\r\n\r\n<p>Input: Type-C charging port.</p>\r\n\r\n<p>Control Application: Xiaomi Mi Home.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>الأصدار الجديد من الجرس الذكي مع كاميرا يعمل عن طريق الواي-فاي ذات دقة عالية وتصوير واضح للمراقبة من شركة XIAOMI.</p>\r\n\r\n<p>يتميز هذا الجرس بأنه يعطيك تنبيه ويخليك تشوف من عند الباب وتتواصل معاه بالصوت من خلال هاتفك وانت خارج المنزل.</p>\r\n\r\n<p>يحتوي على حساس للاشياء المتحركة ويكشف الماره امام المنزل ويغطي زاوية مفتوحة 180 درجة وبصورة واضحة.</p>\r\n\r\n<p>يدعم نظام تسجيل الصوت وبذلك يمكنكم تسجيل صوت معين ويعمل في كل مره يدق فيها الجرس بشكل تلقائي.</p>\r\n\r\n<p>سعة البطارية 5200 مللي امبير ويدعم وضع توفير البطارية وبذلك يعمل لمدة 4 شهور بشكل متواصل ويقّدر شحنه بمعدل 4 مرات فالسنة.</p>\r\n\r\n<p>نظام حفظ للفيديوهات مع مسح تلقائي كل 3 ايام وذاكرة تخزين مجانية ومشفرة لا يمكن الاطلاع عليها الى من خلال صاحب الحساب.</p>\r\n\r\n<p>مكبر صوت لاسلكي بمعدل صوت قوي جداً يصل الى 79 ديسيبل للجرس ويعمل بدون انترنت مع 4 اوضاع مختلفة للصوت واهمهم وضع عدم الازعاج.</p>\r\n\r\n<p>يمكن تثبيته من خلال اللاصق او البراغي ويحتوي على نظام مانع للسرقة وفي حال حاول احد سرقته يصدر صوت مزعج جداً وتعمل الكاميرا بشكل تلقائي لتلتقط وجه السارق مع اعطاء تنبيهات على الهاتف.</p>\r\n\r\n<p>يدعم نظام الرؤية الليلة عن طريق الاشعة تحت الحمراء.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n\r\n<p>تطبيق التحكم: Xiaomi Mi Home.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 18:53:27', '2022-09-01 15:53:27', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '48'),
(437, NULL, 5, 0, NULL, NULL, 'Xiaomi Portable Lint Remover', '436', 'جهاز محمول لإزالة الوبر من الملابس من Xiaomi', NULL, 'uploads/products/237206_51385C19-BF8D-4DAA-8BBF-F819BB5924AF-e1661011713325_copy.jpg', NULL, NULL, '', '199', '49.54', '1', '<p>Product Details:</p>\r\n\r\n<p>A portable device for removing lint from clothes</p>\r\n\r\n<p>It is characterized by its small size, lightness and strong performance.</p>\r\n\r\n<p>Easy to use, just turn it on and wipe it over the clothes.</p>\r\n\r\n<p>Very quiet and faint sound that can be carried and used for travel.</p>\r\n\r\n<p>The battery capacity is 1300mAh, rechargeable and does not require batteries.</p>\r\n\r\n<p>Input: Micro, it takes 2 to 3 hours to fully charge and it works for 2 hours continuously.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز محمول لإزالة الوبر من الملابس من شركة Xiaomi.</p>\r\n\r\n<p>يتميز بحجمه الصغير وخفته وادائه القوي.</p>\r\n\r\n<p>سهل الاستخدام فقط يتم تشغيله ومسحهه على الملابس.</p>\r\n\r\n<p>صوت هادئ وخافت جداً ويمكن حمله واستخدامة للسفر.</p>\r\n\r\n<p>سعة البطارية 1300 مللي امبير قابل للشحن ولا يحتاج الى بطاريات.</p>\r\n\r\n<p>مدخل الشحن مايكرو ويستغرق شحنه ساعتين الى ثلاث ساعات ويعمل لمدة ساعتين بشكل متواصل.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 18:54:44', '2022-09-01 15:54:44', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(438, NULL, 15, 10, NULL, NULL, 'Zendrue MIX 2 in1 Power Bank & Wall Charger 5200mAh - Silver', '438', 'شاحن متنقل + شاحن جداري بسعة 5200 مللي امبير من Zendure', NULL, 'uploads/products/872482_dskdjsadk.jpg', NULL, NULL, '', '250', '139.30', '1', '<p>Product Details:</p>\r\n\r\n<p>Multi-use product, it is a power bank and a wall charger at the same time with a capacity of 5200 mAh from ZENDURE.</p>\r\n\r\n<p>It is characterized by the fact that it does not need a wire for charging, but rather is installed in the wall outlet of the house and charges itself.</p>\r\n\r\n<p>Its small size and square shape makes it easy to transport outside the house.</p>\r\n\r\n<p>Contains multiple country port pieces that can be used for travel.</p>\r\n\r\n<p>Easy to use and has a button to turn on the power bank.</p>\r\n\r\n<p>Type C port with PD technology for fast charging of 18W.</p>\r\n\r\n<p>2 USB ports with Zen+ technology for fast charging of 12W.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>منتج متعدد الاستخدام ويعتبر باوربانك وشاحن جداري بنفس الوقت بسعة 5200 مللي امبير من شركة ZENDURE.</p>\r\n\r\n<p>يتميز بانه&nbsp;لا يحتاج الى واير للشحن وانما فقط يتم تركيبة في منفذ الجداري للمنزل ويشحن نفسه.</p>\r\n\r\n<p>حجمه صغير وبشكل مربع مما يسهل عملية نقله لخارج المنزل.</p>\r\n\r\n<p>يحتوي على قطع منافذ متعددة للدول يمكن استخدامة للسفر.</p>\r\n\r\n<p>سهل الاستخدام ويوجد فيه زر لتشغيل الباوربانك.</p>\r\n\r\n<p>مدخل تايب سي بتقنية PD للشحن السريع بقوة 18 واط.</p>\r\n\r\n<p>مدخلين يو اس بي للشحن السريع بقوة 12 واط.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 18:56:29', '2022-09-01 15:56:29', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '49'),
(439, NULL, 9, 0, NULL, NULL, 'Anker Powerline+ III 24k Gold Type C To Lightning Cable - 1.8M', '439', 'واير شحن سريع من الذهب عيار 24 تايب سي الى لايتننغ من Anker', NULL, 'uploads/products/428792_61jpfv5pWjL__AC_SX679_1.jpg', NULL, NULL, '', '189', '139.20', '1', '<p>Product Details:</p>\r\n\r\n<p>Anker 20W PD Type C to Lightning fast charging cable.</p>\r\n\r\n<p>It is made of 24K gold and has a long life span.</p>\r\n\r\n<p>Fast charging technology it charges the iphone from 0% to 50% in 30 minutes only.</p>\r\n\r\n<p>Beautifully packaged and you can gift it to anyone.</p>\r\n\r\n<p>Length: 1.8 Meters.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>واير شحن سريع تايب سي الى لايتننغ بتقنية PD للشحن السريع بقوة 20 واط من شركة Anker.</p>\r\n\r\n<p>يتميز بأنه مصنوع من الذهب عيار 24 وايضاً بعمره الاستهلاكي الطويل.</p>\r\n\r\n<p>يشحن الايفون من 0% الى 50% في 30 دقيقة فقط.</p>\r\n\r\n<p>مغلف بشكل جميل وتقدرون تهدونه لاي شخص.</p>\r\n\r\n<p>الطول: 1.8 متر.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 19:00:56', '2022-09-01 16:00:56', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '11');
