(440, NULL, 15, 12, NULL, NULL, 'Anker Magnetic 5200mAh Wireless Charger 633 MagGo 2 in 1 Wireless Charging Station - Black', '440', 'ستاند 2 في 1 شاحن لاسلكي وباوربانك متنقل بسعة 5000 مللي امبير من Anker - اسود', NULL, 'uploads/products/936167_B25A7211-Anker-2-in-1-Magnetic-Wireless-Charger-MagGo-Black.jpg', NULL, NULL, '', '350', '300.30', '1', '<p>Product Details:</p>\r\n\r\n<p>Wireless charger stand and power bank (MagSafe) at the same time with a capacity of 5000mAh from ANKER.</p>\r\n\r\n<p>It is characterized by the ability to charge AirPods via wireless charging, as well as iPhone through the built-in power bank in the stand.</p>\r\n\r\n<p>The stand can be adjusted 40 degrees horizontally and 360 degrees through the magnet.</p>\r\n\r\n<p>The product can be used on the desk while working or carry the power bank and use it separately.</p>\r\n\r\n<p>The power bank can be charged by placing it in the base only.</p>\r\n\r\n<p>Wireless charging power 7.5W.</p>\r\n\r\n<p>The box contains: Wireless charger + Power bank + Operating cable + Operating wall charger.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>This Product supports ONLY iPhone 12 and iPhone 13 with MageSafe technology.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ستاند شاحن لاسلكي وباوربانك ( MagSafe ) في نفس الوقت بسعة 5000 مللي امبير من ANKER.</p>\r\n\r\n<p>يتميز بالقدرة على شحن الايربودز عن طريق الشحن الاسلكي وايضاً الايفون من خلال الباوربانك المدمج فالستاند.</p>\r\n\r\n<p>الستاند قابل للتحريك 40 درجة بشكل افقي وايضاً 360 درجة من خلال المغناطيس.</p>\r\n\r\n<p>يمكن استخدام المنتج على المكتب اثناء العمل او حمل الباوربانك واستخدامه بشكل منفصل.</p>\r\n\r\n<p>يمكن شحن الباوربانك عن طريق وضعه فالقاعدة فقط.</p>\r\n\r\n<p>قوة الشاحن اللاسلكي 7.5 واط.</p>\r\n\r\n<p>الكرتون يحتوي على: ستاند + باوربانك + كيبل التشغيل + شاحن جداري للتشغيل.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>هذا المنتج يدعم ايفون 12 و ايفون 13 والذي يحتوي على تقنية ( MagSafe ) للشحن اللاسلكي عن طريق المغناطيس.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 19:06:56', '2022-09-01 16:06:56', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '11'),
(441, NULL, 15, 10, NULL, NULL, 'Anker Power Core III Fusion 5000mAh Hybrid Battery & Wall Charger', '441', 'شاحن متنقل + شاحن جداري بسعة 5000 مللي امبير من Anker', NULL, 'uploads/products/931945_0001826_anker-powercore-iii-fusion-5k-pd-hybird-white-a1624h22_copy.jpg', NULL, NULL, '', '250', '139.30', '1', '<p>Product Details:</p>\r\n\r\n<p>Multi-use product, it is a power bank and a wall charger at the same time with a capacity of 5000mAh from ANKER.</p>\r\n\r\n<p>It is characterized by the fact that it does not need a wire for charging, but rather is installed in the wall outlet of the house and charges itself.</p>\r\n\r\n<p>Its small size and square shape makes it easy to transport outside the house.</p>\r\n\r\n<p>Contains multiple country port pieces that can be used for travel.</p>\r\n\r\n<p>Easy to use and has a button to turn on the power bank.</p>\r\n\r\n<p>Type C port with PD technology for fast charging of 18W.</p>\r\n\r\n<p>USB port with IQ technology for fast charging.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>منتج متعدد الاستخدام ويعتبر باوربانك وشاحن جداري بنفس الوقت بسعة 5000 مللي امبير من شركة ANKER.</p>\r\n\r\n<p>يتميز بانه&nbsp;لا يحتاج الى واير للشحن وانما فقط يتم تركيبة في منفذ الجداري للمنزل ويشحن نفسه.</p>\r\n\r\n<p>حجمه صغير وبشكل مربع مما يسهل عملية نقله لخارج المنزل.</p>\r\n\r\n<p>يحتوي على قطع منافذ متعددة لجميع الدول يمكن استخدامة للسفر.</p>\r\n\r\n<p>سهل الاستخدام ويوجد فيه زر لتشغيل الباوربانك.</p>\r\n\r\n<p>مدخل تايب سي بتقنية PD للشحن السريع بقوة 18 واط.</p>\r\n\r\n<p>مدخل يو اس بي تقنية IQ للشحن السريع .</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 19:08:27', '2022-09-01 16:08:27', NULL, NULL, NULL, NULL, 1, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(442, NULL, 5, 0, NULL, NULL, 'UNIQ Lyfro Blast Portable UVC Purifying Air Cooler', '20028', 'مبرد ومعقم للهواء 500مل Lyfro صغير الحجم من UNIQ', NULL, 'uploads/products/163598_21030213010_1.jpg', NULL, NULL, '', '210', '100', '1', '<p>Product Details:</p>\r\n\r\n<p>Uniq Lyfro portable air cooler can cool the hot air around you by 5 degrees lower.</p>\r\n\r\n<p>It is characterized by the presence of ultraviolet rays to sterilize the air during cooling.</p>\r\n\r\n<p>3 fan speeds You can choose the ideal wind power as needed and the air range is 1.5m.</p>\r\n\r\n<p>500ML Water tank capacity and you can put ice mixed with water.</p>\r\n\r\n<p>Ultra-quite fan comfortable and can be used in bedrooms or at work.</p>\r\n\r\n<p>This portable air cooler has three functions including air cooling, humidification and purification.</p>\r\n\r\n<p>The operating port is Micro, and does not require charging or batteries.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مبرد هواء Lyfro شخصي خفيف الوزن محمول من شركة UNIQ يمكنه تبريد الهواء الساخن من حولك بمعدل 5 درجات اقل.</p>\r\n\r\n<p>يتميز بوجود اشعة فوق البنفسجية لتعقيم الهواء اثناء التبريد.</p>\r\n\r\n<p>3 سرعات للمروحة يمكنك اختيار طاقة الرياح المثالية حسب الحاجة ويصل مدى الهواء 1.5 متر.</p>\r\n\r\n<p>سعة خزان المياه 500مل ويمكنك وضع الثلج الممزوج بالماء.</p>\r\n\r\n<p>صوت المبرد خفيف للغاية ويمكن استخدامه في غرف النوم أو في العمل.</p>\r\n\r\n<p>يحتوي مبرد الهواء المحمول هذا على ثلاث وظائف بما في ذلك تبريد الهواء والترطيب والتنقية.</p>\r\n\r\n<p>منفذ التشغيل مايكرو ولا يحتاج الى شحن او بطاريات.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 19:11:02', '2022-09-01 16:11:02', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '45'),
(443, NULL, 12, 0, NULL, NULL, 'Rako Vibo Sports Massage Gun', '20027', 'جهاز مساج العضلات Vibo الرياضي مع شاشة رقمية من Rako', NULL, 'uploads/products/304688_Untitled-1.png', NULL, NULL, '', '320', '290', '1', '<p>Product Details:</p>\r\n\r\n<p>Rechargeable muscle massage gun with 6 replaceable massage heads and LCD touch screen from Rako.</p>\r\n\r\n<p>Helps relieve muscle soreness and stiffness, promotes blood circulation, improves range of motion, and helps speed up warm-up and recovery.</p>\r\n\r\n<p>5 Different vibration speeds each speed has its own massage mode.</p>\r\n\r\n<p>Battery capacity is 6000mAh, the charging time takes 3 to 4 hours, and it works for about 6 hours.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز مساج للعضلات مع 6 رؤوس إضافية وشاشة باللمس للتحكم بسرعة الاهتزاز من شركة Rako.</p>\r\n\r\n<p>يساعد في تخفيف وجع العضلات وتيبسها وايضاً يعزز الدورة الدموية ويحسن نطاق الحركة ويساعد على تسريع الإحماء والتعافي.</p>\r\n\r\n<p>5 سرعات مختلفة للاهتزاز كل سرعة لها وضع خاص بالمساج.</p>\r\n\r\n<p>سعة بطارية 6000 مللي امبير وتستغرق مدة الشحن من 3 الى 4 ساعات ويعمل لمدة 6 ساعات تقريباً.</p>\r\n', NULL, 'https://youtu.be/P0IlwS9ggA4', '', '1', NULL, NULL, '1', '2022-09-01 19:14:04', '2022-09-01 16:14:04', NULL, NULL, NULL, NULL, 3, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '34'),
(444, NULL, 15, 10, NULL, NULL, 'Remax Ligil Series 65W GaN Multi-Compatible Fast Charger', '424', 'شاحن سريع جداً ذو 3 مداخل بقوة 65 واط من Remax', NULL, 'uploads/products/729023_Remax-RP-U55-New-Fast-Charge-Gan-65W-Wall-Fast-Type-C-Gallium-Nitride-Charger-Smart_jpg_640x640.jpg', NULL, NULL, '', '150', '62.80', '1', '<p>Product Details:</p>\r\n\r\n<p>Fast charging 3 ports charger from REMAX.</p>\r\n\r\n<p>It is characterized by its power of up to 65W and can charge all devices very fast charging.</p>\r\n\r\n<p>Two inputs with PD technology for fast charging with a power of 65W, as well as a USB with a power of 60W, and it can charge 3 devices at the same time.</p>\r\n\r\n<p>Supports all types of devices in addition to computers.</p>\r\n\r\n<p>Protection against overpowering or overcharging.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن ذو 3 مداخل للشحن السريع من شركة REMAX.</p>\r\n\r\n<p>يتميز بقوته التي تصل الى 65 واط ويمكنه شحن جميع الاجهزة شحن سريع جداً.</p>\r\n\r\n<p>مدخلين بتقنية PD للشحن السريع بقوة 65 واط وايضاً يو اس بي بقوة 60 واط ويمكن شحن 3 اجهزة في نفس الوقت.</p>\r\n\r\n<p>يدعم جميع انواع الأجهزة بالإضافة الى اجهزة الكمبيوتر.</p>\r\n\r\n<p>حماية من القوة الزائدة او الشحن الزائد.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 19:15:30', '2022-09-01 16:15:30', NULL, NULL, NULL, NULL, 7, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(445, NULL, 7, 0, NULL, NULL, 'Remax Air Conduction Wireless Headphones', '428', 'سماعة لاسلكية بتنقية التوصيل العظمي من Remax', NULL, 'uploads/products/458580_013.jpg', NULL, NULL, '', '199', '71.93', '1', '<p>Product Details:</p>\r\n\r\n<p>Wireless bone conduction headset from REMAX.</p>\r\n\r\n<p>It is characterized by the presence of the latest 5.3 wireless technology and also by its light weight.</p>\r\n\r\n<p>Works with almost all mobile phones.</p>\r\n\r\n<p>IPX6 water and sweat resistant.</p>\r\n\r\n<p>Small and stable, suitable for sports.</p>\r\n\r\n<p>The battery capacity is 140 mAh, it takes 1.5 hours to charge and it works for 7 hours continuously.</p>\r\n', '<p>مواصفات المنتج :</p>\r\n\r\n<p>سماعة لاسلكية بتقنية التوصيل العظمي من شركة REMAX.</p>\r\n\r\n<p>تتميز بوجود احدث تقنيات الاتصال اللاسلكي 5.3 وايضاً بخفة وزنها.</p>\r\n\r\n<p>تعمل مع جميع الهواتف تقريباً.</p>\r\n\r\n<p>مضادة للماء والتعرق بمعيار IPX6.</p>\r\n\r\n<p>صغيرة الحجم وثابته ومناسبة للرياضة.</p>\r\n\r\n<p>سعة البطارية 140 مللي امبير ويستغرق شحنها 1.5 ساعة وتعمل لمدة 7 ساعات متواصلة.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 19:16:54', '2022-09-01 16:16:54', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(446, NULL, 10, 13, NULL, NULL, 'Remax Pressure Washer Gun', '420', 'مسدس ضغط لغسيل السيارات مع خرطوم للماء بطول 15 متر من Remax', NULL, 'uploads/products/958601_o-¦¼_20220816195940.jpg', NULL, NULL, '', '150', '68.96', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable car wash gun with 15 meter hose from REMAX.</p>\r\n\r\n<p>It is characterized by its strength on water pressure and ease of use by way of one switch and carrying it with only one hand.</p>\r\n\r\n<p>4 water spray modes to meet different washing needs.</p>\r\n\r\n<p>Made of strong non-corrosive metal.</p>\r\n\r\n<p>Hose length: 5m before water injection and 15m after water injection.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مسدس لغسيل السيارات متنقل مع خرطوم بطول 15 متر من شركة REMAX.</p>\r\n\r\n<p>يتميز بقوته على ضغط الماء وسهولة استخدامه عن طريق مفتاح واحد وحمله بيد واحدة فقط.</p>\r\n\r\n<p>4 اوضاع لرش الماء لتلبية الاحتياجات المختلفة للغسيل.</p>\r\n\r\n<p>مصنوع من المعدن القوي الغير قابل للحلى.</p>\r\n\r\n<p>طول الخرطوم: 5 متر قبل حقن الماء و 15 متر بعد حقن الماء.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 19:17:55', '2022-09-01 16:17:55', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(447, NULL, 10, 0, NULL, NULL, 'REMAX Lightsee Series Aluminum Screen Lamp', '421', 'اضاءة ليلية خافته للشاشات قابلة للتعليق من Remax', NULL, 'uploads/products/225136_产品1.jpg', NULL, NULL, '', '109', '46.26', '1', '<p>Product Details:</p>\r\n\r\n<p>Dim eye lighting suitable for work at night with a modern and distinctive shape for screens from REMAX.</p>\r\n\r\n<p>It contains 3 shades of colors that are dimmable white + warm + mixed light for two colors.</p>\r\n\r\n<p>Easy to control by touch.</p>\r\n\r\n<p>It works via a USB cord and does not require charging or batteries.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>إضاءة خافتة للعين مناسبة للعمل اثناء الليل ذات شكل عصري ومميز للشاشات من شركة REMAX.</p>\r\n\r\n<p>تحتوي على 3 درجات من الالوان قابلة للتعتيم ابيض + برتقالي وورم + ضوء مختلط للونين.</p>\r\n\r\n<p>سهل التحكم بها عن طريق اللمس.</p>\r\n\r\n<p>تعمل عن طريق سلك يو اس بي ولا تحتاج الى شحن او بطاريات.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 19:19:10', '2022-09-01 16:19:10', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(448, NULL, 5, 0, NULL, NULL, 'REMAX Finlin Series Handheld - White', '427', 'مروحة صغيرة محمولة قابلة للشحن من Remax', NULL, 'uploads/products/996464_¦½-1.jpg', NULL, NULL, '', '99', '22.87', '1', '<p>Product Details:</p>\r\n\r\n<p>Fan with portable stand and concealed blade for cooling from REMAX.</p>\r\n\r\n<p>It contains a hanger for keys or bags, and at the same time it can be used as a table stand and can also be carried manually.</p>\r\n\r\n<p>It is characterized by its strength on its small size and lightness, as well as unobtrusive when used and cools amazingly.</p>\r\n\r\n<p>Two degrees of fan power you can control the power as desired.</p>\r\n\r\n<p>The battery capacity is 1200 mAh, it takes two hours to fully charge and works for two to three hours, depending on the use.</p>\r\n\r\n<p>Input: Micro.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مروحة مع ستاند محمولة وشفرة مخفية للتبريد من شركة REMAX.</p>\r\n\r\n<p>تحتوي على علّاقة للمفاتيح او الشنط وفي نفس الوقت يمكن استخدامة كستاند للطاولات ويمكن حملها بشكل يدوي ايضاً.</p>\r\n\r\n<p>تتميز بقوتها على صغر حجمها وخفتها وايضاً غير مزعجه عند الاستعمال وتبرد بشكل مذهل.</p>\r\n\r\n<p>درجتين لقوة المروحة تقدرون تتحكمون في القوة على حسب الرغبة.</p>\r\n\r\n<p>سعة البطارية 1200 مللي امبير ويستغرق شحنها ساعتين وتعمل من ساعتين الى 3 ساعات على حسب الأستخدام.</p>\r\n\r\n<p>مدخل الشحن: مايكرو.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 19:20:22', '2022-09-01 16:20:22', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(449, NULL, 11, 0, NULL, NULL, 'REMAX Fiyo Series Bicycle Phone Holder', '422', 'قاعدة هواتف للدراجات من Remax', NULL, 'uploads/products/394140_黑色11.jpg', NULL, NULL, '', '105', '24.58', '1', '<p>Product Details:</p>\r\n\r\n<p>Bicycle phone stand from REMAX.</p>\r\n\r\n<p>Universal for All Phones with screen size from 4.5 to 6.7inch.</p>\r\n\r\n<p>Easy to install on the bike and the phone can be removed and installed with only one hand.</p>\r\n\r\n<p>Durable and protective phone holder designed with a thick aluminum base and internal rubble bases to ensure that the phone does not get scratches.</p>\r\n\r\n<p>The base is rotatable 360 degrees you can freely adjust the angle of the phone as desired and provide you with the greatest flexibility so that you can do so while watching the phone.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>قاعدة للهواتف للدراجات الهوائية من شركة REMAX.</p>\r\n\r\n<p>مناسبة لجميع الهواتف من حجم 4.5 انش إلى 6.7 انش.</p>\r\n\r\n<p>سهل تثبيتها على الدراجة ويمكن ازالة الهاتف وتركيبه بيد واحدة فقط.</p>\r\n\r\n<p>حامل هاتف متين ووقائي مصمم بقاعدة سميكة من الألومنيوم&nbsp; وقواعد داخلية من الربل لتأمين عدم حصول خدوش للهاتف.</p>\r\n\r\n<p>القاعدة قابله للدوران 360 درجة يمكنك ضبط زاوية الهاتف بحرية على حسب الرغبه وتوفر لك أكبر قدر من المرونة بحيث يمكنك القيام بذلك أثناء مشاهدة الهاتف.</p>\r\n', NULL, 'https://youtu.be/2iKlvNf2fY0', '', '1', NULL, NULL, '1', '2022-09-01 19:21:48', '2022-09-01 16:21:48', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(450, NULL, 15, 10, NULL, NULL, 'REMAX Astro Series Travel Charger', '423', 'شاحن السفر ذو مدخلين من Remax', NULL, 'uploads/products/655946_o-¦¼_20220816195859.jpg', NULL, NULL, '', '140', '36.82', '1', '<p>Product Details:</p>\r\n\r\n<p>Travel charger with two USB ports, Type C + USB, that support 12W fast charging from REMAX.</p>\r\n\r\n<p>Anti-electric shock and overcharging and also made of flame retardant materials.</p>\r\n\r\n<p>Small in size and easy to move around in travel.</p>\r\n\r\n<p>Can be used with all countries of the world.</p>\r\n\r\n<p>Two devices can be charged at the same time.</p>\r\n\r\n<p>Type C port for fast charging of 12W.</p>\r\n\r\n<p>USB port for fast charging of 12W.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن السفر ذو مدخلين تايب سي + يو اس بي يدعمون الشحن السريع بقوة 12 واط من شركة REMAX.</p>\r\n\r\n<p>مضاد للصدمات الكهربائية والشحن الزائد وايضاً مصنوع من مواد مضادة للأشتعال.</p>\r\n\r\n<p>صغير الحجم ويسهل نقلة فالسفر.</p>\r\n\r\n<p>يمكن استخدامة مع جميع دول العالم.</p>\r\n\r\n<p>يمكن شحن جهازين في نفس الوقت.</p>\r\n\r\n<p>مدخل تايب سي بقوة 12 واط.</p>\r\n\r\n<p>مدخل يو اس بي بقوة 12 واط.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 19:23:05', '2022-09-01 16:23:05', NULL, NULL, NULL, NULL, 6, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(451, NULL, 10, 13, NULL, NULL, 'REMAX Wired Air Pump with Digital Display', '418', 'منفاخ إلكتروني سريع محمول من Remax', NULL, 'uploads/products/390990_¦·¦.jpg', NULL, NULL, '', '189', '57.66', '1', '<p>Product Details:</p>\r\n\r\n<p>Multifunctional portable air blower with car port from REMAX.</p>\r\n\r\n<p>It is characterized by its ability to inflate bicycle and car tires, as well as football.</p>\r\n\r\n<p>A display screen to know the percentage of air and also contains a smart chip to stop the automatic inflation when finished.</p>\r\n\r\n<p>Small in size and can be placed in the car for emergencies or carried anywhere.</p>\r\n\r\n<p>It contains lighting for dark places, as well as a special emergency lighting system.</p>\r\n\r\n<p>Operating input: Car port.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>منفاخ هواء محمول متعدد الاستخدام يعمل عن طريق منفذ السيارة من شركة REMAX.</p>\r\n\r\n<p>يتميز بقدرته على نفخ اطارات الدراجات والسيارات وايضاً كرة القدم.</p>\r\n\r\n<p>شاشة عرض لمعرفة نسبة الهواء وايضاً يحتوي على شريحه ذكية لإيقاف النفخ التلقائي عند الانتهاء.</p>\r\n\r\n<p>صغير الحجم ويمكن وضعه فالسيارة لحالات الطوارئ او حمله لأي مكان.</p>\r\n\r\n<p>يحتوي على إضاءة للأماكن المظلمة وايضاً نظام اضاءة خاص للطوارئ.</p>\r\n\r\n<p>مدخل التشغيل: منفذ السيارة.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 19:24:55', '2022-09-01 16:24:55', NULL, NULL, NULL, NULL, 6, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(452, NULL, 5, 0, NULL, NULL, 'REMAX Quad-Core Folding Neckband Fan - White', '426', 'مبرد هواء متنقل قابل للشحن من Remax', NULL, 'uploads/products/496384_o-¦¼_20220816200051.jpg', NULL, NULL, '', '199', '63.25', '1', '<p>Product Details:</p>\r\n\r\n<p>Personal air cooler with a capacity of 4000mAh portable with hidden fans to cool the air around you from REMAX company.</p>\r\n\r\n<p>It cools the air around 360 degrees around the head and also has four cooling holes.</p>\r\n\r\n<p>It is characterized by its lightweight design and is also very well secured on the neck so as not to cause you inconvenience.</p>\r\n\r\n<p>3 Fan speeds you can choose the ideal wind power as needed.</p>\r\n\r\n<p>Suitable for outside work owners during the summer or for sports.</p>\r\n\r\n<p>Input: Type C, It takes 3 hours to fully charge and works for 5 hours depending on usage.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مبرد هواء شخصي بسعة 4000 مللي امبير محمول يحتوي مراوح مخفيه لتبريد الهواء من حولك من شركة REMAX.</p>\r\n\r\n<p>يبرد الهواء بشكل محيطي 360 درجة حول الرأس وايضاً يحتوي على اربع فتحات للتبريد.</p>\r\n\r\n<p>يتميز بتصميمه وخفة وزنه وايضاً محكم بشكل جيد جداً على الرقبه حتى لا يسبب لك ازعاج.</p>\r\n\r\n<p>3 سرعات للمروحة يمكنك اختيار طاقة الرياح المثالية حسب الحاجة.</p>\r\n\r\n<p>مناسب لأصحاب العمل الخارجي اثناء الصيف او للرياضة.</p>\r\n\r\n<p>مدخل: تايب سي ويستغرق شحنة 3 ساعات ويعمل لمدة 5 ساعات على حسب الاستخدام.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 19:26:18', '2022-09-01 16:26:18', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(453, NULL, 10, 0, NULL, NULL, 'Remax Wireless Live-Stream Microphone - iPhone', '456', 'مايكروفون لاسلكي مسافة 20 متر للايفون من Remax', NULL, 'uploads/products/800602_iPH.jpg', NULL, NULL, '', '120', '36.12', '1', '<p>Product Details:</p>\r\n\r\n<p>Wireless microphone for iPhone devices does not require pairing from REMAX.</p>\r\n\r\n<p>It is distinguished by its clear sound, the isolation of surrounding sounds, and the stability of the sound for a distance of up to 20 meters from the phone.</p>\r\n\r\n<p>Easy to use, just one click to record and another click to stop.</p>\r\n\r\n<p>The battery capacity is 80 mAh, it takes 1.5 hours to charge and works for 10 hours, and it can be used while charging the mobile as well.</p>\r\n\r\n<p>Fast charging technology enables the device to operate for an hour on a 10-minute charge.</p>\r\n\r\n<p>Suitable for personal interviews and other uses.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مايكروفون لاسلكي لأجهزة الايفون لا يحتاج الى اقتران من شركة REMAX.</p>\r\n\r\n<p>يتميز بصوته الواضح وعزل الاصوات المحيطة وايضاً بثبات الصوت لمسافة تصل الى 20 متر من الجوال.</p>\r\n\r\n<p>سهل الاستخدام فقط ضغطة واحدة للتسجيل وضغطة اخرى للايقاف.</p>\r\n\r\n<p>سعة البطارية 80 مللي امبير يستغرق شحنه 1.5 ساعة ويعمل لمدة 10 ساعات ويمكن استخدامه اثناء شحن الجوال ايضاً.</p>\r\n\r\n<p>تقنية الشحن السريع مما تمكن الجهاز من الاشتغال لمدة ساعة عند شحنة لمدة 10 دقائق فقط.</p>\r\n\r\n<p>مناسب للمقابلات الشخصية والاستعمالات الاخرى.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=FNOEZPG4fMs', '', '1', NULL, NULL, '1', '2022-09-01 19:27:43', '2022-09-01 16:27:43', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(454, NULL, 15, 9, NULL, NULL, 'REMAX Hunergy Series Cabled Power Bank 50000mAh', '419', 'باوربانك Hunergy السريع 6 في 1 بسعة 50,000 مللي امبير من Remax', NULL, 'uploads/products/197895_¦¦.jpg', NULL, NULL, '', '299', '93.59', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable 6-in-1 power bank the new version of Hunergy series, with two USB ports, one with QC technology for fast charging and a Type-C port with PD technology, with a power of 22.5 watts from REMAX.</p>\r\n\r\n<p>It is characterized by the presence of all kinds of charging wires integrated into the power bank itself, Type C + Lightning + Micro + USB.</p>\r\n\r\n<p>Charges 6 fast charging devices simultaneously.</p>\r\n\r\n<p>It has a built-in stand for phones to watch movies and series, and it can also be hidden when not needed.</p>\r\n\r\n<p>Digital screen to know the status of charging the power bank with dim lighting for dark places, in addition to a strong hanger to carry the power bank.</p>\r\n\r\n<p>It is made of non-flammable materials and also contains an intelligent protection chip for overcharging and overheating.</p>\r\n\r\n<p>3 Ways to charge via the Type-C port for fast charging, via the micro port, or via the built-in USB cable in the power bank.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>باوربانك متنقل 6 في 1 اصدار Hunergy الحديث مع منفذين يو اس بي واحد بتقنية QC للشحن السريع ومنفذ تايب سي بتقنية PD بقوة 22.5 واط من شركة REMAX.</p>\r\n\r\n<p>يتميز بوجود جميع انواع الاسلاك للشحن مدموجه فالباوربانك نفسه تايب سي + لايتننغ + مايكرو + يو اس بي.</p>\r\n\r\n<p>يشحن 6 اجهزة شحن سريع في وقت واحد.</p>\r\n\r\n<p>يحتوي على ستاند مدمج للهواتف لمشاهدة الافلام والمسلسلات وايضاً يمكن اخفائه في حال عدم الحاجه.</p>\r\n\r\n<p>شاشة رقمية لمعرفة حالة شحن الباوربانك مع إضاءة خافته للأماكن المظلمة بالإضافة الى علّاقه قوية لحمل الباوربانك.</p>\r\n\r\n<p>مصنوع من مواد غير قابلة للاشتعال وايضاً يحتوي على شريحة حماية ذكية للشحن الزائد وارتفاع درجة الحرارة.</p>\r\n\r\n<p>3 طرق للشحن عن طريق منفذ التايب سي للشحن السريع او عن طريق منفذ المايكرو او عن طريق كيبل اليو اس بي المدمج فالباوربانك.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 19:29:10', '2022-09-01 16:29:10', NULL, NULL, NULL, NULL, 10, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(455, NULL, 15, 9, NULL, NULL, 'REMAX Baonen Series 60W Fast Charging Power Bank - Green', '415', 'باوربانك بقوة 60 واط بسعة 20,000 مللي امبير من Remax - زيتي', NULL, 'uploads/products/942086_eG.jpg', NULL, NULL, '', '299', '85.04', '1', '<p>Product Details:</p>\r\n\r\n<p>The latest versions of the Remax power bank with 2 USB outputs QC technology, the first with a power of 50W and the second with a power of 27W, and a Type-C output with PD technology with a power of 60W for fast charging with a capacity of 20000mAh.</p>\r\n\r\n<p>It is characterized by its ability to charge all types of laptops in just two hours, a full charge, and also charges the iPhone to 50% in just 30 minutes.</p>\r\n\r\n<p>Two inputs to charge the power bank, the first is Type C, and it receives 60W, and it takes only two and a half hours to fully charge it, and the second port is a micro, with a power of 18W.</p>\r\n\r\n<p>Digital display for power bank battery status.</p>\r\n\r\n<p>It is made of non-flammable materials and also contains an intelligent protection chip for overcharging and overheating.</p>\r\n\r\n<p>Charges 3 devices at the same time at high speed.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>احدث اصدارات باوربانك Remax ذو 2 مخرجين يو اس بي بتقنية QC الأول بقوة 50 واط والثاني بقوة 27 واط ومخرج تايب سي بتقنية PD بقوة 60 واط للشحن السريع بسعة 20000 مللي امبير.</p>\r\n\r\n<p>يتميز بقدرته على شحن جميع انواع اجهزة اللابتوب خلال ساعتين فقط شحن كامل وايضاً يشحن الايفون الى 50% خلال 30 دقيقة فقط.</p>\r\n\r\n<p>مدخلين لشحن الباوربانك الأول تايب سي ويستقبل 60 واط ويستغرق شحنه ساعتين ونصف فقط شحن كامل والمدخل الثاني مايكرو بقوة 18 واط.</p>\r\n\r\n<p>شاشة رقمية لمعرفة حالة بطارية الباوربانك.</p>\r\n\r\n<p>يحتوي على شريحة حماية ذكية من الشحن الزائد وارتفاع درجة الحرارة.</p>\r\n\r\n<p>يشحن 3 اجهزة بنفس الوقت بسرعة عالية.</p>\r\n', NULL, 'https://youtu.be/TBRhkxYyjMY', '', '1', NULL, NULL, '1', '2022-09-01 19:30:41', '2022-09-01 16:30:41', NULL, NULL, 1, NULL, 20, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(456, NULL, 15, 11, NULL, NULL, 'REMAX Tour Series 100W Fast Charging Car Charger', '425', 'شاحن سريع ذو مدخلين تايب سي + يو اس بي بقوة 100 واط من Remax', NULL, 'uploads/products/879033_¦·¦-1.jpg', NULL, NULL, '', '199', '43.40', '1', '<p>Product Details:</p>\r\n\r\n<p>100W Fast Car Charger with Two Ports, Type C + USB, from REMAX.</p>\r\n\r\n<p>Fast charging all types of phones, tablets and laptops.</p>\r\n\r\n<p>Safe usage with all-round protection, equipped with built-in protections against overheating, overcharging, and short-circuit to safeguard the charging process.</p>\r\n\r\n<p>It has a smart chip to know how much wattage the device needs and charges accordingly.</p>\r\n\r\n<p>Type C charging port of 100W.</p>\r\n\r\n<p>USB charging port of 30W.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن سريع للسيارة بقوة 100 واط ذو مدخلين تايب سي + يو اس بي من شركة REMAX.</p>\r\n\r\n<p>يشحن جميع أنواع الهواتف واجهزة التابليت وايضاً اللابتوب.</p>\r\n\r\n<p>استخدام آمن مع حماية شاملة مزود بوسائل حماية مدمجة ضد ارتفاع درجة الحرارة والشحن الزائد.</p>\r\n\r\n<p>يحتوي على شريحة ذكية لمعرفة كم قوة الواط الذي يحتاجه الجهاز ويشحن بناءً على ذلك.</p>\r\n\r\n<p>مدخل تايب سي بقوة 100 واط.</p>\r\n\r\n<p>مدخل يو اس بي بقوة 30 واط.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 19:31:53', '2022-09-01 16:31:53', NULL, NULL, NULL, NULL, 18, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(457, NULL, 15, 9, NULL, NULL, 'REMAX Sucha Series Full-Compatibility Cabled Power Bank 20000mAh', '414', 'شاحن متنقل سريع صغير الحجم 2 في 1 بسعة 20,000 مللي امبير من Remax', NULL, 'uploads/products/897820_¦½1.jpg', NULL, NULL, '', '249', '76.56', '1', '<p>Product Details:</p>\r\n\r\n<p>2 in 1 Portable Fast Charger Sucha Edition with a capacity of 20,000mAh supports QC3.0 purification and PD 22.5W fast charging technology from REMAX.</p>\r\n\r\n<p>It features a Type-C and iPhone cord integrated into the power bank itself, as well as a USB port for fast charging.</p>\r\n\r\n<p>Convenient and easy to move from one place to another and charges 3 devices at the same time.</p>\r\n\r\n<p>Digital screen battery indicator.</p>\r\n\r\n<p>Type C charging port, and it takes 5 to 6 hours to charge and charges the devices 3 to 4 times a full charge.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن سريع متنقل 2 في 1 اصدار Sucha بسعة 20,000 مللي امبير يدعم تنقية كوال كوم 3.0 و تقنية بي دي للشحن السريع بقوة 22.5 واط من REMAX.</p>\r\n\r\n<p>يتميز بوجود سلك تايب سي وسلك ايفون مدموجين فالباوربانك نفسه بالإضافة الى وجود مخرج يو اس بي للشحن السريع.</p>\r\n\r\n<p>مريح وسهل نقلة من مكان الى اخر ويشحن 3 اجهزة في نفس الوقت.</p>\r\n\r\n<p>شاشة رقمية لحالة شحن البطارية.</p>\r\n\r\n<p>مدخل الشحن تايب سي ويستغرق شحنه من 5 الى 6 ساعات ويشحن الاجهزة من 3 الى 4 مرات شحن كامل.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-01 19:34:12', '2022-09-01 16:34:12', NULL, NULL, NULL, NULL, 10, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(458, NULL, 9, 0, NULL, NULL, 'Joyroom Type C to Type C Fast Charging Cable – 1.8M – Navy Blue', '137', 'واير شحن سريع من Joyroom تايب سي الى تايب سي - 1.8 متر - كحلي', NULL, 'uploads/products/637559_S-1830N9.jpg', NULL, NULL, '', '29', '28.36', '1', '<p>Product Details:</p>\r\n\r\n<p>Type C to Type C fast charge cable from Joyroom.</p>\r\n\r\n<p>PD fast charge cable.</p>\r\n\r\n<p>Anti-flaming &amp; Anti-freeze Cable.</p>\r\n\r\n<p>Length: 1.8M.</p>\r\n\r\n<p>Material: Silicone.</p>\r\n\r\n<p>Applicable models: Type C.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>واير من شركة JOYROOM.</p>\r\n\r\n<p>يدعم شحن سريع بتقنية PD.</p>\r\n\r\n<p>مضاد للاشتعال والتثلج.</p>\r\n\r\n<p>الطول : 1.8 متر.</p>\r\n\r\n<p>مصنوع من السيلكون.</p>\r\n\r\n<p>الموديل : تايب سي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=rSoNhnjk0u0&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-09-02 00:05:10', '2022-09-01 21:05:10', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '25'),
