(460, NULL, 10, 0, NULL, NULL, 'UNIQ Transforma iPad Pro 12.9 Inch 2021 Case & Stand - Black', '20019', 'كڤر وستاند من نوع Transforma للايباد برو 12.9 انش 2021 من UNIQ - اسود', NULL, 'uploads/products/185872_transforma-black-ipadpro-11-01-high-res--768x768_copy.jpg', NULL, NULL, '', '169', '89', '1', '<p>Product Details:</p>\r\n\r\n<p>iPad pro 12.9 inch Transforma case with stand from UNIQ.</p>\r\n\r\n<p>It is characterized by its small size and doesn&#39;t enlarge the size of the iPad when it is installed and also strongly protecting the iPad with thick corners for more protection in the event of the device falling.</p>\r\n\r\n<p>Different positions that can be used as a base with different angles and ways or as a normal protection as desired.</p>\r\n\r\n<p>It has a place to store Apple smart pencil.</p>\r\n\r\n<p>Suitable for watching lectures, movies, series, etc.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كفر حماية وستاند في نفس الوقت للايباد برو 12.9 انش من شركة UNIQ.</p>\r\n\r\n<p>يتميز بحجمه الضئيل ومايكبر من حجم الايباد كثير عند تركيبة وايضاً بقوة حمايته للايباد في حال سقوط الجهاز.</p>\r\n\r\n<p>يمكن تشكيله بوضعيات مختلفة يمكن استخدامة كقاعدة بزوايا وطرق مختلفة او كحماية عادية على حسب الرغبة.</p>\r\n\r\n<p>يحتوي على مكان لتخزين قلم ابل.</p>\r\n\r\n<p>مناسب لمشاهدة المحاضرات او الافلام والمسلسلات وغيرها.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-02 14:30:51', '2022-09-02 11:30:51', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '45'),
(461, NULL, 15, 10, NULL, NULL, 'Charging Station 6 Ports 60W', '158', 'شاحن ذو 6 مداخل مع قواعد منفصلة', NULL, 'uploads/products/772314_Hecb898bf83404339abfd25f93d01d3e45.jpg', NULL, NULL, '', '159', '126.49', '1', '<p>Product Details:</p>\r\n\r\n<p>iLepo multiple charger station 5 USB-Port / 1 Type C-Port with PD power delivery technology.</p>\r\n\r\n<p>Overpower and over-charge protection.</p>\r\n\r\n<p>Detachable holder &amp; charge 6 devices on a single outlet.</p>\r\n\r\n<p>Suitable design for gathering places.</p>\r\n\r\n<p>Support all smart phones and tablets.</p>\r\n\r\n<p>PD Output: 18W.</p>\r\n\r\n<p>QC Port Output: 18W.</p>\r\n\r\n<p>Total Output: 60W.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن مع تقنية الشحن الذكي ذو 5 مداخل يو اس بي ومدخل تايب سي من شركة iLepo.</p>\r\n\r\n<p>حماية من القوة الزائدة او الشحن الزائد.</p>\r\n\r\n<p>يشحن 6 أجهزة في نفس الوقت.</p>\r\n\r\n<p>تصميم مناسب للمجالس.</p>\r\n\r\n<p>يدعم جميع الهواتف الذكية وأجهزة التابلت.</p>\r\n\r\n<p>مخرج بتنقية PD بقوة 18 واط.</p>\r\n\r\n<p>مخرج بتنقية QC بقوة 18 واط.</p>\r\n\r\n<p>اجمالي قوة المداخل: 60 واط.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=sMvSjjHhhoQ', '', '1', NULL, NULL, '1', '2022-09-02 14:34:53', '2022-09-02 11:34:53', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(462, NULL, 15, 9, NULL, NULL, 'Anker Power Bank 2 Ports 10,000mAh With Wireless Charging', '243', 'شاحن متنقل وايرليس بسعة 10,000 مللي امبير ذو مخرجين من Anker', NULL, 'uploads/products/A1615011_TD01_2048x.jpg', NULL, NULL, '', '159', '103', '1', '<p>Product Details:</p>\r\n\r\n<p>10,000mAh Power bank with wireless charging technology and 2 USB outputs IQ technology for fast charging from Anker.</p>\r\n\r\n<p>A slim, distinctive and small shape.</p>\r\n\r\n<p>Charges 2 devices at the same time at high speed.</p>\r\n\r\n<p>Two USB ports with IQ technology, with a power of 12W.</p>\r\n\r\n<p>5W wireless charger.</p>\r\n\r\n<p>Input: Type C.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>باوربانك بتقنية شحن وايرليس ومخرجين يو اس بي بتقنية IQ للشحن السريع بسعة 10000 مللي امبير من شركة Anker.</p>\r\n\r\n<p>شكل نحيف ومميز وصغير الحجم.</p>\r\n\r\n<p>يشحن 2 أجهزة بنفس الوقت بسرعة عالية.</p>\r\n\r\n<p>مدخلين يو اس بي بتقنية IQ بقوة 12 واط.</p>\r\n\r\n<p>شاحن وايرليس بقوة 5 واط.</p>\r\n\r\n<p>مدخل شحن الباوربانك تايب سي.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-02 14:37:28', '2022-09-02 11:37:28', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '11'),
(463, NULL, 6, 0, NULL, NULL, 'Gosund Wi-Fi Smart LED Strip Light 10M', '161', 'شريط اضاءة ذكي واي-فاي من قوسند 10 متر', NULL, 'uploads/products/410932_71oO9dAvwRS__AC_SL1500_-1.jpg', NULL, NULL, '', '195', '91.36', '1', '<p>Product Details:</p>\r\n\r\n<p>Voice &amp; App control smart led strip lights from Gosund (10 meters) length.</p>\r\n\r\n<p>Timer Function: Set a timer for your smart led schedule automatically switches on/off via your phone.</p>\r\n\r\n<p>Diy Colors: Color changing strip lights has 16 million colors with brightness and saturation adjustable.</p>\r\n\r\n<p>Cuttable: the strip light can be cutted to match the size you want.</p>\r\n\r\n<p>It is also characterized by ease of installation and saves on electricity consumption.</p>\r\n\r\n<p>Diy Colors: Color changing strip lights has 16 million colors with brightness and saturation adjustable.</p>\r\n\r\n<p>Support Alexa &amp; Google Assistant.</p>\r\n\r\n<p>Application: Gosund.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شريط الاضاءة الذكي من Gosund يتميز بسهولة التحكم في الشريط عندما لا تكون في المنزل عن طريق هاتفك.</p>\r\n\r\n<p>المؤقت والجدول الزمني: يمكن القيام بجدولة تشغيل / إيقاف تشغيل الأضواء الذكية تلقائيًا عبر هاتفك.</p>\r\n\r\n<p>8 أنواع من المودات المختلفة لطريقة عمل للأنوار.</p>\r\n\r\n<p>يمكن القيام بقص الشريط عند الحاجة لضبط الطول.</p>\r\n\r\n<p>كما يتميز بسهولة التركيب ويوفر من استهلاك الكهرباء.</p>\r\n\r\n<p>التحكم في مستوى قوة الإضاءة من 1٪ إلى 100٪.</p>\r\n\r\n<p>يدعم الأوامر الصوتية من اجهزة اليكسا وقوقل اسستنس الصوتية.</p>\r\n\r\n<p>اسم التطبيق: Gosund.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-02 14:43:03', '2022-09-02 11:43:03', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '17'),
(464, NULL, 15, 9, NULL, NULL, 'Zendure A3PD Power Bank 2 Ports 10000mAh ', '262', 'شاحن متنقل A3PD بسعة 10,000 مللي امبير من Zendure ', NULL, 'uploads/products/Zendure-A3PD-External-Battery-1000mAh-21.jpg', NULL, NULL, '', '205', '125.30', '1', '<p>Product Details:</p>\r\n\r\n<p>Zendure Power Bank with a capacity of 10,000 mAh with two ports Type-C with PD technology and USB port with QC3.0 technology for fast charging.</p>\r\n\r\n<p>Small in size, made of high-quality materials withstands bumps and falls from high places.</p>\r\n\r\n<p>The power bank is distinguished by its 95% charge retention for 6 months when not in use.</p>\r\n\r\n<p>Two devices can be charged at the same time.</p>\r\n\r\n<p>The power bank can be fully charged in 3 hours when using the Type C port for fast charging.</p>\r\n\r\n<p>Type-C input with a power of 18W, and the power bank can be charged from the same input.</p>\r\n\r\n<p>USB port with QC3.0 technology for fast charging.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>باوربانك بسعة 10,000 مللي امبير ذو مدخلين تايب سي بتقنية PD ومدخل يو اس بي بتقنية QC3.0 للشحن السريع من شركة Zendure.</p>\r\n\r\n<p>صغير الحجم ومصنوع من مواد عالية الجودة ويتحمل الضربات والسقوط من اماكن عالية.</p>\r\n\r\n<p>يتميز الباوربانك بالاحتفاظ على شحنه بنسبة 95% لمدة 6 شهور عند عدم الاستعمال.</p>\r\n\r\n<p>يمكن شحن جهازين في نفس الوقت.</p>\r\n\r\n<p>مدة شحن الباوربانك شحن كامل في 3 ساعات عند استعمال مدخل التايب سي للشحن السريع.</p>\r\n\r\n<p>مدخل تايب سي بقوة 18 واط ويمكن شحن الباوربانك من نفس المكان.</p>\r\n\r\n<p>مدخل يو اس بي بتقنية QC3.0 للشحن السريع.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-02 14:44:36', '2022-09-02 11:44:36', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '49'),
(465, NULL, 15, 10, NULL, NULL, 'Goui Travel Charger 30W', '476', 'شاحن السفر ذو 4 مداخل بقوة 30 واط من Goui', NULL, 'uploads/products/808958_goui_travel_adapter.jpg', NULL, NULL, '', '149', '90', '1', '<p>Product Details:</p>\r\n\r\n<p>Travel charger with 4 ports Type-C 30W with PD technology and 3 USB ports from Goui.</p>\r\n\r\n<p>Small in size and easy to move around in travel.</p>\r\n\r\n<p>Can be used with all countries of the world.</p>\r\n\r\n<p>4 devices can be charged at the same time.</p>\r\n\r\n<p>Type C input with a power of 30 watts.</p>\r\n\r\n<p>3 USB ports for fast charging.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن السفر ذو 4 مداخل منهم مدخل تايب سي بتقنية PD بقوة 30 واط و 3 مداخل يو اس بي من شركة Goui.</p>\r\n\r\n<p>صغير الحجم ويسهل نقلة فالسفر.</p>\r\n\r\n<p>يمكن استخدامة مع جميع دول العالم.</p>\r\n\r\n<p>يمكن شحن 4 اجهزة ف نفس الوقت.</p>\r\n\r\n<p>مدخل تايب سي بقوة 30 واط.</p>\r\n\r\n<p>3 مداخل يو اس بي للشحن السريع.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Lueq1mWQ79U&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-09-02 14:46:12', '2022-09-02 11:46:12', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '18'),
(466, NULL, 15, 9, NULL, NULL, 'Anker Power House 2nd Generation 108,000 mAh', '250', 'باور هاوس الجيل الثاني بسعة 108,000 مللي امبير من Anker', NULL, 'uploads/products/667397_A1730111_2048x.jpg', NULL, NULL, '', '1999', '1475', '1', '<p>Product Details:</p>\r\n\r\n<p>A new version of large batteries with a capacity of 108,000 mAh from Anker.</p>\r\n\r\n<p>Supports the operation of most small and large devices such as televisions, refrigerators, flashlights and other devices.</p>\r\n\r\n<p>Back and side lighting for outdoor trips and dark places.</p>\r\n\r\n<p>Contains multiple Input:</p>\r\n\r\n<p>Entrance to operate electrical appliances.</p>\r\n\r\n<p>Type C Input &amp; Output with PD technology for fast charging with a power of 60W.</p>\r\n\r\n<p>3 USB Output ports with IQ technology for fast charging total of 36W.</p>\r\n\r\n<p>Input for car charger.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>اصدار جديد من البطاريات الكبيرة بقوة 108,000 مللي امبير من شركة Anker.</p>\r\n\r\n<p>يدعم تشغيل اغلب الاجهزة الصغيرة والكبيرة مثل التفلزيونات, الثلاجات, الكشافات وغيرها من الأجهزة.</p>\r\n\r\n<p>إنارة خلفية وجانبية للرحلات الخارجية والاماكن المظلمة.</p>\r\n\r\n<p>يحتوي على مداخل متعددة:</p>\r\n\r\n<p>مدخل لتشغيل الاجهزة الكهربائية.</p>\r\n\r\n<p>مدخل تايب سي بتقنية PD للشحن السريع بقوة 60 واط وايضاً يمكن شحن البطارية عن طريقة.</p>\r\n\r\n<p>3 مداخل يو اس بي بتقنية IQ للشحن السريع اجمالي 36 واط.</p>\r\n\r\n<p>مدخل لشاحن السيارة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=XOsosuTClgg&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2022-09-02 14:48:48', '2022-09-02 11:48:48', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '11'),
(467, NULL, 15, 9, NULL, NULL, 'Zendure Power Station Super Base 500 140,000mAh', '263', 'باور ستيشن Super Base 500 بسعة 140,000 مللي امبير من Zendure', NULL, 'uploads/products/463151_SuperBase_5_1800x1800.jpg', NULL, NULL, '', '1999', '1599', '1', '<p>Product Details:</p>\r\n\r\n<p>The new version of batteries with a capacity of 140,000mAh and a power of 518W from Zendure.</p>\r\n\r\n<p>Supports the operation of most small and large devices such as televisions, refrigerators, flashlights and other devices.</p>\r\n\r\n<p>9 devices can be charged at the same time.</p>\r\n\r\n<p>Advanced battery cooling system.</p>\r\n\r\n<p>Small in size and you can take it with you anywhere.</p>\r\n\r\n<p>Front lighting for outdoor trips and dark places.</p>\r\n\r\n<p>It contains multiple entries:</p>\r\n\r\n<p>Two entrances to operate electrical appliances.&nbsp;<em>(&nbsp;a Triple socket that is used in Qatar and not the one in the picture&nbsp;)</em>.</p>\r\n\r\n<p>Two Type-C inputs (one) with PD technology for fast charging with a power of 60 watts, and the battery can also be charged by the same input.</p>\r\n\r\n<p>3 USB ports for fast charging.</p>\r\n\r\n<p>Inlet for car charger.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>الاصدار الجديد من البطاريات بسعة 140,000 مللي امبير وبقوة 518 واط من شركة Zendure.</p>\r\n\r\n<p>يدعم تشغيل اغلب الاجهزة الصغيرة والكبيرة مثل التفلزيونات, الثلاجات, الكشافات وغيرها من الأجهزة.</p>\r\n\r\n<p>يمكن شحن 9 اجهزة بنفس الوقت.</p>\r\n\r\n<p>نظام تبريد متطور فالبطارية.</p>\r\n\r\n<p>حجمها صغير وتقدرون تشيلونها معاكم اي مكان.</p>\r\n\r\n<p>إنارة امامية للرحلات الخارجية والاماكن المظلمة.</p>\r\n\r\n<p>تحتوي على مداخل متعددة:</p>\r\n\r\n<p>&nbsp;مدخلين لتشغيل الاجهزة الكهربائية&nbsp;<em>(&nbsp;بلك ثلاثي الذي يستعمل في قطر وليس الذي موجود فالصورة&nbsp;)</em>.</p>\r\n\r\n<p>&nbsp;مدخلين تايب سي (واحد) بتقنية PD للشحن السريع بقوة 60 واط وايضاً يمكن شحن البطارية عن طريقة.</p>\r\n\r\n<p>&nbsp;3 مداخل يو اس بي للشحن السريع.</p>\r\n\r\n<p>&nbsp;مدخل لشاحن السيارة.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-02 14:51:30', '2022-09-02 11:51:30', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '49'),
(468, NULL, 5, 0, NULL, NULL, 'Baseus LECT-LUCK Electric Heating WaterBag', '298', 'كمادة ماء ساخن كهربائية من Baseus', NULL, 'uploads/products/ACRSD-0Y-1.jpg', NULL, NULL, '', '150', '82', '1', '<p>Product Details:</p>\r\n\r\n<p>Electric hot-water bag from Baseus.</p>\r\n\r\n<p>Made of soft sleeve which makes you feel comfortable.</p>\r\n\r\n<p>Charging for 8 minutes keeps you warm all night.</p>\r\n\r\n<p>Intelligent charging temperature control and power-off when its fully charge by itself.</p>\r\n\r\n<p>350W Power gives you faster heating temperature rise.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كمادة ماء ساخن كهربائي من Baseus مع قماش قابل للغسيل.</p>\r\n\r\n<p>مصنوعة من الأكمام الناعمة التي تجعلك تشعر بالراحة.</p>\r\n\r\n<p>يمكن شحنها لمدة 8 دقائق وتظل دافئة طوال الليل.</p>\r\n\r\n<p>تحكم ذكي في درجة حرارة الشحن وإيقاف التشغيل عند شحنه بالكامل من تلقاء نفسه.</p>\r\n\r\n<p>قوة 350 واط تعطي ارتفاعًا أسرع في درجة حرارة التسخين.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=zL2w0qBzGhw', '', '1', NULL, NULL, '1', '2022-09-02 14:54:02', '2022-09-02 11:54:02', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '13'),
(469, NULL, 6, 0, NULL, NULL, 'Xiaomi Mi 2K Pro 360 Rotation Smart Camera For Home', '218', 'كاميرا شاومي الذكية للمنزل بدقة 2k ودوران 360 درجة', NULL, 'uploads/products/2_1_1.jpg', NULL, NULL, '', '199', '149', '1', '<p>Product Details:</p>\r\n\r\n<p>Smart home security Wi-Fi camera with high quality and clear natural image from Xiaomi.</p>\r\n\r\n<p>Upgraded high quality 3MP and 2K ultra HD resolution.</p>\r\n\r\n<p>360 degree rotating full angle vision.</p>\r\n\r\n<p>Support night vision view through infrared.</p>\r\n\r\n<p>It has a two-way dual microphone allows you to talk through.</p>\r\n\r\n<p>It contains an intelligence system that recognizes human faces.</p>\r\n\r\n<p>Control Application: Mi Home.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كاميرا ذكية تعمل عن طريق الواي-فاي ذات دقة عالية وتصوير واضح للمراقبة من شركة XIAOMI.</p>\r\n\r\n<p>تتميز بجودة عالية 3 ميجابكسل وصورة طبيعية بدقة 2K.</p>\r\n\r\n<p>متحركة بزاوية دوران كاملة 360 درجة.</p>\r\n\r\n<p>تدعم نظام الرؤية الليلة عن طريق الاشعة تحت الحمراء.</p>\r\n\r\n<p>تحتوي على ميكروفون مزدوج مما يتيح لك التحدث من خلالها.</p>\r\n\r\n<p>تحتوي على نظام الذكاء الاصطناعي والذي يتعرف على الوجوه البشرية.</p>\r\n\r\n<p>تطبيق التحكم: Mi Home</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-02 15:08:19', '2022-09-02 12:08:19', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '48'),
(470, NULL, 15, 10, NULL, NULL, 'Goui Mbala 3 in 1 Wall Charger + Wireless Charger + Power Bank 8000mAh', '251', 'شاحن 3 في 1 جداري ولاسلكي ومتنقل Mbala من Goui', NULL, 'uploads/products/1-768x768.jpg', NULL, NULL, '', '199', '99.50', '1', '<p>Product Details:</p>\r\n\r\n<p>3 in 1 Charger with 3 ports, including one with PD technology and one with QC3.0 technology for fast charging, with a capacity of 8000 mAh from Goui.</p>\r\n\r\n<p>It is characterized as a wall charger for travel, at the same time a power bank with a capacity of 8000 mAh, and it also supports wireless charging.</p>\r\n\r\n<p>Two additional pieces to fit the sockets of all countries such as USA, EU and UK.</p>\r\n\r\n<p>Support charging 3 devices at the same time when connects to wall charger.</p>\r\n\r\n<p>Type C port for fast charging of 18W.</p>\r\n\r\n<p>Two USB ports (one) with QC3.0 technology for fast charging.</p>\r\n\r\n<p>10W wireless charger.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن 3 في 1 ذو 3 مداخل منهم مدخل بتنقية PD ومدخل بتقنية IQ للشحن السريع بسعة 8000 مللي امبير من شركة Goui.</p>\r\n\r\n<p>يتميز انه شاحن جداري للسفر وفي نفس الوقت باوربانك بسعة 8000 مللي امبير وايضاً يدعم تقنية الشحن اللاسلكي.</p>\r\n\r\n<p>قطعتين اضافية ليتناسب مع بلكات كل الدول مثل امريكا واوروبا وبريطانيا.</p>\r\n\r\n<p>يمكن شحن 3 اجهزة بنفس الوقت.</p>\r\n\r\n<p>مدخل تايب سي للشحن السريع بقوة 18 واط.</p>\r\n\r\n<p>&ndash; مدخلين يو اس بي (واحد) بتقنية QC3.0 للشحن السريع.</p>\r\n\r\n<p>&ndash; شاحن لاسلكي بقوة 10 واط.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-02 15:10:27', '2022-09-02 12:10:27', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '18'),
(471, NULL, 5, 0, NULL, NULL, 'Goui NURU Lamp With Wireless Charger', '252', 'اضاءة Nuru مع شاحن سلكي و لاسلكي + شاشة رقمية من Goui', NULL, 'uploads/products/41emamUL2cL__AC_SL1000_.jpg', NULL, NULL, '', '299', '194', '1', '<p>Product Details:</p>\r\n\r\n<p>Nuru Table lamp with 2 ports Type-C with PD technology and USB port with QC3.0 technology for fast charging, in addition to a 10W wireless charger from Goui.</p>\r\n\r\n<p>Features LED digital display for temperature, time and date.</p>\r\n\r\n<p>Dim lighting at the bottom of the device with 3 levels to help illuminate a small place in case you do not want to turn on the upper light.</p>\r\n\r\n<p>It contains a sound alarm for the time.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>اضاءة طاولة مع منفذ تايب سي بتقنية PD ومنفذ يو اس بي بتقنية QC3.0 للشحن السريع بالإضافة الى شاحن لاسلكي بقوة 10 واط من شركة Goui.</p>\r\n\r\n<p>تتميز بوجود شاشة رقمية LED لدرجة الحرارة والوقت والتاريخ.</p>\r\n\r\n<p>إضاءة خافتة اسفل الجهاز فيها 3 مستويات للمساعدة في إنارة مكان صغير في حال عدم الرغبة في تشغيل الاضاءة العلويه.</p>\r\n\r\n<p>تحتوي على منبة صوتي للوقت.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-02 15:12:09', '2022-09-02 12:12:09', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '18'),
(472, NULL, 5, 0, NULL, NULL, 'Goui Von Multifunction Mirror', '253', 'مرآة متعددة الاستخدام من Goui', NULL, 'uploads/products/von_1200x1200.jpg', NULL, NULL, '', '399', '259', '1', '<p>Product Details:</p>\r\n\r\n<p>A multifunction mirror capacity of 10,000 mAh with lighting and a speaker, in addition to a 10W wireless charger, two charging ports Type C PD technology and USB QC3.0 technology for fast charging from Goui.</p>\r\n\r\n<p>It features a 12W speaker, and photo magnifier with LED lighting.</p>\r\n\r\n<p>Operated by charging or battery.</p>\r\n\r\n<p>The mirror battery has a capacity of 10,000 mAh and can be used as a power bank.</p>\r\n\r\n<p>Type C input with a power of 18W.</p>\r\n\r\n<p>USB port with a power of 22W.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مرآة بسعة 10,000 مللي امبير مع اضاءة ومكبر صوت بالإضافة الى شاحن لاسلكي بقوة 10 واط ومدخلين للشحن تايب سي بتقنية PD ويو اس بي بتقنية QC3.0 للشحن السريع من شركة Goui.</p>\r\n\r\n<p>تتميز بوجود مكبر صوت بقوة 12 واط وايضاً مرآة ومكبر صورة مع اضاءة LED.</p>\r\n\r\n<p>تعمل عن طريق الشحن او البطارية.</p>\r\n\r\n<p>سعة بطارية المرآة 10,000 مللي امبير ويمكن استخدامها باوربانك.</p>\r\n\r\n<p>مدخل تايب سي بقوة 18 واط.</p>\r\n\r\n<p>مدخل يو اس بي بقوة 22 واط.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-02 15:14:06', '2022-09-02 12:14:06', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '18');
INSERT INTO `product` (`product_id`, `fk_lang_id`, `category_id`, `sub_category_id`, `child_category_id`, `unit_id`, `product_name`, `product_code`, `product_name_ar`, `product_in_marathi`, `image_name`, `pack_size`, `product_price`, `max_sell_limit`, `product_offer_price`, `product_purchase_price`, `listed_in_super_deal`, `description`, `description_ar`, `relatable_products`, `video_url`, `product_barcode`, `status`, `unit`, `mrp`, `stock_status`, `added_on`, `date_modified`, `popular`, `featured`, `best_selling`, `new_arrival`, `qty`, `supplier_id`, `currency_in_english`, `currency_in_arabic`, `product_offer`, `product_status`, `category_type`, `gift_card_stock`, `uniq_code`, `brand_id`) VALUES
(473, NULL, 15, 9, NULL, NULL, 'Zendure Super Tank Pro 26800mAh Power Bank', '478', 'شاحن متنقل سوبر تانك برو بسعة 26800 مللي امبير من Zendure', NULL, 'uploads/products/image_15aea0e7-1b6e-48b9-885f-4084783e797c_1000x1000-768x768.png', NULL, NULL, '', '599', '420', '1', '<p>The latest and most powerful power bank with 4 Type-C inputs, a capacity of 26800 mAh, and a total power of 138W Super Tank Pro from Zendure.</p>\r\n\r\n<p>It features a large OLED screen and gives you the amount of battery charge and the watts power giving to the devices.</p>\r\n\r\n<p>Two 100W Type-C fast charging ports for charging laptops such as Mac Pro and tablets such as iPad, and you can also charge the power bank from the same input.</p>\r\n\r\n<p>Two 18W Type-C fast charging ports for charging tablets such as iPads and others, as well as phones.</p>\r\n\r\n<p>Suitable size and you can take it with you outside home.</p>\r\n\r\n<p>Made of reinforced aluminum, anti-hit or fall.</p>\r\n\r\n<p>It receives a 100W charge and takes time of 90 minutes to fully charge if it is charged with this rated power.</p>\r\n', '<p>باوربانك الأحدث والاقوى ذو 4 مداخل تايب سي بسعة 26800 مللي امبير وبقوة اجمالية 138 واط سوبر برو من شركة Zendure.</p>\r\n\r\n<p>يتميز بوجود شاشة كبيرة OLED وتعطيك كم شحن البطارية وقوة الواط الموصلة للأجهزة.</p>\r\n\r\n<p>مدخلين تايب سي للشحن السريع بقوة 100 واط لشحن اجهزة اللابتوب مثل ماك برو والاجهزة اللوحية مثل الايباد وايضاً تقدرون تشحنون الباوربانك من نفس المكان.</p>\r\n\r\n<p>مدخلين تايب سي للشحن السريع بقوة 18 واط لشحن الاجهزة اللوحية مثل الايباد وغيرها وايضاً الهواتف.</p>\r\n\r\n<p>حجمة مناسب وتقدرون تاخذونة معاكم خارج المنزل.</p>\r\n\r\n<p>مصنوع من الالمنيوم المقوى المضاد للضربات او السقوط.</p>\r\n\r\n<p>يستقبل شحن بقوة 100 واط ويستغرق شحنة 90 دقيقة في حال تم شحنة بهذه القوة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=NrFzaifArwM&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2022-09-02 15:16:56', '2022-09-02 12:16:56', NULL, NULL, 1, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '49'),
(474, NULL, 4, 15, NULL, NULL, 'iTunes US / 25 USD Digital Card', NULL, 'ايتونز امريكي / 25 دولار', NULL, 'uploads/products/i-tunes_251.jpg', NULL, NULL, NULL, '105', '', '1', '<p>Apple iTunes cards are prepaid cards that enable you to charge your balance at Apple Store to be able to purchase all the contents of the Apple Store without sharing your credit card details every time you want to buy through this balance, then you will be able to use it in iTunes Store or Apple App Store or Bookstore.</p>\r\n\r\n<p><strong>Circuit Store Conditions:</strong></p>\r\n\r\n<p>Purchasing the cards via Application or Website only.<br />\r\nYou will receive the code via WhatsApp or Email that you entered at the time of ordering in the application or website.<br />\r\nDelivery of gift cards code are instant, might be delayed for several minutes after completing a purchase.<br />\r\nCircuit Store is not responsible for any loss resulting from theft of gift cards code or by mistakenly charging the balance or by entering wrong phone number.<br />\r\nReturns and refunds are not permitted.</p>\r\n', '<p>بطاقات ابل ايتونز هي بطاقات مسبقة الدفع تمكنك من شحن رصيدك لدى متجر ابل ستور لتتمكن من شراء جميع محتويات متجر ابل دون الحاجه لمشاركة بيانات بطاقتك الائتمانية في كل مره ترغب بها بالشراء من خلال هذا الرصيد سوف تتمكن بعد ذلك باستخدامه في متجر ايتونز أو متجر تطبيقات آبل أو متجر الكتب.</p>\r\n\r\n<p><strong>شروط سيركت ستور:</strong></p>\r\n\r\n<p>شراء البطاقات عند طريق الموقع الالكتروني او تطبيق سيركت ستور&nbsp;فقط.<br />\r\nيكون التسليم عن طريق الواتس اب او الأيميل.<br />\r\nمن الممكن تأخر تسليم كود بطاقات الهدايا أو البطاقات المدفوعة مسبقاً أو شحن الرصيد لعدة دقائق بعد إتمام العملية الشرائية.<br />\r\nسيركت ستور غير مسؤولة عن أية خسارة ناتجة عن سرقة بطاقات الهدايا أو البطاقات المدفوعة مسبقاً أو شحن رصيد بالخطأ او ادخال بيانات خاطئة من قبل العميل عند الشراء.<br />\r\nعمليات الإرجاع واسترجاع النقود غير مسموحة.</p>\r\n', NULL, NULL, NULL, '0', NULL, NULL, '1', '2022-09-02 15:30:31', '2022-09-