(573, NULL, 10, 0, NULL, NULL, 'UNIQ Pixo Magnetic Stylus Pen For iPads - Graphite Black', '452', 'قلم Pixo الذكي للايباد من Uniq - اسود', NULL, 'uploads/products/174524_H7bede4ac0f624719bb78c6e4f7fb37mQ-copy.jpg', NULL, NULL, '', '205', '130', '1', '<p>Product Details:</p>\r\n\r\n<p>A Smart pen that works with all IOS systems from UNIQ.</p>\r\n\r\n<p>Suitable for facilitating the work of students or workers on the iPads.</p>\r\n\r\n<p>Small in size and has no weight. It is easy to use with a single push of a button, and it does not need any pairing process.</p>\r\n\r\n<p>Comes with USB wire for charging.</p>\r\n\r\n<p>Input: Type-C charging port.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>قلم ذكي يعمل مع جميع انظمة IOS من شركة UNIQ.</p>\r\n\r\n<p>مناسب لتسهيل العمل للطلاب او العاملين على الايباد.</p>\r\n\r\n<p>حجمه صغير ومافيه وزن سهل الاستخدام بضغطة زر وحدة ومايحتاج الى اي عملية اقتران.</p>\r\n\r\n<p>يأتي مع واير الشحن بمنفذ يو اس بي.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-11-10 12:14:34', '2022-11-10 09:14:34', NULL, NULL, NULL, NULL, 1, 3, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '45'),
(487, NULL, 4, 19, NULL, NULL, 'XBOX US / 3 Months Gold Membership Digital Card', NULL, 'Xbox امريكي / اشتراك لمدة 3 أشهر', NULL, 'uploads/products/xbox-usa-3m.jpg', NULL, NULL, NULL, '100', '', '1', '<p>Xbox Membership cards are prepaid cards that enable you to register at Xbox to be able to play and use all the contents of the Xbox without sharing your credit card details every time you want to buy Membership.</p>\r\n\r\n<p><strong>Circuit Store Conditions:</strong></p>\r\n\r\n<p>Purchasing the cards via Application or Website only.</p>\r\n\r\n<p>You will receive the code via WhatsApp or Email that you entered at the time of ordering in the application or website.</p>\r\n\r\n<p>Delivery of gift cards code are instant, might be delayed for several minutes after completing a purchase.</p>\r\n\r\n<p>Circuit Store is not responsible for any loss resulting from theft of gift cards code or by mistakenly charging the balance or by entering wrong deliver phone number by customers.</p>\r\n\r\n<p>Returns and refunds are not permitted.</p>\r\n', '<p>بطاقات اشتراك اكس بوكس هي بطاقات مسبقة الدفع تمكنك من الاشتراك لدى اكس بوكس لتتمكن من اللعب في اكس بوكس دون الحاجه لمشاركة بيانات بطاقتك الائتمانية في كل مره ترغب بها بالاشتراك من خلال هذا الرصيد<span dir=\"LTR\">.</span></p>\r\n\r\n<p><strong>شروط سيركت ستور</strong><strong>:</strong></p>\r\n\r\n<p>شراء البطاقات عند طريق الموقع الالكتروني او تطبيق سيركت ستور فقط.<br />\r\nيكون التسليم عن طريق الواتس اب او الأيميل.<br />\r\nمن الممكن تأخر تسليم كود بطاقات الهدايا أو البطاقات المدفوعة مسبقاً أو شحن الرصيد لعدة دقائق بعد إتمام العملية الشرائية.<br />\r\nسيركت ستور غير مسؤولة عن أية خسارة ناتجة عن سرقة بطاقات الهدايا أو البطاقات المدفوعة مسبقاً أو شحن رصيد بالخطأ او ادخال بيانات خاطئة من قبل العميل عند الشراء.<br />\r\nعمليات الإرجاع واسترجاع النقود غير مسموحة.</p>\r\n', NULL, NULL, NULL, '1', NULL, NULL, '1', '2022-09-02 16:17:51', '2022-09-02 13:17:51', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '1', 'Gift Card', '1', NULL,