(494, NULL, 15, 9, NULL, NULL, 'Anker 633 Magnetic Power Bank 10000mAh - White', '443', 'باوربانك مغناطيسي لاسلكي + سلكي وستاند بقوة 10000 مللي امبير من Anker - ابيض', NULL, 'uploads/products/327951_A1641H31-1.jpg', NULL, NULL, '', '349', '279', '1', '<p>Product Details:</p>\r\n\r\n<p>Wireless and wired power bank at the same time, New version of the 633 series, with a capacity of 10000mAh and a stand with Magsafe technology for iPhone from Anker.</p>\r\n\r\n<p>Supports fast wireless charging for iPhone 12 and above.</p>\r\n\r\n<p>It can be used as a phone stand to watch movies, series, etc.</p>\r\n\r\n<p>It is characterized by its small size and is considered the size compared to other wireless chargers.</p>\r\n\r\n<p>20W Type C port with IQ technology for charging the power bank, and other devices can be charged from the same port.</p>\r\n\r\n<p>USB port with IQ technology for fast charging.</p>\r\n\r\n<p>Charges the iPhone from one and a half to two times a full charge, depending on the type of device.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن لاسلكي وسلكي في نفس الوقت الاصدار الجديد من فئة 633 بسعة 10000 مللي امبير وستاند بتقنية Magsafe للايفون من شركة Anker.</p>\r\n\r\n<p>يدعم الشحن اللاسلكي السريع لاجهزة الايفون 12 وما فوق.</p>\r\n\r\n<p>يمكن استخدامة كستاند للهاتف لمشاهدة الافلام او المسلسلات وغيرها.</p>\r\n\r\n<p>يتميز بصغر حجمه على سعة البطارية مقارنةً بغيره من الشواحن اللاسلكية.</p>\r\n\r\n<p>منفذ تايب سي بقوة 20 واط بتقنية IQ لشحن الباوربانك ويمكن شحن اجهزة اخرى من نفس المدخل.</p>\r\n\r\n<p>منفذ يو اس بي بتقنية IQ للشحن السريع.</p>\r\n\r\n<p>يشحن الايفون من مره ونصف الى مرتين شحن كامل على حسب نوع الجهاز.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-05 22:44:19', '2022-09-05 19:44:19', NULL, NULL, NULL, NULL, 2, 5, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '11'),
(495, NULL, 6, 0, NULL, NULL, 'Eufy By Anker Indoor Cam 2K Pan & Tilt', '483', 'كاميرا ذكية للمنزل بدقة 2k ودوران 360 درجة من Anker', NULL, 'uploads/products/471792_Anker-Eufy-Indoor-Security-2K-Cam-Pan-and-Tilt-in-Qatar-600x600.jpg', NULL, NULL, '', '229', '148', '1', '<p>Product Details:</p>\r\n\r\n<p>Eufy Smart home security Wi-Fi camera with high quality and clear natural image from Anker.</p>\r\n\r\n<p>Upgraded high quality 2K ultra HD resolution.</p>\r\n\r\n<p>360 degree rotating full angle vision.</p>\r\n\r\n<p>Support night vision view through infrared.</p>\r\n\r\n<p>It has a two-way dual microphone allows you to talk through.</p>\r\n\r\n<p>It contains an intelligence system that recognizes human faces.</p>\r\n\r\n<p>Supports voice commands from Siri and Google Assistant.</p>\r\n\r\n<p>Control App: Eufy Security</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كاميرا ذكية تعمل عن طريق الواي-فاي ذات دقة عالية وتصوير واضح للمراقبة من شركة Anker.</p>\r\n\r\n<p>تتميز بجودة عالية وصورة طبيعية بدقة 2K او 1440P.</p>\r\n\r\n<p>متحركة بزاوية دوران كاملة 360 درجة.</p>\r\n\r\n<p>تدعم نظام الرؤية الليلة عن طريق الاشعة تحت الحمراء.</p>\r\n\r\n<p>تحتوي على ميكروفون مزدوج مما يتيح لك التحدث من خلالها.</p>\r\n\r\n<p>تحتوي على نظام الذكاء الاصطناعي والذي يتعرف على الوجوه البشرية.</p>\r\n\r\n<p>تدعم الاوامر الصوتية من سيري وقوقل اسستنس.</p>\r\n\r\n<p>تطبيق التحكم: Eufy Security.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-05 22:46:10', '2022-09-05 19:46:10', NULL, NULL, NULL, NULL, 2, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(496, NULL, 7, 0, NULL, NULL, 'Porodo Mono Type-C Single Side Earphone', '445', 'سماعة اذن واير جانب واحد يمين تايب سي من Porodo', NULL, 'uploads/products/ezgif-2-c98c82fc00-14-1144x1144-1.jpg', NULL, NULL, '', '60', '', '1', '<p>Product Details:</p>\r\n\r\n<p>Single right side earphone from Porodo.</p>\r\n\r\n<p>Input: Type C</p>\r\n', '<p>تفاصيل المنتج:</p>\r\n\r\n<p>سماعة اذن واير تايب سي من شركة Porodo.</p>\r\n\r\n<p>مدخل: تايب سي.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-05 22:47:57', '2022-09-05 19:47:57', NULL, NULL, NULL, NULL, 2, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '31'),
(497, NULL, 5, 0, NULL, NULL, 'uGreen Wet & Dry Dual Use Lightweight Portable Mini Vacuum Cleaner', '20032', 'مكنسة كهربائية محمولة صغيرة الحجم من uGreen', NULL, 'uploads/products/533728_11-33.jpg', NULL, NULL, '', '180', '120', '1', '<p>Product Details:</p>\r\n\r\n<p>Small size vacuum cleaner with high performance motor and distinctive cylindrical shape from uGreen.</p>\r\n\r\n<p>The device has an innovative 2-in-1 nozzle that can be used separately or togther.</p>\r\n\r\n<p>It is characterized by ease of use and high suction power of up to 5500Pa.</p>\r\n\r\n<p>Comfortable and you can use it for home, car or cleaning difficult places.</p>\r\n\r\n<p>The internal filter of the vacuum cleaner can be washed and reused.</p>\r\n\r\n<p>The battery capacity is 2000mAh, it takes two to two and a half hours to charge, and it works for 15 minutes continuously.</p>\r\n\r\n<p>Input: Type C</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مكنسة كهربائية صغيرة الحجم بمحرك عالي الاداء وشكل اسطواني مميز من شركة uGreen.</p>\r\n\r\n<p>الجهاز يحتوي على فوهة مبتكرة 2 في 1 والتي يمكن استخدامها بشكل منفصل او مع الفرشاة.</p>\r\n\r\n<p>تتميز بسهولة الاستخدام وقوة شفط عالية تصل الى 5500 باسكال.</p>\r\n\r\n<p>مريحة وتقدرون تستخدمونها للبيت او السيارة او تنظيف الاماكن الصعبة.</p>\r\n\r\n<p>يمكن غسيل الفلتر الداخلي للمكنسة واعادة استخدامه مرة اخرى.</p>\r\n\r\n<p>سعة البطارية 2000 مللي امبير يستغرق شحنها من ساعتين الى ساعتين ونصف وتعمل لمدة 15 دقيقة متواصلة.</p>\r\n\r\n<p>مدخل: تايب سي.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-09-05 22:50:02', '2022-09-05 19:50:02', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '46'),
(498, NULL, 11, 0, NULL, NULL, 'MOFT Float Snap Invisible Stand', '20031', 'ستاند Float Snap لجميع اجهزة الايباد من Moft', NULL, 'uploads/products/936180_392931292.jpg', NULL, NULL, '', '149', '110', '1', '<p>Product Details:</p>\r\n\r\n<p>Magnetic 360 degree stand for all iPads from Moft.</p>\r\n\r\n<p>It is characterized by ease of installation. It comes with a magnetic adhesive plate that must be installed on the iPad, and then install the base using the built-in magnet.</p>\r\n\r\n<p>3 Different positions that can be used as a base with different angles and ways as desired, also the device can move 360 degrees rotation.</p>\r\n\r\n<p>Suitable for watching lectures, movies, series, etc.</p>\r\n\r\n<p>Supports all types of iPads from 7.9inch to 12.9inch.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ستاند معناطيسي 360 درجة لجميع انواع الايباد من شركة Moft.</p>\r\n\r\n<p>يتميز بسهولة تركيبة يأتي مع لوحة مغناطيسية لاصقه يتم تركيبها على الايباد وبعدها يتم تركيب القاعدة عن طريق المغناطيس المدمج.</p>\r\n\r\n<p>3 وضعيات مختلفة يمكن استخدامة كقاعدة بزوايا وطرق مختلفة على حسب الرغبة وايضاً يمكن تحريك الجهاز 360 درجة دوران.</p>\r\n\r\n<p>مناسب لمشاهدة المحاضرات او الافلام والمسلسلات وغيرها.</p>\r\n\r\n<p>يدعم اجهزة الايباد جميعها من 7.9 انش الى 12.9 انش.</p>\r\n', NULL, 'https://youtu.be/c709gx-IOW4', '', '1', NULL, NULL, '1', '2022-09-05 22:52:00', '2022-09-05 19:52:00', NULL, NULL, NULL, NULL, 2, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '29'),
