(505, NULL, 15, 12, NULL, NULL, 'Redmi Note 11 4G', '', 'ريدمي نوت 11 4G', NULL, 'uploads/products/redmo01.jpg', NULL, NULL, NULL, '11000', '9000', '1', '<h1>About this item</h1>\r\n\r\n<ul>\r\n	<li>Display: 90Hz FHD+ (1080x2400) AMOLED display; 16.33 centimeters (6.43 inch); 20:9 aspect ratio</li>\r\n	<li>Camera: 50 MP Quad Rear camera with 8MP Ultra-wide, 2MP Macro and Portrait lens| 13 MP Front camera</li>\r\n	<li>Battery: 5000 mAh large battery with 33W Pro fast charger in-box and Type-C connectivity</li>\r\n	<li>Processor: Qualcomm Snapdragon 680 Octa-core; 6nm processor; Up to 2.4GHz clock speed</li>\r\n	<li>Memory, Storage &amp; SIM: 4GB RAM | 64GB UFS 2.2 storage expandable up to 512GB with dedicated SD card slot | Dual SIM (nano+nano) dual standby (4G+4G)</li>\r\n	<li>Alexa Hands-Free capable: Download the Alexa app to use Alexa hands-free. Play music, make calls, hear news, open apps, navigate, and more, all using just your voice, while on-the-go</li>\r\n	<li>Get 2 months of YouTube Premium free!</li>\r\n</ul>\r\n', '<p>حول هذا البند الشاشة: 90 هرتز FHD (1080x2400) شاشة AMOLED ؛ 16.33</p>\r\n\r\n<p>سم (6.43 بوصة) ؛ نسبة العرض إلى الارتفاع 20:9 الكاميرا: كاميرا خلفية رباعية بدقة 50</p>\r\n\r\n<p>ميجابكسل مع عدسة ماكرو وبورتريه بدقة 8 ميجابكسل بدقة 8 ميجابكسل| 13 ميجابكسل F</p>\r\n\r\n<p>حول هذا البند الشاشة: 90 هرتز FHD (1080x2400) شاشة AMOLED ؛ 16.33</p>\r\n\r\n<p>سم (6.43 بوصة) ؛ نسبة العرض إلى الارتفاع 20:9 الكاميرا: كاميرا خلفية رباعية بدقة 50</p>\r\n\r\n<p>ميجابكسل مع عدسة ماكرو وبورتريه بدقة 8 ميجابكسل بدقة 8 ميجابكسل| 13 ميجابكسل F</p>\r\n', NULL, '', '', '0', NULL, NULL, '1', '2022-10-13 12:08:09', '2022-10-13 09:08:09', NULL, 1, NULL, 1, 10, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL),
(506, NULL, 15, 12, NULL, NULL, 'OnePlus Nord CE 2 5G', '', 'ون بلس نورد سي إي 2 5G', NULL, 'uploads/products/oneplus1.jpg', NULL, NULL, NULL, '25000', '22000', '1', '<h1>About this item</h1>\r\n\r\n<ul>\r\n	<li>65W SUPERVOOC &ndash; Accelerated charge velocity shall rocket the 4500mAh battery to a day&#39;s power in 15 minutes. Certified by T&Uuml;V Rheinland, one shall &ldquo;Charge &amp; Play&rdquo; with absolute peace of mind.</li>\r\n	<li>Mediatek Dimensity 900 &ndash; Powered by a 5G enabled, octa-core monster of a chipset that&rsquo;s tad more powerful than previous CE, consider this the &ldquo;Best in class&rdquo; daily driver for entertainment with its &ldquo;dragon-slaying&rdquo; power efficiency, thermal control and support for Wi-Fi 6.</li>\r\n	<li>6.43 inch, 90Hz FHD+ AMOLED Display &ndash; Shielded by Corning Gorilla Glass 5, scroll, swipe, and enjoy all your entertainment effortlessly on this HDR10+ certified, OnePlus-worthy display.</li>\r\n	<li>AI-infused Triple Camera &ndash; This amazing camera setup comprises of a 64MP main sensor, 119&deg; wide-angle and a 16MP selfie shooter. Powered by inhouse algorithm, imaging in badly or unevenly lit environments shall become so much easier</li>\r\n	<li>All Flexible &ndash; The OnePlus Nord CE 2 is equipped with triple card slots, meaning you have the flexibility to go dual SIM, with an additional micro SD that allows for up to 1TB extendable storage. Also, this phone has a 3.5mm headphone jack</li>\r\n	<li>Designed by OnePlus &ndash; Coming in at 7.8mm thick, weighing 173g, this is THE slimmest OnePlus phone yet, since the 6T.</li>\r\n	<li>OnePlus Quality &ndash; Powered by the most stable version of OxygenOS 11, based on Android 11, this device is easily futureproof, boasting 2 Years of Android version updates and 3 years of worth of security patches via OTA</li>\r\n</ul>\r\n', '<p>حول هذا البند 65W SUPERVOOC - سرعة الشحن المعجلة يجب أن تطلق بطارية 4500mAh</p>\r\n\r\n<p>إلى طاقة اليوم الواحد في 15 دقيقة.معتمدة من قبل T&Uuml;V Rheinland ،</p>\r\n\r\n<p>يجب على المرء &quot;الشحن واللعب&quot; مع المطلق</p>\r\n\r\n<p>حول هذا البند 65W SUPERVOOC - سرعة الشحن المعجلة يجب أن تطلق بطارية 4500mAh</p>\r\n\r\n<p>إلى طاقة اليوم الواحد في 15 دقيقة.معتمدة من قبل T&Uuml;V Rheinland ،</p>\r\n\r\n<p>يجب على المرء &quot;الشحن واللعب&quot; مع المطلق</p>\r\n', NULL, '', '', '0', NULL, NULL, '1', '2022-10-13 12:11:57', '2022-10-13 09:11:57', NULL, 1, NULL, 1, 10, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL),
(507, NULL, 15, 12, NULL, NULL, 'Apple iPhone 13 Mini (128GB) - Starlight', '', 'ابل ايفون ١٣ ميني (١٢٨ جيجابايت) - ضوء النجوم', NULL, 'uploads/products/iPhone1.jpg', NULL, NULL, NULL, '64000', '60000', '1', '<h1>About this item</h1>\r\n\r\n<ul>\r\n	<li>13 cm (5.4-inch) Super Retina XDR display</li>\r\n	<li>Cinematic mode adds shallow depth of field and shifts focus automatically in your videos</li>\r\n	<li>Advanced dual-camera system with 12MP Wide and Ultra Wide cameras; Photographic Styles, Smart HDR 4, Night mode, 4K Dolby Vision HDR recording</li>\r\n	<li>12MP TrueDepth front camera with Night mode, 4K Dolby Vision HDR recording</li>\r\n	<li>A15 Bionic chip for lightning-fast performance</li>\r\n	<li>Up to 17 hours of video playback</li>\r\n	<li>Durable design with Ceramic Shield</li>\r\n</ul>\r\n', '<p>حول هذا البند شاشة Super Retina XDR مقاس 13 سم (5.4 بوصة)</p>\r\n\r\n<p>يضيف الوضع السينمائي عمقا ضحلا للمجال ويحول التركيز تلقائيا في</p>\r\n\r\n<p>مقاطع الفيديو الخاصة بك نظام كاميرا مزدوجة متقدم بدقة 12 ميجابكسل عريضة وفائقة</p>\r\n\r\n<p>حول هذا البند شاشة Super Retina XDR مقاس 13 سم (5.4 بوصة)</p>\r\n\r\n<p>يضيف الوضع السينمائي عمقا ضحلا للمجال ويحول التركيز تلقائيا في</p>\r\n\r\n<p>مقاطع الفيديو الخاصة بك نظام كاميرا مزدوجة متقدم بدقة 12 ميجابكسل عريضة وفائقة</p>\r\n', NULL, '', '', '0', NULL, NULL, '1', '2022-10-13 12:14:58', '2022-10-13 09:14:58', NULL, 1, NULL, 1, 10, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL),
(508, NULL, 15, 12, NULL, NULL, 'Apple MacBook Air Laptop: Apple M1 chip, 13.3-inch/33.74 cm Retina', '', 'ابل ماك بوك اير لابتوب: شريحة ابل ام1، 13.3 بوصة/33.74 سم شبكية العين', NULL, 'uploads/products/Mac1.jpg', NULL, NULL, NULL, '90000', '80000', '1', '<h1>About this item</h1>\r\n\r\n<ul>\r\n	<li>All-Day Battery Life &ndash; Go longer than ever with up to 18 hours of battery life.</li>\r\n	<li>Powerful Performance &ndash; Take on everything from professional-quality editing to action-packed gaming with ease. The Apple M1 chip with an 8-core CPU delivers up to 3.5x faster performance than the previous generation while using way less power.</li>\r\n	<li>Superfast Memory &ndash; 8GB of unified memory makes your entire system speedy and responsive. That way it can support tasks like memory-hogging multitab browsing and opening a huge graphic file quickly and easily.</li>\r\n	<li>Stunning Display &ndash; With a 13.3-inch/33.74 cm Retina display, images come alive with new levels of realism. Text is sharp and clear, and colors are more vibrant.</li>\r\n	<li>Why Mac &ndash; Easy to learn. Easy to set up. Astoundingly powerful. Intuitive. Packed with apps to use right out of the box. Mac is designed to let you work, play, and create like never before.</li>\r\n	<li>Simply Compatible &ndash; All your existing apps work, including Adobe Creative Cloud, Microsoft 365, and Google Drive. Plus you can use your favorite iPhone and iPad apps directly on macOS. Altogether you&rsquo;ll have access to the biggest collection of apps ever for Mac. All available on the App Store.</li>\r\n	<li>Easy to Learn &ndash; If you already have an iPhone, MacBook Air feels familiar from the moment you turn it on. And it works perfectly with all your Apple devices. Use your iPad to extend the workspace of your Mac, answer texts and phone calls directly on your Mac, and more.</li>\r\n</ul>\r\n', '<p>حول هذا البند عمر بطارية يدوم طوال اليوم - يمكنك العمل لفترة أطول من أي وقت مضى مع</p>\r\n\r\n<p>عمر بطارية يصل إلى 18 ساعة.أداء قوي - استمتع بكل شيء بدءا من</p>\r\n\r\n<p>التحرير بجودة احترافية إلى الألعاب المليئة بالإثارة باستخدام</p>\r\n\r\n<p>حول هذا البند عمر بطارية يدوم طوال اليوم - يمكنك العمل لفترة أطول من أي وقت مضى مع</p>\r\n\r\n<p>عمر بطارية يصل إلى 18 ساعة.أداء قوي - استمتع بكل شيء بدءا من</p>\r\n\r\n<p>التحرير بجودة احترافية إلى الألعاب المليئة بالإثارة باستخدام</p>\r\n', NULL, '', '', '0', NULL, NULL, '1', '2022-10-13 12:18:50', '2022-10-13 09:18:50', NULL, 1, NULL, 1, 10, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, NULL),
(509, NULL, 15, 12, NULL, NULL, 'HP Pavilion 14 12th Gen Intel Core i5 16GB SDRAM/512GB SSD 14 inch(35.6cm)', '', 'اتش بي بافيليون 14 الجيل 12 انتل كور i5 16 جيجا بايت اس دي / 512 جيجابايت اس اس دي 14 بوصة (35.6cm)', NULL, 'uploads/products/hp1.jpg', NULL, NULL, NULL, '68000', '65000', '1', '<h1>About this item</h1>\r\n\r\n<ul>\r\n	<li>Do Check Partner offer section for Exciting offers from HP</li>\r\n	<li>Processor: Intel Core i5-1235U (up to 4.4 GHz with Intel Turbo Boost Technology, 12 MB L3 cache, 10 cores, 12 threads)| Memory &amp; Storage: 16 GB DDR4-3200 MHz RAM (2 x 8 GB) | Storage: 512GB PCIe NVMe TLC M.2 SSD</li>\r\n	<li>Display &amp; Graphics: 35.6 cm (14&quot;) diagonal, FHD, IPS, micro-edge, BrightView, 250 nits, 157 ppi | Graphics: Intel UHD Graphics</li>\r\n	<li>Operating System &amp; Pre-installed Software: Pre-loaded Windows 11 Home 64 Single Language| Microsoft Office Home &amp; Student 2021|McAfee LiveSafe (30 days free trial as default)| Pre-installed Alexa built-in- Your life simplified with Alexa. Just ask Alexa to check your calendar, create to-do lists, shopping lists, play music, set reminders, get latest news and control smart home.</li>\r\n	<li>Ports: 1 SuperSpeed USB Type-C 10Gbps signaling rate (USB Power Delivery, DisplayPort 1.4, HP Sleep and Charge), 2 SuperSpeed USB Type-A 5Gbps signaling rate,1 Headphone/microphone Combo,1 AC Smart pin, 1 HDMI 2.1</li>\r\n	<li>Features: Camera: HP Wide Vision 720p HD camera with temporal noise reduction and integrated dual array digital microphones| Audio: Audio by B&amp;O, Dual Speakers| Keyboard: Full-size backlit natural silver keyboard , HP Imagepad with multi-touch gesture support| Battery: 3-cell, 43 Wh Li-ion, Support battery fast charge| Networking: MediaTek Wi-Fi CERTIFIED 6 MT7921 (2x2) and Bluetooth 5.2 combo, MU-MIMO supported| Fingerprint Reader</li>\r\n	<li>Why HP? What is good for the planet, is good for technology and good for us. Technology must be mindful of the environment and HP 