(552, NULL, 15, 10, NULL, NULL, 'UNIQ Voyage PD World Travel Charger', '450', 'شاحن السفر ذو 3 مداخل من Uniq', NULL, 'uploads/products/331573_H7bede4ac0f624719bb78c6e4f7fb3763Q-copy.jpg', NULL, NULL, '', '180', '95', '1', '<p>Product Details:</p>\r\n\r\n<p>Travel charger with two USB ports + Type C, that support 33W fast charging from UNIQ.</p>\r\n\r\n<p>Anti-electric shock and overcharging and also made of flame retardant materials.</p>\r\n\r\n<p>Small in size and easy to move around in travel.</p>\r\n\r\n<p>Can be used with all countries of the world.</p>\r\n\r\n<p>3 devices can be charged at the same time.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن السفر ذو مدخلين يو اس بي + مدخل تايب سي يدعمون الشحن السريع بقوة 33 واط من شركة UNIQ.</p>\r\n\r\n<p>مضاد للصدمات الكهربائية والشحن الزائد وايضاً مصنوع من مواد مضادة للأشتعال.</p>\r\n\r\n<p>صغير الحجم ويسهل نقلة فالسفر.</p>\r\n\r\n<p>يمكن استخدامة مع جميع دول العالم.</p>\r\n\r\n<p>يمكن شحن 3 اجهزة في نفس الوقت.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-10-28 16:28:01', '2022-10-28 13:28:01', NULL, NULL, NULL, NULL, 2, 3, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '45'),
(553, NULL, 10, 0, NULL, NULL, 'UNIQ Pixo Magnetic Stylus Pen For iPads - Dove White', '493', 'قلم Pixo الذكي للايباد من Uniq - ابيض', NULL, 'uploads/products/844079_H7bede4ac0f624719bb78c6e4f7fb3763Q-copy-1.jpg', NULL, NULL, '', '205', '117', '1', '<p>Product Details:</p>\r\n\r\n<p>A Smart pen that works with all IOS systems from UNIQ.</p>\r\n\r\n<p>Suitable for facilitating the work of students or workers on the iPads.</p>\r\n\r\n<p>Small in size and has no weight. It is easy to use with a single push of a button, and it does not need any pairing process.</p>\r\n\r\n<p>Comes with USB wire for charging.</p>\r\n\r\n<p>Input: Type-C charging port.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>قلم ذكي يعمل مع جميع انظمة IOS من شركة UNIQ.</p>\r\n\r\n<p>مناسب لتسهيل العمل للطلاب او العاملين على الايباد.</p>\r\n\r\n<p>حجمه صغير ومافيه وزن سهل الاستخدام بضغطة زر وحدة ومايحتاج الى اي عملية اقتران.</p>\r\n\r\n<p>يأتي مع واير الشحن بمنفذ يو اس بي.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-10-28 16:30:12', '2022-10-28 13:30:12', NULL, NULL, NULL, NULL, 2, 3, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '45'),
