(558, NULL, 10, 0, NULL, NULL, 'Moft Snap Flash Wallet Stand - Blue', '448', 'ستاند ومحفظة للجوال MagSafe الاصدار الجديد Snap Flash من موفت  – كحلي', NULL, 'uploads/products/620523_H7bede4ac0f624719bbsdasdsab3763Q-copy.jpg', NULL, NULL, '', '130', '79', '1', '<p>Product Details:</p>\r\n\r\n<p>New series of Grip, Stand and Wallet from Moft, supports MagSafe technology.</p>\r\n\r\n<p>Suitable for all Apple 12 phones and above via magnet ( MagSafe ) without need for any adhesive.</p>\r\n\r\n<p>It can be used as a base in length or width at an angle of 60 degrees, as desired and enjoy watching Movies or Youtube.</p>\r\n\r\n<p>It features magnets to attach it to any magnetic bases in the car.</p>\r\n\r\n<p>It has a wallet for cards, and a maximum of 3 cards can be placed.</p>\r\n\r\n<p>Small in size, suitable and does not increase the thickness of the phone.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مسكة وستاند ومحفظة (الاصدار الجديد) من شركة موفت والتي تدعم تقنية MagSafe.</p>\r\n\r\n<p>مناسبة لجميع هواتف ابل 12 ومافوق عن طريق المغناطيس ( MagSafe ) دون الحاجة الى أي لاصق.</p>\r\n\r\n<p>يمكن استخدامها كقاعدة بالطول او العرض بزاوية 60 درجة على حسب الرغبة لمشاهدة الأفلام او اليوتيوب.</p>\r\n\r\n<p>تتميز بوجود مغناطيس لتثبيتها بقواعد مغناطيسية في السيارة وغيرها.</p>\r\n\r\n<p>يوجد فيها محفظة للبطاقات ويمكن وضع 3 بطاقات كحد اقصى.</p>\r\n\r\n<p>صغيرة الحجم ومناسبة ولا تزيد من سماكة الهاتف.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Oih0bSZdzLQ', '', '1', NULL, NULL, '1', '2022-10-28 16:45:17', '2022-10-28 13:45:17', NULL, NULL, NULL, NULL, 2, 3, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '29'),
