(626, NULL, 15, 9, NULL, NULL, 'Anker 347 PowerCore 40,000mAh Power Bank', '498', 'باوربانك ذو 4 مخارج بسعة 40,000 مللي امبير من Anker', NULL, 'uploads/products/440122_Untitled.png', NULL, NULL, NULL, '499', '370', '1', '<p>Product Details:</p>\r\n\r\n<p>ANKER&nbsp;New 40k PowerCore series 40000mAh power bank 2 USB IQ fast charging ports &amp; 2 Type-C&nbsp;PD 30W ports.</p>\r\n\r\n<p>It is distinguished by its capacity, which can work for several days without&nbsp;charging it every day.</p>\r\n\r\n<p>It charges all kinds of devices, including laptops, tablets, phones and more.</p>\r\n\r\n<p>Charges iPhone almost 6 times, Mac Air 2 times,&nbsp;iPad 3 times, and Samsung 6 times fully charges&nbsp;at high speed.</p>\r\n\r\n<p>2 USB Outputs with IQ technology for fast charging.</p>\r\n\r\n<p>2 Type C port with PD technology for fasting charging total of 30W.</p>\r\n\r\n<p>LED battery indicator.</p>\r\n\r\n<p>Support simultaneous charging of 4 devices.</p>\r\n\r\n<p>Input: Type C.</p>\r\n\r\n<p>Warranty: 1 Year</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن متنقل&nbsp;الاصدار الجديد من فئة PowerCore&nbsp;بسعة 40,000 مللي امبير ذو مخرجين يو اس بي ومخرجين تايب سي من شركة ANKER.</p>\r\n\r\n<p>يتميز بسعته والذي يمكن ان يعمل لأيام بدون الحاجه الى شحنه في كل يوم.</p>\r\n\r\n<p>يشحن جميع انواع الأجهزة بما فيها اجهزة اللابتوب والتابليت والهواتف وغيرها.</p>\r\n\r\n<p>يشحن الايفون 6 مرات تقريباً وجهاز ماك اير مرتين والايباد 3 مرات&nbsp;بشكل كامل وبسرعة عالية.</p>\r\n\r\n<p>منفذين للشحن يو اس بي بتقنية IQ للشحن السريع.</p>\r\n\r\n<p>منفذين تايب سي بتقنية PD للشحن السريع بقوة اجمالية 30 واط.</p>\r\n\r\n<p>إضاءة LED لحالة شحن البطارية.</p>\r\n\r\n<p>يشحن 4 أجهزة بسرعة عالية وفي نفس الوقت.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n\r\n<p>ضمان لمدة سنة.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2023-02-08 22:44:57', '2023-02-08 19:44:57', 1, NULL, NULL, 1, 2, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(584, NULL, 10, 0, NULL, NULL, 'Remax Wireless Live-Stream Microphone - Type C', '456', 'مايكروفون لاسلكي مسافة 20 متر تايب سي من Remax', NULL, 'uploads/products/206925_Microphone_K02_(15).jpg', NULL, NULL, '', '120', '36.12', '1', '<p>Product Details:</p>\r\n\r\n<p>Wireless microphone for Android devices does not require pairing from REMAX.</p>\r\n\r\n<p>It is distinguished by its clear sound, the isolation of surrounding sounds, and the stability of the sound for a distance of up to 20 meters from the phone.</p>\r\n\r\n<p>Easy to use, just one click to record and another click to stop.</p>\r\n\r\n<p>The battery capacity is 80 mAh, it takes 1.5 hours to charge and works for 10 hours, and it can be used while charging the mobile as well.</p>\r\n\r\n<p>Fast charging technology enables the device to operate for an hour on a 10-minute charge.</p>\r\n\r\n<p>Suitable for personal interviews and other uses.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مايكروفون لاسلكي لأجهزة الاندرويد لا يحتاج الى اقتران من شركة REMAX.</p>\r\n\r\n<p>يتميز بصوته الواضح وعزل الاصوات المحيطة وايضاً بثبات الصوت لمسافة تصل الى 20 متر من الجوال.</p>\r\n\r\n<p>سهل الاستخدام فقط ضغطة واحدة للتسجيل وضغطة اخرى للايقاف.</p>\r\n\r\n<p>سعة البطارية 80 مللي امبير يستغرق شحنه 1.5 ساعة ويعمل لمدة 10 ساعات ويمكن استخدامه اثناء شحن الجوال ايضاً.</p>\r\n\r\n<p>تقنية الشحن السريع مما تمكن الجهاز من الاشتغال لمدة ساعة عند شحنة لمدة 10 دقائق فقط.</p>\r\n\r\n<p>مناسب للمقابلات الشخصية والاستعمالات الاخرى.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-12-27 20:57:09', '2022-12-27 17:57:09', 1, NULL, NULL, 1, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '35'),
(585, NULL, 9, 0, NULL, NULL, 'Data Transfer Adapter 4 Ports For All Phones', '455', 'وصلة نقل بيانات بـ 4 منافذ لجميع الهواتف', NULL, 'uploads/products/595238_ghhghgj.jpg', NULL, NULL, '', '79', '20.42', '1', '<p>Product Details:</p>\r\n\r\n<p>3-Port data link for all phones.</p>\r\n\r\n<p>It features all ports that fit all IOS and Android phones.</p>\r\n\r\n<p>It is small in size and you can take it with you outside the house.</p>\r\n\r\n<p>It is considered the most suitable solution for your phones in case you do not have storage space.</p>\r\n\r\n<p>Suitable for owners of mobile photography or those who need more storage space, as well as for travel.</p>\r\n\r\n<p>It is easy to use, only a flash memory is installed, the connection is installed in the phone, and data is transferred from the phone to the flash.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>وصلة نقل بيانات بـ 3 منافذ لجميع الهواتف.</p>\r\n\r\n<p>يتميز بوجود جميع المنافذ التي تناسب جميع الهواتف نظام IOS و Android.</p>\r\n\r\n<p>حجمه صغير وتقدرون تشيلونه معاكم خارج البيت.</p>\r\n\r\n<p>يعتبر الحل الانسب لهواتفكم في حال صار ماعندكم مساحة تخزين.</p>\r\n\r\n<p>مناسب لأصحاب التصوير بالهاتف او الي يحتاجون مساحات تخزين اكبر وايضاً للسفر.</p>\r\n\r\n<p>سهل الاستخدام فقط يتم تركيب فلاش ميموري وتركيب الوصلة في الهاتف ونقل البيانات من الهاتف الى الفلاش.</p>\r\n', NULL, 'https://youtu.be/34M8C4YCVak', '', '1', NULL, NULL, '1', '2022-12-27 21:03:42', '2022-12-27 18:03:42', NULL, NULL, NULL, NULL, 10, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(586, NULL, 10, 0, NULL, NULL, 'Multifunction Airpods Cleaning Pen', '457', 'قلم وفرشاة التنظيف للأماكن الضيقه لسماعات Airpods – ابيض', NULL, 'uploads/products/480411_98909090.jpg', NULL, NULL, '', '55', '16.77', '1', '<p>Product Details:</p>\r\n\r\n<p>Very small pen and important at the same time for cleaning the headphone case as well as the headphones themselves.</p>\r\n\r\n<p>This pen contains a small tool to clean the inside of the speaker, as well as a brush to remove dirt, as well as a piece of cotton to clean the speaker case.</p>\r\n\r\n<p>It is characterized by its small size and can be carried outside the house or put in the car and others.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>قلم صغير الحجم جداً ومهم في نفس الوقت لتنظيف علبة السماعة وايضاً السماعات نفسها.</p>\r\n\r\n<p>يحتوي هذا القلم على اداة صغيرة لتنظيف السماعة من الداخل وايضاً فرشاة لأزالة الاوصاخ وكذلك قطعة من القطن لتنظيف علبة السماعة.</p>\r\n\r\n<p>يتميز بصغر حجمه ويمكن حملة خارج المنزل او وضعه في السيارة وغيرها.</p>\r\n', NULL, 'https://youtu.be/zExEXAITvME', '', '1', NULL, NULL, '1', '2022-12-27 21:17:57', '2022-12-27 18:17:57', NULL, NULL, NULL, NULL, 18, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(587, NULL, 5, 0, NULL, NULL, 'Handheld Electric Food Chopper', '458', 'جهاز محمول قابل للشحن لتقطيع الخضروات', NULL, 'uploads/products/952771_electronic_crush_machine_(2).jpg', NULL, NULL, '', '189', '66.78', '1', '<p>Product Details:</p>\r\n\r\n<p>Unique and small portable device that is the perfect and fastest solution for cutting vegetables or small foods in slices or by chopping.</p>\r\n\r\n<p>It contains several heads, and each head has a specific method for cutting or mincing foods.</p>\r\n\r\n<p>It is characterized by ease of use, just by pressing the button and placing the foods you want in the place designated for them.</p>\r\n\r\n<p>The device can be washed in a quick and easy way by placing the water in the same entrance as the food, and turn the device on and it will clean itself.</p>\r\n\r\n<p>Charging port: Type-C and It does not need batteries.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز مميز وصغير محمول ويعتبر الحل الامثل والاسرع لتقطيع الخضروات او الاطعمة الصغيرة بشكل شرائح او بالفرم.</p>\r\n\r\n<p>يحتوي على عدة رؤوس لكل رأس طريقة معينة لتقطيع الاطعمه او لفرمها.</p>\r\n\r\n<p>يتميز بسهولة استخدامة فقط بالضغط على زر التشغيل ووضع الاطعمة التي ترغبون بها في المكان المخصص لها.</p>\r\n\r\n<p>يمكن غسيل الجهاز بطريقة سريعه وسهله يتم وضع الماء في نفس مدخل الاطعمة وتشغيل الجهاز وسيقوم بتنظيف نفسه.</p>\r\n\r\n<p>يعمل عن طريق الشحن ولا يحتاج الى بطاريات.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-12-27 21:23:22', '2022-12-27 18:23:22', 1, NULL, NULL, 1, 10, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(588, NULL, 12, 0, NULL, NULL, 'Diamond Selector II', '459', 'جهاز اختبار الاحجار الكريمة', NULL, 'uploads/products/326516_Diamond_Selector__(2).jpg', NULL, NULL, '', '120', '27.72', '1', '<p>Product Details:</p>\r\n\r\n<p>Small gem tester to detect the condition of the original stone from the fake.</p>\r\n\r\n<p>More than one type of stones can be tested, such as diamonds, sapphires, crystals, and others.</p>\r\n\r\n<p>Easy to use, just calibrate the device to the standard of the stone that you want to measure, as shown in the pictures, usage guide, or video explanation, and place the device on it.</p>\r\n\r\n<p>It works by battery and does not need charging.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>To operate the device, a 6LR61 9V battery must be installed, and the device does not include a battery.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز اختبار الاحجار الكريمة الصغير لاكتشاف حالة الحجر الاصلي من المزيف.</p>\r\n\r\n<p>يمكن اختبار اكثر من نوع للاحجار مثل الالماس والياقوت والكريستال وغيرة.</p>\r\n\r\n<p>سهل الاستخدام فقط قم بعيار الجهاز على معيار الحجر الذي تريد قياسه كما هو موضح فالصور او دليل الاستخدام او شرح الفيديو وضع الجهاز عليه.</p>\r\n\r\n<p>يعمل عن طريق البطارية ولا يحتاج الى شحن.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>لتشغيل الجهاز يجب تركيب بطارية من نوع 6LR61&nbsp;9V وان الجهاز لا يحتوي على بطارية التشغيل.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-12-27 21:42:33', '2022-12-27 18:42:33', 1, NULL, NULL, 1, 20, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(589, NULL, 5, 0, NULL, NULL, 'Multifunction Electric Shower Brush', '460', 'فرشاة الاستحمام الالكترونية مع 5 رؤوس مختلقة', NULL, 'uploads/products/306777_Electric_Shower_Brush_(8).jpg', NULL, NULL, '', '159', '42.68', '1', '<p>Product Details:</p>\r\n\r\n<p>Multi-use rechargeable portable electronic body brush.</p>\r\n\r\n<p>This brush is characterized by being made of silicone, which is suitable for the skin and does not harm it, as well as the presence of 4 other heads, each head has its own feature.</p>\r\n\r\n<p>It contains 5 heads: a shower head, a silicone head, a dead skin cleaning head, a cleaning head, and a rough head for deep cleaning.</p>\r\n\r\n<p>3 Different speeds that can be controlled according to desire, in addition to giving a feeling of comfort through massage.</p>\r\n\r\n<p>A long handle to enable you to reach difficult places such as the lower back. The handle can be removed when you want to use the device from others.</p>\r\n\r\n<p>Waterproof with IPX67 standard.</p>\r\n\r\n<p>It works by charging and does not require batteries to operate.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>فرشاة استحمام إلكترونية قابلة للشحن متعددة الاستخدام.</p>\r\n\r\n<p>تتميز هذه الفرشاة بأنها مصنوعة من السيليكون الذي يتناسب مع البشرة ولا يضر بها وايضاً بوجود 4 رؤوس اخرى لكل رأس ميزه خاصة به.</p>\r\n\r\n<p>تحتوي على 5 رؤوس وهي:&nbsp;رأس الاستحمام، ورأس السيليكون، ورأس تنظيف الاقدام من الجلد الميت، ورأس للتنظيف، وايضاً رأس خشن للتنظيف العميق.</p>\r\n\r\n<p>3 سرعات مختلفة يمكن التحكم بها على حسب الرغبة بالاضافه الى انها تعطي الشعور بالراحه عن طريق المساج.</p>\r\n\r\n<p>مسكة طويلة للتمكنكم من الوصول الى الاماكن العيدة مثل اسفل الظهر ويمكن ازالة المسكة عند الرغبه في استعمال الجهاز من غيرها.</p>\r\n\r\n<p>مضاده للماء بمعيار IPX67.</p>\r\n\r\n<p>تعمل عن طريق الشحن ولا تحتاج الى بطاريات للتشغيل.</p>\r\n', NULL, 'https://youtu.be/jna2IiD5tdw', '', '1', NULL, NULL, '1', '2022-12-27 21:59:29', '2022-12-27 18:59:29', NULL, NULL, NULL, NULL, 7, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(590, NULL, 5, 0, NULL, NULL, 'Enchen Electric Foot Grinder', '461', 'جهاز نحت الجلد الميت للقدم من Enchen', NULL, 'uploads/products/886664_H65463133c9fc456183e139e47a99c720m.jpg_960x960_proc.jpg', NULL, NULL, '', '129', '63.13', '1', '<p>Product Details:</p>\r\n\r\n<p>ENCHEN electric portable handheld foots grinder.</p>\r\n\r\n<p>The device is characterized by its power to sculpt dead skin and contains two speeds for carving can be chosen according to desire.</p>\r\n\r\n<p>Smart chip inside the device, and its function is that when used incorrectly&nbsp;by forcibly pressing&nbsp;the device stops working.</p>\r\n\r\n<p>The device can be washed from above when finished&nbsp;and it also has a self-drying feature. It is advised not to use tissues for drying.</p>\r\n\r\n<p>3 Different heads for carving, each head has a different strength for carving, and they can be used according to desire and need.</p>\r\n\r\n<p>The battery capacity is 1500mAh can be charged and works for a long time when fully charged and does not require batteries.</p>\r\n\r\n<p>IP67 waterproof.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز نحت الجلد الميت للقدم من شركة ENCHEN.</p>\r\n\r\n<p>يتميز الجهاز بقوته على نحت الجلد الميت ويحتوي على سرعتين للنحت يمكن اختيار السرعه على حسب الرغبه.</p>\r\n\r\n<p>شريحة ذكية داخل الجهاز ووظيفتها هي عند الاستعمال الخاطئ عن طريق الضغط بالقوة يقف الجهاز عن العمل.</p>\r\n\r\n<p>يمكن غسل الجهاز من فوق عند الانتهاء وايضاً تحتوي على خاصية التنشيف الذاتي وينصح بعدم استخدام المناديل للتنشيف.</p>\r\n\r\n<p>3 رؤوس مختلفة للنحت لكل رأس قوة مختلفة للنحت يمكن استخدامهم على حسب الرغبة والاحتياج.</p>\r\n\r\n<p>سعة البطارية 1500 مللي امبير يمكن شحنها وتعمل لمدة طويلة عند شحنها بالكامل ولا تحتاج الى بطاريات.</p>\r\n\r\n<p>مضادة للماء بمعيار IP67.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-12-27 22:18:35', '2022-12-27 19:18:35', 1, NULL, NULL, 1, 10, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(591, NULL, 10, 0, NULL, NULL, 'Leather Travel Mobile Accessories Bag', '462', 'حقيبة من نوع جلد ضد الماء لأكسسوارات الهاتف مع قفل ومنفذ شاحن', NULL, 'uploads/products/782987_bag_(2).png', NULL, NULL, '', '80', '33.93', '1', '<p>Product Details:</p>\r\n\r\n<p>Product Details:</p>\r\n\r\n<p>Accessories organizer bag.</p>\r\n\r\n<p>Small in size, convenient and light in weight.</p>\r\n\r\n<p>Organizes your charging wires and mobile phones.</p>\r\n\r\n<p>Made of water-resistant leather.</p>\r\n\r\n<p>Suitable for use outside home or travel.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>حقيبة لتنظيم الاكسسوارات وترتيبها.</p>\r\n\r\n<p>صغيرة الحجم ومريحة وخفيفة فالوزن.</p>\r\n\r\n<p>تنظم لكم وايرات الشحن والهواتف.</p>\r\n\r\n<p>مصنوعة من الجلد المقاوم للماء.</p>\r\n\r\n<p>مناسبة للاستعمال خارج المنزل او السفر.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-12-28 20:58:33', '2022-12-28 17:58:33', 1, NULL, NULL, 1, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(592, NULL, 5, 0, NULL, NULL, 'Classic Design Electric Clock', '463', 'ساعة إلكترونية بشكل كلاسيكي مع ارقام متحركة', NULL, 'uploads/products/237208_Balance_flip_clock_(3)_proc-removebg-preview.jpg', NULL, NULL, '', '199', '90.87', '1', '<p>Product Details:</p>\r\n\r\n<p>Classic clock with moving electronic numbers.</p>\r\n\r\n<p>It is characterized by its traditional shape and the movement of the numbers of the clock in a distinctive way.</p>\r\n\r\n<p>It works by battery and does not need charging.</p>\r\n', '<p>مواصفات المنتج:&nbsp;</p>\r\n\r\n<p>ساعة بشكل كلاسيكي مع ارقام متحركة الكترونية.</p>\r\n\r\n<p>تتميز بشكلها التراثي وحركة ارقام الساعة بشكل مميز.</p>\r\n\r\n<p>تعمل عن طريق البطارية ولا تحتاج الى شحن.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-12-28 21:17:02', '2022-12-28 18:17:02', 1, NULL, NULL, 1, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(593, NULL, 12, 0, NULL, NULL, 'Pills Reminder Device', '464', 'جهاز تنبية بموعد اقراص الدواء', NULL, 'uploads/products/209340_Bill_Reminder_Device_(2).jpg', NULL, NULL, '', '99', '18.56', '1', '<p>Product Details:</p>\r\n\r\n<p>Smart tablet alarm with timer setting device.</p>\r\n\r\n<p>This device is characterized by its small size and also its importance in reminding when to take the medicine.</p>\r\n\r\n<p>It is made of disc preservatives and is designed to be hermetically sealed so that no air can enter.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز تنبيه بموعد الاقراص الذكي مع خاصية ضبط المؤقت وتنبيه بالصوت.</p>\r\n\r\n<p>يتميز هذا الجهاز بصغر حجمه وايضاً بأهميته في التذكير بموعد اخذ الدواء.</p>\r\n\r\n<p>مصنوع من مواد حافظة للأقراص ومصمم بشكل مغلق بأحكام حتى لا يدخل الهواء.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-12-28 22:07:43', '2022-12-28 19:07:43', 1, NULL, NULL, 1, 20, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(594, NULL, 8, 0, NULL, NULL, 'OPOLAR Portable Rechargeable Air Blower', '465', 'منفضة هواء كهربائية قابلة للشحن من OPOLAR', NULL, 'uploads/products/637499_dust_blower__(4).jpg', NULL, NULL, '', '250', '162.05', '1', '<p>Product Details:</p>\r\n\r\n<p>Rechargeable air duster with a power of 40 watts and a capacity of 6000 mAh from OPOLAR.</p>\r\n\r\n<p>It has several uses that can be used to clean cars, computers, or even light a fire in the winter period.</p>\r\n\r\n<p>It is characterized by its power, which reaches 33,000 revolutions per minute, in addition to its small size.</p>\r\n\r\n<p>The charging port is Type-C, the charging time takes 3 hours, and it works for 30 continuous minutes when fully charged.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>منفضة هواء قابلة للشحن بقوة 40 واط وبسعة 6000 مللي امبير من شركة OPOLAR.</p>\r\n\r\n<p>لها عدة استخدامات يمكن استخدامها لتنظيف السيارات او اجهزة الكمبيوتر او حتى اشعال النار في فترة الشتاء.</p>\r\n\r\n<p>تتميز بقوتها التي تصل الى 33,000 دورة في الدقيقة بالإضافة الى حجمها الصغير.</p>\r\n\r\n<p>مدخل الشحن تايب سي&nbsp;وتستغرف مدة الشحن 3 ساعات وتعمل لمدة 30 دقيقة متواصلة عند شحنها بالكامل.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=7FkzbXx2AXI', '', '1', NULL, NULL, '1', '2022-12-29 08:37:54', '2022-12-29 05:37:54', 1, NULL, NULL, 1, 9, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '55'),
(595, NULL, 5, 0, NULL, NULL, 'Hicon Small Ice Maker Machine', '466', 'جهاز صنع الثلج السريع من Hicon', NULL, 'uploads/products/794938_13960095432_946341231.jpg', NULL, NULL, '', '400', '255.49', '1', '<p>Product Details:</p>\r\n\r\n<p>Home ice maker within minutes from HICON.</p>\r\n\r\n<p>It is characterized by its small size and its ability to make 15 kilograms of ice per day.</p>\r\n\r\n<p>Makes 9 ice cubes in just 6 to 9 minutes.</p>\r\n\r\n<p>It contains a full ice sensor and also a water-repellent system.</p>\r\n\r\n<p>The capacity of the water tank is 2 liters.</p>\r\n\r\n<p>Made of plastic and stainless steel.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز صنع الثلج المنزلي خلال دقائق من شركة HICON.</p>\r\n\r\n<p>يتميز بصغر حجمه وقدرته على صنع 15 كيلو جرام من الثلج في اليوم الواحد.</p>\r\n\r\n<p>يصنع 9 حبات من الثلج بشكل سريع من 6 الى 9 دقائق فقط.</p>\r\n\r\n<p>يحتوي على مستشعر للثلج بالكامل وايضاً نظام مانع لخروج الماء.</p>\r\n\r\n<p>سعة خزان الماء 2 لتر.</p>\r\n\r\n<p>مصنوع من البلاستيك والستيل المقاوم للصدا.</p>\r\n', NULL, 'https://youtu.be/SzR9q3JF5q0', '', '1', NULL, NULL, '1', '2022-12-29 09:18:34', '2022-12-29 06:18:34', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '57'),
(596, NULL, 8, 0, NULL, NULL, '3D LED Decorative Triangle Light 15CM', '470', 'اضاءة ثلاثية الابعاد بشكل مثلث حجم 15 سم', NULL, 'uploads/products/932645_173090_il_1588xN.3878106901_hkpt.png', NULL, NULL, '', '149', '82.46', '1', '<p>Product Details:</p>\r\n\r\n<p>3D triangle light in a modern and distinctive shape made of acrylic 15cm size.</p>\r\n\r\n<p>It is distinguished by its shape and lighting, which creates a comfortable environment and can be placed in living rooms, bedrooms, and others.</p>\r\n\r\n<p>It can be controlled by the wireless remote control, the colors and brightness can also be changed through it.</p>\r\n\r\n<p>It works by electricity and does not requires batteries or charging.</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '<p>مواصفات المنتج:</p>\r\n\r\n<p>اضاءة ثلاثية الابعاد بشكل عصري ومميز مصنوعة من الكريليك بحجم 15 سنتيميتر.</p>\r\n\r\n<p>تتميز بشكلها واضاءتها والتي تخلق بيئة مريحة ويمكن وضعها في غرف المعيشة او النوم وغيرها.</p>\r\n\r\n<p>يمكن التحكم بها عن طريق الجهاز التحكم اللاسلكي وايضاً يمكن تغيير الالوان ودرجة السطوع من خلاله.</p>\r\n\r\n<p>تعمل عن طريق الكهرباء ولا تحتاج الى بطاريات او شحن.</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', NULL, 'https://www.youtube.com/watch?v=4z4gIKaOJhA', '', '1', NULL, NULL, '1', '2022-12-29 10:45:02', '2022-12-29 07:45:02', 1, NULL, NULL, 1, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(597, NULL, 5, 0, NULL, NULL, 'Liquid 3D Moving Sand Art Table Light', '471', 'اضاءة وستاند ديكور لفن الرمال المتحركة', NULL, 'uploads/products/949939_liquid_3D_light_(7).jpg', NULL, NULL, '', '200', '98.54', '1', '<p>Product Details:</p>\r\n\r\n<p>The latest versions of 3D light from moving sand, which creates a beautiful atmosphere in the home.</p>\r\n\r\n<p>It is characterized by being made of reflective glass in a circular shape, which blocks direct light from the eyes while sleeping.</p>\r\n\r\n<p>It can be controlled via its wireless device in terms of changing color tones and even brightness.</p>\r\n\r\n<p>Suitable as home or office decoration and even bedrooms.</p>\r\n\r\n<p>It works by electricity and does not need charging or batteries.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>احدث اصدارات اضاءات ثلاثية الابعاد من الرمال المتحركة والتي تخلق جو جميل في المنزل.</p>\r\n\r\n<p>تتميز بأنها مصنوعة من الزجاج العاكس وبشكل دائري والذي يحجب الضوء المباشر للعين اثناء النوم.</p>\r\n\r\n<p>يمكن التحكم بها عن طريق الجهاز اللاسلكي الخاص بها من حيث تغيير درجات الالوان وحتى السطوع.</p>\r\n\r\n<p>مناسبة كديكور للمنزل او المكاتب وحتى غرف النوم.</p>\r\n\r\n<p>تعمل عن طريق الكهرباء ولا تحتاج الى شحن او بطاريات.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Qj74-YrLMDc', '', '1', NULL, NULL, '1', '2022-12-29 11:12:44', '2022-12-29 08:12:44', NULL, NULL, NULL, NULL, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(598, NULL, 5, 0, NULL, NULL, 'Portable Hair Style Bukhoor Burner', '472', 'مبخرة إلكترونية متنقلة للشعر', NULL, 'uploads/products/373192_Bakhoor_incense_burner_(10).jpg', NULL, NULL, '', '199', '96.35', '1', '<p>Product Details:</p>\r\n\r\n<p>The latest versions of the portable electronic bakhoor burner incense&nbsp;for hair with different heads.</p>\r\n\r\n<p>It contains two different heads, one for hair and the other for normal use, to be suitable for cars, travel, or offices at work and even at home.</p>\r\n\r\n<p>Rechargeable and does not require batteries.</p>\r\n\r\n<p>New slim and distinctive shape.</p>\r\n\r\n<p>Charging port: Type-C.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>احدث اصدارات المبخرة الإلكترونية المتنقلة للشعر مع رؤوس مختلفة.</p>\r\n\r\n<p>تحتوي على رئسين مختلفين واحد للشعر والاخر للاستخدام العادي لتكون مناسبة للسيارات او السفر او المكاتب في العمل وحتى المنزل .</p>\r\n\r\n<p>قابلة للشحن ولا تحتاج الى بطاريات.</p>\r\n\r\n<p>شكل جديد نحيفه ومميزة.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n', NULL, 'https://youtu.be/rHdcl7DlwOY', '', '1', NULL, NULL, '1', '2022-12-29 11:27:36', '2022-12-29 08:27:36', NULL, NULL, NULL, NULL, 4, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
(599, NULL, 5, 0, NULL, NULL, 'Couss Portable Cold Coffee Machine', '473', 'جهاز محمول لصنع القهوة الباردة من Couss', NULL, 'uploads/products/225475_Couss_CC305_coffee_machine_(2).jpg', NULL, NULL, '', '349', '221.18', '1', '<p>Product Details:</p>\r\n\r\n<p>A small portable coffee machine with a digital screen, through which you can make iced coffee or iced tea in 10 minutes from Couss.</p>\r\n\r\n<p>It is distinguished by its ability to compress ground coffee or tea and to stir water continuously and automatically, thus it can prepare cold coffee, in addition to having a place to put ice.</p>\r\n\r\n<p>Easy to use, all you have to do is put coffee or tea powder, then add ice when needed, then&nbsp;turn it on through the control panel.</p>\r\n\r\n<p>It can be moved around and used outside the home or at work and so on.</p>\r\n\r\n<p>The water tank capacity is 450 ml.</p>\r\n\r\n<p>It works by charging and does not require electricity or batteries.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز محمول صغير الحجم مع شاشة رقمية يمكن من خلاله صنع القهوة او الشاي المثلج في 10 دقائق من شركة Couss.</p>\r\n\r\n<p>يتميز بقدرته على ضغط البن المطحون&nbsp;او الشاي وتحريك الماء بشكل مستمر وتلقائي&nbsp;وبذلك يمكنه تحضير قهوة باردة بالإضافة الى وجود مكان لوضع الثلج.</p>\r\n\r\n<p>سهل الاستخدام كل ماعليك هو وضع مسحوق القهوة او الشاي وبعدها اضافة الثلج عند الحاجه ومن ثم اغلاق الجهاز وتشغيله من خلال لوحة التحكم.</p>\r\n\r\n<p>يمكن التنقل به واستخدامه في خارج المنزل او في العمل وغيره.</p>\r\n\r\n<p>سعة خزان الماء 450 مل.</p>\r\n\r\n<p>يعمل عن طريق الشحن ولا يحتاج الى كهرباء&nbsp;او بطاريات.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2022-12-29 12:55:53', '2022-12-29 09:55:53', 1, NULL, NULL, 1, 5, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '58'),
(600, NULL, 6, 0, NULL, NULL, 'Smart Hot & Cold Water Dispenser With Digital Screen - Black', '30001', 'مبرد ومسخن ذكي للماء مع شاشة رقمية - درجات الاسود', NULL, 'uploads/products/171343_dark.jpg', NULL, NULL, '', '700', '595', '1', '<p>Product Details:</p>\r\n\r\n<p>Intelligent dispenser for heating and cooling water with automatic water filling feature, wireless remote control and digital display.</p>\r\n\r\n<p>It is characterized by heating the water to the boiling and also cooling the water quickly.</p>\r\n\r\n<p>The water heating temperature ranges from 60 to 100 degrees, and the water cooling from 10 to minus 15 degrees.</p>\r\n\r\n<p>It can keep the water warm continuously to a temperature of 55 degrees.</p>\r\n\r\n<p>It can be controlled via the device&#39;s built-in control panel or via wireless remote.</p>\r\n\r\n<p>Digital display shows real time temperature accurately and continuously.</p>\r\n\r\n<p>It has a smart lock feature for children, as well as a special place to store cups, tea, or coffee, as desired.</p>\r\n\r\n<p>Easy to use all you have to do is put the water barrel in its tank, operate the device and control it normally, whether to heat or cool the water.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>The device contains 2 kettle&#39;s and does not contain&nbsp;water barrel.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز ذكي لتسخين وتبريد الماء مع خاصية التعبئة التلقائية للماء وجهاز تحكم لاسلكي وشاشة عرض رقمية.</p>\r\n\r\n<p>يتميز هذا الجهاز بتسخينه للماء لدرجة الغليان وايضاً تبريد الماء بشكل سريع وتصل درجة تسخين الماء من 60 الى 100 درجة مؤيه وتبريد الماء من 10 الى 15 تحت الصفر درجة مئويه.</p>\r\n\r\n<p>يمكنه ابقاء الماء دافئاً بشكل مستمر لدرجة حرارة تصل الى 55 درجة مئوية.</p>\r\n\r\n<p>يمكن التحكم به عن طريق لوحة التحكم المدمجه فالجهاز او عن طريق جهاز التحكم اللاسلكي الخاص به.</p>\r\n\r\n<p>شاشة عرض رقمية توضح درجة الحرارة بشكل دقيق ومستمر.</p>\r\n\r\n<p>يحتوي على ميزة القفل الذكي للأطفال وايضاً مكان خاص لتخزين الاكواب او الشاي او القهوة على حسب الرغبة.</p>\r\n\r\n<p>سهل الاستخدام كل ماعليك هو وضع برميل الماء في الخزان الخاص به وتشغيل الجهاز والتحكم به بشكل عادي سواء لتسخين او تبريد الماء.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>الجهاز يحتوي على عدد 2 كتل ولايحتوي على برميل الماء.</p>\r\n', NULL, 'https://youtu.be/RiowzrxGhRY', '', '1', NULL, NULL, '1', '2022-12-31 21:50:11', '2022-12-31 18:50:11', 1, NULL, NULL, 1, 2, 0, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
