(602, NULL, 12, 0, NULL, NULL, 'Digital Display Socket Tester', '175', 'جهاز اختبار توصيلات الكهرباء', NULL, 'uploads/products/686727_Hdc75b789f5a643dbb96e0c1a432d91a84.jpg', NULL, NULL, '', '89', '', '1', '<p>Product Details:</p>\r\n\r\n<p>Socket tester It tests your protection system to ensure the household electrical safety.</p>\r\n\r\n<p>Mini portable design, easy to carry and simple to use.</p>\r\n\r\n<p>Can detect the wiring status of the socket quickly and accurately.</p>\r\n\r\n<p>Voltage test(with LCD).</p>\r\n', '<p>تفاصيل المنتج:</p>\r\n\r\n<p>جهاز اختبار المقبس يختبر نظام الحماية الخاص بك لضمان السلامة الكهربائية للمنزل.</p>\r\n\r\n<p>تصميم صغير محمول ، سهل الحمل وسهل الاستخدام.</p>\r\n\r\n<p>يمكن الكشف عن حالة الأسلاك للمقبس بسرعة وبدقة.</p>\r\n\r\n<p>اختبار الجهد (مع شاشة LCD).</p>\r\n', NULL, 'https://www.youtube.com/watch?v=A5Yra1KwnfE&feature=emb_imp_woyt', '', '1', NULL, NULL, '1', '2023-01-02 18:43:08', '2023-01-02 15:43:08', NULL, NULL, NULL, NULL, 0, 0, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, NULL),
(603, NULL, 5, 0, NULL, NULL, 'Xiaomi Mi Stick S 4K Android TV', '475', 'جهاز الترفيه الاصدار الجديد 4K من Xiaomi', NULL, 'uploads/products/868706_51i5VjXxiOL._AC_SL1000_.jpg', NULL, NULL, '', '200', '140', '1', '<p>Product Details:</p>\r\n\r\n<p>Xiaomi Mi 4K stick turns any TV into a smart TV.</p>\r\n\r\n<p>It contains all the programs found in Android, such as Netflix, YouTube and you can also download external programs via flash.</p>\r\n\r\n<p>It supports the Android system, allowing you to control it with ease.</p>\r\n\r\n<p>It has a very high image clarity with 4k ultra HD resolution.</p>\r\n\r\n<p>Inputs type: HDMI + USB</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز الترفيه الاصدار الجديد&nbsp;يحول اي تلفزيون الى تلفزيون ذكي.</p>\r\n\r\n<p>فيه جميع البرامج الموجودة في الاندرويد مثل نتفليكس ويوتيوب وايضاً تقدرون تنزلون برامج خارجية عن طريق الفلاش.</p>\r\n\r\n<p>يدعم نظام اندرويد مما يتيح لك التحكم فيه بكل سهولة.</p>\r\n\r\n<p>يتميز بوضوح عالي جداً للصورة.</p>\r\n\r\n<p>نوع المداخل: HDMI + USB</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2023-01-17 20:28:14', '2023-01-17 17:28:14', 1, NULL, NULL, 1, 2, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '48'),
(604, NULL, 15, 9, NULL, NULL, 'Zendure Super Mini Go Magsafe Power Bank 10000mAh - Galaxy Black', '477', 'باوربانك مغناطيسي لاسلكي + سلكي بقوة 10000 مللي امبير من Zendure – اسود', NULL, 'uploads/products/683918_32f2f32.jpg', NULL, NULL, '', '199', '139', '1', '<p>Product Details:</p>\r\n\r\n<p>Wireless and wired power bank at the same time, ٍSuper Mini Go series, capacity of 10000mAh&nbsp;with Magsafe technology for iPhone from Zendure.</p>\r\n\r\n<p>Supports fast wireless charging 15W for iPhone 12 and above.</p>\r\n\r\n<p>It is characterized by its small size and is considered the size compared to other wireless chargers.</p>\r\n\r\n<p>20W Type C port with PD technology for charging the power bank, and other devices can be charged from the same port.</p>\r\n\r\n<p>USB port with Zen+ technology for fast charging.</p>\r\n\r\n<p>Charges the iPhone from one and a half to two times a full charge, depending on the type of device.</p>\r\n', '<p>واصفات المنتج:</p>\r\n\r\n<p>شاحن لاسلكي وسلكي في نفس الوقت Super Mini Go بسعة 10000 مللي امبير بتقنية Magsafe للايفون من شركة Zendure.</p>\r\n\r\n<p>يدعم الشحن اللاسلكي السريع لاجهزة الايفون 12 وما فوق بقوة 15 واط.</p>\r\n\r\n<p>يتميز بصغر حجمه على سعة البطارية مقارنةً بغيره من الشواحن اللاسلكية.</p>\r\n\r\n<p>منفذ تايب سي بقوة 20 واط بتقنية PD لشحن الباوربانك ويمكن شحن اجهزة اخرى من نفس المدخل.</p>\r\n\r\n<p>منفذ يو اس بي بتقنية +Zen للشحن السريع.</p>\r\n\r\n<p>يشحن الايفون من مره ونصف الى مرتين شحن كامل على حسب نوع الجهاز.</p>\r\n', NULL, 'https://youtu.be/mr_m6EZy9l0', '', '1', NULL, NULL, '1', '2023-01-17 20:56:33', '2023-01-17 17:56:33', 1, NULL, NULL, 1, 2, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '49'),
(605, NULL, 15, 9, NULL, NULL, 'Zendure Super Mini Go Magsafe Power Bank 10000mAh - Space Silver', '477', 'باوربانك مغناطيسي لاسلكي + سلكي بقوة 10000 مللي امبير من Zendure – فضي', NULL, 'uploads/products/630874_d32e23e23r.jpg', NULL, NULL, '', '199', '139', '1', '<p>Product Details:</p>\r\n\r\n<p>Wireless and wired power bank at the same time, ٍSuper Mini Go series, capacity of 10000mAh&nbsp;with Magsafe technology for iPhone from Zendure.</p>\r\n\r\n<p>Supports fast wireless charging 15W for iPhone 12 and above.</p>\r\n\r\n<p>It is characterized by its small size and is considered the size compared to other wireless chargers.</p>\r\n\r\n<p>20W Type C port with PD technology for charging the power bank, and other devices can be charged from the same port.</p>\r\n\r\n<p>USB port with Zen+ technology for fast charging.</p>\r\n\r\n<p>Charges the iPhone from one and a half to two times a full charge, depending on the type of device.</p>\r\n', '<p>واصفات المنتج:</p>\r\n\r\n<p>شاحن لاسلكي وسلكي في نفس الوقت Super Mini Go بسعة 10000 مللي امبير بتقنية Magsafe للايفون من شركة Zendure.</p>\r\n\r\n<p>يدعم الشحن اللاسلكي السريع لاجهزة الايفون 12 وما فوق بقوة 15 واط.</p>\r\n\r\n<p>يتميز بصغر حجمه على سعة البطارية مقارنةً بغيره من الشواحن اللاسلكية.</p>\r\n\r\n<p>منفذ تايب سي بقوة 20 واط بتقنية PD لشحن الباوربانك ويمكن شحن اجهزة اخرى من نفس المدخل.</p>\r\n\r\n<p>منفذ يو اس بي بتقنية +Zen للشحن السريع.</p>\r\n\r\n<p>يشحن الايفون من مره ونصف الى مرتين شحن كامل على حسب نوع الجهاز.</p>\r\n', NULL, 'https://youtu.be/mr_m6EZy9l0', '', '1', NULL, NULL, '1', '2023-01-17 21:02:06', '2023-01-17 18:02:06', 1, NULL, NULL, 1, 2, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '49'),
(606, NULL, 15, 9, NULL, NULL, 'Anker 737 Power Bank 24000mAh 140W ', '479', 'شاحن متنقل بسعة 24000 مللي امبير وبقوة 140 واط من Anker', NULL, 'uploads/products/423652_ewesdsd.jpg', NULL, NULL, '', '610', '460', '1', '<p>Product Details:</p>\r\n\r\n<p>The latest version of the portable charger with a power of 140W and a capacity of 26000mAh, charges all devices, including laptops, phones, and others from Anker.</p>\r\n\r\n<p>Two Type-C ports and one USB port all support fast charging charging.</p>\r\n\r\n<p>It contains a digital screen that shows the battery status, output and input power for each port individually, as well as other features such as temperature.</p>\r\n\r\n<p>The iPhone charges almost 5 times fully, the Galaxy 4 times, and Mac devices&nbsp;approximately 1 and a half times.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>احدث اصدارات شاحن المتنقل بقوة 140 واط وبسعة 26000 مللي امبير يشحن جميع الاجهزة من اللابتوب والهواتف وغيرها من شركة Anker.</p>\r\n\r\n<p>منفذين تايب سي ومنفذ يو اس بي جميعهم يدعمون تنقية الشحن السريع.</p>\r\n\r\n<p>يحتوي على شاشة رقمية توضح حالة البطارية وقوة الاخراج والادخال للشحن لكل منفذ بشكل منفرد وايضاً مزايا اخرى كدرجة الحرارة.</p>\r\n\r\n<p>يشحن الايفون 5 مرات تقريباً شحن كامل والجالكسي 4 مرات والماك 1 ونصف تقريباً.</p>\r\n', NULL, 'https://youtu.be/R7_l2Xq3h4o', '', '1', NULL, NULL, '1', '2023-01-17 21:47:25', '2023-01-17 18:47:25', 1, NULL, NULL, 1, 2, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(607, NULL, 15, 10, NULL, NULL, 'Anker 733 Wall Charger + Power Bank GaN Prime PowerCore 65W', '480', 'شاحن متنقل + شاحن جداري بسعة 10000 مللي امبير من Anker', NULL, 'uploads/products/481464_r5y4rerg.jpg', NULL, NULL, '', '349', '245', '1', '<p>Product Details:</p>\r\n\r\n<p>Multi-use product that is a power bank &amp; wall charger at the same time, with a capacity of 10000mAh and a power of 65W from ANKER.</p>\r\n\r\n<p>Its size is small and rectangular, which makes it easy to carry it outside the house.</p>\r\n\r\n<p>Easy to use and there is a button to turn on the powerbank.</p>\r\n\r\n<p>It charges all kinds of devices, including laptops.</p>\r\n\r\n<p>Two Type-C ports with PD technology for fast charging, and it can be charged at the same port.</p>\r\n\r\n<p>USB input IQ technology for fast charging.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>منتج متعدد الاستخدام ويعتبر باوربانك وشاحن جداري بنفس الوقت بسعة 10000 مللي امبير وبقوة 65 واط من شركة ANKER.</p>\r\n\r\n<p>حجمه صغير وبشكل مستطيل مما يسهل عملية نقله لخارج المنزل.</p>\r\n\r\n<p>سهل الاستخدام ويوجد فيه زر لتشغيل الباوربانك.</p>\r\n\r\n<p>يشحن جميع انواع الاجهزة بما فيها اجهزة اللابتوب.</p>\r\n\r\n<p>مدخلين تايب سي بتقنية PD للشحن السريع ويمكن شحن الباوربانك من نفس المدخل.</p>\r\n\r\n<p>مدخل يو اس بي تقنية IQ للشحن السريع.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=_25anzF2SFk&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2023-01-17 22:26:33', '2023-01-17 19:26:33', NULL, NULL, NULL, NULL, 1, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(608, NULL, 15, 9, NULL, NULL, 'Anker 521 Portable Power Station 256W', '481', 'باور هاوس الاصدار الاصغر بقوة 256 واط من Anker', NULL, 'uploads/products/963048_424187_Untitled.jpg', NULL, NULL, '', '1499', '1050', '1', '<p>Product Details:</p>\r\n\r\n<p>A new version of large batteries with a power of 256W from Anker.</p>\r\n\r\n<p>Supports the operation of most small and large devices such as televisions, small refrigerators, flashlights and other devices.</p>\r\n\r\n<p>Back and side lighting for outdoor trips and dark places.</p>\r\n\r\n<p>Contains multiple Input:</p>\r\n\r\n<p>Entrance to operate electrical appliances.</p>\r\n\r\n<p>Type C Input &amp; Output with PD technology for fast charging with a power of 60W.</p>\r\n\r\n<p>2 USB Output ports with IQ technology for fast charging total of 18W.</p>\r\n\r\n<p>Input for car charger.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>بطارية باور هاوس الصغيرة&nbsp;بقوة 256 واط&nbsp;من شركة Anker.</p>\r\n\r\n<p>يدعم تشغيل اغلب الاجهزة الصغيرة والكبيرة مثل التفلزيونات, الثلاجات الصغيرة, الكشافات وغيرها من الأجهزة.</p>\r\n\r\n<p>إنارة خلفية وجانبية للرحلات الخارجية والاماكن المظلمة.</p>\r\n\r\n<p>يحتوي على مداخل متعددة:</p>\r\n\r\n<p>مدخل لتشغيل الاجهزة الكهربائية.</p>\r\n\r\n<p>مدخل تايب سي بتقنية PD للشحن السريع بقوة 60 واط وايضاً يمكن شحن البطارية عن طريقة.</p>\r\n\r\n<p>2 مداخل يو اس بي بتقنية IQ للشحن السريع اجمالي 18&nbsp;واط.</p>\r\n\r\n<p>مدخل لشاحن السيارة.</p>\r\n', NULL, 'https://youtu.be/7D9He95VdHk', '', '1', NULL, NULL, '1', '2023-01-17 22:37:22', '2023-01-17 19:37:22', 1, NULL, NULL, 1, 1, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(609, NULL, 15, 10, NULL, NULL, 'Anker 736 Charger Nano II 100W', '482', 'شاحن جداري ذو 3 مخارج بقوة 100 واط من Anker', NULL, 'uploads/products/900613_jdhd238eu32wd.jpg', NULL, NULL, '', '299', '170', '1', '<p>Product Details:</p>\r\n\r\n<p>Fast charging 3 ports charger from ANKER.</p>\r\n\r\n<p>It is characterized by its power of up to 100W and can charge all devices very fast charging.</p>\r\n\r\n<p>Two inputs with PD technology for fast charging, as well as a USB fast charging port, and it can charge 3 devices at the same time.</p>\r\n\r\n<p>Supports all types of devices in addition to computers.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن ذو 3 مداخل للشحن السريع من شركة ANKER.</p>\r\n\r\n<p>يتميز بقوته التي تصل الى 100 واط ويمكنه شحن جميع الاجهزة شحن سريع جداً.</p>\r\n\r\n<p>مدخلين بتقنية PD للشحن السريع وايضاً يو اس بي&nbsp;ويمكن شحن 3 اجهزة في نفس الوقت.</p>\r\n\r\n<p>يدعم جميع انواع الأجهزة بالإضافة الى اجهزة الكمبيوتر.</p>\r\n', NULL, 'https://youtu.be/q_Qqocwa464', '', '1', NULL, NULL, '1', '2023-01-17 22:45:30', '2023-01-17 19:45:30', 1, NULL, NULL, 1, 1, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(610, NULL, 6, 0, NULL, NULL, 'Eufy By Anker Indoor Mini Cam 2K', '485', 'كاميرا ذكية للمنزل بحجم صغير بدقة 2k ودوران 360 درجة من Anker', NULL, 'uploads/products/220047_243213.jpg', NULL, NULL, '', '199', '135', '1', '<p>Product Details:</p>\r\n\r\n<p>Eufy Mini Smart home security Wi-Fi camera with high quality and clear natural image from Anker.</p>\r\n\r\n<p>Upgraded high quality 2K ultra HD resolution.</p>\r\n\r\n<p>360 degree rotating full angle vision.</p>\r\n\r\n<p>Support night vision view through infrared.</p>\r\n\r\n<p>It has a two-way dual microphone allows you to talk through.</p>\r\n\r\n<p>It contains an intelligence system that recognizes human faces.</p>\r\n\r\n<p>Supports voice commands from Alexa and Google Assistant.</p>\r\n\r\n<p>Control App: Eufy Security</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كاميرا ذكية صغيرة الحجم&nbsp;تعمل عن طريق الواي-فاي ذات دقة عالية وتصوير واضح للمراقبة من شركة Anker.</p>\r\n\r\n<p>تتميز بجودة عالية وصورة طبيعية بدقة 2K.</p>\r\n\r\n<p>متحركة بزاوية دوران كاملة 360 درجة.</p>\r\n\r\n<p>تدعم نظام الرؤية الليلة عن طريق الاشعة تحت الحمراء.</p>\r\n\r\n<p>تحتوي على ميكروفون مزدوج مما يتيح لك التحدث من خلالها.</p>\r\n\r\n<p>تحتوي على نظام الذكاء الاصطناعي والذي يتعرف على الوجوه البشرية.</p>\r\n\r\n<p>تدعم الاوامر الصوتية من اليكسا وقوقل اسستنس.</p>\r\n\r\n<p>تطبيق التحكم: Eufy Security.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2023-01-17 23:22:18', '2023-01-17 20:22:18', 1, NULL, NULL, 1, 2, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
