(636, NULL, 15, 11, NULL, NULL, 'Joyroom Three-Axis Electric Wireless Charging Car Holder Dashboard', '507', 'شاحن لاسلكي مع قاعدة إلكترونية بقوة 15 واط للسيارات من Joyroom', NULL, 'uploads/products/664264_eng_pl_Joyroom-Qi-wireless-15W-automatic-car-charger-electric-phone-holder-dashboard-and-air-vent-black-JR-ZS219-74263_6.png', NULL, NULL, '', '120', '70', '1', '<p>Product Details:</p>\r\n\r\n<p>Joyroom electric holder wireless 15W fast car charger.</p>\r\n\r\n<p>The charger phone holders are electronic. You can control it to hold the phone&nbsp;by pressing one button or manually according to your desire.</p>\r\n\r\n<p>The bottom base of the stand is retractable to fit all types of phones.</p>\r\n\r\n<p>Suitable for all mobile phones that support wireless charging from 4.5 to&nbsp; 6.8 inches size.</p>\r\n\r\n<p>90&deg; rotation angle (Free to adjust the viewing angle, it is more convenient for navigation).</p>\r\n\r\n<p>Fireproof casing material &amp; high temperature resistance.</p>\r\n\r\n<p>Input interface: Type C.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن لاسلكي ثابت وسريع بقوة 15 واط من شركة Joyroom.</p>\r\n\r\n<p>حامل الهاتف للشاحن الكترونية تقدرون تتحكمون فيها&nbsp;بضغطت زر وحدة او يدوياً على حسب رغبتكم.</p>\r\n\r\n<p>القاعدة السفليه للشاحن قابله للتنزيل لتناسب جميع انواع الهواتف مع وجود طبقة للسليكون لضمان عدم خدش الهاتف.</p>\r\n\r\n<p>مناسبه لجميع الهواتف المحمولة القابلة للشحن اللاسلكي من قياس 4.5 انش الى 6.8 انش.</p>\r\n\r\n<p>زاوية دوران 90 درجة.</p>\r\n\r\n<p>مصنوع من مواد مضادة للاشتعال.</p>\r\n\r\n<p>نوع المدخل: تايب سي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=z5_uTRd85Ag&ab_channel=JOYROOM', '', '1', NULL, NULL, '1', '2023-02-16 15:44:06', '2023-02-16 12:44:06', 1, NULL, NULL, 1, 2, 3, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '25'),
(629, NULL, 11, 0, NULL, NULL, 'Anker 610 Magnetic Phone Grip MagGo - Black', '500', 'حامل هاتف وستاند مغناطيسي من Anker - اسود', NULL, 'uploads/products/661200_3.png', NULL, NULL, '', '69', '36', '1', '<p>Product Details:</p>\r\n\r\n<p>Anker magnetic ring holder and stand for mobile phones with MagSafe tecnology.</p>\r\n\r\n<p>Ring is aptly designed to be compatible with all finger sizes.</p>\r\n\r\n<p>360-degree rotatable design offers convenient viewing angles and can be used as a stand to watch Youtube or Movies.</p>\r\n\r\n<p>Made from top-quality material that allows for long term use.</p>\r\n\r\n<p>Slim and comfortable doesn&rsquo;t increase the size of your phone.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>This product only work with MagSafe tecnology that supports in iPhone 12 and higher.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>حامل هاتف مغناطيسي وستاند&nbsp;في نفس الوقت&nbsp;من شركة ANKER.</p>\r\n\r\n<p>تم تصميم الحلقة بشكل مناسب لتكون متوافقة مع جميع أحجام الأصابع.</p>\r\n\r\n<p>قابل للدوران بزاوية 360 درجة لزوايا عرض مريحة وتقدرون تستعملونه كستاند لمشاهدة الأفلام او اليوتيوب.</p>\r\n\r\n<p>مصنوع من مواد عالية الجودة تسمح باستخدام طويل الأمد.</p>\r\n\r\n<p>حجم نحيف جداً ومريح ولا يزيد من حجم الهاتف.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>هذا المنتج يدعم الهواتف التي تحتوي على تقنية MagSafe فقط والتي تدعمها اجهزة الايفون من 12 وما فوق.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2023-02-11 18:09:04', '2023-02-11 15:09:04', 1, NULL, NULL, 1, 1, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
