(615, NULL, 9, 0, NULL, NULL, 'inCharge 6 in 1 Cable 100W - 1.5M', '487', 'واير 6 في 1 شحن سريع بقوة 100 واط من inCharge - طول 1.5 متر', NULL, 'uploads/products/331414_aasasas.jpg', NULL, NULL, '', '150', '97', '1', '<p>Product Details:</p>\r\n\r\n<p>6-in-1 cable for all devices from inCharge.</p>\r\n\r\n<p>100W PD fast charging.</p>\r\n\r\n<p>Metal luxury no overheating.</p>\r\n\r\n<p>Interface: USB + Type C + Lightning + Micro.</p>\r\n\r\n<p>Applicable Model: All devices that support Type C or USB.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>واير 6 في 1&nbsp;لجميع الاجهزة بطول 1.5 متر من شركة inCharge.</p>\r\n\r\n<p>قوة شحن 100 واط بتقنية PD للشحن السريع تقدر تشحن جهازك ونقل البيانات في نفس الوقت.</p>\r\n\r\n<p>تصميم رائع من الحديد العازل للحرارة.</p>\r\n\r\n<p>مداخل الوصله: USB + Type C + Lightning + Micro.</p>\r\n\r\n<p>الموديل المناسب: كل الأجهزة التي تدعم مدخل تايب سي او يو اس بي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=sHcEskKsBlc&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2023-01-28 19:05:21', '2023-01-28 16:05:21', NULL, NULL, NULL, NULL, 2, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, NULL),
