(621, NULL, 15, 9, NULL, NULL, 'UNIQ Fuele Mini 8000mAh Pocket Slim Power Bank - Blush', '492', 'شاحن متنقل ذو مخرجين صغير جداً بسعة 8000 مللي امبير من UNIQ - كحلي', NULL, 'uploads/products/526020_Blush_1.jpg', NULL, NULL, '', '150', '65', '1', '<p>Product Details:</p>\r\n\r\n<p>UNIQ Fuelemini 8000mAh 1 USB port &amp; 1 PD port 18W fast charging.</p>\r\n\r\n<p>Portable pocket size&nbsp;mini design.</p>\r\n\r\n<p>Fireproof casing material &amp; high temperature resistance.</p>\r\n\r\n<p>Input: Type C + Micro.</p>\r\n\r\n<p>Output: Type C + USB.</p>\r\n', '<p>مواصفات المنتج :</p>\r\n\r\n<p>شاحن متنقل بسعة 8000 مللي امبير مخرج يو اس بي ومخرج تايب سي بقوة 18 واط.</p>\r\n\r\n<p>تصميم مميز بحجم جيب القميص صغيرجداً.</p>\r\n\r\n<p>مصنوع من مواد مضادة للحرارة ومضادة للاشتعال.</p>\r\n\r\n<p>يمكن شحنة بمدخل: مايكرو وتايب سي.</p>\r\n\r\n<p>نوع المخرج: تايب سي + يو اس بي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=T7x23kif2D8&ab_channel=myChameleonMalaysia', '', '1', NULL, NULL, '1', '2023-02-01 18:36:47', '2023-02-01 15:36:47', NULL, NULL, NULL, NULL, 2, 3, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '45'),
(622, NULL, 10, 0, NULL, NULL, 'MOFT Snap-On MagSafe Phone Stand – Yellow', '20009', 'ستاند ومحفظة للجوال MagSafe من موفت – اصفر', NULL, 'uploads/products/672477_moft_hello_yellow.jpg', NULL, NULL, '', '109', '65', '1', '<p>Product Details:</p>\r\n\r\n<p>Grip, Stand and Wallet from Moft, supports MagSafe technology.</p>\r\n\r\n<p>Suitable for all Apple 12 phones via magnet ( MagSafe ) without need for any adhesive.</p>\r\n\r\n<p>It can be used as a base in length or width at an angle of 60 degrees, as desired and enjoy watching Movies or Youtube.</p>\r\n\r\n<p>It features magnets to attach it to any magnetic bases in the car.</p>\r\n\r\n<p>It has a wallet for cards, and a maximum of 3 cards can be placed.</p>\r\n\r\n<p>Small in size, suitable and does not increase the thickness of the phone.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>مسكة وستاند ومحفظة من شركة موفت والتي تدعم تقنية MagSafe.</p>\r\n\r\n<p>مناسبة لجميع هواتف ابل 12 عن طريق المغناطيس ( MagSafe ) دون الحاجة الى أي لاصق.</p>\r\n\r\n<p>يمكن استخدامها كقاعدة بالطول او العرض بزاوية 60 درجة على حسب الرغبة لمشاهدة الأفلام او اليوتيوب.</p>\r\n\r\n<p>تتميز بوجود مغناطيس لتثبيتها بقواعد مغناطيسية في السيارة وغيرها.</p>\r\n\r\n<p>يوجد فيها محفظة للبطاقات ويمكن وضع 3 بطاقات كحد اقصى.</p>\r\n\r\n<p>صغيرة الحجم ومناسبة ولا تزيد من سماكة الهاتف.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=JgNyIMvivZ4&feature=emb_imp_woyt&ab_channel=CircuitStore%D8%B3%D9%8A%D8%B1%D9%83%D8%AA%D8%B3%D8%AA%D9%88%D8%B1', '', '1', NULL, NULL, '1', '2023-02-01 20:13:27', '2023-02-01 17:13:27', NULL, NULL, NULL, NULL, 2, 3, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '29'),
(638, NULL, 15, 9, NULL, NULL, 'RiverSong iPhone Portable Power Bank 5000mAh', '509', 'شاحن متنقل بسعة 5000 مللي امبير للايفون من RiverSong', NULL, 'uploads/products/358298_12.png', NULL, NULL, '', '99', '48', '1', '<p>Product Details:</p>\r\n\r\n<p>Very compact power bank with a capacity of 5,000mAh with a built-in Lightning output from RIVERSONG.</p>\r\n\r\n<p>It is characterized by its small size and it does not need to carry any other wires to charge the phone.</p>\r\n\r\n<p>Suitable for outdoor uses. You can put it in the bag or in your clothes due to its small size.</p>\r\n\r\n<p>Supports PD 20W fast charging technology that charges the iPhone 50% in just 30 minutes.</p>\r\n\r\n<p>Input: Type C.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>باوربانك صغير الحجم جداً بسعة 5,000 مللي امبير مع مخرج لايتننغ مدمج من شركة RIVERSONG.</p>\r\n\r\n<p>يتميز بحجمة الصغير ويوفر من عدم حمل اي وايرات اخرى لشحن الهاتف.</p>\r\n\r\n<p>مناسب للأستعمالات الخارجية تقدرون تحطونة فالشنطة او في ملابسك بحكم حجمة الصغير.</p>\r\n\r\n<p>يدعم تقنية PD للشحن السريع بقوة 20 واط يشحن الايفون 50% خلال 30 دقيقة فقط.</p>\r\n\r\n<p>مدخل شحن الباوربانك تايب سي.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2023-02-19 18:28:18', '2023-02-19 15:28:18', 1, NULL, NULL, 1, 5, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '60'),
