(627, NULL, 10, 0, NULL, NULL, 'Moft Powerful iPhone 14 Pro MagSafe Case - Clear', '499', 'كڤر للايفون 14 برو يدعم MagSafe من Moft - شفاف', NULL, 'uploads/products/771923_Untitled.png', NULL, NULL, '', '109', '69', '1', '<p>Product Details:</p>\r\n\r\n<p>Strong protection case supports MagSafe technology for Apple phones from MOFT.</p>\r\n\r\n<p>Excellent protects the phone in addition to the screen from scratches or drops.</p>\r\n\r\n<p>It is made of high quality materials in addition to its distinctive design.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كڤر لحماية الجوال يدعم تقنية MagSafe لهواتف ابل من شركة MOFT.</p>\r\n\r\n<p>يحمي الهاتف بشكل ممتاز بالإضافة الى الشاشة من الخدوش او السقطات.</p>\r\n\r\n<p>يتميز بأنه مصنوع من مواد عالية الجودة بالإضافة الى تصميمه المميز.</p>\r\n', NULL, 'https://youtu.be/k8E9sZx2XXA', '', '1', NULL, NULL, '1', '2023-02-09 16:04:58', '2023-02-09 13:04:58', 1, NULL, NULL, 1, 2, 3, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '29'),
(624, NULL, 15, 9, NULL, NULL, 'Anker Magnetic 5200mAh Wireless Charger 633 MagGo 2 in 1 Wireless Charging Station - White', '496', 'ستاند 2 في 1 شاحن لاسلكي وباوربانك متنقل بسعة 5000 مللي امبير من Anker - ابيض', NULL, 'uploads/products/781041_51F54wMT4PL._AC_SL1500_.jpg', NULL, NULL, '', '350', '250', '1', '<p>Product Details:</p>\r\n\r\n<p>Wireless charger stand and power bank (MagSafe) at the same time with a capacity of 5000mAh from ANKER.</p>\r\n\r\n<p>It is characterized by the ability to charge AirPods via wireless charging, as well as iPhone through the built-in power bank in the stand.</p>\r\n\r\n<p>The stand can be adjusted 40 degrees horizontally and 360 degrees through the magnet.</p>\r\n\r\n<p>The product can be used on the desk while working or carry the power bank and use it separately.</p>\r\n\r\n<p>The power bank can be charged by placing it in the base only.</p>\r\n\r\n<p>Wireless charging power 7.5W.</p>\r\n\r\n<p>The box contains: Wireless charger + Power bank + Operating cable + Operating wall charger.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>This Product supports ONLY iPhone 12 and iPhone 13 with MageSafe technology.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>ستاند شاحن لاسلكي وباوربانك ( MagSafe ) في نفس الوقت بسعة 5000 مللي امبير من ANKER.</p>\r\n\r\n<p>يتميز بالقدرة على شحن الايربودز عن طريق الشحن الاسلكي وايضاً الايفون من خلال الباوربانك المدمج فالستاند.</p>\r\n\r\n<p>الستاند قابل للتحريك 40 درجة بشكل افقي وايضاً 360 درجة من خلال المغناطيس.</p>\r\n\r\n<p>يمكن استخدام المنتج على المكتب اثناء العمل او حمل الباوربانك واستخدامه بشكل منفصل.</p>\r\n\r\n<p>يمكن شحن الباوربانك عن طريق وضعه فالقاعدة فقط.</p>\r\n\r\n<p>قوة الشاحن اللاسلكي 7.5 واط.</p>\r\n\r\n<p>الكرتون يحتوي على: ستاند + باوربانك + كيبل التشغيل + شاحن جداري للتشغيل.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>هذا المنتج يدعم ايفون 12 و ايفون 13 والذي يحتوي على تقنية ( MagSafe ) للشحن اللاسلكي عن طريق المغناطيس.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2023-02-06 20:24:34', '2023-02-06 17:24:34', NULL, NULL, NULL, NULL, 1, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(625, NULL, 15, 10, NULL, NULL, 'Anker Power Strip & Charger 6 in 1', '494', 'موصل كهرباء وشاحن 6 في 1 من Anker', NULL, 'uploads/products/536259_5126igjjcjl._ac_sl1500__2.jpg', NULL, NULL, '', '120', '70', '1', '<p>Product Details:</p>\r\n\r\n<p>Power strip &amp; charger at the same time from Anker.</p>\r\n\r\n<p>It has 4 power outlets, in addition to two USB ports with QC3.0 technology.</p>\r\n\r\n<p>It is also characterized by ease of installation and saves on electricity consumption.</p>\r\n\r\n<p>Fire prevention and overload protection.</p>\r\n\r\n<p>Max Power: 2860w.</p>\r\n\r\n<p>Line length: 2m.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>موصل الكهرباء وشاحن في نفس الوقت من Anker.</p>\r\n\r\n<p>يوجد فيه 4 بلكات للكهرباء بالإضافة الى منفذين يو اس بي بتقنية QC3.0.</p>\r\n\r\n<p>يتميز بسهولة التركيب والاستخدام ويوفر من استهلاك الكهرباء.</p>\r\n\r\n<p>مصنوع من مواد عالية الجودة وغير قابلة للحريق وحماية من الكهرباء الزائدة.</p>\r\n\r\n<p>قوة تحمل الموصل: 2860 واط</p>\r\n\r\n<p>طول السلك: 2 متر.</p>\r\n', NULL, 'https://youtu.be/AumdzzxNPE4', '', '1', NULL, NULL, '1', '2023-02-06 20:36:05', '2023-02-06 17:36:05', NULL, NULL, NULL, NULL, 2, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
