(628, NULL, 10, 0, NULL, NULL, 'Moft Powerful iPhone 14 Pro Max MagSafe Case - Clear', '499', 'كڤر للايفون 14 برو ماكس يدعم MagSafe من Moft - شفاف', NULL, 'uploads/products/110928_Untitled.png', NULL, NULL, '', '109', '69', '1', '<p>Product Details:</p>\r\n\r\n<p>Strong protection case supports MagSafe technology for Apple phones from MOFT.</p>\r\n\r\n<p>Excellent protects the phone in addition to the screen from scratches or drops.</p>\r\n\r\n<p>It is made of high quality materials in addition to its distinctive design.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>كڤر لحماية الجوال يدعم تقنية MagSafe لهواتف ابل من شركة MOFT.</p>\r\n\r\n<p>يحمي الهاتف بشكل ممتاز بالإضافة الى الشاشة من الخدوش او السقطات.</p>\r\n\r\n<p>يتميز بأنه مصنوع من مواد عالية الجودة بالإضافة الى تصميمه المميز.</p>\r\n', NULL, 'https://youtu.be/k8E9sZx2XXA', '', '1', NULL, NULL, '1', '2023-02-09 16:08:56', '2023-02-09 13:08:56', 1, NULL, NULL, 1, 2, 3, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '29'),
(630, NULL, 11, 0, NULL, NULL, 'Anker 610 Magnetic Phone Grip MagGo - White', '500', 'حامل هاتف وستاند مغناطيسي من Anker - ابيض', NULL, 'uploads/products/377718_7.png', NULL, NULL, '', '69', '36', '1', '<p>Product Details:</p>\r\n\r\n<p>Anker magnetic ring holder and stand for mobile phones with MagSafe tecnology.</p>\r\n\r\n<p>Ring is aptly designed to be compatible with all finger sizes.</p>\r\n\r\n<p>360-degree rotatable design offers convenient viewing angles and can be used as a stand to watch Youtube or Movies.</p>\r\n\r\n<p>Made from top-quality material that allows for long term use.</p>\r\n\r\n<p>Slim and comfortable doesn&rsquo;t increase the size of your phone.</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>This product only work with MagSafe tecnology that supports in iPhone 12 and higher.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>حامل هاتف مغناطيسي وستاند&nbsp;في نفس الوقت&nbsp;من شركة ANKER.</p>\r\n\r\n<p>تم تصميم الحلقة بشكل مناسب لتكون متوافقة مع جميع أحجام الأصابع.</p>\r\n\r\n<p>قابل للدوران بزاوية 360 درجة لزوايا عرض مريحة وتقدرون تستعملونه كستاند لمشاهدة الأفلام او اليوتيوب.</p>\r\n\r\n<p>مصنوع من مواد عالية الجودة تسمح باستخدام طويل الأمد.</p>\r\n\r\n<p>حجم نحيف جداً ومريح ولا يزيد من حجم الهاتف.</p>\r\n\r\n<p><strong>ملاحظة:</strong></p>\r\n\r\n<p>هذا المنتج يدعم الهواتف التي تحتوي على تقنية MagSafe فقط والتي تدعمها اجهزة الايفون من 12 وما فوق.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2023-02-11 18:09:06', '2023-02-11 15:09:06', 1, NULL, NULL, 1, 1, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(631, NULL, 7, 0, NULL, NULL, 'ِAnker SoundCore Life P2i', '', 'سماعة Life P2i من Anker', NULL, 'uploads/products/829462_8.png', NULL, NULL, '', '139', '80', '1', '<p>Product Details:</p>\r\n\r\n<p>Soundcore Life P2i wireless earphone is suitable for Apple and Android devices from Anker.</p>\r\n\r\n<p>The recognition feature to turn on and off when placed in the ear or removed, in addition to the presence of many features with touch technology.</p>\r\n\r\n<p>It is characterized by its fast charging and can be used for an hour continuously when charged for only 10 minutes.</p>\r\n\r\n<p>2 EQ Modes.</p>\r\n\r\n<p>IPX7 Waterproof tecnology.</p>\r\n\r\n<p>Supports the latest side noise cancellation technologies.</p>\r\n\r\n<p>It contains the latest Bluetooth 5.2 technology.</p>\r\n\r\n<p>Input: Type-C charging port.</p>\r\n\r\n<p>Warranty: 1 Year</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>سماعة Soundcore Life P2i لاسلكية مناسبة لأجهزة ابل والاندرويد من شركة Anker.</p>\r\n\r\n<p>ميزة التعرف للتشغيل وايقاف التشغيل عند وضعها بالاذن او ازالتها بالإضافه الى وجود مميزات عديدة بتقنية اللمس.</p>\r\n\r\n<p>تتميز بسرعة شحنها ويمكن استعمالها لمدة ساعة متواصله عند شحنها لمدة 10 دقائق فقط.</p>\r\n\r\n<p>2 اوضاع مختلفة لأخراج الصوت على حسب الرغبة.</p>\r\n\r\n<p>تدعم احدث تقنيات عزل الضوضاء الجانبية.</p>\r\n\r\n<p>تحتوي على تقنية البلوتوث الحديثة 5.2.</p>\r\n\r\n<p>تقنية IPX7 مقاومة للماء.</p>\r\n\r\n<p>مدخل الشحن: تايب سي.</p>\r\n\r\n<p>ضمان لمدة سنة.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=eJjOGKgG8NQ&t=8s&ab_channel=soundcoreSupport', '', '1', NULL, NULL, '1', '2023-02-11 18:31:10', '2023-02-11 15:31:10', 1, NULL, NULL, 1, 1, 5, 'QAR', 'ر.ق', NULL, '0', 'Normal', '1', NULL, '11'),
(632, NULL, 9, 0, NULL, NULL, 'Anker PowerLine III Flow Type-C to Lightning Cable 1M - Black', '502', 'واير شحن سريع تايب سي الى لايتننغ 1 متر من Anker - اسود', NULL, 'uploads/products/740637_1.png', NULL, NULL, '', '99', '50', '1', '<p>Product Details:</p>\r\n\r\n<p>Anker 20W PD Type C to Lightning fast charging cable.</p>\r\n\r\n<p>It is made of good material and has a long life span.</p>\r\n\r\n<p>Fast charging technology it charges the iphone from 0% to 50% in 25 minutes only.</p>\r\n\r\n<p>Length: 1 Meters.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>واير شحن سريع تايب سي الى لايتننغ بتقنية PD للشحن السريع بقوة 20 واط من شركة Anker.</p>\r\n\r\n<p>يتميز بأنه مصنوع مواد عالية الجودة بحيث انه مقاوم للف والثني وايضاً&nbsp;بعمره الاستهلاكي الطويل.</p>\r\n\r\n<p>يشحن الايفون من 0% الى 50% في 25 دقيقة فقط.</p>\r\n\r\n<p>الطول: 1 متر.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=mzx2kHXtrdA&t=30s&ab_channel=Anker', '', '1', NULL, NULL, '1', '2023-02-11 18:51:49', '2023-02-11 15:51:49', NULL, NULL, NULL, NULL, 1, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(633, NULL, 9, 0, NULL, NULL, 'Anker PowerLine III Type-C to Type-C Cable 1M - Black', '503', 'واير شحن سريع تايب سي الى تايب سي بقوة 100 واط 1 متر من Anker - اسود', NULL, 'uploads/products/896436_Untitled.png', NULL, NULL, '', '89', '30', '1', '<p>Product Details:</p>\r\n\r\n<p>Anker 100W fast charging cable and can be used for transition data.</p>\r\n\r\n<p>Length: 1M</p>\r\n\r\n<p>Current: PD 100W</p>\r\n\r\n<p>Transmission Data Speed: 480Mbps</p>\r\n\r\n<p>Applicable Model: Type C</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>واير شحن سريع تايب سي الى تايب سي بقوة 100 واط ويمكن استخدامه لنقل البيانات من شركة ANKER.</p>\r\n\r\n<p>الطول: 1 متر</p>\r\n\r\n<p>قوة التيار: 100 واط</p>\r\n\r\n<p>سرعة نقل البيانات: 480 ميغا هيرتز</p>\r\n\r\n<p>نوع السلك: تايب سي</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2023-02-11 19:09:13', '2023-02-11 16:09:13', NULL, NULL, NULL, NULL, 1, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '11'),
(634, NULL, 15, 11, NULL, NULL, 'Energea Magdisc Drive Magnetic Wireless Car Charger 15W', '501', 'شاحن لاسلكي مع عدة قواعد للسيارات بقوة 15 واط من Energea', NULL, 'uploads/products/732804_MAGD-DRV-GUN-1000x1000.png', NULL, NULL, '', '149', '96', '1', '<p>Product Details:</p>\r\n\r\n<p>Magnetic wireless 15W fast car charger with smart charging detection from Energea.</p>\r\n\r\n<p>Fully adjustable with the 360-degree swivel ball head for custom viewing angles.</p>\r\n\r\n<p>Easy to use designed multiple stand to fit on car dashboard or clip to fit on any AC vent.</p>\r\n\r\n<p>Wonderful small design to not take alot of space in the car.</p>\r\n\r\n<p>Support any phone with wireless charging or MagSafe technology.</p>\r\n\r\n<p>Input: Type C</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن لاسلكي بقوة 15 واط مع عدة قواعد تركب في فتحات مكيف السيارة او على الطبلون نفسه من شركة ENERGEA.</p>\r\n\r\n<p>القاعدة قابلة للدوران 360 درجة.</p>\r\n\r\n<p>سهل في التركيب كل ماعليك تركيبه في المكان المطلوب&nbsp;وشحن هاتفك.</p>\r\n\r\n<p>تصميم مميز وصغير فالحجم حتى لايأخذ حيز كبير من المساحة.</p>\r\n\r\n<p>يدعم جميع الهواتف التي تشحن عن طريق الشحن اللاسلكي او اي هاتف يدعم تقنية Magsafe.</p>\r\n\r\n<p>مدخل: تايب سي.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=12huIewvNGA&t=52s&ab_channel=GlobalSynergyConcepts', '', '1', NULL, NULL, '1', '2023-02-11 19:48:28', '2023-02-11 16:48:28', 1, NULL, NULL, 1, 2, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '59'),
(635, NULL, 15, 11, NULL, NULL, 'Energea Alu Drive D60 2 Type-C Ports PD/PPS 66W Car Charger', '504', 'شاحن سريع ذو مدخلين تايب سي بقوة 66 واط من Energea', NULL, 'uploads/products/146349_333.png', NULL, NULL, '', '80', '45', '1', '<p>Product Details:</p>\r\n\r\n<p>66W Fast car charger with two ports Type-C from Energea.</p>\r\n\r\n<p>Fast charging all types of phones, tablets and laptops.</p>\r\n\r\n<p>Safe usage with all-round protection, equipped with built-in protections against overheating, overcharging, and short-circuit to safeguard the charging process.</p>\r\n\r\n<p>It has a smart chip to know how much wattage the device needs and charges accordingly.</p>\r\n\r\n<p>Type C charging port of 30W + 33W.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>شاحن سريع للسيارة بقوة 66 واط ذو مدخلين تايب سي&nbsp;من شركة ENERGEA.</p>\r\n\r\n<p>يشحن جميع أنواع الهواتف واجهزة التابليت وايضاً اللابتوب.</p>\r\n\r\n<p>استخدام آمن مع حماية شاملة مزود بوسائل حماية مدمجة ضد ارتفاع درجة الحرارة والشحن الزائد.</p>\r\n\r\n<p>يحتوي على شريحة ذكية لمعرفة كم قوة الواط الذي يحتاجه الجهاز ويشحن بناءً على ذلك.</p>\r\n\r\n<p>مدخلين&nbsp;تايب سي بقوة 30 واط + 33 واط.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2023-02-11 19:59:09', '2023-02-11 16:59:09', NULL, NULL, NULL, NULL, 2, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '59'),
(637, NULL, 11, NULL, NULL, NULL, 'Joyroom 360 Rotation Invisibility Series Metal Gravity Holder', '508', 'قاعدة 360 درجة صغيرة جداً لفتحة التكييف للسيارات من Joyroom', NULL, 'uploads/products/201843_eng_pl_Joyroom-gravity-car-mount-phone-holder-for-air-vent-black-JR-ZS211-184033_1.jpg', NULL, NULL, NULL, '60', '28', '1', '<p>Product Details:</p>\r\n\r\n<p>Strong phone stand from Joyroom.</p>\r\n\r\n<p>Built in strong metal arms&nbsp;to hold phone weight and not stable roads .</p>\r\n\r\n<p>Compact and safe (It will not block your AC vents, no damage to the mobile phone and without signal interference).</p>\r\n\r\n<p>360 &deg; rotation angle (Free to adjust the viewing angle, it is more convenient for navigation).</p>\r\n\r\n<p>One-hand operation (It is simple to operate it with one hand, and it is safe for driving).</p>\r\n', '<p>تفاصيل المنتج:</p>\r\n\r\n<p>قاعدة قويه للسيارات&nbsp;من شركة JOYROOM .</p>\r\n\r\n<p>حامل الهاتف مصنوع من الحديد المقوى بحيث يستحمل اوزان الهواتف بالاضافة الى الطرق الوعرة للسيارات.</p>\r\n\r\n<p>يستخدم الستاند قفل من الخلف حتى يمسك في فتحة التكييف وفي نفس الوقت حجمه صغير ولا يحجب هواء التكييف.</p>\r\n\r\n<p>زاوية دوران 360 درجة وايضاً الطبقة الداخلية مصنوعة من السيليكون بحيث لا يسبب خدوش للهاتف.</p>\r\n\r\n<p>التحكم بيد واحدة فقط.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=Sj2OUuBHuxE&ab_channel=MobileDirect', '', '1', NULL, NULL, '1', '2023-02-16 16:08:05', '2023-02-16 13:08:05', 1, NULL, NULL, 1, 1, 3, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '25'),
(639, NULL, 5, 0, NULL, NULL, 'Porodo Lifestyle Portable Cordless Juicer', '510', 'عصارة فواكة متنقلة قابلة للشحن من Porodo', NULL, 'uploads/products/381092_1.jpg', NULL, NULL, '', '180', '85', '1', '<p>Product Details:</p>\r\n\r\n<p>Portable device for squeezing fruits automatically, such as oranges, etc., rechargeable from PORODO.</p>\r\n\r\n<p>This device has the ability to juice 30 times in just one charge.</p>\r\n\r\n<p>Small in size and can be taken anywhere outside the home.</p>\r\n\r\n<p>It is very practical and easy to use, and it has a special outlet for the juice, so that it is easy for you to extract the juice into the cup.</p>\r\n\r\n<p>The battery capacity is 1300mAh.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز متنقل لعصر الفواكة بشكل تلقائي مثل البرتقال وما يشابهها قابل للشحن من شركة PORODO.</p>\r\n\r\n<p>يتميز هذا الجهاز بقدرتة على العصر 30 مرة في شحنه واحدة فقط.</p>\r\n\r\n<p>صغير الحجم ويمكن اخذه لأي مكان خارج المنزل.</p>\r\n\r\n<p>عملي&nbsp;جداً وسهل&nbsp;في الاستخدام وله مخرج خاص للعصير بحيث يسهل عليك استخراج العصير في الكوب.</p>\r\n\r\n<p>سعة البطارية 1300 مللي امبير&nbsp;</p>\r\n', NULL, 'https://www.youtube.com/watch?v=93YaxLDvytk&ab_channel=OskarGroupTV', '', '1', NULL, NULL, '1', '2023-02-23 15:16:38', '2023-02-23 12:16:38', 1, NULL, NULL, 1, 2, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '31'),
(640, NULL, 12, NULL, NULL, NULL, 'Green Mega Shredding Machine 15L', '511', 'جهاز تقطيع اوراق A4 بحجم 15 لتر من Green', NULL, 'uploads/products/623068_Untitled.png', NULL, NULL, NULL, '250', '150', '1', '<p>Product Details:</p>\r\n\r\n<p>Small shredder with 15L waste paper from GREEN.</p>\r\n\r\n<p>This device is distinguished by shreddering 6 A4 sheets at once, as well as its ability to shred cards.</p>\r\n\r\n<p>The size of the garbage bin is 15L, which is a large capacity for shredded pappers.</p>\r\n\r\n<p>It is quick to cut and easy to use, and is suitable for personal use at home, work, etc.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>جهاز تقطيع او فرم الورق بحجم قمامة 15 لتر من شركة GREEN.</p>\r\n\r\n<p>يتميز هذا الجهاز بتقطيع 6&nbsp;اوراق A4 دفعة واحدة وايضاً بقدرته على تقطيع البطاقات.</p>\r\n\r\n<p>حجم سلة القمامة 15 لتر ويعتبر هذه سعة كبيرة للاوراق المفرومة.</p>\r\n\r\n<p>سريع فالتقطيع وسهل&nbsp;فالاستخدام ومناسب للاستخدام الشخص في المنزل او العمل وغيره.</p>\r\n', NULL, 'https://www.youtube.com/watch?v=k6OR5xmDPqU&t=20s&ab_channel=OskarGroupTV', '', '1', NULL, NULL, '1', '2023-02-23 15:35:44', '2023-02-23 12:35:44', 1, NULL, NULL, 1, 2, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '20'),
(641, NULL, 10, NULL, NULL, NULL, 'Porodo Super Slim Wireless Mouse & Keyboard Arabic\\English', '512', 'ماوس ولوحة مفاتيح لاسلكي عربي/انجليزي من Porodo', NULL, 'uploads/products/475564_1.jpg', NULL, NULL, NULL, '120', '62', '1', '<p>Product Details:</p>\r\n\r\n<p>Very small keyboard and mouse that support Bluetooth for computers, tablets and others from PORODO.</p>\r\n\r\n<p>It supports Arabic and English languages, and also supports Bluetooth 4.0 technology, which makes it compatible with a wide range of devices.</p>\r\n\r\n<p>Small in size and light in weight, it can be used at home or work and carried anywhere.</p>\r\n\r\n<p>Connecion distance up to about 10M.</p>\r\n\r\n<p>Easy to use, all you have to do is pair the mouse &amp; keyboard with your device via Bluetooth and use them normally.</p>\r\n\r\n<p>It operates on batteries and does not require charging.</p>\r\n', '<p>مواصفات المنتج:</p>\r\n\r\n<p>لوحة مفاتيح وماوس بحجم صغير جداً&nbsp;يدعمون البلوتوث لأجهزة الكمبيوتر والتابليت وغيرها من شركة PORODO.</p>\r\n\r\n<p>تدعم اللغتين العربية والانجليزية وايضاً تدعم تقنية&nbsp;بلوتوث 4.0 مما يجعلها تتوافق مع مجموعة واسعة من الاجهزة.</p>\r\n\r\n<p>صغيرة فالحجم وخفيفه فالوزن يمكن استخدامها في المنزل او العمل وحملها لأي مكان.</p>\r\n\r\n<p>مسافة اتصال تصل الى 10 متر تقريباً.</p>\r\n\r\n<p>سهلة الاستخدام كل ماعليك هو اقتران الماوس ولوحة المفاتيح بجهازك عن طريق البلوتوث واستعمالها بكل طبيعي.</p>\r\n\r\n<p>تعمل عن طريق البطاريات ولا تحتاج الى شحن.</p>\r\n', NULL, '', '', '1', NULL, NULL, '1', '2023-02-23 16:11:53', '2023-02-23 13:11:53', 1, NULL, NULL, 1, 1, 5, 'QAR', 'ر.ق', NULL, '1', 'Normal', '1', NULL, '31'),
(643, NULL, 10, 14, NULL, NULL, 'testproduct1', '12555555', 'testproduct', NULL, 'uploads/products/954074_12.jpg', NULL, NULL, NULL, '1', '1', '1', '<p>test</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '<p>test</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', NULL, '', '12555555', '1', NULL, NULL, '1', '2023-02-24 07:39:15', '2023-02-24 04:39:15', 1, 1, 1, 1, 10, 0, 'QAR', 'ر.ق', '1', '1', 'Normal', '1', NULL, '10');
